var book = {
	"name": "ၥ မိစ့ၭ",
	"numChapters": 50,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> လၧအခၪ့ထံၭနီၪ ယွၩမၩကဲၪထၪ့မူၭခိၪ ဒဲဂၪ့ခိၪ",
			"2": "<sup>2</sup> လီၫ.- တၭဂၪ့ခိၪနီၪ အီၪဝ့ၫလ့ၩတ့ၩ ဒဲပျီၩပျီၩလီၫ. ဆၧ ခံၭအီၪလၧဆၧယိၬ အဖၫ့ခိၪတၭ, ယွၩအၥၭဂုၪဝ့ၫလၧ",
			"3": "<sup>3</sup> ထံၫအဖၫ့ခိၪလီၫ.- တၭယွၩစံၭဝ့ၫဒၪ, မွဲဆၧဖၩ့အီၪထၪ့",
			"4": "<sup>4</sup> ဆံၭ, တၭဆၧဖၩ့အီၪဝ့ၫလီၫ.- တၭယွၩဒၪဘၪဆၧဖၩ့ နီၪမွဲဆၧအဂ့ၩလီၫ. တၭယွၩအၪ့နၩ့ဖၭ ဆၧဖၩ့အဆၧၫ့",
			"5": "<sup>5</sup> ဒဲဆၧခံၭအဆၧၫ့လီၫ.- တၭဆၧအဖၩ့နီၪ ယွၩကိၭဝ့ၫ လၧမုဆၫတၭ, ဆၧအခံၭနီၪ ယွၩကိၭဝ့ၫ လၧမုနၩလီၫ. မုဂၪအီၪ, ဒဲမုဂီၩအီၪတၭ, မုလနံၩလီၫ.",
			"6": "<sup>6</sup> ယွၩစံၭဝ့ၫဒၪ, လၧထံၫအၥၭကျၩနီၪ, မွဲမူၭဖိၭဖၫ့ကဲၪ",
			"7": "<sup>7</sup> ထၪ့တၭ, အၪ့နၩ့ဖၭထံၫ ဒဲထံၫအဆၧၫ့နီၪဆံၭ.- တၭ ယွၩမၩကဲၪထၪ့မူၭဖိၭဖၫ့နီၪ, ဒဲအၪ့နၩ့ဖၭထံၫလၧမူၭ ဖိၭဖၫ့အဖၫ့လၬ ဒဲထံၫလၧမူၭဖိၭဖၫ့အဖၫ့ခိၪ အဆၧၫ့",
			"8": "<sup>8</sup> နီၪလီၫ. တၭဆၧမၩအၥၭဘဲၫနီၪလီၫ.- တၭမူၭဖိၭဖၫ့ နီၪ ယွၩကိၭဝ့ၫလၧမူၭခိၪလီၫ. မုဂၪအီၪ, ဒဲမုဂီၩအီၪ တၭ, မုနံၫနံၩလနံၩလီၫ.",
			"9": "<sup>9</sup> တၭယွၩစံၭဝ့ၫဒၪ, ထံၫလၧမူၭခိၪအဖၫ့လၬယီၩ,မွဲ အအီၪကီၪ့ လၧအလးလစီၪ့ဎးတၭ, ခီၫ့ၥူၫခိၪအီၪဖျီၪ",
			"10": "<sup>10</sup> ထၪ့ဆံၭ. တၭဆၧမၩအၥၭဘဲၫနီၪလီၫ.- ခီၫ့ၥူၫခိၪနီၪ ယွၩကိၭဝ့ၫ လၧဂၪ့ခိၪတၭ, ထံၫအီၪကီၪ့အလးနီၪ,ကိၭ ဝ့ၫလၧမၫဆမံၭတၭ, ယွၩဒၪဘၪဝ့ၫ လၧအဂ့ၩလီၫ.",
			"11": "<sup>11</sup> တၭယွၩစံၭဝ့ၫဒၪ, မွဲဂၪ့ခိၪဒုၭမဲၪထၪ့ နၪ့ၥံၪမံၩ့ၥံၪ, ဘုၪ ၥံၪဂူၫၥံၪၥၪဝ့ၫလၧဘုၪၥၪ, ၥံၪ့ၥံၪဝၪၥံၪၥၪဝ့ၫလၧအၥၪ ဒၪဝ့ၫအၥိၭ လၧအချံၫအီၪ လၧအလီၩ့ လၧဂၪ့ခိၪချိၫ့",
			"12": "<sup>12</sup> ယီၩဆံၭ, တၭဆၧမၩအၥၭဘဲၫနီၪလီၫ.- တၭဂၪ့ခိၪ ဒုၭမဲၪထၪ့နၪ့ၥံၪမံၩ့ၥံၪ, ဘုၪၥံၪဂူၫၥံၪ ၥၪဝ့ၫလၧဘုၪၥၪဒဲ ၥံၪ့ၥံၪဝၪၥံၪၥၪဝ့ၫ လၧအၥၪဒၪဝ့ၫအၥိၭ, လၧအချံၫအီၪ လၧအလီၩ့လၧဂၪ့ခိၪချိၫ့လီၫ. တၭယွၩဒၪဘၪဝ့ၫ လၧ",
			"13": "<sup>13</sup> အဂ့ၩလီၫ.- မုဂၪအီၪ, ဒဲမုဂီၩအီၪတၭ, မုၥၧၫ့နံၩလနံၩ လီၫ.",
			"14": "<sup>14</sup> တၭယွၩစံၭဝ့ၫဒၪ, ဘဲၫၥိၭအမိအၪ့နၩ့ဖၭမုဆၫ ဒဲမု နၩအဆၧၩ့နီၪ, မွဲဆၧဖၩ့အဖျိၪ့လဖၪ ကဲၪထၪ့ လၧမူၭ ဖိၭဖၫ့နီၪဆံၭ. တၭမွဲအအီၪ လၧဆၧမၩနဲၪ့အဂး, လၧ ဆၧအမုအလၩအဂး, ဒဲလၧမုနံၩအဂး, ဒဲလၧအနံၪ့အ",
			"15": "<sup>15</sup> လၩအဂးဆံၭ. တၭဘဲၫၥိၭအမိဖၩ့ထၪ့ လၧဂၪ့ခိၪချိၫ့ နီၪ, မွဲအအီၪဝ့ၫလၧမူၭဖိၭဖၫ့ လၧဆၧဖၩ့ၥံၪအဂးနီၪ",
			"16": "<sup>16</sup> ဆံၭ, တၭဆၧမၩအၥၭဘဲၫနီၪလီၫ.- တၭယွၩမၩကဲၪ ထၪ့ဆၧအဖၩ့ဖၭဒိၪ နံၫဖျိၪ့လီၫ. အဒိၪလဖျိၪ့ဘဲၫၥိၭ",
			"17": "<sup>17</sup> အမိပၧၩ့မုဆၫတၭ.- အဆံၭလဖျိၪ့ဘဲၫၥိၭအမိပၧၩ့မု",
			"18": "<sup>18</sup> နၩတၭ, ဒဲအမၩကဲၪထၪ့ၡၪၥံၪဆ့လီၫ.- ဘဲၫၥိၭအမိ ဖၩ့ထၪ့လၧဂၪ့ခိၪချိၫ့တၭ, ဘဲၫၥိၭအမိပၧၩ့မုဆၫဒဲမုနၩ, ဒဲအၪ့နၩ့ဖၭဆၧအဖၩ့ ဒဲဆၧအခံၭအဆၧၩ့တၭ, ယွၩ အီၪက့ၪဝ့ၫ လၧမူၭဖိၭဖၫ့နီၪလီၫ. တၭယွၩဒၪဘၪဝ့ၫ",
			"19": "<sup>19</sup> လၧအဂ့ၩလီၫ.- မုဂၪအီၪ, ဒဲမုဂီၩအီၪတၭ, မုလံနံၩ လနံၩလီၫ.",
			"20": "<sup>20</sup> တၭယွၩစံၭဝ့ၫဒၪ, မွဲထံၫဒုၭအီၪထၪ့ဆၧအီၪ လၧအ ၥၭမၧၫ့အၪအၪလ့ၬ, ဒဲထိၪၥံၪလံၪၥံၪ ယူၩထၪ့ လၧဂၪ့",
			"21": "<sup>21</sup> ခိၪအဖၫ့ခိၪလၧမူၭခိၪ အဆၧဖိၭဖၫ့နီၪဆံၭ.- တၭယွၩ မၩကဲၪထၪ့ယၪဖၭဒိၪ ဒဲကယဲဆၧအၥၭမၧၫ့ လၧအဂဲၩ ဝ့ၫလၧထံၫဒုၭအီၪထၪ့ဝ့ၫ အၪအၪလ့ၬ, ဘဲၫအဆၨၩဒၪ ဝ့ၫအၥိၭနီၪ, ဒဲထိၪၥံၪကိၭမံၩ့ဒ့ၭ ဘဲၫအဆၨၩဒၪဝ့ၫအ",
			"22": "<sup>22</sup> ၥိၭနီၪလီၫ. တၭယွၩဒၪဘၪဝ့ၫလၧအဂ့ၩလီၫ.- တၭ ယွၩဆိၪဂ့ၩအဝ့ၫၥံၪ, စံၭဝ့ၫဒၪ, ဖၭထၪ့အၪအၪလ့ၬ တၭ, မၩဎွ့ၩထၪ့မၫဆမံၭအဖၧၩ့နီၪဆံၭ. ထိၪၥံၪလံၪ",
			"23": "<sup>23</sup> ၥံၪနီၪ, မွဲအအၪထၪ့လၧဂၪ့ခိၪချိၫ့ဆံၭ.- မုဂၪအီၪ, ဒဲမု ဂီၩအီၪတၭ, မုယဲနံၩလနံၩလီၫ.",
			"24": "<sup>24</sup> တၭယွၩစံၭဝ့ၫဒၪ, မွဲဂၪ့ခိၪ ဒုၭဖၭထၪ့န့ဆၧ အၥၭ မၧၫ့, ဘဲၫအဆၨၩဒၪဝ့ၫအၥိၭ, ဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲ ဆၧအစွၩၥ့ၪ, ဒဲဆၧဖိၪဆၧဎါအမံၩ့ ဘဲၫအဆၨၩဒၪဝ့ၫ",
			"25": "<sup>25</sup> အၥိၭနီၪဆံၭ, တၭဆၧမၩအၥၭဘဲၫနီၪလီၫ.- တၭယွၩ မၩကဲၪထၪ့ဂၪ့ခိၪ အဆၧဖိၪဆၧဎါအမံၩ့ ဘဲၫအဆၨၩ ဒၪဝ့ၫအၥိၭ, ဒဲဆၧဖိၪဆၧဎါအဒိၩ့ ဘဲၫအဆၨၩဒၪဝ့ၫ အၥိၭ, ဒဲကယဲဆၧအစွၩလၧဂၪ့ခိၪချိၫ့ ဘဲၫအဆၨၩဒၪ ဝ့ၫအၥိၭနီၪလီၫ, တၭယွၩဒၪဘၪဝ့ၫလၧအဂ့ၩလီၫ.",
			"26": "<sup>26</sup> ယွၩစံၭဝ့ၫဒၪ, ပမိမၩကဲၪထၪ့ ၦၡၩဘဲၫပဂၩ့ဒၪပဝ့ၫ အၥိၭ ဘဲၫပနၫ့ဆါဒၪပဝ့ၫအၥိၭတၭ, အဝ့ၫၥံၪ မိပၧၩ့ ဒ့ၪၥံၪယၪၥံၪ လၧမၫဆမံၭဖၧၩ့, ဒဲထိၪၥံၪလံၪၥံၪ လၧ ဆၧဖိၭဖၫ့, ဒဲဆၧဖိၪဆၧဎါ, ဒဲဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫ, ဒဲက",
			"27": "<sup>27</sup> ယဲဆၧအစွၩအဂဲၩ လၧအစွၩလၧဂၪ့ခိၪချိၫ့ဆံၭ.- တၭ ယွၩမၩကဲၪထၪ့ ၦၡၩအခွၫ ဘဲၫအဂၩ့ဒၪဝ့ၫအၥိၭနီၪ, တၭမၩကဲၪထၪ့ဝ့ၫ လၧယွၩအဂၩ့လီၫ. ၦမုၪဒဲၦခွၫနီၪ",
			"28": "<sup>28</sup> မၩကဲၪထၪ့အဝ့ၫၥံၪလီၫ.- ယွၩဆိၪဂ့ၩအဝ့ၫၥံၪ, ဒဲစံၭ အဝ့ၫၥံၪ, အၪထၪ့ဂီထၪ့နၥံၪဝ့ၫ အၪအၪလ့ၬ ဒဲမၩဎွ့ၩ ထၪ့ဂၪ့ခိၪချိၫ့ယီၩ, ဒဲမၩနၧၩ့မၩစၪ ဂၪ့ခိၪဒဲပၧၩ့ဒ့ၪၥံၪ ယၪၥံၪလၧမၫဆမံၭဖၧၩ့, ဒဲထိၪၥံၪလံၪၥံၪ လၧဆၧဖိၭ ဖၫ့, ဒဲကယဲဆၧအၥၭမၧၫ့ လၧအဂဲၩလၧဂၪ့ခိၪချိၫ့ကိၭ အမံၩ့ဒ့ၭဆံၭ.",
			"29": "<sup>29</sup> ယွၩစံၭဝ့ၫဒၪ, ယိခွါ, ယဖ့ၪလၫ့ယူၭနၥံၪ လၧဘုၪၥံၪ ဂူၫၥံၪကိၭအမံၩ့ဒ့ၭ အီၪလၧအချံၫအၥၪ လၧဂၪ့ခိၪထၧၫ့ ဖျိၪ့ယၫ, ဒဲၥံၪ့ၥံၪဝၪၥံၪကိၭအမံၩ့ဒ့ၭ လၧအမိၥၪထၪ့ အဆၧၥၪဒၪဝ့ၫလဖၪနီၪ အီၪလၧအချံၫၥံၪလီၫ. တၭ",
			"30": "<sup>30</sup> ဆၧလဖၪနီၪ မိကဲၪထၪ့နၥံၪအဆၧအၪ့လီၫ.- တၭက ယဲဆၧဖိၪဆၧဎါ လၧဂၪ့ခိၪချိၫ့, ဒဲကယဲထိၪၥံၪလံၪၥံၪ လၧဆၧဖိၭဖၫ့, ဒဲကယဲဆၧလၧအစွၩ လၧဂၪ့ခိၪချိၫ့ လၧအအီၪ လၧအၥၭမၧၫ့လဖၪနီၪ, ယဖ့ၪလၫ့ယူၭလၧ နၪ့ၥံၪမံၩ့ၥံၪကိၭအမံၩ့ဒ့ၭ လၧအဆၧအၪ့ အဂးနီၪ, တၭဆၧမၩအၥၭ ဘဲၫနီၪလီၫ.",
			"31": "<sup>31</sup> ယွၩယိဆၧလၧအမၩကဲၪထၪ့ဝ့ၫ လမံၩ့လါလါ ကိၭအမံၩ့နီၪတၭ, ဒၪဘၪဝ့ၫလၧအဂ့ၩမၬလီၫ. မုဂၪအီၪ, ဒဲမုဂီၩအီၪတၭ, မုဎူၫနံၩလနံၩလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ဘဲၫနီၪၥိၭမူၭခိၪဒဲဂၪ့ခိၪ, ဒဲကယဲအၥုၭမုခမျၧးနီၪ",
			"2": "<sup>2</sup> ဂီၩ့ဝ့ၫဒၪထီးအလူၬလီၫ.- တၭလၧမုနွ့ၫနံၩ လနံၩနီၪ ယွၩမၩထုၬအဆၧမၩ လၧအမၩဝ့ၫ, အီၪပွံၭလၧမုနွ့ၫ နံၩလနံၩ လၧကယဲအဆၧမၩ လၧအမၩဝ့ၫ ထီးအလူၬ",
			"3": "<sup>3</sup> လီၫ.- ယွၩဆိၪဂ့ၩမုနွ့ၫနံၩလနံၩနီၪ, ဒဲအီၪက့ၪဆံၫ့ဎံၪ ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ အီၪပွံၭဝ့ၫလၧ မုလနံၩနီၪလၧ ကယဲအဆၧမၩထီးအလူၬ လၧယွၩမၩကဲၪထၪ့ဝ့ၫဒၪ လီၫ.",
			"4": "<sup>4</sup> မူၭခိၪဒဲဂၪ့ခိၪ အဂဲးအကၠီၪ့ ထီးအဘၪကဲၪထၪ့ဝ့ၫ နီၪ, လၧမုလနံၩ လၧယဟိဝၩယွၩ မၩကဲၪထၪ့ဂၪ့ခိၪ,",
			"5": "<sup>5</sup> ဒဲမူၭခိၪလဖၪမွဲအယီၩ,- တၭကယဲဆၧမဲၪထၪ့လၧဆံၬ ၥံၪနၩၥံၪ လၧဂၪ့ခိၪဖၧၩ့နီၪ, ဒဲကယဲဘုၪၥံၪဂူၫၥံၪ လၧ ဆံၬၥံၪနၩၥံၪအဖၧၩ့နီၪ မဲၪထၪ့ဒံၭအ့ၬ, အဂဲးဘဲၫယီၩ ယဟိဝၩဒုၭဆၧၩ့လၩ့ဆၧ လၧဂၪ့ခိၪချိၫ့ဒံၭအ့ၬ, ဒဲၦၡၩ",
			"6": "<sup>6</sup> လၧအမိမၩကၩ လၧဂၪ့ခိၪနီၪ အီၪနးဂၩဒံၭအ့ၬ.- ဆၧ အွံၩထၪ့လၧဂၪ့ခိၪတၭ မၩဘၪစီၪဂၪ့ခိၪ ထီးအလူၬ လီၫ.",
			"7": "<sup>7</sup> ယဟိဝၩယွၩမၩကဲၪထၪ့ၦၡၩအခွၫ လၧဂၪ့ခိၪအမုၬ တၭ, အူၪၡိၫနုၬဆၧမၧၫ့အၥၪ လၧအနၫဖၧၩ့တၭ, ၦခွၫနီၪ ကဲၪထၪ့ၦၡၩအၥၭမၧၫ့လီၫ.",
			"8": "<sup>8</sup> တၭယဟိဝၩၥုၪ့လၩ့ဖျၭလၩ့ ကျိၭလလးလၧအံဒံၫ့ အဖၧၩ့ မုထၪ့လခီၫတၭ, ၦၡၩလၧအမၩကဲၪထၪ့ဝ့ၫ",
			"9": "<sup>9</sup> နီၪမွဲအအီၪက့ၪဝ့ၫ ထီးနီၪလီၫ.- တၭယဟိဝၩယွၩဒုၭ မဲၪထၪ့ ကယဲၥံၪ့လၧၦယိဂ့ၩ, ဒဲၦအၪ့ဂ့ၩ လၧဂၪ့ခိၪဖၧၩ့ လထံၭလါလါ, ဒဲဆၧမၧၫ့အၥံၪ့လထံၭ လၧအအီၪဝ့ၫ လၧကျိၭအၥၭကျၩနီၪ, ဒဲဆၧၥ့ၪယၫဆၧဂ့ၩ ဒဲဆၧအၧၩ့",
			"10": "<sup>10</sup> အၥံၪ့လထံၭဆ့လီၫ.- တၭထံၫမိၡါ လချိၬစဲၪ့ထၪ့ခွံၬ လၧအံဒံၫ့အဖၧၩ့ဘဲၫၥိၭ အမိမၩဘၪစီၪကျိၭအလး လီၫ. ထဲၩ့ဖၭထၪ့ထီးနီၪတၭ, ကဲၪထၪ့ဝ့ၫထံၫချိၬ လံချိၬ",
			"11": "<sup>11</sup> လီၫ.- အခၪ့ထံၭလချိၬနီၪ အမံၩ့မွဲပဲၡၫ့လီၫ. အဝ့ၫနီၪ လ့ၩဎဲၪ့ခး ဟၭဝလၫထၧၫ့ခးယၫတၭ, အလးနီၪထီၫ့",
			"12": "<sup>12</sup> အီၪဝ့ၫဒၪ, ဒဲခးအထီၫ့နီၪမွဲထီၫ့အဂ့ၩလီၫ.- ဒဲမနံၬၥံၫ့",
			"13": "<sup>13</sup> လၫ, ဒဲထၫ့မျါမဟူၫယၫ အီၪဝ့ၫထီးနီၪလီၫ.- တၭထံၫ ချိၬနံၫဘီၩ့လဘီၩ့နီၪ အမံၩ့မွဲဂဲဟၫ့လီၫ. အဝ့ၫနီၪလ့ၩ",
			"14": "<sup>14</sup> ဖျီၫ့ခးကုၡၫထၧၫ့ခးယၫလီၫ.- တၭထံၫချိၬၥၧၫ့ဘီၩ့လ ဘီၩ့နီၪအမံၩ့မွဲတဲဂြံၬလီၫ. အဝ့ၫနီၪလ့ၩ လၧခးအစံရ အၫအနဲၩ့ထံၭ လၧမုထၪ့လခီၫလီၫ. ဒဲထံၫချိၬလံဘီၩ့ လဘီၩ့နီၪ, မွဲယုၫပ့တံၫလီၫ.",
			"15": "<sup>15</sup> တၭယဟိဝၩယွၩ မၩန့ၦၡၩအခွၫနီၪတၭ အီၪက့ၪဝ့ၫ လၧအံဒံၫ့အကျိၭဖၧၩ့ ဘဲၫၥိၭအမိမၩဆၧ လၧအဖၧၩ့",
			"16": "<sup>16</sup> ဒဲခိၭဝ့ၫဒၪလီၫ.- ယဟိဝၩယွၩ မၪလူၬၦၡၩအခွၫနီၪ တၭ, စံၭဝ့ၫဒၪ, ကယဲၥံၪ့လၧကျိၭအဖၧၩ့ယီၩ, နအၪ့",
			"17": "<sup>17</sup> ဘၪပျီၩမၬကၨ.- အ့ၪမွဲဆၧၥ့ၪယၫဆၧဂ့ၩ ဒဲဆၧအၧၩ့ အၥံၪ့လထံၭနီၪ, ထီးအၪ့အၥၪလဂ့ၩ, အဂဲးဘဲၫယီၩ မုလနံၩ လၧနအၪ့ဆၧနီၪတၭ နမိၥံၫတၡါလီၫ.",
			"18": "<sup>18</sup> ယဟိဝၩယွၩစံၭဝ့ၫဒၪ, ၦၡၩအခွၫအီၪလဂၩဎး လ ဂ့ၩဘၪတၭ, ယမိမၩကဲၪထၪ့ၦမၩဆၧၩ့ဝ့ၫ လဂၩကြၨၭ",
			"19": "<sup>19</sup> လၧအဂးလီၫ.- တၭယဟိဝၩယွၩ မၩကဲၪထၪ့ကယဲ ဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩ, ဒဲကယဲထိၪၥံၪလံၪၥံၪ လၧဆၧဖိၭဖၫ့ ကိၭမံၩ့ဒ့ၭလီၫ. ဒုၭဂဲၫဝ့ၫ လၧၦခွၫအ အီၪဘဲၫၥိၭအမိဒၪဝ့ၫ လၧအမိဖျိၬအမံၩ့ ဘဲၫၥ့ၪလဲၪဘဲၫ ၥ့ၪလဲၪအဂးနီၪ, တၭကယဲဆၧအမၧၫ့ လမံၩ့လါလါ",
			"20": "<sup>20</sup> လၧၦၡၩနီၪ ဖျိၬဝ့ၫအမံၩ့တၭ, ကဲၪထၪ့အမံၩ့လီၫ.- တၭ ၦၡၩနီၪဖျိၬ ကယဲဆၧဖိၪဆၧဎါ အဒိၩ့ဒဲထိၪၥံၪလံၪၥံၪ လၧဆၧဖိၭဖၫ့, ဒဲကယဲဆၧဖိၪဆၧဎါ လၧမံၩ့လၬကျၩ ကိၭအဆၨၩဒ့ၭအမံၩ့လီၫ. အ့ၪမွဲလၧၦခွၫအဂး ၦမၩ ဆၧၩ့ဝ့ၫလဂၩ ကြၨၭလၧအဂးနီၪ ဆၧဒၪန့ဘၪဝ့ၫအီၪ အ့ၬ.",
			"21": "<sup>21</sup> ယဟိဝၩယွၩ ဒုၭမံၫမၪၦၡၩအခွၫနီၪတၭ, အဝ့ၫဒၪ မံၫဝ့ၫတၭ, အဆၧမၩန့အဂုၬဎွံၪလဘီၩ့တၭ, မၩဘုၭ",
			"22": "<sup>22</sup> ထၬထဲၩ့ဝ့ၫ အယၪလၧအလးလီၫ.- ဆၧဂုၬဎွံၪလၧအ မၩန့ဝ့ၫလၧၦခွၫအဖၧၩ့နီၪ, ယဟိဝၩယွၩ မၩကဲၪထၪ့ ၦမုၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦခွၫနီၪလီၫ.",
			"23": "<sup>23</sup> တၭၦခွၫနီၪစံၭဝ့ၫဒၪ, ဘိၩ့နဲၪ့ယီၩ အယီၩမွဲဎွံၪလၧ ယဎွံၪလဖၪ, ဒဲယၪလၧယယၪလီၫ. တၭအယီၩမွဲဆၧ မၩန့ထၪ့ဝ့ၫ လၧၦခွၫအဖၧၩ့တၭ, ဆၧမိကိၭဝ့ၫလၧၦမုၪ",
			"24": "<sup>24</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧၦခွၫမိဘၪစဲၪ့ဒၪ အမိအဖါတၭ, မိဘၪၥုၭဘူၭအၥၭ လၧအမၫအအီၪလ ခီၫတၭ, ဆၧလၧၦနံၫဂၩနီၪ မိဘၪကဲၪထၪ့လၥွံၪဎးလ",
			"25": "<sup>25</sup> ယၪဎးလီၫ.- တၭဆၧလၧၦနံၫဂၩ ၦခွၫဒဲအမၫနီၪအီၪ ဘိၪ့လါနၫ့တၭ, အမ့ၬမဲဘၪအ့ၬ."
		},
		"3": {
			"1": "<sup>1</sup> တၭဆၧလၧဂူနီၪကိၪ့ဆၧၥ့ၪနဲၪ့ ကယဲဆၧဖိၪဆၧဎါ လၧမံၩ့လၬကျၩ လၧယဟိဝၩ ယွၩမၩကဲၪ ထၪ့ဝ့ၫနီၪ လီၫ. အဝ့ၫဒၪစံၭၦမုၪနီၪ, ကယဲၥံၪ့လထံၭလါလါနီၪ,",
			"2": "<sup>2</sup> ယွၩမၪလူၬနၥံၪအၪ့လဂ့ၩ, မွဲတၡါဆ့ဧၪ.- တၭၦမုၪ စံၭဆၧၫ့ဝ့ၫ, ၥံၪ့အၥၪ လၧကျိၭဖၧၩ့နီၪ, ပအၪ့ဘၪမၬ",
			"3": "<sup>3</sup> ကၨ.- အ့ၪမွဲၥံၪ့အီၪလၧကျိၭအၥၭကျၩလထံၭနီၪ, အၪ့ လဂ့ၩ, ထိၭဘၪလဂ့ၩတၭ နၥံၪမိၥံၫဘၪခိၬလီၫ, ယွၩ",
			"4": "<sup>4</sup> စံၭဝ့ၫဒၪ.- တၭဂူနီၪ စံၭဆၧၫ့ၦမုၪ, နၥံၪမိၥံၫတၡါ",
			"5": "<sup>5</sup> အ့ၬ.- အဂဲးဘဲၫယီၩ ယွၩၥ့ၪယၫလၧမုလနံၩ လၧနၥံၪ အၪ့ဝ့ၫနီၪ, နၥံၪအမ့ၬၥၪၥံၪ မိဝဲထၪ့အၥၭ, နၥံၪမိလၩ့ဂၬ ယွၩတၭ, မိၥ့ၪယၫဆၧဂ့ၩ, ဒဲဆၧအၧၩ့နီၪလီၫ.",
			"6": "<sup>6</sup> တၭၦမုၪဒၪဘၪဝ့ၫ လၧၥံၪ့လထံၭနီၪ ဂ့ၩလၧဆၧအၪ့ အဂး, ဒဲဎံၫလၩလၧၦယိဝ့ၫအဂး, ဒဲဆၧမုၬလၩအၥံၪ့ လထံၭလၧအမိဒုၭ ကိၪ့ၥ့ၪဆၧအဂးတၭ, မၩန့ဆၧၥၪ နီၪအၪ့ဝ့ၫတၭ, ဖ့ၪလၫ့အဝၩဆ့ လၧအအီၪလၧအၥိၭ",
			"7": "<sup>7</sup> နီၪတၭ, အဝ့ၫဒၪအၪ့ဝ့ၫလီၫ.- တၭၦနံၫဂၩနီၪ အမ့ၬၥၪ ၥံၪဝဲထၪ့အၥၭနီၪ ၥ့ၪယၫဝ့ၫလၧအအီၪဘိၪ့လီၫ. တၭ အဝ့ၫၥံၪဆၭဘုၭထၬ ချိၪ့ဒိၩ့အလၪလဖၪ လၧအခဲးအ ယးဒံၩ့အဂးလီၫ.",
			"8": "<sup>8</sup> တၭအဝ့ၫၥံၪနါဂၧၫ့ဝ့ၫ လၧယဟိဝၩယွၩ အလူဂဲၫ လၧကျိၭအလး လၧမုရှူၪလၩ့လခီၫတၭ, ၦခွၫဒဲအမၫ အီၪက့ၪၥူၪခွံၬအၥၭ လၧယဟိဝၩယွၩအမ့ၬယၫ လၧ",
			"9": "<sup>9</sup> ၥံၪ့အကျၩ လၧကျိၭအလးနီၪလီၫ.- ယဟိဝၩယွၩကိၭ",
			"10": "<sup>10</sup> ထၪ့ၦခွၫနီၪတၭ, စံၭဝ့ၫဒၪ, မွဲနအီၪခီၫခီၫလဲၪ.- အဝ့ၫ ဒၪစံၭဆၧၫ့ဝ့ၫ, ယနါဂၧၫ့နလူ လၧကျိၭဖၧၩ့တၭ, လၧ ယအီၪဘိၪ့အကၠီၩ့နီၪ, ယၥၭမဲၪဆၧတၭ, ယအီၪက့ၪ",
			"11": "<sup>11</sup> ၥူၪယၥၭလီၫ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, မွဲပလၫဒုၭနဲၪနၧၩ လၧနအီၪဘိၪ့လဂၩလဲၪ, ၥံၪ့လထံၭလၧယမၪလူၬနၧၩ,",
			"12": "<sup>12</sup> အၪ့အၥၪလဂ့ၩနီၪ, မွဲနအၪ့ဘၪယူၭဧၪ.- တၭၦခွၫစံၭ ဝ့ၫ, ၦမုၪလၧနဖ့ၪလၫ့ အီၪလၧယၥိၭလဂၩနီၪ, ဖ့ၪလၫ့",
			"13": "<sup>13</sup> ယၧၩၥံၪ့အၥၪတၭ, ယအၪ့ဘၪယဝ့ၫလီၫ.- တၭယဟိ ဝၩယွၩစံၭၦမုၪနီၪ, ဆၧယီၩလၧနမၩယူၭ မွဲဆၧနီၪလ မံၩ့လဲၪ, ၦမုၪစံၭဝ့ၫ, ဂူအၪ့လီၫန့ယၧၩတၭ, ယအၪ့ ဘၪလီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩ ယွၩစံၭဂူနီၪ, လၧနမၩဆၧယီၩ အကၠီၩ့ တၭ, နဘၪဆိၪအၧၩ့နၭနဲၪ့ ဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲဆၧ ဖိၪဆၧဎါ လၧမံၩ့လၬကျၩထီးအလူၬလီၫတၭ နမိဘၪ စွၩလၧနဂူၭဖိၫ့, ဒဲနမိဘၪအၪ့ဂၪ့ခိၪအမုၬမုနံၩ လၧန",
			"15": "<sup>15</sup> မၧၫ့နဝ့ၫထီးအလူၬလဖၪနီၪလီၫ.- တၭယမိဒုၭထၫ့ဒုၪ ဒၩနၧၩလၧၦမုၪ, ဒဲနချံၫနၥၪ လၧၦမုၪအချံၫအၥၪနီၪလီၫ. အဝ့ၫနီၪမိဒိၪဆံဖိၫနခိၪတၭ, နမိဒိၪဆံဖိၫအဝ့ၫဒၪ အ ခၪ့နိးခဲၫ့လီၫ.",
			"16": "<sup>16</sup> အဝ့ၫဒၪစံၭၦမုၪ, နဒၧၩ့အဆၧဆၫနီၪ, ယမိမၩအၪ ထၪ့အၪအၪလ့ၬတၭ, လၧဆၧဆၫအဖၧၩ့နီၪ, နမိအီၪ ဖျဲၪန့နဖိၪလဖၪလီၫ. နမိဘၪဒိၭနဲၩ့နၥၭ လၧနဝၩတၭ, အဝ့ၫဒၪမိပၧၩ့ဘၪနၧၩလီၫ.",
			"17": "<sup>17</sup> တၭစံၭၦခွၫနီၪ, နခိၭနၪနမၫအလူအကၠီၩ့တၭ, နအၪ့ ၥံၪ့ၥၪလၧယမၪလူၬနၧၩ, စံၭဝ့ၫ, မွဲနထီးအၪ့ လဂ့ၩ တၭ, ဂၪ့ခိၪဘၪဆိၪအၧၩ့ လၧနကၠီၩ့လီၫ. လၧဆၧခိ",
			"18": "<sup>18</sup> ဆၧဝီၩအဖၧၩ့ နဘၪမၩကၩလဆိၩဒၪနၥၭလီၫ.- တၭ ဆၧဆူၪဆၧမဲၪ, ဒဲနၪ့ၥံၪမံၩ့ၥံၪမိမဲၪထၪ့ လၧနဂးတၭ,",
			"19": "<sup>19</sup> နမိအၪ့ဘုၪၥံၪဂူၫၥံၪ လၧဆၧပျၩ့ဖၧၩ့လီၫ.- တၭနမိဘၪ အၪ့ဆၧလၧနမ့ၬ အခိၥွ့ၫလၩ့ထီးနထဲၩ့ထဲၩ့ လၧဂၪ့ခိၪ လၬလီၫ. အဂဲးဘဲၫယီၩ ဆၧမၩန့နၧၩလၧဂၪ့ခိၪအဖၧၩ့ တၭ, အဂဲးဘဲၫယီၩ နမွဲဂၪ့ခိၪအမုၬတၭ, နမိဘၪကဲၪ ထဲၩ့လၧဂၪ့ခိၪအမုၬလီၫ.",
			"20": "<sup>20</sup> တၭစအၫဒၫ့ ဖျိၬအမၫအမံၩ့ လၧနးအံၫလီၫ. အဂဲး",
			"21": "<sup>21</sup> ဘဲၫယီၩ မွဲကယဲၦမၧၫ့ဝ့ၫ ထီးအလူၬအမိလီၫ.- တၭ ယဟိဝၩယွၩမၩဆဲၫ့ဆၧဖံၭ လၧစအၫဒၫ့အဂး, ဒဲလၧ အမၫအဂးတၭ, ဒုၭၥိၭထၪ့ဝ့ၫလီၫ.",
			"22": "<sup>22</sup> တၭယဟိဝၩစံၭဝ့ၫဒၪ, ယိခွါ, ၦၡၩနီၪကဲၪထၪ့ဝ့ၫ ဘဲၫၦလဂၩလၧပကျၩအၥိၭ, လၧအမိၥ့ၪယၫဆၧဂ့ၩ ဒဲဆၧအၧၩ့လီၫ. တၭဘိၩ့နဲၪ့ယီၩ မိယူၬထၪ့ဘၪခိၬ အစူၪတၭ, မိမၩန့ၥံၪ့မၧၫ့အၥၪတၭ မိမၧၫ့ဝ့ၫအဆိၩ",
			"23": "<sup>23</sup> ဆိၩအကၠၪကၠၪလီၫ.- တၭယဟိဝၩယွၩ အၪ့မၧၫ့အစဲၪ့ ထၪ့ခွံၬလၧကျိၭအံဒံၫ့အလး, ဘဲၫအမိမၩကၩလၧ",
			"24": "<sup>24</sup> ဂၪ့ခိၪလၧဆၧမၩန့အဝ့ၫ လၧအဖၧၩ့လီၫ.- အဝ့ၫဒၪနၫ့ ထၪ့ခွံၬၦၡၩတၭ, လၧကျိၭအံဒံၫ့မုထၪ့လခီၫနီၪ, အီၪ က့ၪခ့ၫရူၬလဖၪ, ဒဲနၭမ့ၪခဲၩထၪ့ လၧအဝံၩ့ဝၩ့အၥၭ ဝၬဝၬဘဲၫအမိခိၭၥံၪ့မၧၫ့ အဖၧၩ့ၥၭလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> စအၫဒၫ့ၥ့ၪယၫအမၫ နးအံၫတၭ, အဝ့ၫဒၧၩ့ထၪ့ဝ့ၫ နီၪ, အီၪဖျဲၪန့အဖိၪ စကံၫ့တၭ, စံၭဝ့ၫဒၪ, ယန့ဘၪယူၭ",
			"2": "<sup>2</sup> ၦၡၩအခွၫလဂၩ လၧယဟိဝၩယူၭ.- တၭအီၪဖျဲၪန့ဒီၭ အဖုစအၫဘလၭလီၫ. စအၫဘလၭနီၪ မွဲၦယူၬၥိၪအ ဒီၪ့လဖၪလီၫ, အ့ၪမွဲစကံၫ့လဂၩနီၪ မွဲၦမၩအၪ့ ကၩ လၧဂၪ့ခိၪလီၫ.",
			"3": "<sup>3</sup> တၭဆၧမၩအၥၭလၧ အဆၧၫ့အထီဖီၩ့ခွံၬနီၪ,စကံၫ့ ဂဲၫဆိၬဂၪ့ခိၪအဆၧၥၪတၭ, မၩဘိၪ့ယဟိဝၩလီၫ.",
			"4": "<sup>4</sup> တၭစအၫဘလၭ ဂဲၫဆိၬဆ့ၥိၪအဖိၪဝဲၡါလဖၪ ဒဲအၥိၪ",
			"5": "<sup>5</sup> လီၫ.- တၭဘၪယဟိဝၩအၥၭ လၧစအၫဘလၭ ဒဲအ ဆၧမၩဘိၪ့လီၫ. အ့ၪမွဲစကံၫ့ ဒဲအဆၧမၩဘိၪ့နီၪလ ဘၪဘၪအၥၭတၭ, စကံၫ့အၥၭထၪ့ဒိၪမၬတၭ အမ့ၬ",
			"6": "<sup>6</sup> လၩ့ၡါဝ့ၫဒၪလီၫ.- တၭယဟိဝၩစံၭစကံၫ့နီၪ, မွဲဘၪနီၫ",
			"7": "<sup>7</sup> နၥၭထၪ့လဲၪ, မွဲဘၪနီၫနမ့ၬလၩ့ၡါလဲၪ.- နအ့ၪမၩဆၧ ဂ့ၩတၭ, ဆၧအီၪက့ၪထၪ့ထီၫနၧၩနီၪ, မွဲအ့ၬဧၪ, နအ့ၪ မၩဆၧ လဂ့ၩဘၪနီၪ, ဆၧဒဲၩဘၭခိၭဆၧ လၧတရၫ့ ထံၭတၭ, အဆၧဆိၫ့န့ဘၪနီၪ, မွဲလၧနၧၩတၭ, နဝ့ၫဒၪ မၩနၧၩ့မၩစၪဆၧနီၪဆံၭ.",
			"8": "<sup>8</sup> စကံၫ့လီၩဘၪဝ့ၫလၧအဖု စအၫဘလၭတၭ,ဆၧမၩ အၥၭလၧအဝ့ၫၥံၪ အီၪလၧဆၧပျၩ့ဖၧၩ့ အဘိၩ့ဘၭနီၪ, စကံၫ့ဂဲထုၪ့ထၫ့ဒုၪဒၩ အဖုစအၫဘလၭတၭ, မၩၥံၫဝ့ၫ",
			"9": "<sup>9</sup> လီၫ.- တၭယဟိဝၩစံၭစကံၫ့, နဖုလဂၩနီၪ, မွဲအအီၪခီၫ ခီၫလဲၪ, တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယၥ့ၪယၫအ့ၬ, ယ",
			"10": "<sup>10</sup> ဝ့ၫဒၪယီၩ ယမွဲၦခိၭယိယဖုဆ့ဧၪ.- တၭအဝ့ၫဒၪစံၭ ဆၧၫ့ဝ့ၫ, မွဲနမၩယူၭဆၧနီၪ လမံၩ့လဲၪ, နဖုအၥွံၪအၥီၫ",
			"11": "<sup>11</sup> နီၪကိၭထၪ့ယၧၩ လၧဂၪ့ခိၪလၬလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ နဘၪဆိၪအၧၩ့ လၧဂၪ့ခိၪလၧအအၩ့ထၪ့ အနိၭဘဲၫၥိၭ",
			"12": "<sup>12</sup> အမိဒိၭန့နဖုအၥွံၪ လၧနစူၪဖၧၩ့လီၫ.- ထီးနမၩကၩ လၧဂၪ့ခိၪနီၪ, ဆၧလမိဖ့ၪလၫ့ဘၪနၧၩ လၧအဂဲးအဘၭ တၭ, နမိကဲၪထၪ့ၦလ့ၩလိၭဝၭၡၫ, ဒဲၦစဲၪ့ဝံၩ့ဝၩ့ လၧ",
			"13": "<sup>13</sup> ဂၪ့ခိၪချိၫ့လီၫ.- တၭစကံၫ့စံၭယဟိဝၩ, ယဆၧဒဲၩဘၭ",
			"14": "<sup>14</sup> ဒိၪထီးယထိးနၧၩ့အ့ၬ.- ယိခွါ, မုဆၫလနံၩယီၩနနၫ့ ထၪ့ခွံၬယၧၩ လၧဂၪ့ခိၪချိၫ့တၭ, ဒဲယဘၪအီၪကဒုၩ ခွံၬယၥၭလၧနမ့ၬ, ဒဲယမိကဲၪထၪ့ၦစဲၪ့ဖျိၭ, ဒဲၦစဲၪ့ဝံၩ့ ဝၩ့လၧဂၪ့ခိၪချိၫ့လီၫ. တၭဆၧမိမၩအၥၭ ထီးဒၪၦလၧ",
			"15": "<sup>15</sup> အဒၪန့ယၧၩ လဂၩလါလါနီၪ မိမၩၥံၫယၧၩလီၫ.-တၭ ယဟိဝၩ စံၭအဝ့ၫဒၪ, မၩအၥၭဘဲၫနီၪတၭ, ကယဲၦ လၧအမၩၥံၫစကံၫ့ လဂၩဂၩနီၪ မိဘၪထိးဆၧဒဲၩဘၭ နွ့ၫစၩလီၫ. တၭယဟိဝၩ အီၪက့ၪဆၧမၩနဲၪ့ လၧစကံၫ့ အဂး, ဘဲၫၥိၭၦလၧအဒၪန့အဝ့ၫနီၪ, မွဲအထီးမၩၥံၫဝ့ၫ နးဂၩလဂ့ၩလီၫ.",
			"16": "<sup>16</sup> စကံၫ့စဲၪ့ထၪ့ခွံၬ လၧယဟိဝၩ အမ့ၬယၫတၭ,လ့ၩ အီၪဝ့ၫလၧခးနီၭအဖၧၩ့ အီၪလၧအံဒံၫ့မုထၪ့လခီၫ",
			"17": "<sup>17</sup> လီၫ.- တၭစကံၫ့ၥ့ၪယၫအမၫတၭ, အဝ့ၫဒၪဒၧၩ့ထၪ့ တၭအီၪဖျဲၪန့ စအံနၧၭလီၫ. မွဲအမၩကဲၪထၪ့ ဒိၩ့လ ဖျိၪ့တၭ ဖျိၬဝ့ၫအမံၩ့ ဘဲၫအဖိၪခွၫစအံနၧၭ အမံၩ့အၥိၭ",
			"18": "<sup>18</sup> နီၪလီၫ.- စအံနၧၭထၪ့ဖိၪ စအဲရၭတၭ, စအဲရၭနီၪထၪ့ ဖိၪ စမဟုယလၭတၭ, စမဟုယလၭနီၪ ထၪ့ဖိၪစမၥု စလၭတၭ, စမၥုစလၭနီၪ ထၪ့ဖိၪစလၫမ့ၭလီၫ.",
			"19": "<sup>19</sup> တၭစလၫမ့ၭနီၪ န့အမၫနံၫဂၩလီၫ. အလဂၩနီၪအ မံၩ့မွဲနးအၫဒၫတၭ, အဝ့ၫလဂၩအမံၩ့မွဲ နးဇံလၫလီၫ.",
			"20": "<sup>20</sup> နးအၫဒၫနီၪအီၪဖျဲၪန့ စယၫဘလၭလီၫ, အဝ့ၫနီၪ မွဲၦ လၧအအီၪဝ့ၫ လၧတဲၩဖၧၩ့ ဒဲယိအဆၧဖိၪဆၧဎါအဒိၩ့",
			"21": "<sup>21</sup> လဖၪအဖါလီၫ.-အထၧၫ့ဖုဝဲလဂၩ အမံၩ့မွဲစယုဘလၭ လီၫ. အဝ့ၫလဂၩနီၪ မွဲၦလၧအဒံၩ့နါဒံၩ့, ဒဲအူၪပံၩလ",
			"22": "<sup>22</sup> ဖၪအဖါလီၫ.- တၭနးဇံလၫအီၪဖျဲၪန့ စတုၫဘလၭကံၫ့ ၦလၧအၥီၪ့လိၪ ကယဲၦ လၧအမၩထမၬထၭ ဒဲထမၬ ထီးကိၭဂၩဒ့ၭလီၫ. တၭစတုၫဘလၭကံၫ့ အထၧၫ့ဖုဝဲ မုၪမွဲနးန့အမၫလီၫ.",
			"23": "<sup>23</sup> စလၫမ့ၭစံၭအမၫၥံၪ, နးအၫဒၫ, ဒဲနးဇံလၫလဖၪနီၪ, နါဂၧၫ့ယလူစလၫမ့ၭအမၫၥံၪဧ့, ခိၭနၪယဆၧချဲၩ့ယီၩ ဆံၭ, အဂဲးဘဲၫယီၩ ယမၩၥံၫၦလဂၩ လၧယဘၪထူၬ အဂး, ဒဲဖိၪၥၪခွၫလဂၩ လၧယဘၪထး အလး အဂး",
			"24": "<sup>24</sup> လီၫ.- တၭၦလၧအမၩၥံၫ စကံၫ့နီၪ အ့ၪဘၪထိးဆၧဒဲၩ ဘၭနွ့ၫစၩတၭ, မွဲမၬၦလၧအမၩၥံၫ စလၫမ့ၭနီၪမိဘၪ ဆၧဒဲၩဘၭ နွ့ၫဆံၫနွ့ၫစၩလီၫ.",
			"25": "<sup>25</sup> စအၫဒၫ့ၥ့ၪယၫဒီၭ အမၫတၭ, အဝ့ၫဒၪအီၪဖျဲၪန့အ ဖိၪခွၫတၭ, ကိၭဝ့ၫအမံၩ့စစ့ၥၭလီၫ. အဂဲးဘဲၫယီၩယွၩ အီၪက့ၪယၧၩ လၧဆၧအချံၫအၥၪအဂူၫဂၩ လၧစအၫ ဘလၭအလး, အဂဲးဘဲၫယီၩ စကံၫ့မၩၥံၫအဝ့ၫလဂၩ လီၫ.",
			"26": "<sup>26</sup> စစ့ၥၭထၪ့ဖိၪအဖိၪခွၫဆ့တၭ, ကိၭဝ့ၫအမံၩ့လၧ စအံနိၭလီၫ. ထီးနီၪလဖၧၫ့ ၦကိၭထၪ့ၥၫ့ယဟိဝၩအ မံၩ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> အယီၩမွဲစအၫဒၫ့ အဆၨၩအဆၬလဖၪ အဆရၫ့ လီၫ. မုလနံၩလၧယွၩမၩကဲၪထၪ့ၦၡၩနီၪ, မွဲအမၩကဲၪ ထၪ့ဝ့ၫလၧယွၩအဂၩ့လီၫ. ၦမုၪဒဲၦခွၫနီၪ မၩကဲၪထၪ့",
			"2": "<sup>2</sup> ဝ့ၫတၭ, ဆိၪဂ့ၩအဝ့ၫၥံၪ,- တၭမုလနံၩလၧအမၩကဲၪ ထၪ့ဝ့ၫနီၪ ဖျိၬဝ့ၫအမံၩ့ စအၫဒၫ့လီၫ.",
			"3": "<sup>3</sup> တၭစအၫဒၫ့ အီၪဝ့ၫအနံၪ့လယၩၥၧၫ့ဆံၫတၭ, ထၪ့ ဖိၪလၩ့ဂၬ လၧအနၫ့ဆါဒၪဝ့ၫ ဘဲၫအဂၩ့ဒၪဝ့ၫအၥိၭ",
			"4": "<sup>4</sup> နီၪတၭ, ဖျိၬဝ့ၫအမံၩ့ စစ့ၥၭလီၫ.- တၭစအၫ့ဒၫ့အမုနံၩ လၧအထၪ့ဖိၪ စစ့ၥၭအလးခဲၫ့နီၪ, အနံၪ့ဎိၭယၩတၭ,",
			"5": "<sup>5</sup> ထၪ့ဖိၪအဖိၪမုၪၥံၪ ဒဲအဖိၪခွၫၥံၪလီၫ.- တၭစအၫဒၫ့အ မုနံၩထီးအလူၬနီၪ, အနံၪ့ခွံၫယၩၥၧၫ့ဆံၫတၭ, ၥံၫဝ့ၫ ဒၪလီၫ.",
			"6": "<sup>6</sup> စစ့ၥၭအီၪဝ့ၫ အနံၪ့လယၩယဲနံၪ့တၭ, ထၪ့ဖိၪစအံ",
			"7": "<sup>7</sup> နိၭလီၫ.- တၭစစ့ၥၭအီၪဝ့ၫ လၧအထၪ့ဖိၪစအံနိၭအ လးခဲၫ့အနံၪ့ဎိၭယၩနွ့ၫနံၪ့တၭ, ထၪ့ဖိၪအဖိၪမုၪၥံၪ",
			"8": "<sup>8</sup> ဒဲအဖိၪခွၫၥံၪလီၫ.- တၭစစ့ၥၭအမုနံၩ ထီးအလူၬနီၪ, မွဲခွံၫယၩလဆံၫနံၫနံၪ့တၭ, ၥံၫဝ့ၫဒၪလီၫ.",
			"9": "<sup>9</sup> စအံနိၭ အီၪဝ့ၫအနံၪ့ခွံၫဆံၫတၭ, ထၪ့ဖိၪစက့နၫ့",
			"10": "<sup>10</sup> လီၫ.- တၭစအံနိၭအီၪဝ့ၫ လၧအထၪ့ဖိၪစက့နၫ့အလး ခဲၫ့နီၪ, အနံၪ့ဎိၭယၩလဆံၫယဲနံၪ့တၭ, ထၪ့ဖိၪအဖိၪမုၪ",
			"11": "<sup>11</sup> ၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- တၭစအံနိၭအမုနံၩ ထီးအလူၬ နီၪမွဲအနံၪ့ ခွံၫယၩယဲနံၪ့တၭ, ၥံၫဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> စက့နၫ့အီၪဝ့ၫအနံၪ့ နွ့ၫဆံၫတၭ, ထၪ့ဖိၪစမဟၫလ",
			"13": "<sup>13</sup> လံၫလၭလီၫ.- တၭစက့နၫ့အီၪဝ့ၫ လၧအထၪ့ဖိၪစမ ဟၫလလံၫလၭအလးခဲၫ့နီၪ, အနံၪ့ဎိၭယၩလံဆံၫတၭ,",
			"14": "<sup>14</sup> ထၪ့ဖိၪအဖိၪမုၪၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- တၭစက့နၫ့အမု နံၩထီးအလူၬနီၪ မွဲအနံၪ့ ခွံၫယၩလဆံၫတၭ, ၥံၫဝ့ၫဒၪ လီၫ.",
			"15": "<sup>15</sup> စမဟၫလလံၫလၭ အီၪဝ့ၫအနံၪ့ဎူၫဆံၫယဲနံၪ့တၭ,",
			"16": "<sup>16</sup> ထၪ့ဖိၪစယၫရ့ၭလီၫ.- တၭစမဟၫလလံၫလၭအီၪဝ့ၫ လၧအထၪ့ဖိၪစယၫရ့ၭအလးခဲၫနီၪ, အနံၪ့ဎိၭယၩၥၧၫ့",
			"17": "<sup>17</sup> ဆံၫတၭ, ထၪ့ဖိၪအဖိၪမုၪၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- တၭ စမဟၫလလံၫလၭ အမုနံၩထီးအလူၬနီၪ မွဲဎိၭယၩခွံၫ ဆံၫယဲနံၪ့တၭ, ၥံၫဝ့ၫဒၪလီၫ.",
			"18": "<sup>18</sup> စယၫရ့ၭအီၪဝ့ၫအနံၪ့ လယၩဎူၫဆံၫနံၫနံၪ့တၭ,",
			"19": "<sup>19</sup> ထၪ့ဖိၪစအံနၧၭလီၫ.- စယၫရ့ၭအီၪဝ့ၫ လၧအထၪ့ဖိၪ စအံနၧၭအလးခဲၫ့နီၪ အနံၪ့ဎိၭယၩတၭ, ထၪ့ဖိၪအဖိၪ",
			"20": "<sup>20</sup> မုၪၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- တၭစယၫရ့ၭအမုနံၩထီးအ လူၬနီၪ, မွဲအနံၪ့ခွံၫယၩဎူၫဆံၫနံၫနံၪ့တၭ, ၥံၫဝ့ၫဒၪလီၫ.",
			"21": "<sup>21</sup> စအံနၧၭအီၪဝ့ၫအနံၪ့ဎူၫဆံၫယဲနံၪ့တၭ, ထၪ့ဖိၪစမ",
			"22": "<sup>22</sup> ၥုစလၫလီၫ.- စအံနၧၭလၧအထၪ့ဖိၪ စမၥုစလၫအလး ခဲၫ့နီၪ, လ့ၩဆၧလၧယွၩအၥိၭ အနံၪ့ၥၧၫ့ယၩတၭ, ထၪ့",
			"23": "<sup>23</sup> ဖိၪအဖိၪမုၪၥံၪ ဒဲအဖိၪခွၫၥံၪလီၫ.- စအံနၧၭအမုနံၩထီး",
			"24": "<sup>24</sup> အလူၬနီၪမွဲအနံၪ့ ၥၧၫ့ယၩဎူၫဆံၫယဲနံၪ့လီၫ.- စအံနၧၭ လ့ၩဆၧလၧယွၩအၥိၭတၭ, လအီၪလၧၩ့ဘၪနီၪ, အ ဂဲးဘဲၫယီၩ ယွၩမၩန့ထၪ့ဝ့ၫလီၫ.",
			"25": "<sup>25</sup> စမၥုစလၫအီၪဝ့ၫအနံၪ့ လယၩဎိၭဆံၫနွ့ၫနံၪ့တၭ,",
			"26": "<sup>26</sup> ထၪ့ဖိၪစလၫမ့ၭလီၫ.- စမၥုစလၫအီၪဝ့ၫ လၧအထၪ့ဖိၪ စလၫမ့ၭအလးခဲၫ့နီၪ အနံၪ့နွ့ၫယၩဎိၭဆံၫနံၫနံၪ့တၭ,",
			"27": "<sup>27</sup> ထၪ့ဖိၪအဖိၪမုၪၥံၪ ဒဲအဖိၪခွၫၥံၪလီၫ.- စမၥုစလၫအ မုနံၩထီးအလူၬနီၪ, မွဲအနံၪ့ ခွံၫယၩဎူၫဆံၫခွံၫနံၪ့တၭ, ၥံၫဝ့ၫဒၪလီၫ.",
			"28": "<sup>28</sup> စလၫမ့ၭအီၪဝ့ၫအနံၪ့ လယၩဎိၭဆံၫနံၫနံၪ့တၭ,ထၪ့",
			"29": "<sup>29</sup> ဖိၪအဖိၪခွၫလဂၩလီၫ.- တၭဖျိၬဝ့ၫအမံၩ့ စနိအၫတၭ, စံၭဝ့ၫဒၪ, အယီၩလဂၩ မိမၩမုၬထၪ့ထဲၩ့ပၧၩ လၧပဆၧ မၩလၧပမၩဆၧ လၧပစူၪထီးဆၧပွံၭပၥၭ အဂဲးအကၠီၪ့",
			"30": "<sup>30</sup> လၧဂၪ့ခိၪ လၧယဟိဝၩဆိၪအၧၩ့အကၠီၩ့လီၫ.- စလၫ မ့ၭအီၪဝ့ၫ လၧအထၪ့ဖိၪစနိအၫ အလးခဲၫ့နီၪ အနံၪ့ယဲ ယၩခွံၫဆံၫယဲနံၪ့တၭ, ထၪ့ဖိၪအဖိၪမုၪၥံၪ ဒဲအဖိၪခွၫ",
			"31": "<sup>31</sup> ၥံၪလီၫ.- စလၫမ့ၭအမုနံၩ ထီးအလူၬနီၪ, မွဲအနံၪ့နွ့ၫ ယၩနွ့ၫဆံၫနွ့ၫနံၪ့တၭ, ၥံၫဝ့ၫဒၪလီၫ.",
			"32": "<sup>32</sup> စနိအၫအီၪဝ့ၫ အနံၪ့ယဲယၩတၭ, ထၪ့ဖိၪစၡံၫ့, စဟၫ့, ဒဲစယၫဖ့ၭလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭထီးၦၡၩ အခွၫၥံၪအီၪထၪ့ၥၫ့အၪအၪ လ့ၬလၧဂၪ့ခိၪချိၫ့တၭ, အဖိၪမုၪလဖၪအီၪဖျဲၪဝ့ၫ လၧအ",
			"2": "<sup>2</sup> ဂးနီၪ,- ယွၩအဖိၪခွၫလဖၪ ဒၪဘၪဝ့ၫလၧၦၡၩအဖိၪမုၪ ၥံၪမွဲအဂ့ၩတၭ, မၩန့အမၫ လၧကယဲအရွံန့ဝ့ၫ လဖၪ နီၪလီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, လၧၦၡၩမၪဘၪဆၧအဖၧၩ့နီၪ, ယၥၭမုလဂဲးလိၬတ့ၭလိၬဘၪ အဆိၩအကၠၪတၭ, အဝ့ၫ ဒၪမွဲဆၧယၪဆ့လီၫ, မွဲလါနၫ့တၭ, အမုနံၩလဖၪမိအီၪ အနံၪ့လယၩနံၫဆံၫလီၫ.",
			"4": "<sup>4</sup> တၭဆၧလၧမုနံၩလဖၪနီၪ, ၦလၧအအၪ့ဂူၬမၩဆီၪ့ ဆၧအၧၩ့လဖၪ အီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့လီၫ. ထီးယွၩအ ဖိၪခွၫၥံၪလ့ၩနုၬ လၧၦၡၩအဖိၪမုၪၥံၪ အအီၪနီၪအလး ခဲၫ့တၭ, အဝ့ၫၥံၪအီၪဖျဲၪန့ ဖိၪၥၪၥံၪလၧအဂးလီၫ. တၭ အဝ့ၫၥံၪကဲၪထၪ့ ၦလၧအဂဲးဆီၪ့အဘၭဆီၪ့, ဒဲၦလၧ အမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့လီၫ.",
			"5": "<sup>5</sup> ယဟိဝၩဒၪဘၪ ၦၡၩအဆၧဒဲၩဘၭနီၪ, လၧအဒိၪ လၧဂၪ့ခိၪချိၫ့တၭ, ကယဲအကိၪ့ဆၧ လၧအဆီၫ့မီၪ့လၧ အၥၭ လမံၩ့လါလါနီၪ, မွဲဆၧအၧၩ့ ကိၭမုနံၩမုနၩဒ့ၭ",
			"6": "<sup>6</sup> လီၫ.- လၧအမၩကဲၪထၪ့ၦၡၩ လၧဂၪ့ခိၪချိၫ့အကၠီၩ့နီၪ, ယဟိဝၩနီၫ့ယါလၩ့ထဲၩ့အၥၭတၭ, အၥၭအုၭလၧအ",
			"7": "<sup>7</sup> ၥၭခံဖၧၩ့လီၫ.- ယဟိဝၩစံၭဝ့ၫဒၪ, ၦၡၩလၧယမၩကဲၪ ထၪ့နီၪ, ယမိထူၭခွံၬဝ့ၫ လၧဂၪ့ခိၪချိၫ့တၭ, ၦၡၩမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, ဆၧစွၩဆၧဂဲၩ, ဒဲထိၪၥံၪလံၪၥံၪ လၧဆၧဖိၭဖၫ့ ထီးအလူၬလီၫ. အဂဲးဘဲၫယီၩ ယမၩ ကဲၪထၪ့အဝ့ၫၥံၪအကၠီၩ့နီၪ, ယနီၫ့ယါလၩ့ထဲၩ့ယၥၭ",
			"8": "<sup>8</sup> လီၫ.- အ့ၪမွဲစနိအၫ န့ဘၪအခိးအတၩ လၧယဟိဝၩ အမ့ၬၥၪဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> အယီၩမွဲစနိအၫ အဆၨၩအဆၬလီၫ. တၭစနိအၫ မွဲၦအတီၩအလီၩ့ ဒဲၦအလၧၫ့အဎွ့ၩ လၧၦလၧအဆိၩ ဒၪဝ့ၫအကျၩလီၫ. စနိအၫလ့ၩဆၧ လၧယွၩအၥိၭလီၫ.",
			"10": "<sup>10</sup> တၭစနိအၫထၪ့ဖိၪ အဖိၪခွၫၥၧၫ့ဂၩ, စၡံၫ့, စဟၫ့,",
			"11": "<sup>11</sup> ဒဲစယၫဖ့ၭလီၫ.- ဂၪ့ခိၪအုၪဝ့ၫ လၧယွၩအမ့ၬယၫတၭ, ဂၪ့ခိၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ လၧဆၧအၪ့ဂူၬမၩဆီၪ့ဆၧ",
			"12": "<sup>12</sup> အၧၩ့လီၫ.- ယွၩယိလၩ့လၧဂၪ့ခိၪချိၫ့တၭ, ယိခွါ,မွဲအ ဘၪဆၧစံၪစၪဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ကယဲဆၧဖံၭဆၧ ယၪမၩစံၪစၪအဖၧၩ့ၥၭ လၧဂၪ့ခိၪချိၫ့ထီးအလူၬလီၫ.",
			"13": "<sup>13</sup> တၭယွၩစံၭစနိအၫ, ဆၧယၪထီးအလူၬအထုၬဂဲၫ ထၪ့ယူၭလၧယမ့ၬယၫယူၭ, အဂဲးဘဲၫယီၩ ဂၪ့ခိၪလၧၫ့ ဎွ့ၩဝ့ၫလၧဆၧအၪ့ဂူၬမၩဆီၪ့ဆၧအၧၩ့ လၧအဝ့ၫၥံၪ အကၠီၩ့တၭ, ယိခွါ,ယမိမၩ ဂၭဂီၩ့ခွံၬဎုၬအဝ့ၫၥံၪလၧ",
			"14": "<sup>14</sup> ဂၪ့ခိၪလီၫ.- တၭမၩတလၫဖၭဒိၪ လၧၥံၪ့ကိၬဖၫလၧ နဂးဆံၭ. နမိဘၪမၩဒူၭဖၧၩ့ၥံၪ လၧတလၫဖၧၩ့တၭ, လၧအချိၫ့မွဲဂ့ၩ, လၧအဖၧၩ့မွဲဂ့ၩ, နမိဘၪဂုၪလၧၥံၪ့",
			"15": "<sup>15</sup> ထူၭလီၫ.- တၭနမိဘၪမၩဘဲၫယီၩ, တလၫဖၭဒိၪနီၪအ ဖၭထီၫအဖျါၥၧၫ့ယၩ, အဒၪ့ဎၩ့အဖျါယဲဆံၫ, အထၪ့",
			"16": "<sup>16</sup> ထီၫလခီၫအဖျါၥၧၫ့ဆံၫလီၫ.- တၭနမိဘၪမၩဆၧဖၩ့လၧ တလၫဖၭဒိၪနီၪအဂး, ဒဲအဖၫ့ခိၪနီၪနမိဘၪမၩဂီၩ့လၧ လဖျါတၭ, တလၫဖၭဒိၪအတရၫ့နီၪ နမိဘၪမၩလၧအ နဲၩ့ဖၩလခီၫလီၫ. နမိဘၪမၩဒူၭဖၧၩ့ အခၪ့ထံၭလဆၫ့,",
			"17": "<sup>17</sup> ဒဲနံၫဆၫ့လဆၫ့, ဒဲၥၧၫ့ဆၫ့လဆၫ့လီၫ.- ယိခွါ,ယဝ့ၫဒၪ ယီၩယမိဒုၭဂဲၫထၪ့ ထံၫလုၬဘံၭဆၧ လၧဂၪ့ခိၪချိၫ့,လၧ အမိမၩဂၭဂီၩ့ခွံၬ ကယဲဆၧယၪလၧအအီၪ လၧဆၧမၧၫ့ အၥၪလၧမူၭခိၪအဖၫ့လၬလီၫ. တၭကယဲဆၧအီၪလၧ",
			"18": "<sup>18</sup> ဂၪ့ခိၪချိၫ့မိၥံၫခွံၬ ကိၭအမံၩ့ဒ့ၭလီၫ.- အ့ၪမွဲနဝ့ၫဒၪယီၩ, ယမိမၩဂုးမၩခၧၫ့ ယဆၧအုၩ့လၩ့လၧနၥိၭတၭ, နမိ ဘၪလ့ၩနုၬ လၧတလၫဖၭဒိၪအဖၧၩ့နီၪ, နဝ့ၫဒၪ,ဒဲနဖိၪ",
			"19": "<sup>19</sup> ခွၫၥံၪ,ဒဲနမၫ, ဒဲနဖိၪခွၫအမၫၥံၪ, လၧနၥိၭလီၫ.- တၭ နမိဘၪဒုၭလ့ၩနုၬ ဆၧနံၫဒုၩနံၫဒုၩ, လၧကယဲဆၧအ ၥၭမၧၫ့အကျၩ လၧဆၧကိၭမံၩ့ဒ့ၭအကျၩ လၧတလၫ ဖၭဒိၪအဖၧၩ့ ဘဲၫၥိၭအမိမၧၫ့ဎုၬ လၧနၧၩတၭ, အမိ",
			"20": "<sup>20</sup> ဒဲအဖၫမိဘၪအီၪဝ့ၫဒၪလီၫ.- ထိၪၥံၪလံၪၥံၪဘဲၫအ ဆၨၩဒၪဝ့ၫအၥိၭ, ဆၧဖိၪဆၧဎါ ဘဲၫအဆၨၩဒၪဝ့ၫအ ၥိၭ, ကယဲဆၧစွၩဆၧဂဲၩ လၧဂၪ့ခိၪချိၫ့ ဘဲၫအဆၨၩ ဒၪဝ့ၫအၥိၭနီၪ, နံၫဒုၩနံၫဒုၩ လၧကိၭဆၨၩဒ့ၭအကျၩ",
			"21": "<sup>21</sup> နီၪ,မိဂဲၫလၧနအီၪ, ဘဲၫၥိၭအမိမၧၫ့ဒံၭလီၫ.- တၭမၩ န့ဆၧအၪ့လၧဆၧကိၭအမံၩ့ဒ့ၭ လၧဆၧအၪ့အကျၩနီၪ ဆံၭ,နမိဘၪအီၪက့ၪကီၪ့ လၧနအီၪတၭ, မွဲအမိကဲၪထၪ့ ဆၧအၪ့လၧနဂး, ဒဲလၧအဝ့ၫၥံၪအဂးဆ့လီၫ.",
			"22": "<sup>22</sup> တၭစနိအၫမၩဝ့ၫ ဘဲၫကယဲဆၧလၧယွၩမၪလူၬဝ့ၫ အၥိၭနီၪ ထီးအလူၬလီၫ, ဘဲၫနီၪအၥိၭမွဲအမၩဝ့ၫဒၪ လီၫ."
		},
		"7": {
			"1": "<sup>1</sup> တၭယဟိဝၩ စံၭစနိအၫ, ဂဲၫနုၬနဝ့ၫ, ဒဲနၡၩဂံၪ့ဖိၪ ထီးအလူၬ လၧတလၫဖၭဒိၪအဖၧၩ့ယီၩဆံၭ, အဂဲးဘဲၫ ယီၩ နဝ့ၫဒၪယီၩယဒၪန့နၧၩ လၧၦအတီၩအလီၩ့လၧ",
			"2": "<sup>2</sup> ယမ့ၬယၫ လၧၦလဆိၩယီၩအကျၩလီၫ.- ကယဲဆၧ ဖိၪဆၧဎါ လၧအဆံၫ့အကျၩနီၪ, နမိဘၪမၩန့နွ့ၫဒုၩနွ့ၫ ဒုၩ,အမိဒဲအဖၫ, ဒဲလၧဆၧဖိၪဆၧဎါ အလဆံၫ့ဘၪအ",
			"3": "<sup>3</sup> ကျၩနီၪ, နံၫဒုၩနံၫဒုၩအမိဒဲအဖၫလီၫ.- လၧထိၪၥံၪလံၪ ၥံၪ လၧဆၧဖိၭဖၫ့အကျၩနီၪ, နမိဘၪမၩန့နွ့ၫဘံၪ့နွ့ၫ ဘံၪ့ဆ့,အမိဒဲအဖၫ ဘဲၫၥိၭအချံၫအၥၪ မိမၧၫ့ထၪ့လၧ",
			"4": "<sup>4</sup> ဂၪ့ခိၪချိၫ့ထၧၫ့ဖျိၪ့ယၫလီၫ.- အဂဲးဘဲၫယီၩ နွ့ၫနံၩဖီၩ့ ခွံၬတၭ,ယမိအၪ့မၧၫ့ဆၧ ဂဲၫဆၧၩ့လၩ့အနံၩ လံဆံၫဒဲ အနၩလံဆံၫ လၧဂၪ့ခိၪချိၫ့တၭ, ကယဲဆၧအၥၭမၧၫ့ လၧယမၩကဲၪထၪ့လမံၩ့လါလါနီၪ, ယမိထူၭခွံၬဝ့ၫလၧ ဂၪ့ခိၪချိၫ့လီၫ.",
			"5": "<sup>5</sup> တၭစနိအၫမၩကယဲဆၧလၧ ယဟိဝၩမၪလူၬဝ့ၫနီၪ",
			"6": "<sup>6</sup> လီၫ.- တၭလၧထံၫလုၬဘံၭခွံၬ ဆၧအီၪဝ့ၫလၧဂၪ့ခိၪ ချိၫ့နီၪစနိအၫအၥၭၡါအနံၪ့ဎူၫယၩလီၫ.",
			"7": "<sup>7</sup> တၭစနိအၫဒဲအဖိၪခွၫၥံၪ, ဒဲအမၫ, ဒဲအဖိၪခွၫအမၫ ၥံၪအီၪလၧအၥိၭနီၪ, လ့ၩနုၬလၧတလၫဖၭဒိၪအဖၧၩ့",
			"8": "<sup>8</sup> လၧထံၫမိလုၬဘံၭဆၧအကၠီၩ့လီၫ.- လၧဆၧဖိၪဆၧဎါ အဆံၫ့, ဒဲလၧဆၧဖိၪဆၧဎါအလဆံၫ့ဘၪ, ဒဲလၧထိၪၥံၪ လံၪၥံၪ, ဒဲကယဲဆၧလၧအစွၩ လၧဂၪ့ခိၪချိၫ့လမံၩ့လါ",
			"9": "<sup>9</sup> လါအကျၩ,- နံၫဒုၩနံၫဒုၩနီၪ လ့ၩနုၬလၧတလၫဖၧၩ့ လၧစနိအၫအအီၪ, အမိဒဲအဖၫဘဲၫယွၩမၪလူၬစနိအၫ",
			"10": "<sup>10</sup> အၥိၭနီၪလီၫ.- ဆၧမၩအၥၭလၧနွ့ၫနံၩဖီၩ့ခွံၬတၭ ထံၫလုၬဘံၭဆၧအီၪထၪ့ဝ့ၫ လၧဂၪ့ခိၪချိၫ့လီၫ.",
			"11": "<sup>11</sup> လၧစနိအၫအၥၭၡါ အနံၪ့ဎူၫယၩလၩနံၫဘံၪ့လဘံၪ့ ဒဲလၩထၪ့လဆံၫနွ့ၫနံၩလနံၩနီၪ, ဆၧယိၬဖၧၩ့ဖၭဒိၪ အထံၫထၪ့ဖျိၭအလး ဘုၪ့ဖိးထၪ့အၥၭတၭ, ဒဲမူၭခိၪ",
			"12": "<sup>12</sup> အဆၧဖိးဝဲထၪ့အၥၭလီၫ.- တၭဆၧဆၧၩ့လၩ့ဖၭဒိၪ",
			"13": "<sup>13</sup> လၧဂၪ့ခိၪအနံၩလံဆံၫအနၩလံဆံၫလီၫ.- ဆၧလၧမုလ နံၩနီၪစနိအၫ, ဒဲစနိအၫအဖိၪခွၫၥံၪ, စၡံၫ့, စဟၫ့ဒဲစယၫ ဖ့ၭလဖၪ, ဒဲစနိအၫအမၫ, ဒဲအဖိၪခွၫလဖၪအမၫၥၧၫ့ ဂၩအီၪလၧအၥိၭနီၪ, လ့ၩနုၬဝ့ၫ လၧတလၫဖၭဒိၪအ",
			"14": "<sup>14</sup> ဖၧၩ့လီၫ.- အဝ့ၫၥံၪဒဲကယဲဆၧအၥၭမၧၫ့ လမံၩ့လါလါ, ဘဲၫအဆၨၩဒၪဝ့ၫအၥိၭ, ဒဲကယဲဆၧဖိၪဆၧဎါဘဲၫအ ဆၨၩဒၪဝ့ၫအၥိၭ, ကယဲဆၧအစွၩ လၧဂၪ့ခိၪချိၫ့ဘဲၫအ ဆၨၩဒၪဝ့ၫအၥိၭ, ဒဲကယဲထိၪၥံၪလံၪၥံၪ ဘဲၫအဆၨၩ ဒၪဝ့ၫအၥိၭတၭ, ကယဲဆၧအီၪ လၧအဒံၭလမံၩ့လါ",
			"15": "<sup>15</sup> လါနီၪလီၫ.- တၭအဝ့ၫၥံၪလ့ၩနုၬ လၧတလၫဖၭဒိၪအ ဖၧၩ့လၧစနိအၫအၥိၭ နံၫဒုၩနံၫဒုၩ လၧကယဲဆၧယၪ အကျၩ,ကယဲဆၧမၧၫ့အၥၪအီၪဝ့ၫ လၧအဖၧၩ့လီၫ.",
			"16": "<sup>16</sup> တၭဆၧလၧအလ့ၩနုၬလဖၪနီၪ အမိဒဲအဖၫ, လၧကယဲ ဆၧယၪအကျၩ, ဘဲၫယွၩမၪလူၬဝ့ၫအၥိၭနီၪလီၫ. တၭ ယဟိဝၩကၭဘံၭထၬဝ့ၫ လၧအလးခဲၫ့လီၫ.",
			"17": "<sup>17</sup> ထံၫလုၬဘံၭဆၧနီၪ အၥၫ့လံဆံၫ လၧဂၪ့ခိၪချိၫ့တၭ, ထံၫဒိၪထၪ့ထီးအဆိၬ တလၫဖၭဒိၪ လၧဂၪ့ခိၪအဖၫ့ခိၪ",
			"18": "<sup>18</sup> နီၪတၭ, ထၪ့ဖီၫဝ့ၫဒၪလီၫ.- ထံၫဆီၪ့ထၪ့နီၪ ဒိၪထၪ့အၪ အၪလ့ၬလၧဂၪ့ခိၪချိၫ့တၭ, တလၫဖၭဒိၪလ့ၩဆၧလၧ",
			"19": "<sup>19</sup> ထံၫဖံၭခိၪလီၫ.- ထံၫဒိၪထၪ့ဆီၪ့ဆီၪ့လ့ၬ, ဆီၪ့ဆီၪ့ လ့ၬလၧဂၪ့ခိၪချိၫ့တၭ, ကယဲခိၪလီၩ့အထီၫလၧမူၭခိၪ",
			"20": "<sup>20</sup> ထၧၫ့ဘံၪ့ယၫအဖၫ့လၬနီၪ လၩ့ဘံၭခွံၬဝ့ၫဒၪလီၫ.- ထံၫ ဒိၪထၪ့အထၪ့ထီၫနီၪ လဆံၫယဲဖျါတၭ, ခိၪလီၩ့ၥံၪလၩ့ ဘံၭခွံၬဝ့ၫဒၪလီၫ.",
			"21": "<sup>21</sup> တၭကယဲဆၧယၪ လၧအဂဲၩလၧဂၪ့ခိၪချိၫ့,ထိၪၥံၪ လံၪၥံၪမွဲဂ့ၩ, ဆၧဖိၪဆၧဎါအဒိၩ့မွဲဂ့ၩ, ဆၧဖိၪဆၧဎါ အမံၩ့မွဲဂ့ၩ, ကယဲဆၧအစွၩ လၧဂၪ့ခိၪချိၫ့မွဲဂ့ၩ, ကယဲ",
			"22": "<sup>22</sup> ၦၡၩကိၭအဂၩမွဲဂ့ၩ, ၥံၫဝ့ၫဒၪထီးအလူၬလီၫ.- တၭ ဆၧထီးအလူၬ လၧဆၧမၧၫ့ အၥၪအီၪ လၧအနၫဖၧၩ့ လၧအအီၪလၧခီၫ့ယီၩ, ၥံၫဝ့ၫဒၪ ကိၭအမံၩ့ဒ့ၭလီၫ.",
			"23": "<sup>23</sup> တၭကယဲဆၧအၥၭမၧၫ့ လၧဂၪ့ခိၪချိၫ့, ၦၡၩဖိးလၧဆၧ ဖိၪဆၧဎါ, ဒဲဆၧအစွၩအဂဲၩ, ဒဲထိၪၥံၪလံၪၥံၪ လၧဆၧ ဖိၭဖၫ့နီၪ, ဘၪဆၧထူၭခွံၬ ထီးအလူၬလီၫ. အဝ့ၫၥံၪ ဘၪဆၧထူၭခွံၬ လၧဂၪ့ခိၪချိၫ့တၭ, အီၪလၩ့ထးန့ၫစနိ အၫဒဲၦလၧအအီၪ လၧအၥိၭ လၧတလၫဖၭဒိၪအဖၧၩ့",
			"24": "<sup>24</sup> နီၪလီၫ.- တၭထံၫအီၪဂုးခၧၫ့ လၧဂၪ့ခိၪချိၫ့အၥၫ့လယၩ ယဲဆံၫလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ယွၩနၪ့ထၪ့ထဲၩ့စနိအၫ ဒဲကယဲဆၧအၥၭမၧၫ့တၭ, ကယဲဆၧဖိၪဆၧဎါ လၧအအီၪလၧအၥိၭ လၧတလၫ ဖၭဒိၪအဖၧၩ့နီၪ, ယွၩဒုၭအူၪထၪ့လံၩ လၧဂၪ့ခိၪချိၫ့",
			"2": "<sup>2</sup> တၭ,ထံၫလၩ့ၥံၭထဲၩ့ဝ့ၫဒၪလီၫ.- ဆၧယိၬဖၧၩ့အထံၫ ထၪ့ဖျိၭအလး, ဒဲမူၭခိၪအဆၧဖိးလဖၪ ကၭဘံၭထဲၩ့ အၥၭတၭ, ဆၧဂဲၫဆၧၩ့လၩ့ဖၭဒိၪ လၧမူၭခိၪနီၪ ဆၧ",
			"3": "<sup>3</sup> မၩထုၬဝ့ၫဒၪလီၫ.- ထံၫထဲၩ့ထဲၩ့ လၧဂၪ့ခိၪလထံၪဎး တၭ,အၥၫ့လယၩယဲဆံၫ ဖီၩ့ခွံၬနီၪ ထံၫလၩ့ၡၩထဲၩ့ ဝ့ၫဒၪလီၫ.",
			"4": "<sup>4</sup> တၭလၧလၩနွ့ၫဘံၪ့လဘံၪ့ လၩထၪ့လဆံၫနွ့ၫနံၩ လနံၩနီၪ, တလၫဖၭဒိၪဘုၭထၬ လၧခိၪလီၩ့အၫရရၭ",
			"5": "<sup>5</sup> အဒၩ့ခိၪနီၪလီၫ.- ထံၫလၩ့ၡၩလထံၪဎးထီၩ့လၩ့လၧ လၩဆံၫဘံၪ့လဘံၪ့တၭ, လၧလၩဆံၫဘံၪ့ လဘံၪ့, ဒဲလၩထၪ့ လနံၩနီၪ ခိၪလီၩ့ဒၩ့ခိၪအီၪ ဖျီၪထၪ့ဝ့ၫဒၪ လီၫ.",
			"6": "<sup>6</sup> တၭဆၧမၩအၥၭ လၧအၥၫ့လံဆံၫဖီၩ့ခွံၬနီၪ, စနိအၫ",
			"7": "<sup>7</sup> ဝဲထၪ့တလၫဖၭဒိၪအဖိး လၧအမၩဝ့ၫဒၪလီၫ.- တၭ ကွဲၪဖျါထၪ့ကျၭလဘံၪ့နီၪ, အဝ့ၫလ့ၩဂဲၫထဲၩ့, လ့ၩဂဲၫ ထဲၩ့ထီးထံၫအွံၩထၪ့ခွံၬ လၧဂၪ့ခိၪချိၫ့လီၫ.",
			"8": "<sup>8</sup> ထံၫလၩ့ၥံၭဧၪလလၩ့ၥံၭဘၪဧၪ လၧဂၪ့ခိၪချိၫ့ယီၩ, ဘဲၫၥိၭအမိၥ့ၪယၫတၭ, ကွဲၪဖျါထၪ့ထိၪလွံလဘံၪ့လၧ",
			"9": "<sup>9</sup> အအီၪလီၫ.- ထိၪလွံလဘံၪ့နီၪ လဒၪဘၪအီၪပွံၭအလး လၧအခၪ့အဂးနးစီၪ့တၭ, ဂဲၫထဲၩ့ထဲၩ့လၧအလးလၧ အအီၪလၧတလၫဖၭဒိၪအဖၧၩ့နီၪ, အဂဲးဘဲၫယီၩထံၫ အီၪလၧဂၪ့ခိၪချိၫ့ထၧၫ့ဖျိၪ့ယၫလီၫ. အဝ့ၫဒၪယူၬထၪ့ အစူၪမၩန့ဝ့ၫတၭ, ဒုၭနုၬထဲၩ့ဝ့ၫလၧတလၫဖၭဒိၪအ",
			"10": "<sup>10</sup> ဖၧၩ့လီၫ.- အီၪခိၭဒံၭနွ့ၫၥၫ့တၭ, ဖျါထၪ့ခွံၬဒီၭထိၪလွံ",
			"11": "<sup>11</sup> လဘံၪ့နီၪ လၧတလၫဖၭဒိၪ အဖၧၩ့လီၫ.- ထိၪလွံနီၪ ဂဲၫထဲၩ့လၧအအီၪ လၧမုဂၪလၩ့တၭ, ယိခွါ, အလဲအိၫ့ အလၪလၧအဘျၨၪန့ဝ့ၫလဘံၪ့ အီၪလၧအနိၭဖၧၩ့လီၫ. တၭစနိအၫၥ့ၪယၫဝ့ၫ လၧထံၫလၩ့ၥံၭခွံၬ လၧဂၪ့ခိၪချိၫ့",
			"12": "<sup>12</sup> လီၫ.- အီၪခိၭဒီၭနွ့ၫၥၫ့တၭ, ဖျါထၪ့ခွံၬထိၪလွံနီၪတၭ လဂဲၫထဲၩ့လၧၩ့ဘၪ လၧအအီၪနီၪလီၫ.",
			"13": "<sup>13</sup> ဆၧမၩအၥၭ လၧအနံၪ့ဎူၫယၩလနံၪ့, လၩခၪ့ထံၭ လဘံၪ့လၩထၪ့လနံၩနီၪ ထံၫအွံၩထၪ့ခွံၬ လၧဂၪ့ခိၪချိၫ့ တၭ, စနိအၫရိလၩ့ခွံၬ တလၫဖၭဒိၪအခိၪတၭ, ယိဝ့ၫနီၪ",
			"14": "<sup>14</sup> ဒၪဘၪဂၪ့ခိၪဎဲၫ့ထၪ့ယူၭ.- တၭလၧလၩနံၫဘံၪ့လဘံၪ့, လၩထၪ့နံၫဆံၫနွ့ၫနံၩလနံၩနီၪ ဂၪ့ခိၪဎဲၫ့ထၬယူၭလီၫ. တၭယွၩချဲၩ့ဆၧ လၧစနိအၫစံၭဝ့ၫဒၪ,",
			"15": "<sup>15</sup> စဲၪ့လၩ့ ခွံၬလၧတလၫဖၭဒိၪအဖၧၩ့ဆံၭ. နဝ့ၫဒၪ, ဒဲနမၫ, ဒဲနဖိၪ",
			"17": "<sup>17</sup> ခွၫၥံၪ, ဒဲနဖိၪခွၫလဖၪအမၫၥံၪ, လၧနၥိၭနီၪဆံၭ.- တၭ ဒုၭစဲၪ့လၩ့လၧနၥိၭ လၧကယဲဆၧအၥၭမၧၫ့ ဒဲလၧဆၧ ယၪထီးအလူၬအကျၩ, ထိၪၥံၪလံၪၥံၪ, ဆၧဖိၪဆၧဎါ, ဒဲကယဲဆၧအစွၩ လၧအစွၩ လၧဂၪ့ခိၪချိၫ့, ဘဲၫၥိၭ အမိဖၭထၪ့အၪအၪလ့ၬ လၧဂၪ့ခိၪချိၫ့တၭ, ၥၪထၪ့",
			"18": "<sup>18</sup> ဒဲအၪထၪ့လၧဂၪ့ခိၪချိၫ့နီၪဆံၭ.- တၭစနိအၫစဲၪ့လၩ့ ခွံၬဝ့ၫ, ဒဲအဖိၪခွၫၥံၪ, ဒဲအမၫ, ဒဲအဖိၪခွၫလဖၪအမၫၥံၪ",
			"19": "<sup>19</sup> လၧအၥိၭလီၫ.- ကယဲဆၧဖိၪဆၧဎါ, ကယဲဆၧစွၩဆၧ ဂဲၩ, ဒဲကယဲထိၪၥံၪလံၪၥံၪ, ဒဲကယဲဆၧအစွၩလၧဂၪ့ ခိၪချိၫ့လမံၩ့လါလါ, ဘဲၫအဒီၪ့ဒၪဝ့ၫအၥိၭနီၪ, စဲၪ့လၩ့ ခွံၬဝ့ၫလၧတလၫဖၭဒိၪ အဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> တၭစနိအၫမၩဆၧလုအလး လၧယဟိဝၩအဂးတၭ, မၩန့ကယဲဆၧဖိၪဆၧဎါလၧအဆံၫ့, ဒဲကယဲထိၪၥံၪ လံၪၥံၪ လၧအဆံၫ့လဖၪအကျၩ လမံၩ့လါလါနီၪ, လု",
			"21": "<sup>21</sup> ထၪ့ဆၧလုမ့ၪလၧဆၧလုလး အဖၫ့ခိၪနီၪလီၫ.- ယဟိ ဝၩနၧၫ့ထၪ့ဆၧနၧၫ့မၧၫ့တၭ, ယဟိဝၩစံၭလၧအၥၭခံ ဖၧၩ့,ၦၡၩအၥၭကိၪ့ထၪ့ဆၧအၧၩ့ လၧအၥၭဘၪ့လံၩ လံၩလါနၫ့တၭ, ယလဆိၪအၧၩ့လၧၩ့ဘၪ ဂၪ့ခိၪလၧၦ ၡၩအကၠီၩ့တၭ, ယလကျီၪ့လၧၩ့ဘၪ ကယဲဆၧအၥၭ",
			"22": "<sup>22</sup> မၧၫ့ဘဲၫယမၩဝဲၩယူၭ အၥိၭနီၪလီၫ.- ဂၪ့ခိၪအမုနံၩ လၧအအီၪဒံၭအဘိၩ့ဘၭ ထီးအလူၬနီၪ, ဎွံၪဆၧအခၫ, ဒဲကူၭဆၧအခၫ, ဒဲဆၧဂီးအခၫ, ဒဲဆၧခိအခၫ, ဒဲဆၧ ယီၩအခၫ, ဒဲနံၩ ဒဲနၩ, လထုၬဘၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ယွၩဆိၪဂ့ၩစနိအၫ ဒဲအဖိၪခွၫၥံၪတၭစံၭအဝ့ၫၥံၪ, မွဲနၥံၪၥၪထၪ့ ဒဲအၪထၪ့တၭ, မၩဎွ့ၩထၪ့ဂၪ့ခိၪဆံၭ.",
			"2": "<sup>2</sup> တၭဆၧၥၭမဲၪနၥံၪဒဲဆၧဝၭထိၬ လၧနၥံၪအကၠီၩ့မိအီၪ လၧကယဲဆၧဖိၪဆၧဎါအလီၩ့ လၧအအီၪဝ့ၫလၧဂၪ့ခိၪ ချိၫ့ယီၩ, ဒဲလၧကယဲထိၪၥံၪလံၪၥံၪအလီၩ့, လၧအအီၪ ဝ့ၫလၧဆၧဖိၭဖၫ့, ဒဲကယဲဆၧလၧအစွၩ လၧဂၪ့ခိၪချိၫ့ အလီၩ့, ဒဲလၧကယဲဒ့ၪၥံၪယၪၥံၪအလီၩ့ လၧမၫဆမံၭ ဖၧၩ့နီၪလီၫ. တၭဆၧဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ လၧနၥံၪအ",
			"3": "<sup>3</sup> စူၪဖၧၩ့လီၫ.- ကယဲဆၧဂဲၩလၧအမၧၫ့ဝ့ၫ လမံၩ့လါလါ နီၪမိကဲၪထၪ့ဆၧအၪ့ လၧနၥံၪအဂး, ဘဲၫဆၧဒိၭဆၧ လၪအၥိၭနီၪ ယဖ့ၪလၫ့နၥံၪ လၧဆၧထီးအလူၬလီၫ.",
			"4": "<sup>4</sup> အ့ၪမွဲဆၧယၪအီၪ လၧအၥၭမၧၫ့ဘဲၫၦစံၭ ဆၧအၥိၭ,",
			"5": "<sup>5</sup> အၥွံၪနီၪတၭ, ထီးအၪ့လဂ့ၩ.- ယမိအၪ့ဎၬနၥံၪအၥၭ မၧၫ့အၥွံၪတၡါတၭ, ယမိအၪ့ဎၬဝ့ၫ လၧကယဲဆၧဖိၪ ဆၧဎါအစူၪဖၧၩ့, လၧကယဲၦၡၩအစူၪဖၧၩ့တၭ, ကယဲ ၦၡၩအထၧၫ့ဖုဝဲအစူၪဖၧၩ့ လဂၩလါလါနီၪ ယမိအၪ့",
			"6": "<sup>6</sup> ဎၬၦၡၩအၥၭမၧၫ့လီၫ.- ၦလၧအလူၫလၩ့ခွံၬၦၡၩအ ၥွံၪနီၪ, မိဘၪဆၧလူၫလၩ့ခွံၬအၥွံၪဒၪဝ့ၫ လၧၦၡၩအ စူၪဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယွၩမၩကဲၪထၪ့ၦၡၩဘဲၫ",
			"7": "<sup>7</sup> အခံးအဂၩ့ဒၪဝ့ၫအၥိၭနီၪလီၫ.- တၭနၥံၪဝ့ၫဒၪယီၩ, ၥၪထၪ့နၥံၪဝ့ၫတၭ, အၪထၪ့ဆံၭ, ထၪ့ဖိၪအၪဂၩလၧ ဂၪ့ခိၪချိၫ့, ဒဲအၪထၪ့လၧအဖၫ့ခိၪဆံၭ.",
			"8": "<sup>8</sup> ယွၩစံၭစနိၭအၫ, ဒဲအဖိၪခွၫၥံၪလၧအအီၪလၧအၥိၭ",
			"9": "<sup>9</sup> တၭ,စံၭဝ့ၫဒၪ,- ယဝ့ၫဒၪယီၩ, ယိခွါ, ယအီၪက့ၪဂုး ခၧၫ့ယဆၧအုၩ့လၩ့ လၧနၥံၪ, ဒဲလၧနၥံၪအချံၫအၥၪ",
			"10": "<sup>10</sup> လၧနၥံၪအလးခဲၫ့လီၫ.- ဒဲလၧကယဲဆၧၥၭမၧၫ့ အီၪ လၧနၥံၪအၥိၭ လၧထိၪၥံၪလံၪၥံၪ လၧဆၧဖိၪဆၧဎါ အဒိၩ့, ဒဲလၧကယဲဆၧဖိၪဆၧဎါ လၧဂၪ့ခိၪချိၫ့ၥံၪအ ကျၩအီၪလၧနၥံၪအၥိၭ, လၧကယဲဆၧလၧအစဲၪ့လၩ့ ခွံၬလၧတလၫဖၭဒိၪအဖၧၩ့ ကယဲဆၧဖိၪဆၧဎါလၧဂၪ့",
			"11": "<sup>11</sup> ခိၪချိၫ့လမံၩ့လါလါနီၪလီၫ.- တၭယမိအီၪက့ၪဂုးခၧၫ့ ယဆၧအုၩ့လၩ့ လၧနၥံၪလီၫ. ကယဲဆၧယၪလမိဘၪ လၧၩ့ဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧထံၫလၩ့ဘံၭဆၧတၭ, ထံၫလုၬဘံၭဆၧ လၧအမိမၩဂၭဂီၩ့ခွံၬ ဂၪ့ခိၪယီၩမိ အီၪထၪ့လၧၩ့အ့ၬ.",
			"12": "<sup>12</sup> တၭယွၩစံၭဝ့ၫဒၪ, ယဆၧအုၩ့လၩ့အဆၧမၩနဲၪ့လၧ ယအုၩ့လၩ့လၧနၥံၪ, ဒဲကယဲဆၧၥၭမၧၫ့ လၧအအီၪ",
			"13": "<sup>13</sup> လၧနၥံၪအၥိၭ အဆိၩအကၠၪနီၪမွဲအယီၩ,- ယမိအီၪ က့ၪယချံၪလၧဆၧအုၪ့အလီၩ့တၭ, မိကဲၪထၪ့ဆၧအုၩ့ လၩ့အဆၧမၩနဲၪ့ လၧယအုၩ့လၩ့ဆၧ လၧဂၪ့ခိၪနီၪ",
			"14": "<sup>14</sup> လီၫ.- ဆၧမိမၩအၥၭ ထီးယဒုၭအုၪ့ထၪ့ဆၧလၧဂၪ့ခိၪ အဖၫ့ခိၪတၭ, ချံၪလဒုၩနီၪ မိအီၪဖျီၪ လၧဆၧအုၪ့အ",
			"15": "<sup>15</sup> လီၩ့နီၪလီၫ.- တၭယမိနၪ့ထၪ့ထဲၩ့ ယဆၧအုၩ့လၩ့လၧ ယအုၩ့လၩ့ဆၧလၧနၥံၪ, ဒဲကယဲဆၧၥၭမၧၫ့ အီၪလၧ ကယဲဆၧယၪ အကျၩနီၪလီၫ. တၭထံၫမိကဲၪထၪ့ဆၧ လၧအမၩလၩ့ဘံၭဆၧ, ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခွံၬကယဲ",
			"16": "<sup>16</sup> ဆၧယၪထီးအလူၬနီၪမွဲအ့ၬ.- တၭဆၧလၧချံၪလဒုၩ နီၪမိအီၪလၧဆၧအုၪ့အလီၩ့တၭ, ယမိယိအဝ့ၫဘဲၫယ မိနၪ့ထၪ့ထဲၩ့ယဆၧအုၩ့လၩ့အၥိၭ အဆိၩအကၠၪလၧ ယွၩအုၩ့လၩ့ဆၧ, ဒဲကယဲဆၧၥၭမၧၫ့ လၧကယဲဆၧ",
			"17": "<sup>17</sup> ယၪအကျၩ လၧအအီၪလၧဂၪ့ခိၪလီၫ.- တၭယွၩစံၭ စနိအၫ, အယီၩ, မွဲဆၧအုၩ့လၩ့ လၧယအုၩ့လၩ့ဆၧ လၧကယဲဆၧယၪ လၧဂၪ့ခိၪချိၫ့ အဆၧမၩနဲၪ့လီၫ.",
			"18": "<sup>18</sup> တၭစနိအၫအဖိၪခွၫၥံၪ လၧအစဲၪ့လၩ့ခွံၬလၧတလၫ ဖၭဒိၪအဖၧၩ့နီၪ, မွဲစၡံၫ့, စဟၫ့, ဒဲစယၫဖ့ၭလီၫ, တၭ",
			"19": "<sup>19</sup> စဟၫ့နီၪ, မွဲစကၫနအၫ့အဖါလီၫ.- အဝ့ၫၥံၪနီၪမွဲစနိအၫ အဖိၪခွၫၥၧၫ့ဂၩတၭ, ၦလဖၪနီၪ အဆၨၩအဆၬအီၪ ဎံၩ့ဂၪ့ခိၪချိၫ့ယီၩလီၫ.",
			"20": "<sup>20</sup> တၭစနိအၫကဲၪထၪ့ ၦမၩကၩလၧဂၪ့ခိၪတၭ,ၥုၪ့လၩ့",
			"21": "<sup>21</sup> စဘံၭမုအလးလီၫ.- အဝ့ၫအီၩစဘံၭထံၫနီၪ မၧၩ့ဝ့ၫ",
			"22": "<sup>22</sup> တၭ,အီၪဘိၪ့ လၧအတဲၩဖၧၩ့လီၫ.- စကၫနအၫ့အဖါ စဟၫ့လဂၩဒၪ ဘၪအဖါအီၪဘိၪ့ဝ့ၫတၭ, လီၩဘၪအ",
			"23": "<sup>23</sup> ထၧၫ့ဖုဝဲနံၫဂၩ လၧအအီၪလၧခီၫ့လီၫ.- စၡံၫ့ဒဲစယၫဖ့ၭ မၩန့ဖၬဘဲၩ့လုၬလဘံၪ့တၭ, အီၪက့ၪထၪ့ဝ့ၫလၧအခိၬ ထံၭနံၫဂၩလူၬတၭ, လ့ၩဂုၩ့ထဲၩ့အၥၭလခီၫတၭ, မၩ ဘံၭအဖါအီၪဘိၪ့နီၪတၭ, လဒၪဘၪအဖါအီၪဘိၪ့ဝ့ၫ",
			"24": "<sup>24</sup> ဒၪလီၫ.- စနိအၫမံၫနၪ့ထၪ့အၥၭ လၧအအီၩစဘံၭထံၫ အဖၧၩ့တၭ, ဆၧလၧအဖိၪဒၪဘၨၩမၩဝ့ၫနီၪ ၥ့ၪယၫဝ့ၫ",
			"25": "<sup>25</sup> ဒၪလီၫ.- တၭစံၭဝ့ၫဒၪ, မွဲစကၫနအၫ့ ဘၪဆၧဆိၪအၧၩ့ ဆံၭ, မိကဲၪထၪ့ဎီးလဖၪအဎီး လၧအထၧၫ့ဖုဝဲလဖၪ",
			"26": "<sup>26</sup> အဎီးလီၫ.- တၭစံၭဝ့ၫဒၪ, ယဟိဝၩစၡံၫ့အယွၩနီၪ,မွဲ အဘၪဆိၪဂ့ၩဆံၭ, တၭစကၫနအၫ့မိကဲၪထၪ့ အဎီးအ",
			"27": "<sup>27</sup> ၡၩလီၫ.- ယွၩမိမၩလဲထၪ့စယၫဖ့ၭအလးတၭ, မိအီၪ ဝ့ၫလၧစၡံၫ့အတဲၩလဖၪအဖၧၩ့တၭ, စကၫနအၫ့မိကဲၪ ထၪ့အဎီးအၡၩလီၫ.",
			"28": "<sup>28</sup> တၭစနိအၫအီၪဝ့ၫ လၧထံၫလုၬဘံၭဆၧအလးခဲၫ့",
			"29": "<sup>29</sup> နီၪ,အနံၪ့ၥၧၫ့ယၩယဲဆံၫလီၫ.- စနိအၫအမုနံၩထီးအ လူၬနီၪ, အနံၪ့ခွံၫယၩယဲဆံၫတၭ, ၥံၫဝ့ၫဒၪလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> လၧထံၫလုၬဘံၭဆၧအလးခဲၫ့နီၪ, စနိအၫအဖိၪခွၫ စၡံၫ့, စဟၫ့ဒဲစယၫဖ့ၭၥံၪအဆၨၩအဆၬ လၧအလၩ့ ဆိၩထဲၩ့ဝ့ၫမွဲဘဲၫယီၩ,",
			"2": "<sup>2</sup> စယၫဖ့ၭအဖိၪခွၫၥံၪ,မွဲစဂိမၧၫ, ဒဲစမ့ဂီၭ,ဒဲစမၭဒအဲၫ,",
			"3": "<sup>3</sup> ဒဲစယၫဝၫ့, ဒဲစတုဘလၭ,ဒဲစမံၡ့ၭ, ဒဲစတဲရၭလီၫ.-စဂိ မၧၫအဖိၪခွၫၥံၪ, မွဲစအၭၡခံၫနၭ, ဒဲစရဲဖၭ, ဒဲစတိၫဂၫ",
			"4": "<sup>4</sup> မၫလီၫ.- စယၫဝၫ့အဖိၪခွၫၥံၪ, မွဲစအံၫလဲၡၫ, ဒဲစတၫ",
			"5": "<sup>5</sup> ၡံၭ, ဒဲစကံတံၫ့, ဒဲစဒိဒနံၫ့လီၫ.- တၭၦအဆၨၩလဖၪနီၪ အခးဖိၪလၩ့မုလၩ့ဖၭဝ့ၫ လၧအခးဖၧၩ့နီၪ, ကယဲၦဘဲၫ အဆၧချဲၩ့အလၨအၥိၭ, ဘဲၫအဝ့ၫၥံၪအဂံၪ့ဒီၪ့ လၧအ ဆၨၩအကျၩအၥိၭ ကိၭဂၩဒ့ၭလီၫ.",
			"6": "<sup>6</sup> စဟၫ့အဖိၪခွၫၥံၪ, မွဲစကုၡၫ, ဒဲစမံၭဇရံၫ့, ဒဲစဖၧၭ",
			"7": "<sup>7</sup> ဒဲစကၫနအၫ့လီၫ.- စကုၡၫအဖိၪခွၫၥံၪ, မွဲစစံဘၫ, ဒဲစဟၭဝလၫ,ဒဲစစၭဘတၫ, ဒဲစရၫအမၫ,ဒဲစစၫဘတံၫ ခၫလီၫ. တၭစရၫအမၫအဖိၪခွၫၥံၪ, မွဲစရံဘၫ, ဒဲစဒံဒၫ့ လီၫ.",
			"8": "<sup>8</sup> စကုၡၫထၪ့ဖိၪစနံၪ့ရီၭလီၫ, အဝ့ၫနီၪ ကဲၪထၪ့ၦအ",
			"9": "<sup>9</sup> ဒိၪလၧဂၪ့ခိၪချိၫ့လီၫ.- မွဲ ၦ အၪ့ ဎၬ ဆၧ ဖၭ ဒိၪ လၧ ယဟိဝၩအမ့ၬယၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ၦစံၭဝ့ၫ, ဘဲၫစနံၪ့ရီၭအၥိၭ, ၦအၪ့ဎၬဆၧဖၭဒိၪ လၧယဟိဝၩ",
			"10": "<sup>10</sup> အမ့ၬယၫနီၪလီၫ.- တၭအဘၩ့အမုးအခၪ့ထံၭနီၪ မွဲ ဘၫဘလၭ, ဒဲအံရ့ၭ, ဒဲအၭကၭ, ဒဲကၪလနံၫအီၪဝ့ၫ",
			"11": "<sup>11</sup> လၧခးၡဲနၫအဖၧၩ့လီၫ.- မွဲအစဲၪ့ထၪ့ခွံၬ လၧခးထီးနီၪ တၭ, ထီၩ့လၧအစံရအၫအဖၧၩ့နီၪ မၩကဲၪထၪ့ဒိၩ့",
			"12": "<sup>12</sup> နံနဝ့ၫ, ဒဲရဟိဘိၭ, ဒဲကၫလၫ- ဒဲရံစံၫ့အီၪဝ့ၫလၧနံနဝ့ၫ ဒဲကၫလၫအဘိၩ့ဆၧၩ့နီၪလီၫ. အဝ့ၫနီၪမွဲ ဒိၩ့ဖၭဒိၪ လဖျိၪ့လီၫ.",
			"13": "<sup>13</sup> စမံၭဇရံၫ့ထၪ့ဖိၪ,စလုဒံၫ့, ဒဲစအၪ့အမံၫ့,ဒဲစလဟ့",
			"14": "<sup>14</sup> ဘံၫ့,ဒဲစနၭတုၫဟံၫ့.- ဒဲစပၭၥစံၫ့, ဒဲစကၭလုဟံၫ့, (ၦဖလံၡၫဖိၪလဆၨၩလၩ့ဆၨၩထဲၩ့လၧအဝ့ၫၥံၪ) ဒဲစ",
			"15": "<sup>15</sup> ကၫပတိရံၫ့လီၫ. စကၫနအၫ့ထၪ့ဖိၪ အဝဲၡါစဇဲဒၧၫ့,",
			"16": "<sup>16</sup> ဒဲစဟ့ၥၭ,-ဒဲၦယံဘုၫဖိၪ, ဒဲၦအၫမိၫဖိၪ,ဒဲၦဂၧဂၫဖိၪ,",
			"17": "<sup>17</sup> ဒဲၦဟံဝဲၫဖိၪ,ဒဲၦအၫကၫဖိၪ, ဒဲၦစံၫဖိၪ,-ဒဲၦအၫဝၭဖိၪ",
			"18": "<sup>18</sup> ဒဲၦစ့မၫဖိၪဒဲၦဟ့မၫဖိၪလီၫ. လၧခဲၫ့ထဲၩ့ၦကၫနအၫ့ဖိၪ",
			"19": "<sup>19</sup> အဂံၪ့ဒီၪ့ၥံၪ လၩ့မုလၩ့ဖၭဝ့ၫဒၪလီၫ.- ၦကၫနအၫ့ဖိၪ အနဲၩ့ထံၭနီၪ, မွဲလၧဇဲဒၧၫ့, လၧနဂဲၫနုၬလၧဂံရၫ ဖိး လၧဂ့ဇၫထီးနလ့ၩဆၧထီၩ့ လၧစီဒၧၫ့, ဒဲဂမီရၫ,ဒဲအၫ",
			"20": "<sup>20</sup> ဒမၫ,ဒဲဇဘိအံၫ့, ထီၩ့လၧလၫၡၫလီၫ.- အဝ့ၫၥံၪနီၪမွဲ စဟၫ့အဖိၪခွၫလဖၪ ဘဲၫအဝ့ၫၥံၪ အဂံၪ့ဒီၪ့အၥိၭဘဲၫ အဆၧချဲၩ့အလၨအၥိၭ လၧအခးဖၧၩ့, ဒဲလၧအဆၨၩ အကျၩနီၪလီၫ.",
			"21": "<sup>21</sup> စအံဘၧၫအဖိၪခွၫထီးအလူၬအဖါမွဲစၡံၫ့, လၧအမွဲ စယၫဖ့ၭအဝဲလဂၩနီၪ, ဖိၪလဖၪအီၪဖျဲၪ လၧအဂးဆ့",
			"22": "<sup>22</sup> လီၫ.- တၭစၡံၫ့အဖိၪခွၫလဖၪ, မွဲစအံလၫ့,ဒဲစအၭၡၧၫ,",
			"23": "<sup>23</sup> ဒဲစအၫဖၭစၭ, ဒဲစလၧၭ,ဒဲစအၫရၫ့လီၫ.- တၭစအၫရၫ့ အဖိၪခွၫၥံၪမွဲစအုဇၭ, ဒဲစဟုလၭ, ဒဲစဂံၥၧၫ,ဒဲစမၫၡၭ",
			"24": "<sup>24</sup> လီၫ.- တၭစအၫဖၭစၭနီၪ ထၪ့ဖိၪစၡၫလၫ, တၭစၡၫ",
			"25": "<sup>25</sup> လၫနီၪထၪ့ဖိၪစအံဘၧၫလီၫ.- တၭလၧစအံဘၧၫအဂး နီၪအဖိၪခွၫ အီၪဖျဲၪဝ့ၫနံၫဂၩလီၫ. အလဂၩအမံၩ့မွဲ စပံလ့ၭ,အဂဲးဘဲၫယီၩ လၧအဝ့ၫလဂၩအဆိၩနီၪ အ ခးဖိၪၥံၪလၩ့မုလၩ့ဖၭလီၫ, ဒဲ အ ထၧၫ့ ဖု ဝဲ အ မံၩ့ မွဲ",
			"26": "<sup>26</sup> စယီၭတၫ့လီၫ.- ဒဲစယီၭတၫ့နီၪ ထၪ့ဖိၪစအၫလမိဒၭ,",
			"27": "<sup>27</sup> ဒဲစၡံလ့ၭဖၫ, ဒဲစဟၫဇၫမ့ၫဝံၭ,ဒဲမယံရၫ,- ဒဲစဟဒိရၫ့, ဒဲစယုဇလၭ. ဒဲစဒံၭလၫ,ဒဲစအိဘလၭ, ဒဲစအဘံၫမအ့",
			"28": "<sup>28</sup> လၭ,ဒဲစၡံဘၫ.- ဒဲစအိဖၧၫ,ဒဲစဟၫဝလၫ, ဒဲစယိဘၭ",
			"29": "<sup>29</sup> လီၫ.- အဝ့ၫၥံၪထီးအလူၬနီၪ, မွဲစယီၭတၫ့အဖိၪခွၫၥံၪ",
			"30": "<sup>30</sup> လီၫ.- တၭအဝ့ၫၥံၪအီၪအလးနီၪမွဲလၧမံၡၫ, ထီးနလ့ၩ ဆၧလၧစ့ၭဖၫ, ခိၪလီၩ့လဖျိၪ့အီၪလၧမုထၪ့လခီၫလီၫ.",
			"31": "<sup>31</sup> အဝ့ၫၥံၪနီၪမွဲစၡံၫ့အဖိၪခွၫၥံၪ ဘဲၫဂံၪ့ဒီၪ့အၥိၭ, ဘဲၫအ ဆၧချဲၩ့အလၨဒၪဝ့ၫအၥိၭ လၧအခးဖၧၩ့ဘဲၫအ",
			"32": "<sup>32</sup> ဆၨၩဒၪဝ့ၫအၥိၭနီၪလီၫ.- အဝ့ၫၥံၪနီၪမွဲစနိအၫအဖိၪ ခွၫၥံၪအဂံၪ့ဒီၪ့လဖၪ ဘဲၫအဆိၩအၥိၭ လၧအဆၨၩၥံၪ အကျၩနီၪလီၫ. တၭလၧထံၫလုၬဘံၭ ဆၧအလးခဲၫ့ နီၪ,ၦဆၨၩၥံၪလၩ့မုလၩ့ဖၭဎံၩ့ ဂၪ့ခိၪချိၫ့လၧအဝ့ၫၥံၪ နီၪလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> တၭဂၪ့ခိၪဖိၪအီၪ လၧအလၨလမံၩ့ဎး ဒဲအဆၧချဲၩ့",
			"2": "<sup>2</sup> လမံၩ့ဎးထီးအလူၬလီၫ.- ဆၧမၩအၥၭလၧၦၡၩစဲၪ့ ထၪ့ခွံၬ လ့ၩစိၩမုထၪ့လခီၫအဘိၩ့ဘၭနီၪတၭ, အဝ့ၫ ၥံၪဒၪန့ဆၧပျၩ့အီၪ လၧခးၡဲနၫအဖၧၩ့တၭ, အီၪဝ့ၫထီး နီၪလီၫ.",
			"3": "<sup>3</sup> တၭအဝ့ၫၥံၪစံၭလိၬအၥၭဆုၬဆုၬ, ဂဲၫဘီၪ. မၩၡီၩ့ အၩ့ကတဲၩတၭ, ဎူထၪ့အၪအၪလ့ၬဘီၪ. တၭအဝ့ၫၥံၪ အီၪလၧအၩ့ကတဲၩ လၧလိးအလး, ဒဲကျဲၩ့တံၭခိလီၪ့",
			"4": "<sup>4</sup> လၧၥယိၭအလးလီၫ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫ, ဂဲၫဘီၪ, ပမိမၩၡီၩ့ဒိၩ့လဒိၩ့လၧပဂး, ဒဲတၨၭအထီၫလၧအခံၫ ထိၭထၪ့ဘၭ လၧမူၭခိၪအဖၧၩ့လဖျိၪ့, ဒဲမၩၡီၩ့ပမံၩ့ လမံၩ့ဘဲၫၥိၭ ပထီးလၩ့မုလၩ့ဖၭ လၧဂၪ့ခိၪချိၫ့ဎံၩ့",
			"5": "<sup>5</sup> လ့ၬလဂ့ၩလီၫ.- တၭယဟိဝၩဂဲၫလၩ့ယိဝ့ၫ ဒိၩ့လဒိၩ့",
			"6": "<sup>6</sup> ဒဲတၨၭထီၫ လၧၦၡၩမၩထၪ့ဝ့ၫနီၪလီၫ.- ယဟိဝၩစံၭ ဝ့ၫဒၪ,ယိခွါ, ၦၡၩမွဲၦလဆၨၩဎး, အဆၧချဲၩ့လမံၩ့ဎး ထီးအလူၬတၭ, မၩထၪ့ၥၫ့ဆၧယီၩတၭ, ဘိၩ့နဲၪ့ယီၩ ကယဲဆၧလၧအကိၪ့ မၩဆၧလမံၩ့လါလါ, ဆၧမိပဒၩ့",
			"7": "<sup>7</sup> ထၬဝ့ၫနးမံၩ့အ့ၬ.- ဂဲၫဘီၪ, မွဲပမိလ့ၩလၩ့ၡီၩ့တၭ, မၩ ဘံၪဘူၪအဝ့ၫၥံၪ အဆၧချဲၩ့ ဘဲၫၥိၭအထီးနၪၥ့ၪလိၬ အဆၧချဲၩ့ဆုၬဆုၬလဂ့ၩ.",
			"8": "<sup>8</sup> ယဟိဝၩမၩလၩ့မုလၩ့ဖၭအဝ့ၫၥံၪ လၧဂၪ့ခိၪထၧၫ့",
			"9": "<sup>9</sup> ဖျိၪ့ယၫတၭ, အဝ့ၫၥံၪလမၩလၧၩ့ဘၪဒိၩ့နီၪလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, အမံၩ့မွဲဘၫဘလၭနီၪ, အဂဲးဘဲၫ ယီၩထီးနီၪယဟိဝၩ မၩဘံၪဘူၪဂၪ့ခိၪဖိၪ ထီးအလူၬ အဆၧချဲၩ့ ဒဲထီးနီၪယဟိဝၩ မၩလၩ့မုလၩ့ဖၭအဝ့ၫ ၥံၪလၧဂၪ့ခိၪချိၫ့ ထၧၫ့ဖျိၪ့ယၫလီၫ.",
			"10": "<sup>10</sup> တၭအယီၩ မွဲစၡံၫ့အဆိၩလဖၪလီၫ. တၭထံၫလုၬ ဘံၭဆၧအလးခဲၫ့နံၫနံၪ့နီၪ စၡံၫ့ အီၪဝ့ၫအနံၪ့လယၩ",
			"11": "<sup>11</sup> တၭ,ထၪ့ဖိၪစအၫဖၭစၭလီၫ.- တၭစၡံၫ့အီၪဝ့ၫလၧ အထၪ့ဖိၪစအၫဖၭစၭအလးခဲၫ့နီၪ, အနံၪ့ယဲယၩတၭ, ထၪ့ဖိၪအဖိၪမုၪၥံၪ, ဒဲအဖိၪခွၫၥံၪလီၫ.",
			"12": "<sup>12</sup> စအၫဖၭစၭအီၪဝ့ၫ အနံၪ့ၥၧၫ့ဆံၫယဲနံၪ့တၭ, ထၪ့ဖိၪ",
			"13": "<sup>13</sup> စၡၫလၫလီၫ.- စအၫဖၭစၭအီၪဝ့ၫ လၧအထၪ့ဖိၪစၡၫ လၫအလးခဲၫ့နီၪ အနံၪ့လံယၩၥၧၫ့နံၪ့တၭ, ထၪ့ဖိၪအ",
			"14": "<sup>14</sup> ဖိၪမုၪၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- စၡၫလၫအီၪဝ့ၫအနံၪ့ၥၧၫ့",
			"15": "<sup>15</sup> ဆံၫတၭ, ထၪ့ဖိၪစအံဘၧၫလီၫ.- စၡၫလၫအီၪဝ့ၫလၧ အထၪ့ဖိၪစအံဘၧၫအလးခဲၫ့နီၪ အနံၪ့လံယၩၥၧၫ့နံၪ့ တၭ,ထၪ့ဖိၪ အဖိၪမုၪၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.",
			"16": "<sup>16</sup> စအံဘၧၫအီၪဝ့ၫ အနံၪ့ၥၧၫ့ဆံၫလံနံၪ့တၭ, ထၪ့ဖိၪ",
			"17": "<sup>17</sup> စပံလ့ၭလီၫ.- စအံဘၧၫအီၪဝ့ၫ လၧအထၪ့ဖိၪ စပံလ့ၭ အလးခဲၫ့နီၪ အနံၪ့လံယၩၥၧၫ့ဆံၫတၭ, ထၪ့ဖိၪအဖိၪ",
			"18": "<sup>18</sup> မုၪၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- စပံလ့ၭအီၪဝ့ၫအနံၪ့ၥၧၫ့ဆံၫ",
			"19": "<sup>19</sup> တၭ,ထၪ့ဖိၪစရုၫလီၫ.- စပံလ့ၭအီၪဝ့ၫ လၧအထၪ့ဖိၪ စရုၫအလးခဲၫ့နီၪ အနံၪ့နံၫယၩ ခွံၫနံၪ့တၭ, ထၪ့ဖိၪအ",
			"20": "<sup>20</sup> ဖိၪမုၪၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- စရုၫအီၪဝ့ၫအနံၪ့ၥၧၫ့ဆံၫ",
			"21": "<sup>21</sup> နံၫနံၪ့တၭ, ထၪ့ဖိၪစစံရၧၭလီၫ.- စရုၫအီၪဝ့ၫလၧအ ထၪ့ဖိၪစစံရၧၭအလးခဲၫ့နီၪ အနံၪ့နံၫယၩနွ့ၫနံၪ့တၭ,",
			"22": "<sup>22</sup> ထၪ့ဖိၪအဖိၪမုၪၥံၪ ဒဲအဖိၪခွၫၥံၪလီၫ.- စစံရၧၭအီၪဝ့ၫ",
			"23": "<sup>23</sup> အနံၪ့ၥၧၫ့ဆံၫတၭ, ထၪ့ဖိၪစနၫဟီၫလီၫ.- စစံရၧၭအီၪ ဝ့ၫလၧအထၪ့ဖိၪ စနၫဟီၫအလးခဲၫ့နီၪ အနံၪ့နံၫယၩ တၭ,ထၪ့ဖိၪအဖိၪမုၪၥံၪ ဒဲအဖိၪခွၫၥံၪလီၫ.",
			"24": "<sup>24</sup> စနၫဟီၫအီၪဝ့ၫအနံၪ့ နံၫဆံၫခွံၫနံၪ့တၭ, ထၪ့ဖိၪစတံ",
			"25": "<sup>25</sup> ရၫလီၫ.- စနၫဟီၫအီၪဝ့ၫ လၧအထၪ့ဖိၪစတံရၫအလး ခဲၫ့နီၪအနံၪ့လယၩလဆံၫခွံၫနံၪ့တၭ, ထၪ့ဖိၪအဖိၪမုၪ",
			"26": "<sup>26</sup> ၥံၪဒဲအဖိၪခွၫၥံၪလီၫ.- စတံရၫအီၪဝ့ၫအနံၪ့နွ့ၫဆံၫတၭ, ထၪ့ဖိၪစအၫဘြၫ့, စနၫဟီၫ, ဒဲစဟၫရၫ့လီၫ.",
			"27": "<sup>27</sup> တၭအယီၩမွဲစတံရၫအဆိၩလဖၪလီၫ. တၭစတံရၫ ထၪ့ဖိၪစအၫဘြၫ့, ဒဲစနၫဟီၫ, ဒဲစဟၫရၫ့လီၫ. တၭ",
			"28": "<sup>28</sup> စဟၫရၫ့နီၪထၪ့ဖိၪ စလီၭလီၫ. အဖါစတံရၫလချႃၭၥံၫ ဒံၭဘၪတၭ, စဟၫရၫ့ ၥံၫလၧခးလၧအအီၪဖျဲၪဝ့ၫလၧ အဖၧၩ့, လၧၦခၫလဒံအၫဖိၪ အဒိၩ့အၧၫ အဖၧၩ့နီၪ",
			"29": "<sup>29</sup> လီၫ.- တၭစအၫဘြၫ့, ဒဲစနၫဟီၫန့အမၫၥံၪလီၫ. တၭ စအၫဘြၫ့ အမၫအမံၩ့မွဲနးစၫရ့ၫ, ဒဲစနၫဟီၫ အမၫအ မံၩ့မွဲနးမံလကၫ, စဟၫရၫ့အဖိၪမုၪလီၫ. အဝ့ၫလဂၩ",
			"30": "<sup>30</sup> နီၪမွဲနးမံလကၫ, ဒဲနးအံစကၫအဖါလီၫ.- တၭနးစၫရ့ၫ လဂၩနီၪမွဲၦထူၬဖိၪတၭ, အဖိၪအီၪဘၪအ့ၬ.",
			"31": "<sup>31</sup> တၭစတံရၫမၩန့အဖိၪခွၫစအၫဘြၫ့, ဒဲအလံၩစဟၫ ရၫ့အဖိၪခွၫစလီၭ, ဒဲအဒဲၪနးစၫရ့ၫ, အဖိၪခွၫစအၫဘြၫ့ အမၫလၧအၥိၭတၭ, အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧၦခၫ လဒံအၫဖိၪအဒိၩ့အၧၫနီၪ, ဘဲၫၥိၭအမိလ့ၩစိၩလၧခး ကၫနအၫ့နီၪလီၫ. လ့ၩဝ့ၫဖိးလၧဟၫရၫ့တၭ, အီၪဝ့ၫ",
			"32": "<sup>32</sup> ထီးနီၪလီၫ. တၭစတံရၫအမုနံၩထီးအလူၬနီၪ မွဲအနံၪ့ နံၫယၩယဲနံၪ့တၭ, စတံရၫၥံၫဝ့ၫ လၧဟၫရၫ့အဖၧၩ့ လီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭယဟိဝၩစံၭစအၫဘြၫ့နီၪ, စဲၪ့ထၪ့ခွံၬနဝ့ၫလၧ နထံၫနခးအဖၧၩ့, ဒဲလၧနဘူၭနထံးအအီၪ, ဒဲလၧနဖါ အဂံၪ့ဖၧၩ့, လ့ၩလၧခးလဘံၪ့ လၧယမိဒုၭနဲၪနၧၩနီၪ",
			"2": "<sup>2</sup> ဆံၭ.- ယမိဒုၭကဲၪထၪ့နၧၩ လၧၦလဆၨၩဖၭဒိၪတၭ, ယမိဆိၪဂ့ၩနၧၩ ဒဲယမိမၩဒိၪနမံၩ့တၭ, နမိကဲၪထၪ့ဆၧ",
			"3": "<sup>3</sup> ဆိၪဂ့ၩလီၫ.- တၭၦလၧအဆိၪဂ့ၩနၧၩနီၪ, ယမိဆိၪ ဂ့ၩအဝ့ၫၥံၪ, ဒဲၦလၧအမၩကြၩ့ထမးနၧၩနီၪ, ယမိဆိၪ အၧၩ့အဝ့ၫၥံၪလီၫ. တၭၦဂၪ့ခိၪဖိၪ အဂံၪ့ဒီၪ့လဖၪထီး အလူၬနီၪ မိဘၪဆၧဆိၪဂ့ၩ လၧနဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> စအၫဘြၫ့စဲၪ့ထၪ့ခွံၬ ဘဲၫယဟိဝၩ မၪလူၬဝ့ၫအၥိၭ နီၪတၭ, စလီၭလ့ၩဝ့ၫ လၧအၥိၭလီၫ. တၭလၧစအၫ ဘြၫ့စဲၪ့ထၪ့ခွံၬဝ့ၫ လၧဟၫရၫ့အဖၧၩ့နီၪ, အၥၭၡါယူၭ",
			"5": "<sup>5</sup> အနံၪ့နွ့ၫဆံၫယဲနံၪ့လီၫ.- စအၫဘြၫ့မၩန့အမၫ နးစၫ ရ့ၫဒဲအမၧၩ့စလီၭ, ဒဲကယဲအဆၧဖိၪဆၧလံၩ လၧအ မၩန့ဝ့ၫ, ဒဲၦၡၩလၧအန့ဘၪဝ့ၫ လၧဟၫရၫ့အဖၧၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫ ဘဲၫၥိၭအမိလ့ၩ လၧခးကၫနအၫ့တၭ, လ့ၩနုၬလၧခးကၫနအၫ့ အဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> တၭစအၫဘြၫ့ ခၫ့ဂၬဆၧလၧခးနီၪ အဖၧၩ့ဖိးလၧၡံ ခံၫ့အလး, ထီးမိရံၫအၥံၪ့ထိၭဖၫနီၪလီၫ. အထီထီးနီၪ",
			"7": "<sup>7</sup> ၦကၫနအၫ့ဖိၪအီၪဝ့ၫ လၧခးနီၪလီၫ.- ယဟိဝၩမၩဖျီၪ ထၪ့အၥၭလၧစအၫဘြၫ့တၭ, စံၭဝ့ၫဒၪ, ယမိဖ့ၪလၫ့ခး လဘံၪ့ယီၩလၧနချံၫနၥၪလီၫ. တၭထီးနီၪမွဲအမၩထၪ့ ဆၧလုအလး လၧယဟိဝၩ လၧအမၩဖျီၪထၪ့အၥၭလၧ အမ့ၬယၫအဂးလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪ ထီၩ့လၧခိၪလီၩ့လဖျိၪ့ အီၪလၧဒိၩ့ဘ့ၫၥလၭ အမုထၪ့လခီၫတၭ, ၥုၪ့အတဲၩ နီၪ,ဒိၩ့ဘ့ၫၥလၭ အီၪလၧမုနုၬလခီၫ, ဒဲဒိၩ့ဟၫအဲၫလၧ မုထၪ့လခီၫလီၫ. မၩဆၧလုအလးထီးနီၪ လၧယဟိဝၩ",
			"9": "<sup>9</sup> အဂးတၭ, ကိၭထၪ့ယဟိဝၩအမံၩ့လီၫ.- စအၫဘြၫ့စဲၪ့ ထၪ့ခွံၬဝ့ၫတၭ, ၥုၭအလးစိၩမုခံၫ့ လခီၫလီၫ.",
			"10": "<sup>10</sup> ဆၧၥၭဝံလၩ့ဒိၩ အီၪထၪ့လၧခးဖၧၩ့နီၪတၭ, စအၫ ဘြၫ့လ့ၩလၩ့ဝ့ၫ လၧအံဇံၭ ဘဲၫၥိၭအမိအီၪၦမွံၩ ထီး နီၪလီၫ. အဂဲးဘဲၫယီၩ ဆၧၥၭဝံလၩ့ဒိၩနီၪ အီၪနၭမၬ",
			"11": "<sup>11</sup> လၧခးဖၧၩ့နီၪလီၫ.- တၭဆၧမၩအၥၭ ဘူၭလၧအမိ လ့ၩနုၬလၧအံဇံၭနီၪ, စံၭအမၫနးစၫရ့ၫ, ယိခွါ, ၦယိ နၧၩလမံၩ့ယၥ့ၪယၫ လၧနမွဲၦမုၪ အဎံၫအလၩလီၫ.",
			"12": "<sup>12</sup> ဆၧမိမၩအၥၭ ထီးၦအံဇံၭဖိၪဒၪဘၪနၧၩတၭ, မိစံၭဝ့ၫ, ၦလဂၩယီၩ မွဲအဝ့ၫနီၪ အမၫလီၫ. အဝ့ၫၥံၪ မိမၩၥံၫ",
			"13": "<sup>13</sup> ယၧၩတၭ, အ့ၪမွဲနဝ့ၫဒၪ မိဒုၭမၧၫ့ဒံၭနၧၩလီၫ.- တၭ စံၭလါလၧနမွဲ ယထၧၫ့ဖုဝဲမုၪ ဘဲၫၥိၭဆၧမိမၩဂ့ၩယၧၩ လၧနကၠီၩ့နီၪဆံၭ. တၭယၥၭမိမၧၫ့ဒံၭ လၧနကၠီၩ့လီၫ.",
			"14": "<sup>14</sup> ဆၧမၩအၥၭ ထီးစအၫဘြၫ့ နုၬလၧအံဇံၭအဖၧၩ့ တၭ,ၦအံဇံၭဖိၪ ဒၪဘၪၦမုၪနီၪ လၧအဎံၫလၩဒိၪမၬ",
			"15": "<sup>15</sup> လီၫ.- ဖၫရိၫအၦဒိၪဖၭဒိၪလဖၪ ဒၪဘၪဝ့ၫနီၪ စံၭထၪ့ အၪ့အူၭဝ့ၫ လၧဖၫရိၫအမ့ၬယၫတၭ, ဆၧမၩန့ၥိၫ့ထၪ့",
			"16": "<sup>16</sup> ဝ့ၫလၧဖၫရိၫအဂံၪ့ဖၧၩ့လီၫ.- အဝ့ၫဒၪမၩဂ့ၩ စအၫ ဘြၫ့လၧအကၠီၩ့တၭ, အဝ့ၫနီၪအီၪလၧၥိၪဒဲချီ, ဒဲကၥ့ၪ ယီၩ့အဖၫ, ဒဲဎီးခွၫ, ဒဲဎီးမုၪ, ဒဲကၥ့ၪယီၩ့အမိဒဲကလအူၭ",
			"17": "<sup>17</sup> ၥံၪလီၫ.- တၭယဟိဝၩစ့ၩရၫ့ ဖၫရိၫဒဲအဂံၪ့ဖိၪလၧဆၧ ဆၫဖၭဒိၪလဖၪ လၧစအၫဘြၫ့အမၫ နးစၫရ့ၫအကၠီၩ့",
			"18": "<sup>18</sup> လီၫ.- ဖၫရိၫကိၭန့စအၫဘြၫ့တၭ, စံၭဝ့ၫဒၪ, နမၩယၧၩ လၧဆၧနီၪလမံၩ့လဲၪ. အဝ့ၫလဂၩယီၩမွဲနမၫနီၪ, နလ",
			"19": "<sup>19</sup> လီၩဘၪယၧၩမွဲဘၪလဲၪ.- အယီၩမွဲယထၧၫ့ဖုဝဲမုၪနီၪ, နစံၭမွဲဘၪလဲၪ. တၭယမိမၩန့ကၪယူၭ လၧယမၫလီၫ. တၭဘိၩ့နဲၪ့ယီၩ, ယိခွါ, မၩန့နမၫတၭ, စဲၪ့ထၪ့ခွံၬဘီၪ.",
			"20": "<sup>20</sup> ဖၫရိၫမၪလူၬ အခ့ၫအၡၩ လၧအဂဲးအကၠီၪ့တၭ, အဝ့ၫၥံၪၥိၫ့ထၪ့ခွံၬ အဝ့ၫဒၪဒဲအမၫ, ဒဲကယဲဆၧလၧအ အီၪလၧအစူၪဖၧၩ့ ထီးအလူၬလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> စအၫဘြၫ့စဲၪ့ထၪ့ခွံၬလၧအံဇံၭ, အဝ့ၫဒၪ, ဒဲအမၫ, ဒဲကယဲအဆၧအီၪထီးအလူၬ, ဒဲစလီၭ အီၪလၧအၥိၭ",
			"2": "<sup>2</sup> တၭ, လ့ၩစိၩဝ့ၫလၧမုခံၫ့လခီၫလီၫ.- တၭစအၫဘြၫ့ လၧၫ့ဎွ့ၩဝ့ၫ လၧဆၧဖိၪဆၧဎါ, ကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪ",
			"3": "<sup>3</sup> လွ့ၫၥံၪအၪမၬလီၫ.- တၭလ့ၩဝ့ၫထူထူ လၧမုခံၫ့လခီၫ, ထီၩ့လၧဒိၩ့ဘ့ၫၥလၭ ထီးအလး လၧအတဲၩအီၪလၧ အခၪ့ထံၭလၧဒိၩ့ဘ့ၫၥလၭ ဒဲဒိၩ့ဟၫအဲၫအဘိၩ့ဆၧၩ့,",
			"4": "<sup>4</sup> ထီၩ့လၧဆၧလုအလးအီၪ လၧအမၩဝ့ၫလၧအခၪ့ထံၭ လီၫ. တၭစအၫဘြၫ့ ကိၭထၪ့ယဟိဝၩအမံၩ့ ထီးနီၪ လီၫ.",
			"5": "<sup>5</sup> တၭစလီၭလၧအလ့ၩဆၧ လၧစအၫဘြၫ့အၥိၭအီၪ ဆ့လၧၥိၪအဒီၪ့လဖၪ, ဒဲချီအဒီၪ့လဖၪ, ဒဲတဲၩလဖၪနီၪ",
			"6": "<sup>6</sup> လီၫ.- ဘဲၫၥိၭအဝ့ၫၥံၪမိအီၪစီၪ့ဎးတၭ, ခးလဘံၪ့နီၪ ထီဝါအ့ၬ. အဂဲးဘဲၫယီၩ အဆၧဖိၪဆၧလံၩ အီၪအၪ",
			"7": "<sup>7</sup> မၬတၭ, အီၪဝ့ၫလစီၪ့ဎးၥ့ၪဝါအ့ၬ.- တၭၦလၧအယိ စအၫဘြၫ့အဆၧဖိၪဆၧဎါအဒီၪ့လဖၪ, ဒဲၦလၧအယိ စလီၭ အဆၧဖိၪဆၧဎါ အဒီၪ့လဖၪနီၪ, အဲၪ့လိၬဆိၭ ချဲၩ့လိၬအၥၭလီၫ. တၭအထီထီးနီၪ ၦကၫနအၫ့ဖိၪ",
			"8": "<sup>8</sup> ဒဲၦပံရ့ၭဖိၪ အီၪဝ့ၫလၧခးဖၧၩ့နီၪလီၫ.- တၭစအၫဘြၫ့ စံၭစလီၭ မွဲဆၧအဲၪ့လိၬဆိၭချဲၩ့ထီးအီၪ လၧယၧၩဒဲနၧၩ, ဒဲၦၡၩယိယဆၧဖိၪဆၧဎါ, ဒဲၦၡၩယိနဆၧဖိၪဆၧဎါ လဖၪနီၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ပဝ့ၫဒၪယီၩပမွဲထၧၫ့ဖုဝဲ",
			"9": "<sup>9</sup> လီၫ.- ခးလဘံၪ့ယီၩ အီၪလၧနမ့ၬယၫထၧၫ့ဘံၪ့ယၫ, မွဲအ့ၬဧၪ. မၩလၩ့မုလၩ့ဖၭလါနၥၭ လၧယၧၩဆံၭ, အ့ၪ မွဲလၧနစူၪစ့ၪလခီၫတၭ, ယမိလ့ၩယဝ့ၫလၧစူၪထွ့ၪလခီၫ လီၫ. အ့ၪမွဲလၧစူၪထွ့ၪလခီၫတၭ, ယမိလ့ၩယဝ့ၫလၧ စူၪစ့ၪလခီၫလီၫ.",
			"10": "<sup>10</sup> စလီၭကျဲၪ့ထၪ့အမ့ၬတၭ, ဒၪဘၪယီၫဒၫ့အဆၧပျၩ့ ဖၧၩ့ထၧၫ့ဘံၪ့ယၫ လၧအဘၪစီၪထၧၫ့ဘံၪ့ယၫ (ယဟိ ဝၩမၩဂၭဂီၩ့စီဒၧၫ့ဒဲဂမီရၫဒံၭအ့ၬ,) တၭဘဲၫယဟိဝၩ အကျိၭအၥိၭ, ဘဲၫခးအံဇံၭထီးနလ့ၩနုၬ လၧဇိအၫအ",
			"11": "<sup>11</sup> ဖၧၩ့အလးနီၪလီၫ.- တၭစလီၭရွံန့ယီၫဒၫ့ အဆၧပျၩ့ ဖၧၩ့ထၧၫ့ဘံၪ့ယၫ လၧအနၫ့ဆါအဂးလီၫ. စလီၭစဲၪ့ ထၪ့လ့ၩဝ့ၫစိၩမုထၪ့လခီၫတၭ, အဝ့ၫၥံၪလၩ့မုလၩ့ဖၭ လိၬအၥၭလီၫ.",
			"12": "<sup>12</sup> စအၫဘြၫ့အီၪဝ့ၫ လၧခးကၫနအၫ့အဖၧၩ့တၭ,စလီၭ အီၪဝ့ၫလၧဆၧပျၩ့အဒိၩ့ၥံၪ အဖၧၩ့တၭ, ၥုၪ့အတဲၩဖိး",
			"13": "<sup>13</sup> လၧစီဒၧၫ့လခီၫလီၫ.- တၭစီဒၧၫ့အၦၡၩလဖၪနီၪ မွဲၦအ အၧၩ့ ဒဲၦဆၧဒဲၩဘၭဖိၪ လၧယဟိဝၩအမ့ၬယၫဒိၪမၬ လီၫ.",
			"14": "<sup>14</sup> လၧစလီၭ လၩ့မုလၩ့ဖၭ လၧအဝ့ၫဒၪ အလးခဲၫ့နီၪ ယဟိဝၩ စံၭစအၫဘြၫ့, ကျဲၪ့ထၪ့နမ့ၬတၭ, ထီးနအီၪ အလးနီၪယိထၪ့လၧမုဖၩ, ဒဲမုခံၫ့, ဒဲမုထၪ့, ဒဲလၧမုနုၬ",
			"15": "<sup>15</sup> နီၪဆံၭ.- အဂဲးဘဲၫယီၩ ခးလၧနဒၪဘၪနီၪ ယမိဖ့ၪလၫ့ နၧၩထၧၫ့ဘံၪ့ယၫ, ဒဲလၧနချံၫနၥၪ အဆိၩဆိၩအကၠၪ",
			"16": "<sup>16</sup> ကၠၪလီၫ.- ယမိဒုၭအီၪနချံၫနၥၪ ဘဲၫဂၪ့ခိၪမုၬ အၥိၭ တၭ,ၦဝံထၪ့နၬထၪ့ ဂၪ့ခိၪမုၬနီၪအ့ၪၥ့ၪတၭ, မိဝံထၪ့",
			"17": "<sup>17</sup> နၬထၪ့နချံၫနၥၪဆ့လီၫ.- ဂဲထုၪ့ဘီၪ, လ့ၩထၪ့လၧခး ဖၧၩ့ခၫ့ဂၬ လၧအဖၭထီၫလခီၫ, လၧအဒၪ့ဎၩ့လခီၫနီၪ ဆံၭ. အဂဲးဘဲၫယီၩ ယမိဖ့ၪလၫ့လၧနၧၩလီၫ.",
			"18": "<sup>18</sup> စအၫဘြၫ့ ၥုၭအတဲၩတၭ, လ့ၩအီၪဝ့ၫထီၩ့မၫမရံၫ အၥံၪ့ထိၭဖၫ လၧအအီၪလၧဒိၩ့ဟံဘြၧၫ့တၭ, မၩထၪ့ ဆၧလုအလး လၧယဟိဝၩအဂး ထီးနီၪလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭ လၧၡဲနၫအစဎွၩအၫမရ့ၫဖ့လၭ အမု နံၩလဖၪနီၪ, အ့လစၫအစဎွၩအၫရအီၭ, အံလၫ့အစ ဎွၩခ့ဒၧၫလအိမၧၫ ဒဲၦဆၨၩလဖၪ အစဎွၩ တဲဒလၭ",
			"2": "<sup>2</sup> ၥံၪ,- ဒုၭလိၬအၥၭ လၧစီဒၧၫ့အစဎွၩဘံရၫ, ဒဲဂမီရၫအ စဎွၩဘၧၡၫ, ဒဲအၫဒမၫအစဎွၩၡဲနၫ, ဒဲဇဘိအံၫ့အစဎွၩ ၡမံဘၧၫ, ဒဲဘံလၫ (အဝ့ၫဒၪမွဲဇိအၫ) အစဎွၩလီၫ.",
			"3": "<sup>3</sup> ၦလဖၪနီၪ မွဲအထၧၫ့ထံၩထၧၫ့ၥိၭလိၬအၥၭ ထီးအလူၬ လၧစံဒံၫ့အဆၧဒၩအဖၧၩ့တၭ, အဝ့ၫလစီၪ့နီၪမွဲပၪ့လဲၪ ထံၫလၪလီၫ.",
			"4": "<sup>4</sup> အဝ့ၫၥံၪမၩစခ့ဒၧၫ လအိမၧၫအဆၧ လဆံၫနံၫနံၪ့",
			"5": "<sup>5</sup> တၭ, လဆံၫၥၧၫ့နံၪ့လနံၪ့နီၪ မွဲအပိၩ့ထၪ့ဝ့ၫလီၫ.- တၭ လဆံၫလံနံၪ့လနံၪ့နီၪ စခ့ဒၧၫလအိမၧၫဂဲၫဝ့ၫ ဒဲစဎွၩၥံၪ လၧအအီၪလၧအၥိၭတၭ, ကျီၪ့ခွံၬၦရ့ၭဖၫဖိၪၥံၪအီၪ လၧအၭၡတ့ၫရီၭကၫနအံၫ့ ဒဲၦဇုဇံၫ့ဖိၪအီၪ လၧဟၫ့",
			"6": "<sup>6</sup> အဖၧၩ့, ဒဲၦအံမံၫ့ဖိၪအီၪလၧၡၫဝ့ၫကံရၥ့အံၫ့,- ဒဲၦဟီ ဖိၪအီၪလၧအခိၪလီၩ့စံအၫ ထီၩ့လၧအ့ၫလပၫရၫ့လၧ",
			"7": "<sup>7</sup> အအီၪလၧမံၩ့လၬကျၩအနဲၩ့ထံၭနီၪလီၫ.- အဝ့ၫၥံၪဂဲၫ ထဲၩ့ထဲၩ့ဝ့ၫတၭ, လ့ၩဝ့ၫလၧအံၫ့မံၡပၭတၭ, အဝ့ၫလ စီၪ့နီၪမွဲကၫဒ့ၭလီၫ. တၭကျီၪ့ခွံၬ ၦအၫမလ့ၭ အခး ထၧၫ့ဘံၪ့ယၫ, ဒဲၦအၫမီၫဖိၪဆ့လၧအအီၪ လၧဟၫဇ ဇၫ့တၫမၫအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> စီဒၧၫ့အစဎွၩ,ဒဲဂမီရၫ အစဎွၩ,ဒဲအၫဒမၫအစဎွၩ, ဒဲဇဘိအံၫ့အစဎွၩ, ဒဲဘံလၫ(အဝ့ၫဒၪမွဲဇိအၫ)အစဎွၩ ၥံၪလ့ၩထၪ့တၭ, ဒုၭဆၧလၧအဝ့ၫၥံၪ လၧစံဒံၫ့အဆၧ",
			"9": "<sup>9</sup> ပျၩ့ဖၧၩ့နီၪလီၫ.- ဒုၭဆၧလၧအံလၫ့အစဎွၩ ခ့ဒၧၫလအိ မၧၫ, ဒဲၦဆၨၩလဖၪအစဎွၩတဲဒလၭ, ဒဲၡဲနၫအစဎွၩ အၫမရ့ၫဖ့လၭ, ဒဲအ့လစၫ အစဎွၩ အၫရအီၭတၭ,",
			"10": "<sup>10</sup> စဎွၩလံဂၩဒုၭယဲဂၩလီၫ.- စံဒံၫ့အဆၧဒၩဖၧၩ့ဎွ့ၩလၧ ကျဲၩ့တံၭခိလီၪ့အဖၧၩ့တၭ, စီဒၧၫ့ဒဲဂမီရၫအစဎွၩလ ဖၪစဲၪ့ဝ့ၫတၭ, လၩ့ထံၩဖါဝ့ၫထီးနီၪတၭ, ၦလၧအအီၪ",
			"11": "<sup>11</sup> လၩ့ထးလဖၪနီၪ စဲၪ့ဖျိၭဝ့ၫလၧခိၪလီၩ့လီၫ.- အဝ့ၫၥံၪ မၩန့စီဒၧၫ့ ဒဲဂမီရၫအဆၧဖိၪဆၧလံၩ ထီးအလူၬဒဲအ",
			"12": "<sup>12</sup> ဆၧအၪ့ဆၧအီၩထီးအလူၬတၭ, လ့ၩဆၧလီၫ.- အဝ့ၫ ၥံၪမၩန့စအၫဘြၫ့အမၧၩ့စလီၭ, ဒဲအဆၧဖိၪဆၧလံၩ တၭလ့ၩဆၧလီၫ. တၭအဝ့ၫဒၪနီၪ အီၪဝ့ၫလၧစီဒၧၫ့",
			"13": "<sup>13</sup> အဖၧၩ့လီၫ.- တၭၦလၧအဂၭဖျ့ၭလဂၩ ဂဲၫလီၩဘၪ ၦဟံဘြူၫဖိၪ စအၫဘြၫ့လီၫ. တၭအဝ့ၫဒၪနီၪ အီၪဝ့ၫ ထီးမၫမရံၫအၥံၪ့ထိၭဖၫလီၫ. စမၫမရံၫနီၪ မွဲၦအၫမီၫ ဖိၪထၧၫ့ဖုဝဲ လၧစအ့ၡကီၫလၭ, ဒဲထၧၫ့ဖုဝဲလၧစအၫ နၧၫလီၫ. အဝ့ၫၥံၪမွဲၦအုၩ့လၩ့လိၬအၥၭ လၧစအၫဘြၫ့",
			"14": "<sup>14</sup> လီၫ.- တၭထီးစအၫဘြၫ့နါဂၧၫ့ဘၪ လၧဆၧဖီၪ့န့အ ထၧၫ့ဖုဝဲတၭ, ကိၭထၪ့, တဲၩ့ဝဲၩၦလၧအၥီၪ့လိၪဝ့ၫလၧ အအီၪဖျဲၪလၧအဂံၪ့ဖၧၩ့, ၦၥၧၫ့ယၩလဆံၫဎိၭဂၩတၭ,",
			"15": "<sup>15</sup> လီၩ့ဆီးအဝ့ၫၥံၪဖိးလၧဒၫ့နီၪလီၫ.- အဝ့ၫဒၪဒဲအခ့ၫအ ၡၩအၪ့နၩ့ဖၭလိၬအၥၭ ဒုၭအဝ့ၫၥံၪလၧမုနၩတၭ, ကျီၪ့ ခွံၬဝ့ၫတၭ, လီၩ့ဆီးဝ့ၫဖိးလၧဟိဘၫ လၧအအီၪလၧ",
			"16": "<sup>16</sup> ဒိၩ့ဒမၭစကၧၭအစူၪစ့ၪလခီၫ.- တၭဂဲၫထဲၩ့ဆိၬထဲၩ့ ဆၧဖိၪဆၧလံၩ ထီးအလူၬ ဒဲဂဲၫထဲၩ့ဆိၬအထၧၫ့ဖုဝဲ စလီၭလဂၩဆ့, ဒဲအဆၧဖိၪဆၧလံၩ, ဒဲၦမုၪၦမၧၩ့ဆ့, ဒဲၦခမျၧးလီၫ.",
			"17": "<sup>17</sup> တၭလၧစအၫဘြၫ့ဂဲၫထဲၩ့ထဲၩ့ လၧအကျီၪ့ခွံၬစခ့ ဒၧၫလအိမၧၫ, ဒဲစဎွၩၥံၪလၧအအီၪ လၧအၥိၭအလးခဲၫ့ နီၪ, စီဒၧၫ့အစဎွၩ လ့ၩအၪ့ဂၬဝ့ၫ လၧၡၫဝ့ၫအဆၧဒၩ",
			"18": "<sup>18</sup> ဖၧၩ့လီၫ. အလစီၪ့နီၪမွဲစဎွၩ အဆၧဒၩဖၧၩ့လီၫ.- တၭ စ့လံၫ့အစဎွၩမ့ၫလခံစဒ့ၭ ဂဲၫဆိၬထၪ့န့ကိၪဒဲစဘံၭထံၫ လီၫ. အဝ့ၫဒၪနီၪမွဲဆၧထၪ့ထီၫထုၬ ယွၩအၡၩလုဆၧ",
			"19": "<sup>19</sup> လီၫ.- အဝ့ၫဒၪနီၪ ဆိၪဂ့ၩဝ့ၫတၭ, စံၭဝ့ၫဒၪ, စအၫဘြၫ့ ဘၪဆဲၫ့ လၧဆၧထီၫထုၬ ယွၩလၧအမွဲဂၪ့ခိၪ ဒဲမူၭခိၪ",
			"20": "<sup>20</sup> အကဆါနီၪ, မွဲအဘၪဆိၪဂ့ၩဝ့ၫဆံၭ.- ဒဲဆၧထီၫထုၬ ယွၩလၧအဖ့ၪလၫ့နဒုၪနဒၩ လၧနစူၪဖၧၩ့နီၪ, မွဲအဘၪ ဆၧဆိၪဂ့ၩဆံၭ. ကယဲဆၧထီးအလူၬနီၪ စအၫဘြၫ့ဖ့ၪ လၫ့အဝ့ၫဒၪဆံၫပိၩ့လပိၩ့လီၫ.",
			"21": "<sup>21</sup> စီဒၧၫ့စဎွၩ စံၭစအၫဘြၫ့, ဖ့ၪလၫ့ယၧၩ လၧၦၡၩ",
			"22": "<sup>22</sup> တၭ,မၩန့ဆၧဖိၪဆၧလံၩ လၧနဂးဒၪနဝ့ၫဆံၭ.- တၭ စအၫဘြၫ့စံၭစီဒၧၫ့အစဎွၩ, ယယူၬထၪ့ယစူၪလၧ ယဟိဝၩဆၧထီၫထုၬယွၩ လၧအမွဲဂၪ့ခိၪ ဒဲမူၭခိၪအ",
			"23": "<sup>23</sup> ကဆါနီၪ,- လၧယလမၩန့ဘၪ ဆၧဘၪဆဲၫ့လၧနၧၩနး မံၩ့တၭ, န့ၫလူၪလဘီၩ့ဒဲခၪ့ဖံၭဖျံၩလဘီၩ့နီၪ, ယမၩန့ အ့ၬ,နမိစံၭဘၪခိၬဘဲၫယီၩ, ယဝ့ၫဒၪယီၩ ယမၩကဲၪ",
			"24": "<sup>24</sup> ဒိၪစအၫဘြၫ့လီၫ.- ယမိမၩန့ကယဲဖိၪၥၪခွၫလဖၪအၪ့ ဆၧ,ဒဲၦလၧအလ့ၩဎုၬဆၧ လၧယၧၩစအၫနၧၫ, စအ့ ၡကီၫလၭ, ဒဲစမၫမရံၫအဂးလီၫ. အဝ့ၫၥံၪနီၪ, မွဲအမၩ န့ဒၪဝ့ၫ လၧအဂးဆံၭ."
		},
		"15": {
			"1": "<sup>1</sup> ဆၧလဖၪယီၩအလးခဲၫ့တၭ, ယဟိဝၩအလူလၩ့ဘၪ စအၫဘြၫ့လၧအဒၪဆၧ လၧယၫလခီၫအဖၧၩ့နီၪ, စံၭ ဝ့ၫဒၪ,စအၫဘြၫ့ဧ့, ထီးၥၭမဲၪဆၧလဂ့ၩ, ယမွဲထၩ့ဖံၭ လဘံၪ့လၧနဂးတၭ, နမိန့ဘၪနဘိၪ့ဒိၪဒိၪလ့ၬလီၫ.",
			"2": "<sup>2</sup> စအၫဘြၫ့စံၭဝ့ၫဒၪ, ကဆါယဟိဝၩဧ့, နမိဖ့ၪလၫ့ယၧၩ ဘဲၫၥ့ၪလဲၪ, အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယီၩ ယမွဲၦထူၬဖိၪ လီၫ. ၦလၧအမိန့ၥၫဆၧလၧယဂံၪ့ဖၧၩ့ မွဲၦဒမၭစကၧၭ",
			"3": "<sup>3</sup> ဖိၪစအံၫလအ့ဇၫလဂၩယီၩလီၫ.- စအၫဘြၫ့စံၭဝ့ၫဒၪ, ယိခွါ, နလဖ့ၪလၫ့ဘၪယၧၩ လၧဆၧအချံၫအၥၪတၭ,",
			"4": "<sup>4</sup> ယိခွါ, ယၡၩဂံၪ့ဖိၪလဂၩ မွဲယၡၩန့ၥၫဆၧလီၫ.-ယိခွါ, ယဟိဝၩ အလူလၩ့ဘၪအဝ့ၫတၭ, စံၭဝ့ၫဒၪ, အဝ့ၫလ ဂၩနီၪမိကဲၪနၡၩန့ၥၫဆၧအ့ၬ, အ့ၪမွဲၦလၧအမိဂဲၫထၪ့",
			"5": "<sup>5</sup> လၧနအီၩ့ဖၧၩ့လဂၩနီၪ, မိကဲၪနၡၩန့ၥၫဆၧလီၫ.- အဝ့ၫ ဒၪၥိၫ့ထၪ့ဝ့ၫလၧခီၫ့တၭ, စံၭအဝ့ၫဒၪ, ယိထၪ့ဆၧလၧ မူၭခိၪနီၪ, နဝံထၪ့နၬထၪ့အ့ၪၥ့ၪတၭ, ဝံထၪ့နၬထၪ့ၡၪ လဖၪနီၪဆံၭ. တၭစံၭအဝ့ၫဒၪ နချံၫနၥၪမိမၩအၥၭဘဲၫ",
			"6": "<sup>6</sup> နီၪၥိၭလီၫ.- အဝ့ၫဒၪနဲၩယဟိဝၩတၭ, ဆၧအီၪက့ၪ",
			"7": "<sup>7</sup> အဆၧနဲၩနီၪ လၧဆၧတီၩဆၧလီၩ့လၧအဂးလီၫ.- တၭ ၦလဂၩနီၪစံၭအဝ့ၫဒၪ, ဆၧလၧယၧၩယီၩ, ယမွဲယဟိ ဝၩလၧအဂဲၫၥိၫ့ထၪ့နၧၩ လၧၦခၫလဒံအၫဖိၪဒိၩ့အၧၫ အဖၧၩ့, ဘဲၫၥိၭယမိဖ့ၪလၫ့နၧၩခးလဘံၪ့ယီၩ, လၧနမိ",
			"8": "<sup>8</sup> န့ၥၫအဂးလီၫ.- တၭအဆၧစံၭဝ့ၫဒၪ, ကဆါယဟိဝၩ",
			"9": "<sup>9</sup> ဧ့,ယမိန့ၥၫခးနီၪ, မွဲယမိၥ့ၪယၫဘဲၫၥ့ၪလဲၪ.- တၭအ ဆၧစံၭအဝ့ၫ ဒၪမၩန့လၧယဂးချီမိၥၧၫ့နံၪ့လဒုၩ, ဒဲဘ့ၪ အမိၥၧၫ့နံၪ့လဒုၩ, ၥိၪဖၫၥၧၫ့နံၪ့လဒုၩ, ဒဲထိၪလွံလ",
			"10": "<sup>10</sup> ဘံၪ့,ဒဲကၪကဲၪလဘံၪ့နီၪဆံၭ.- အဝ့ၫဒၪမၩန့ဆၧလဖၪ နီၪလၧအဂးတၭ, ဖ့ၬဖၭဝ့ၫထီးအကျၩနီၪ, အီၪက့ၪဝ့ၫ လါခီၫလါခီၫဎၩ့လိၬအၥၭ လကဲၩ့ဒဲလကဲၩ့လီၫ. အ့ၪ",
			"11": "<sup>11</sup> မွဲထိၪလဖၪနီၪ, ဖ့ၬဖၭဝ့ၫအ့ၬ,- ထိၪၥံၪလံၪၥံၪဂဲၫလၩ့ လၧဆၧစွၪအလီၩ့တၭ, စအၫဘြၫ့မၩတုၩ့ဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ထီးမုလၩ့နုၬတၭ, ဆၧမံၫမၪလၩ့ဘၪလၧစအၫဘြၫ့ အလီၩ့တၭ, ယိခွါ, ဆၧခံၭတၪ့လၩ့ဘၪ လၧအလီၩ့တၭ,",
			"13": "<sup>13</sup> ဝၭထိၬဝၭတ့ၭဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪစံၭစအၫဘြၫ့, ၥ့ၪ ယၫနဝ့ၫလၩ့ထံးလၩ့ဆ့ၭ လၧနချံၫနၥၪမိကဲၪထၪ့ ၦမွံၩ လၧခးလဘံၪ့အဖၧၩ့ လၧအလမွဲဘၪအဆၧဒၪဝ့ၫတၭ, မိဘၪမၩခးဖိၪနီၪအဆၧ, ဒဲအဝ့ၫၥံၪမိမၩနၭမၩၡၪ့ဝ့ၫ",
			"14": "<sup>14</sup> အနံၪ့လံယၩနီၪလီၫ.- လၧနီၪအမ့ၬယၫၦလဆၨၩလၧ အဝ့ၫၥံၪ မိမၩအဆၧနီၪ, ယမိစ့ၩရၫ့ဝ့ၫလီၫ. လၧခဲၫ့ ထဲၩ့တၭ,အဝ့ၫၥံၪ မိစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧအဆၧဖိၪဆၧ",
			"15": "<sup>15</sup> လံၩအၪအၪလ့ၬလီၫ.- တၭနမိထဲၩ့ထဲၩ့ လၧနဖါၥံၪအ အီၪမုၬမုၬလီၫ. ထီးနၥၭၡါဂ့ၩဂ့ၩဘၪဘၪနီၪ, နမိဘၪ",
			"16": "<sup>16</sup> ဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬနၧၩလီၫ.- တၭလၧယၫၦလံဆိၩ လဆိၩနီၪအဝ့ၫၥံၪ မိဂဲၫထဲၩ့ထဲၩ့ဝ့ၫထီးယီၩလီၫ. အဂဲး ဘဲၫယီၩ ၦအၫမီၫဖိၪၥံၪအဆၧအၧၩ့ဆၧၥၫ့ လဎွ့ၩထၪ့",
			"17": "<sup>17</sup> ဒံၭဘၪလီၫ.- တၭထီးမုလၩ့နုၬဒဲဆၧခံၭလၩ့နီၪ, ယိခွါ, ဖံၫ့ချၪအီၪလၧမ့ၪခူၪ, ဒဲမ့ၪလၪခဲၩထၪ့လၧအလ့ၩလၧ ဆၧလၧအဖ့ၬဖၭဝ့ၫနီၪ လါခီၫလါခီၫအဘိၩ့ဆၧၩ့လီၫ.",
			"18": "<sup>18</sup> ဆၧလၧမုနံၩလနံၩနီၪ, ယဟိဝၩအုၩ့လၩ့ဆၧ လၧ စအၫဘြၫ့တၭ, စံၭဝ့ၫဒၪယဖ့ၪလၫ့ယူၭနချံၫနၥၪလၧခး လဘံၪ့ယီၩလၧအံဇံၭအထံၫချိၬ ဖိးလၧထံၫမိၡါဖၭဒိၪ,",
			"19": "<sup>19</sup> ထံၫယုၫဖ့တံၫ,- ၦကံၫ့နဲၭဖိၪၥံၪ, ဒဲၦကံၫ့နစဲၭဖိၪ, ဒဲၦ",
			"20": "<sup>20</sup> ကၭဒမၧၫ့ဖိၪၥံၪ,- ဒဲၦဟံၥၭဖိၪၥံၪ, ဒဲၦပံရ့ၭဖိၪၥံၪ, ဒဲၦ ရ့ၭဖၫဖိၪၥံၪ, ဒဲၦအၫမီၫဖိၪၥံၪ, ဒဲၦကၫနအၫ့ဖိၪၥံၪ, ဒဲၦ ဂၧဂၫဖိၪၥံၪ, ဒဲၦယံဘူၫဖိၪၥံၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> စအၫဘြၫ့အမၫနးစၫရ့ၫ လအီၪဖျဲၪဘၪအဖိၪလၧအ ဂးနီၪ, အဝ့ၫအီၪ လၧအဎီးမုၪလဂၩ ၦအံဇံၭဖိၪတၭ,",
			"2": "<sup>2</sup> အမံၩ့မွဲနးဟၫဂၫလီၫ.- တၭနးစၫရ့ၫစံၭ စအၫဘြၫ့, ယိခွါ, ယဟိဝၩပဒၩ့ယၧၩဘဲၫၥိၭ ယထီးအီၪဖျဲၪဆၧ လဂ့ၩလီၫ. လ့ၩနုၬလၧယဎီးမုၪအအီၪနီၪဆံၭ, ဘၪ လဘၪယမိကဲၪထၪ့လၧအဝ့ၫဒၪလီၫ. တၭစအၫဘြၫ့",
			"3": "<sup>3</sup> ခိၭနၪအမၫနးစၫရ့ၫအလူလီၫ.- လၧစအၫဘြၫ့အီၪဝ့ၫ လၧခးကၫနအၫ့အနံၪ့ လဆံၫအလးခဲၫ့နီၪ, စအၫဘြၫ့ အမၫနးစၫရ့ၫမၩန့ အဎီးမုၪၦအံဇံၭဖိၪ နးဟၫဂၫတၭ,",
			"4": "<sup>4</sup> ဖ့ၪလၫ့ဝ့ၫလၧအဝၩ စအၫဘြၫ့လၧအမၫအဂးလီၫ.-အ ဝ့ၫဒၪလ့ၩနုၬ လၧနးဟၫဂၫအအီၪတၭ, အဝ့ၫနီၪဒၧၩ့ ထၪ့ဝ့ၫလီၫ. ထီးအၥ့ၪယၫဝ့ၫ လၧအဒၧၩ့ထၪ့ဝ့ၫတၭ,",
			"5": "<sup>5</sup> အကဆါမုၪလၧအမ့ၬယၫနီၪ, မွဲဆၧနးမံၩ့အ့ၬ.- တၭ နးစၫရ့ၫစံၭစအၫဘြၫ့, ယမၩမၪဆၧယီၩအီၪလၧနလီၩ့ လီၫ. ယဖ့ၪလၫ့ယူၭယဎီးမုၪ လၧနၥၭနၫၡါတၭ, ထီး အၥ့ၪယၫဝ့ၫ လၧအဒၧၩ့ထၪ့တၭ, လၧအမ့ၬယၫနီၪ, ယမွဲလၧၩ့ဆၧနးမံၩ့အ့ၬ. တၭမွဲယဟိဝၩ စ့ၩရၫ့ဆၧ",
			"6": "<sup>6</sup> ဘၪဆဲၫ့လၧယၧၩဒဲနၧၩနီၪဆံၭ.- တၭစအၫဘြၫ့စံၭ နးစၫရ့ၫ,ယိခွါ, နဎီးမူၪအီၪလၧနစူၪဖၧၩ့လီၫ, မၩအ ဝ့ၫဒၪကယဲအဂ့ၩ လၧနမ့ၬၥၪဖၧၩ့ဆံၭ. နးစၫရ့ၫမၩနၭ မၩၡၪ့အဝ့ၫတၭ, အဝ့ၫဒၪ စဲၪ့ထၪ့ခွံၬ လၧအမ့ၬယၫ လီၫ.",
			"7": "<sup>7</sup> တၭယဟိဝၩအၥီၫ့လဂၩ ဒၪဘၪအဝ့ၫလၧထံၫထၪ့ ဖျိၭလဖၧၩ့အနဲၩ့ထံၭ, လၧမံၩ့လၬကျၩထီးထံၫထၪ့ဖျိၭ",
			"8": "<sup>8</sup> အနဲၩ့ထံၭအီၪဝ့ၫ လၧဒိၩ့ၡၧၫအဖၧၩ့ၥၭနီၪလီၫ.- တၭ စံၭဝ့ၫဒၪ, နးစၫရ့ၫအဎီးမုၪနးဟၫဂၫဧ့, မွဲနဂဲၫအထံၭ ခီၫခီၫလဲၪ, မွဲနမိလ့ၩခီၫခီၫလဲၪ, တၭအဝ့ၫစံၭဝ့ၫဒၪ, ယစဲၪ့ထၪ့ခွံၬ လၧယကဆါမုၪ နးစၫရ့ၫအမ့ၬယၫလီၫ.",
			"9": "<sup>9</sup> ယဟိဝၩအၥီၫ့လဂၩစံၭအဝ့ၫဒၪ, ထဲၩ့ထဲၩ့လၧနကဆါ မုၪအအီၪတၭ, ဆၪ့လၩ့နၥၭ လၧအစူၪဖၧၩ့ဆံၭ.",
			"10": "<sup>10</sup> ယဟိဝၩအၥီၫ့စံၭအဝ့ၫ, ယမိမၩအၪထၪ့နချံၫနၥၪအၪ အၪလ့ၬတၭ, လၧအအၪအကၠီၩ့နီၪ, ၦဝံထၪ့နၬထၪ့ၥ့ၪ",
			"11": "<sup>11</sup> အ့ၬ.- တၭယဟိဝၩအၥီၫ့စံၭအဝ့ၫ, ယိခွါ, နဒၧၩ့ထၪ့ ယူၭ, နမိအီၪဖျဲၪန့နဖိၪခွၫတၭ, နမိဘၪဖျိၬအမံၩ့လၧ စအံၡမၫအ့လၭလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩနါဂၧၫ့",
			"12": "<sup>12</sup> ယူၭနဆၧနၭဆၧၡၪ့ယူၭ.- အဝ့ၫနီၪမိကဲၪထၪ့ၦၡၩအ မံၩ့လဂၩတၭ, အစူၪမိထၫ့ဒုၪဒၩ ကယဲၦၡၩလဂၩလါ လါ, ဒဲကယဲၦၡၩလဂၩလါလါအစူၪ မိထၫ့ဒုၪဒၩအဝ့ၫ နီၪတၭ, မိအီၪဝ့ၫလၧအထၧၫ့ဖုဝဲ ထီးအလူၬအမ့ၬယၫ",
			"13": "<sup>13</sup> လီၫ.- တၭယဟိဝၩလၧအချဲၩ့ ဆၧလၧအဝ့ၫနီၪ, ၦမုၪ ကိၭဝ့ၫအမံၩ့, နဝ့ၫဒၪယီၩနမွဲဆၧအီၪဖျီၪ အယွၩလီၫ. အဂဲးဘဲၫယီၩ ၦမုၪစံၭဝ့ၫဒၪ, ယဒၪဆၧဖျီၪနီၪ, မွဲယယိ",
			"14": "<sup>14</sup> ထွ့ၫထီးယီၩဒၪလ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ထံၫဖၧၩ့ လဖၧၩ့နီၪ, ၦကိၭဝ့ၫလၧဘံၫအၧၫလဟဲရီၫအံၫ ဎၦမၧၫ့ ဝ့ၫ, ၦလၧအဒၪဘၪယၧၩလဂၩအထံၫဖၧၩ့ၭ လီၫ. ယိ ခွါ, အီၪဝ့ၫလၧကၫဒ့ၭ, ဒဲဘံရ့ၭအဘိၩ့ဆၧၩ့နီၪလီၫ.",
			"15": "<sup>15</sup> နးဟၫဂၫအီၪဖျဲၪန့ အဖိၪခွၫ လၧစအၫဘြၫ့အဂးလီၫ. တၭစအၫဘြၫ့ကိၭအဖိၪခွၫ လၧနးဟၫဂၫအီၪဖျဲၪန့ဝ့ၫ",
			"16": "<sup>16</sup> အမံၩ့လၧစအံၡမၫအ့လၭလီၫ.- လၧနးဟၫဂၫအီၪဖျဲၪ န့စအံၡမၫအ့လၭ လၧစအၫဘြၫ့အဂးနီၪ စအၫဘြၫ့အ ၥၭၡါအနံၪ့ ဎိၭဆံၫဎူၫနံၪ့လီၫ."
		},
		"17": {
			"1": "<sup>1</sup> လၧစအၫဘြၫ့ အၥၭၡါ ခွံၫဆံၫခွံၫနံၪ့နီၪ, ယဟိဝၩ နဲၪဖျီၪထၪ့အၥၭ လၧစအၫဘြၫ့အမ့ၬယၫတၭ, စံၭအ ဝ့ၫဆၧလၧယၧၩယီၩ, ယမွဲယွၩလၧအၥ့ၪဆၧလူၬတၭ, လ့ၩဆၧလၧယမ့ၬယၫတၭ, လၧၫ့ထၪ့ဎွ့ၩထၪ့ဆံၭ.",
			"2": "<sup>2</sup> ယမိအုၩ့လၩ့ဆၧလၧနၧၩတၭ, ယမိမၩအၪထၪ့နၧၩအၪ",
			"3": "<sup>3</sup> အၪလ့ၬလီၫ.- စအၫဘြၫ့ထွံၩလၩ့ၡီၫ့လၩ့အခိၪတၭ,",
			"4": "<sup>4</sup> ယွၩချဲၩ့ဆၧလၧအဝ့ၫနီၪ စံၭဝ့ၫဒၪ,- ယဝ့ၫဒၪယီၩ, ယိ ခွါ,ယဆၧအုၩ့လၩ့အီၪလၧနၧၩတၭ, နမိကဲၪထၪ့ၦအၪ",
			"5": "<sup>5</sup> ဆၨၩအဖါလီၫ.- တၭဆၧလကိၭလၧၩ့ဘၪနမံၩ့လၧ စအၫဘြၫ့တၭ, နမံၩ့မိမွဲစအၫဘြဟၫ့လီၫ. အဂဲးဘဲၫ",
			"6": "<sup>6</sup> ယီၩ,ယမိအီၪက့ၪနၧၩ လၧၦအၪဆၨၩအဖါလီၫ.- တၭ ယမိဒုၭၥၪထၪ့နၧၩ အၪအၪလ့ၬတၭ, ယမိဒုၭကဲၪထၪ့ နၧၩလၧၦအၪဆၨၩတၭ, စဎွၩလဖၪမိလၩ့ဆၨၩလၧ",
			"7": "<sup>7</sup> နၧၩလီၫ.- တၭယမိဒုၭအီၪဂုးအီၪခၧၫ့ ယဆၧအုၩ့လၩ့ လၧနၧၩ, ဒဲနချံၫနၥၪလၧနလးခဲၫ့ လၧအဆိၩအကၠၪ, လၧယမိကဲၪထၪ့နယွၩ, ဒဲနချံၫနၥၪ လၧနလးခဲၫ့ဆ့",
			"8": "<sup>8</sup> လီၫ.- ယမိဖ့ၪလၫ့နၧၩ ဒဲနချံၫနၥၪလၧနလးခဲၫ့နီၪ လၧ ခးလဘံၪ့, လၧနအီၪမွံၩလၧအဖၧၩ့ယီၩ, ခးကၫနအၫ့ ထၧၫ့ဘံၪ့ယၫ လၧနဆၧန့ဘၪအဆိၩအကၠၪအဂးတၭ, ယမိကဲၪထၪ့အဝ့ၫၥံၪ အယွၩလီၫ.",
			"9": "<sup>9</sup> တၭယွၩစံၭစအၫဘြဟၫ့, နမိဘၪထီးန့ယဆၧအုၩ့ လၩ့နဝ့ၫဒၪ, ဒဲနချံၫနၥၪလၧနလးခဲၫ့နီၪ, လၧအဝ့ၫၥံၪအ",
			"10": "<sup>10</sup> ဆိၩလဖၪအကျၩလီၫ.- တၭယဆၧအုၩ့လၩ့လိၬလၧ ယၧၩ ဒဲနၧၩဒဲနချံၫနၥၪ လၧနလးခဲၫ့နီၪ, လၧနၥံၪဘၪ ထီးန့နီၪ, မွဲအယီၩ, ကယဲၦခွၫလၧနၥံၪအကျၩလဂၩ",
			"11": "<sup>11</sup> လါလါနီၪ, ဘၪဒိၭဆၧကူၭတရံၭလီၫ.- တၭနၥံၪဘၪ ကူၭတရံၭခွံၬနၥံၪအဆၧခိၪဖံၭလီၫ. တၭဆၧနီၪမိကဲၪ",
			"12": "<sup>12</sup> ထၪ့ယဆၧအုၩ့လၩ့ ဒဲနၥံၪအဆၧမၩနဲၪ့လီၫ.- တၭၦဎိၭ နံၩဖိၪလၧနၥံၪအကျၩ ကယဲၦခွၫလၧနၥံၪ အဆိၩလဖၪ အကျၩ, ၦလၧအအီၪဖျဲၪလၧဂံၪ့ဖၧၩ့မွဲဂ့ၩ, ၦလၧနၥံၪ ဎွ့ၩဝ့ၫလၧစ့ၩ ၦလခီၫဘၩ့မုးဖိၪလၧအလမွဲဘၪနၥံၪအ",
			"13": "<sup>13</sup> ချံၫအၥၪမွဲဂ့ၩ, မိဘၪဒိၭဆၧကူၭတရံၭလီၫ.- ၦလၧအ အီၪဖျဲၪလၧနဂံၪ့ဖၧၩ့, ဒဲၦလၧနဎွ့ၩဝ့ၫ လၧစ့ၩနီၪဘၪဒိၭ တၡါဆၧကူၭတရံၭလီၫ. တၭယဆၧအုၩ့လၩ့မိအီၪ လၧနၥံၪအယၪကျၩ လၧဆၧအုၩ့လၩ့အဆိၩအကၠၪအ",
			"14": "<sup>14</sup> ဂးလီၫ.- တၭၦခွၫလၧအလဒိၭဘၪ ဆၧကူၭတရံၭ, လၧ အဆၧခိၪဖံၭလဘၪဘၪ ဆၧကူၭတရံၭနီၪ, အဝ့ၫလဂၩ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧၦအဆၨၩဒၪဝ့ၫလီၫ, မွဲအ လၨၪခၫ့ဖၬယဆၧအုၩ့လၩ့လီၫ.",
			"15": "<sup>15</sup> တၭယွၩစံၭစအၫဘြဟၫ့, နမၫနးစၫရ့ၫယီၩ, နဘၪ ကိၭအမံၩ့လၧနးစၫရ့ၫနီၪမွဲအ့ၬ, အ့ၪမွဲနးစၫရၫမိမွဲအ",
			"16": "<sup>16</sup> မံၩ့လီၫ.- တၭယမိဆိၪဂ့ၩဝ့ၫ ဒဲယမိဖ့ၪလၫ့နဖိၪခွၫလၧ အဝ့ၫဆ့လီၫ. ယမိဆိၪဂ့ၩဝ့ၫတၭ, အဝ့ၫမိကဲၪထၪ့ ၦဆၨၩလဖၪ, ဒဲၦဆၨၩအစဎွၩလဖၪ မိလၩ့ဆၨၩလၧ အဝ့ၫလီၫ.",
			"17": "<sup>17</sup> စအၫဘြဟၫ့ထွံၩလၩ့ၡီၫ့လၩ့အခိၪတၭ, နံထၪ့, စံၭ လၩ့အၥၭ, ၦလၧအၥၭၡါအနံၪ့လယၩလဂၩယီၩ, ဘၪ မိထၪ့ဖိၪဧၪ. တၭၦလၧအၥၭၡါအနံၪ့ခွံၫဆံၫ နးစၫရၫ",
			"18": "<sup>18</sup> လဂၩနီၪမိအီၪဖျဲၪန့ဆၧဆ့ဧၪ.- တၭစအၫဘြဟၫ့စံၭ ယွၩ,မွဲစအံၡမၫအ့လၭ မၧၫ့လါဝ့ၫလၧနမ့ၬယၫဆံၭ.",
			"19": "<sup>19</sup> ယွၩစံၭဝ့ၫဒၪ, နမၫနးစၫရၫ မိအီၪဖျဲၪန့အဖိၪခွၫတၡါ တၭ,နမိဘၪဖျိၬအမံၩ့ လၧစအံစၭလီၫ. တၭယမိဒုၭ အီၪဂုးအီၪခၧၫ့ ယဆၧအုၩ့လၩ့လိၬလၧအဝ့ၫဒၪ, ဒဲအ ချံၫအၥၪ လၧအလးခဲၫ့လဖၪနီၪ လၧဆၧအုၩ့လၩ့အ",
			"20": "<sup>20</sup> ဆိၩအကၠၪအဂးလီၫ.- ဆၧလၧစအံၡမၫအ့လၭအဂး နီၪ, ယနါဂၧၫ့ယူၭနလူယူၭ, ယိခွါ, ယဆိၪဂ့ၩအဝ့ၫ ယူၭ, ယမိဒုၭၥၪထၪ့အဝ့ၫတၭ, ယမိမၩအၪထၪ့အဝ့ၫ အၪအၪလ့ၬတၭ, အဝ့ၫမိထၪ့ဖိၪၦဒိၪလဆံၫနံၫဂၩတၭ, ယမိဒုၭကဲၪထၪ့အဝ့ၫဒၪ လၧၦလဆၨၩ ဖၭဒိၪလီၫ.",
			"21": "<sup>21</sup> အ့ၪမွဲယမိဒုၭအီၪဂုးအီၪခၧၫ့ ယဆၧအုၩ့လၩ့လိၬလၧ စအံစၭလၧနးစၫရၫ မိအီၪဖျဲၪန့နဂး ကဲခိၬလနံၪ့ထီးအ",
			"22": "<sup>22</sup> ထီယီၩဆၧၫ့ထဲၩ့အလးလီၫ.- ထီးအချဲၩ့ဆၧလၧအ ဝ့ၫနီၪဂီၩ့တၭ, ယွၩစဲၪ့ခွံၬ လၧစအၫဘြဟၫ့အအီၪနီၪ လီၫ.",
			"23": "<sup>23</sup> တၭမုလနံၩဎးနီၪ ဘဲၫယွၩမၪလူၬဝ့ၫအၥိၭနီၪ,စအၫ ဘြဟၫ့မၩန့အဖိၪခွၫ စအံၡမၫအ့လၭ, ဒဲကယဲၦအီၪ ဖျဲၪလၧအဂံၪ့ဖၧၩ့နီၪ, ဒဲကယဲၦလၧအဎွ့ၩဝ့ၫလၧစ့ၩ, ဒဲကယဲအခွၫ လၧစအၫဘြဟၫ့အဂံၪ့ဖိၪအကျၩ ကိၭ အဂၩဒ့ၭနီၪ, ကူၭတရံၭအဝ့ၫၥံၪ အဆၧခိၪဖံၭလီၫ.",
			"24": "<sup>24</sup> တၭစအၫဘြဟၫ့ ဒိၭဆၧကူၭတရံၭ အဆၧခိၪဖံၭနီၪ,",
			"25": "<sup>25</sup> အၥၭၡါအနံၪ့ခွံၫဆံၫခွံၫနံၪ့လီၫ.- တၭအဖိၪခွၫစအံ ၡမၫအ့လၭ လၧအဒိၭဆၧကူၭတရံၭ အဆၧခိၪဖံၭနီၪ,",
			"26": "<sup>26</sup> အၥၭၡါဝ့ၫလဆံၫၥၧၫ့နံၪ့လီၫ.- တၭစအၫဘြဟၫ့ဒဲအ ဖိၪခွၫစအံၡမၫအ့လၭ, ဒိၭဆၧကူၭတရံၭလနံၩဎးနီၪ",
			"27": "<sup>27</sup> လီၫ.- တၭကယဲအဂံၪ့ဖိၪ, ၦအီၪဖျဲၪလၧအဂံၪ့ဖၧၩ့, ဒဲၦလၧအဎွ့ၩဝ့ၫလၧစ့ၩ ၦလခီၫဘၩ့မုးဖိၪနီၪ, ဒိၭဆၧ ကူၭတရံၭ လၧအၥိၭထီးအလူၬလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> လၧမုခိလၩ့နီၪ အဝ့ၫဆၧၫ့နၩ့ လၧတဲၩအတရၫ့ထံၭ တၭ, ယဟိဝၩမၩဖျီၪထၪ့အၥၭ လၧအမ့ၬယၫထီးမၫ",
			"2": "<sup>2</sup> မရံၫအၥံၪ့ထိၭဖၫၥံၪလီၫ.- စအၫဘြဟၫ့ကျဲၪ့ထၪ့အမ့ၬ ယိဝ့ၫတၭ, ယိခွါ, ၦၥၧၫ့ဂၩဆၧၫ့ထုၪ့အီၪဎၩ့လၧအမ့ၬ ယၫလီၫ. တၭထီးအဒၪဘၪဝ့ၫနီၪ, စဲၪ့တလဲးခွံၬဝ့ၫလၧ အတရၫ့ ဘဲၫၥိၭအမိအၪ့ဂၬထၪ့ အဝ့ၫၥံၪတၭ, ထွံၩ",
			"3": "<sup>3</sup> လၩ့အၥၭလၧဂၪ့ခိၪချိၫ့,-တၭ, စံၭဝ့ၫဒၪ, ယကဆါဧ့, ယအ့ၪဘၪဆၧအခိးအတၩ လၧနမ့ၬယၫတၭ, လ့ၩဖီၩ့",
			"4": "<sup>4</sup> ခွံၬလါလၧနခ့ၫနၡၩအအီၪလဂ့ၩ.- မွဲၦဂဲၫဆိၬထံၫလ ဆံၭတၭ, ၥူၫဝၭခွံၬနၥံၪအခၪ့, အီၪပွံၭဒၪခလူၬလၧၥံၪ့",
			"5": "<sup>5</sup> အဖၫ့လၬနီၪဘီၪ.- ယမိမၩန့ကိၪလကဲၩ့တၭ, မၩဂုး ထၪ့ထဲၩ့နၥံၪအၥၭဆံၭ, လၧခဲၫ့တၭ နၥံၪမိလ့ၩဒံၭဆၧ လီၫ,အဂဲးဘဲၫယီၩ လၧဆၧလမံၩ့အကၠီၩ့နီၪ, နၥံၪဂဲၫ လၧနၥံၪအဎီးအၡၩအအီၪလီၫ. တၭအဝ့ၫၥံၪစံၭဝ့ၫ ဒၪ,ဘဲၫနီၪအၥိၭ, မၩထီးဒၪနစံၭဆၧအၥိၭနီၪဆံၭ.",
			"6": "<sup>6</sup> တၭစအၫဘြဟၫ့ထဲၩ့ချဲၫ့ချဲၫ့ လၧတဲၩဖၧၩ့လၧနးစၫ ရၫအအီၪတၭ, စံၭဝ့ၫဒၪ, တဲၩ့ဝဲၩန့ကိၪမုၬၥၧၫ့စံအၫ ဎဘဲၫပစံၭဆၧအၥိၭလနၬကၪယူၭၭ ချဲၫ့ချဲၫ့နီၪ, ဘံၭ ဝ့ၫတၭ,မၩကိၪထၧၫ့ဘံၪ့ယၫလဖၪ လၧဖံၫ့ချၪအဖၫ့ခိၪ",
			"7": "<sup>7</sup> နီၪဆံၭ.- စအၫဘြဟၫ့စဲၪ့တလဲး လၧချီလဒီၪ့အအီၪ တၭ,မၩန့ချီဖိၪလၧအယၪဘၪ့ ဒဲလၧအဂ့ၩလဒုၩတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦဖိၪၥၪခွၫ လဂၩတၭ, အဝ့ၫနီၪတဲၩ့ဝဲၩ",
			"8": "<sup>8</sup> ဝ့ၫချဲၫ့ချဲၫ့လီၫ.- အဝ့ၫမၩန့ဆၧနူထံၫလၩ့ဒၭ, ဒဲဆၧနူ ထံၫ,ဒဲချီဖိၪလၧအတဲၩ့ဝဲၩဝ့ၫနီၪ, အီၪက့ၪလၩ့ဝ့ၫလၧ အဝ့ၫၥံၪအမ့ၬယၫတၭ, အနၫ့ဆါဒၪဝ့ၫဆၧၫ့ထုၪ့လၧအ နဲၩ့ထံၭ လၧၥံၪ့အဖၫ့လၬနီၪတၭ, အဝ့ၫၥံၪ အၪ့ဝ့ၫဒၪ လီၫ.",
			"9": "<sup>9</sup> တၭအဝ့ၫၥံၪ စံၭအဝ့ၫဒၪ, နမၫနးစၫရၫနီၪ မွဲအအီၪ ခီၫခီၫလဲၪ. တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယိခွါ, အီၪဝ့ၫလၧ",
			"10": "<sup>10</sup> တဲၩဖၧၩ့နီၪလီၫ.- တၭၦလဂၩနီၪ စံၭဝ့ၫဒၪ, ထီးဆၧ မၧၫ့အဆၧၫ့အထီနီၪ, ယမိဂဲၫထဲၩ့တၡါ လၧနအီၪတၭ, ယိခွါ, နမၫနးစၫရၫမိအီၪ လၧအဖိၪခွၫလီၫ. တၭနးစၫ ရၫအီၪဝ့ၫလၧတဲၩတရၫ့အချိၫ့လခီၫ နါဂၧၫ့ဝ့ၫဒၪလီၫ.",
			"11": "<sup>11</sup> စအၫဘြဟၫ့ ဒဲနးစၫရၫနီၪ, အၥၭၡါဝ့ၫတၭ, အနံၪ့လ ယၩဖီၩ့ခွံၬယူၭ အၪနံၪ့အၪလၩယူၭနီၪ, ဆၧလကဲၪ ထၪ့လၧၩ့ဘၪ လၧနးစၫရၫဘဲၫၦမုၪအထူၫအရူၫအၥိၭ",
			"12": "<sup>12</sup> နီၪလီၫ.- တၭနးစၫရၫနံဝ့ၫ လၧအၥၭခံဖၧၩ့တၭ, စံၭဝ့ၫ ဒၪ,ယၥၭၡါက့ၭယူၭယဝ့ၫအလးခဲၫ့နီၪ, မွဲယမိအီၪလၧ ဆၧမုၬလၩဆ့ဧၪ. ဒဲယကဆါအၥၭၡါယူၭဆ့လီၫ.",
			"13": "<sup>13</sup> တၭယဟိဝၩစံၭစအၫဘြဟၫ့နီၪ, နးစၫရၫနံတၭ, စံၭ ဝ့ၫ,ယၥၭၡါယူၭ, ယမိအီၪဖျဲၪန့ ယဖိၪတၡါဧၪနီၪ,မွဲဘၪ",
			"14": "<sup>14</sup> လဲၪ.- ဆၧလၧယဟိဝၩမၩလၥ့ၪဘၪ, မွဲအအီၪလမံၩ့ မံၩ့ဆ့ဧၪ, ထီးအဆၧၫ့အထီအ့ၪဘၪတၭ, ယမိဂဲၫထဲၩ့ လၧနအီၪထီးဆၧမၧၫ့ အဆၧၫ့အထီ ဆၧၫ့ထဲၩ့အလး",
			"15": "<sup>15</sup> နီၪ,နးစၫရၫမိအီၪလၧအဖိၪခွၫလီၫ.- တၭနးစၫရၫမီၪ့ ဘံၭဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယနံဘၪအ့ၬ, ၥၭမဲၪဆၧအဂဲး လီၫ.တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, မွဲအ့ၬ,နနံဘၪနဝ့ၫမၬကၨ.",
			"16": "<sup>16</sup> ၦလဖၪနီၪ စဲၪ့ထၪ့ထီးနီၪတၭ, ယိဝ့ၫလၧဒိၩ့စီဒၧၫ့ တၭ, စအၫဘြဟၫ့ လ့ၩလၧအဝ့ၫၥံၪအၥိၭ မိၥိၫ့လၧ",
			"17": "<sup>17</sup> ဖၧၩ့ၥၭအဂဲးလီၫ.- တၭယဟိဝၩစံၭဝ့ၫဒၪ, ဆၧလၧ ယမိမၩယီၩ, မွဲယမိအီၪက့ၪၥူၪခွံၬ လၧစအၫဘြဟၫ့ဆ့",
			"18": "<sup>18</sup> ဧၪ.- တၭစအၫဘြဟၫ့မိကဲၪထၪ့ ၦလဆၨၩဖၭဒိၪဒဲအီၪ ဆီၪ့ဝ့ၫတၭ, ကယဲၦၡၩလၧဂၪ့ခိၪချိၫ့မိဘၪဆၧဆိၪဂ့ၩ",
			"19": "<sup>19</sup> လၧအဖၧၩ့ကိၭအဆၨၩဒ့ၭလီၫ.- အဂဲးဘဲၫယီၩယၥ့ၪ ယၫအဝ့ၫဒၪ လၧအမိအၪ့မၧၫ့န့အဖိၪအလံၩ ဒဲအဂံၪ့ဖိၪ လၧအလးခဲၫ့နီၪတၭ, ဒဲအဝ့ၫၥံၪမိဖိၬယဟိဝၩအဖၧၩ့ ၥၭဘဲၫၥိၭ အမိမၩဆၧတီၩဆၧလီၩ့ ဒဲဆၧစ့ၩရၫ့တီၩ, ဘဲၫၥိၭယဟိဝၩ မိဒုၭလၩ့ဘၪ ကယဲဆၧလၧအစံၭဝဲၩ ဝ့ၫလၧစအၫဘြဟၫ့ အလီၩ့နီၪလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲဒိၩ့စီဒၧၫ့ဒဲဂမီရၫအဆၧဂၪ့ကိၭ ဒိၪဝ့ၫအၪဝ့ၫအကၠီၩ့တၭ, ဒဲအဆၧဒဲၩဘၭ ယိၬမၬအ",
			"21": "<sup>21</sup> ကၠီၩ့,- ယမိလ့ၩလၩ့တၭ, အဝ့ၫၥံၪမၩဝ့ၫထီးအလူၬ ဘဲၫအဆၧဂၪ့ကိၭ လၧအဂဲၫထၪ့ လၧယအီၪအၥိၭနီၪ ဧၪ,ယမိယိတၭ, အ့ၪလမွဲဘၪတၭ, ယမိၥ့ၪယၫလီၫ.",
			"22": "<sup>22</sup> ၦလဖၪနီၪ ကၠၪဒိၭချိၫ့အၥၭထီးနီၪတၭ, လ့ၩစိၩစီဒၧၫ့ လီၫ. အ့ၪမွဲစအၫဘြဟၫ့နီၪ ဆၧၫ့ထုၪ့ဒံၭလၧယဟိဝၩ အမ့ၬယၫလီၫ.",
			"23": "<sup>23</sup> စအၫဘြဟၫ့ၥုၭဘူၭအၥၭတၭ, စံၭဝ့ၫဒၪ, မွဲနမိမၩ ဂၭဂီၩ့ဎုၬၦအတီၩအလီၩ့ ဒဲၦလတီၩလလီၩ့ဘၪဆ့ဧၪ.",
			"24": "<sup>24</sup> ဘၪလဘၪၦအတီၩအလီၩ့ ယဲဆံၫမိအီၪဝ့ၫလၧဒိၩ့ဖၧၩ့ လီၫ. မွဲနမိမၩဂၭဂီၩ့ဆ့တၭ, လဖျါဘၪအလးလၧၦအ တီၩအလီၩ့ယဲဆံၫ လၧအအီၪဝ့ၫ လၧအဖၧၩ့အကၠီၩ့",
			"25": "<sup>25</sup> နီၪဧၪ.- မွဲနထီးမၩဘဲၫနီၪလဂ့ၩ, မၩၥံၫဎုၬၦအတီၩအ လီၩ့ ဒဲၦလတီၩလလီၩ့ဘၪတၭ, ၦအတီၩအလီၩ့မိမၩ အၥၭဘဲၫၦလတီၩလလီၩ့ဘၪအၥိၭနီၪ, မွဲဆၧထီးမၩ အၥၭဘဲၫနီၪလၧနၧၩလဂ့ၩ, ၦလၧအစ့ၩရၫ့ဂၪ့ခိၪထၧၫ့",
			"26": "<sup>26</sup> ဖျိၪ့ယၫလဂၩနီၪ, မွဲအမိမၩတီၩအ့ၬဧၪ.- တၭယဟိ ဝၩစံၭဝ့ၫဒၪ, ယအ့ၪဒၪဘၪၦအတီၩအလီၩ့ ယဲဆံၫလၧ ဒိၩ့စီဒၧၫ့အဖၧၩ့နီၪ, ယမိကွဲၪဖျါခွံၬအလး ထၧၫ့ဒိၩ့",
			"27": "<sup>27</sup> ယၫလၧအဝ့ၫၥံၪအကၠီၩ့လီၫ.- စအၫဘြဟၫ့စံၭဆၧၫ့ ဆၧတၭ, စံၭဝ့ၫဒၪ, ယိခွါ, ယအီၪက့ၪယၥၭလၧယမိ ချဲၩ့ဆၧလၧယကဆါယီၩ, ယမွဲဂၪ့ခိၪအမုၬ ဒဲဖံၫ့ချၪ",
			"28": "<sup>28</sup> ယဝ့ၫလီၫ.- ဘၪလဘၪၦအတီၩအလီၩ့ ယဲဆံၫနီၪမိၡၩ လၩ့ယဲဂၩတၭ, မွဲနမိမၩဂၭဂီၩ့ ဒိၩ့ထၧၫ့ဖျိၪ့ယၫလၧ ယဲဂၩအကၠီၩ့ဆ့ဧၪ. အဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယအ့ၪဒၪဘၪ",
			"29": "<sup>29</sup> လံဆံၫယဲဂၩထီးနီၪတၭ, ယမၩဂၭဂီၩ့အ့ၬ.- တၭအ ဝ့ၫနီၪချဲၩ့ဒီၭလဖၧၫ့, စံၭဝ့ၫဒၪ, ဘၪလဘၪဆၧမိဒၪန့ ၦလံဆံၫထီးနီၪလီၫ. တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယလမၩ",
			"30": "<sup>30</sup> ဘၪလၧၦလံဆံၫအကၠီၩ့လီၫ.- တၭအနီၪစံၭဝ့ၫဒၪ, မွဲ ကဆါထီးၥၭထၪ့လဂ့ၩ, ယမိချဲၩ့ဆၧလီၫ. ဘၪလဘၪ ဆၧမိဒၪန့ၦၥၧၫ့ဆံၫ ထီးနီၪလီၫ. အဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယအ့ၪဒၪဘၪ ၦၥၧၫ့ဆံၫထီးနီၪတၭ, ယမိမၩအ့ၬ.",
			"31": "<sup>31</sup> တၭအနီၪစံၭဝ့ၫဒၪ, ယိခွါ, ဘိၩ့နဲၪ့ယီၩ,ယအီၪက့ၪယ ၥၭလၧယမိချဲၩ့ဆၧ လၧယကဆါလီၫ. ဘၪလဘၪဆၧ မိဒၪန့ၦနံၫဆံၫထီးနီၪလီၫ. တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယ",
			"32": "<sup>32</sup> လမၩဂၭဂီၩ့ဘၪ လၧၦနံၫဆံၫအကၠီၩ့နီၪလီၫ.- အနီၪ စံၭဝ့ၫဒၪ, မွဲကဆါထီးၥၭထၪ့ယၧၩလဂ့ၩတၭ, ယမိ ချဲၩ့ဆၧန့ၫအယီၩလဖၧၫ့လီၫ. ဘၪလဘၪ ဆၧမိဒၪန့ ၦဆံၫဂၩထီးနီၪလီၫ. တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, လၧၦ",
			"33": "<sup>33</sup> ဆံၫဂၩအကၠီၩ့နီၪ ယမိမၩဂၭဂီၩ့အ့ၬ.- ထီးယဟိဝၩ ချဲၩ့ဆၧလၧစအၫဘြဟၫ့ဂီၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ. တၭစအၫဘြဟၫ့ထဲၩ့ထဲၩ့ဝ့ၫ လၧအလးလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> တၭမုမ့ၬဂၪလၩ့လခီၫနီၪ အၥီၫ့နံၫဂၩဂဲၫဝ့ၫလၧဒိၩ့ စီဒၧၫ့လီၫ. စလီၭဆၧၫ့နၩ့ဝ့ၫ လၧစီဒၧၫ့ အတရၫ့ဖၧၩ့ တၭ,စလီၭဒၪဘၪဝ့ၫနီၪ, ဂဲထုၪ့ဘဲၫၥိၭအမိအၪ့ဂၬအ ဝ့ၫၥံၪအဂဲးတၭ, ထွံၩလၩ့ချႃၬလၩ့အမ့ၬ လၧဂၪ့ခိၪချိၫ့",
			"2": "<sup>2</sup> တၭ,-စံၭဝ့ၫဒၪ, ယိခွါ,ယကဆါၥံၪဧ့, ဂဲၫထဲၩ့နုၬလၧ နၥံၪအဎီးအၡၩအဂံၪ့ဖၧၩ့တၭ, အီၪၥၫ့နၩချီၩ့တၭ, ၥူၫ ဝၭခွံၬနၥံၪအခၪ့ဘီၪး နၥံၪမိဂဲထုၪ့ဂီၩဂီၩတၭ, လ့ၩ ဆၧလၧယၫလီၫ. တၭအဝ့ၫၥံၪစံၭဝ့ၫဒၪ, မွဲအ့ၬ, မွဲပမိ",
			"3": "<sup>3</sup> အီၪလၧဖၧၩ့ၥၭၥၫ့နၩချီၩ့လီၫ.- အဝ့ၫဒၪယၭဝ့ၫဆီၪ့ ဆီၪ့လ့ၬတၭ, အဝ့ၫၥံၪဂဲၫထဲၩ့ဝ့ၫ လၧအအီၪနီၪ, လ့ၩ နုၬလၧအဂံၪ့ဖၧၩ့လီၫ. အဝ့ၫမၩဆၧအၪ့ဆၧအီၩ လၧ အဝ့ၫၥံၪအဂးတၭ, ၥၪမံၫ့ကိၪလၧအလဘၪဘၪလၧမံၪ တၭအဝ့ၫၥံၪအၪ့ဝ့ၫဒၪလီၫ.",
			"4": "<sup>4</sup> မွဲလါနၫ့တၭ, ဘိၩ့အဝ့ၫၥံၪလချႃၭမံၫနၩ့ဒံၭဘၪနီၪ, ၦဒိၩ့ဖိၪ, ၦစီဒၧၫ့ဖိၪလၧအၥၭဘၪ့မွဲဂ့ၩ, အၥၭၡါမွဲဂ့ၩ, ကယဲၦခမျၧး လၧလခီၫလါလါနီၪ, ဂဲၫအီၪဝၬဖီၩ့ဂံၪ့",
			"5": "<sup>5</sup> လဖျိၪ့နီၪလီၫ.- အဝ့ၫၥံၪကိၭထၪ့စလီၭတၭ, စံၭအဝ့ၫ, ၦလၧအဂဲၫ လၧနအီၪလဂၪယီၩ, မွဲအအီၪခီၫခီၫလဲၪ, ဂဲၫဆိၬထၪ့န့အဝ့ၫၥံၪ လၧပအီၪ, ဘဲၫၥိၭပမိၥ့ၪယၫအ",
			"6": "<sup>6</sup> ဝ့ၫၥံၪအၥိၭနီၪဆံၭ.- စလီၭလ့ၩထၪ့လၧဖၧၩ့ၥၭလၧ အဝ့ၫၥံၪအအီၪတၭ, ကၭဘံၭထၬတရၫ့ လၧအလးခဲၫ့",
			"7": "<sup>7</sup> လီၫ.- တၭစံၭဝ့ၫဒၪ, ယထၧၫ့ဖုဝဲၥံၪဧ့, မွဲနၥံၪထီးမၩ",
			"8": "<sup>8</sup> ဆၧအၧၩ့ဆၧၥၫ့လဂ့ၩ,- ယိခွါ, ယအီၪလၧယဖိၪမုၪ နံၫဂၩလၧအလၥ့ၪယၫဘၪၦခွၫတၭ, ဖ့ၪလၫ့ယဂဲၫဆိၬ အဝ့ၫၥံၪလၧနၥံၪအအီၪတၭ, မၩထီးဒၪအဂ့ၩ လၧနၥံၪ အမ့ၬၥၪဖၧၩ့ဆံၭ. အ့ၪမွဲၦလဖၪယီၩ, မွဲနၥံၪထီးမၩ လၧဆၧနးမံၩ့လဂ့ၩ, မွဲအဂဲၫဝ့ၫလၧယဂံၪ့ခိၪအကဒုၩ",
			"9": "<sup>9</sup> ဖၧၩ့လၧဆၧနီၪလမံၩ့အဂဲးလီၫ.- အဝ့ၫၥံၪစံၭဝ့ၫဒၪ, ပျဲၩ ပၧၩတၭ, စံၭဝ့ၫဒၪ, အဝ့ၫလဂၩယီၩ, ဂဲၫအီၪမွံၩတၭ, မိစ့ၩရၫ့တၡါဆၧလီၫ. ဘိၩ့နဲၪ့ယီၩ ပမိမၩနၧၩနၭနဲၪ့ အဝ့ၫၥံၪနီၪဒံၭလီၫ. တၭဆၪ့မၬၦလဂၩနီၪ စလီၭလဂၩ",
			"10": "<sup>10</sup> တၭ, ဘူၭလၧအမိမၩထ့ဖၭတရၫ့လီၫ.- ၦၡၩနီၪယူၬ ထၪ့အစူၪတၭ, ကၠူၭန့စလီၭလၧအအီၪ လၧဂံၪ့ဖၧၩ့",
			"11": "<sup>11</sup> တၭ, ကၭဘံၭထၬတရၫ့နီၪလီၫ.- တၭမၩဘျီၪၦလၧ အအီၪလၧတရၫ့ထံၭအမ့ၬၥၪ, ၦလၧအဆံၭလဖၪ, ဒဲၦ လၧအဒိၪလဖၪဆ့လီၫ. တၭအဝ့ၫၥံၪမၩပွံၭအၥၭဘဲၫ ၥိၭအမိဒၪန့ဘၪတရၫ့နီၪလီၫ.",
			"12": "<sup>12</sup> တၭၦလဖၪနီၪစံၭစလီၭ ထီးယီၩၦဘၪဆဲၫ့လၧနၧၩ မွဲအအီၪဒံၭၦလဖၪလဲၪ. နမၬၥံၪ, ဒဲနဖိၪခွၫၥံၪ, ဒဲနဖိၪ မုၪၥံၪနီၪ, ဒဲကယဲနဆၧအီၪဝ့ၫ လၧဒိၩ့ဖၧၩ့ လမံၩ့လါ",
			"13": "<sup>13</sup> လါနီၪ,ဒုၭစဲၪ့ထၪ့ခွံၬ လၧဆၧအလးယီၩဆံၭ.- အဂဲး ဘဲၫယီၩ ပမိမၩဂၭဂီၩ့ခွံၬ ဆၧအလးထီးယီၩလီၫ. အ ဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအဆၧဂၪ့ကိၭဒိၪ ထၪ့ဘၭလၧယ ဟိဝၩအမ့ၬယၫတၭ, ယဟိဝၩအၪ့မၧၫ့ပဂဲၫမၩဂၭဂီၩ့",
			"14": "<sup>14</sup> ခွံၬဝ့ၫဒၪလီၫ.- စလီၭစဲၪ့ထၪ့ဝ့ၫတၭ, ချဲၩ့ဆၧလၧအမၬ လဖၪလၧအန့မၫအဖိၪမုၪၥံၪတၭ, စံၭဝ့ၫဒၪ, ဂဲထုၪ့စဲၪ့ ထၪ့ခွံၬလၧဆၧအလးယီၩဘီၪး အဂဲးဘဲၫယီၩ, ယဟိ ဝၩမိမၩဂၭဂီၩ့ခွံၬ ဒိၩ့လဖျိၪ့ယီၩလီၫ. တၭလၧအမၬ ၥံၪအမ့ၬယၫနီၪ အဝ့ၫဒၪမၩအၥၭ ဘဲၫၦလၧအချဲၩ့လိၬ ကွ့ၩအၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> ထီးမုဆဲၪ့ထၪ့တၭ, အၥီၫ့ၥံၪအၪ့မၧၫ့စလီၭလ့ၩဆၧ ချဲၫ့ချဲၫ့တၭ, စံၭဝ့ၫဒၪ, ဂဲထုၪ့ဘီၪ, မၩန့နမၫ, ဒဲနဖိၪမုၪ နံၫဂၩလၧအအီၪထီးယီၩ, ဘဲၫၥိၭနထီးဘၪဆၧဂၭဂီၩ့",
			"16": "<sup>16</sup> လၧဒိၩ့ယီၩအဆၧအၧၩ့ဆၧၥၫ့အဖၧၩ့လဂ့ၩ, ဧီၪ.- အ ဝ့ၫဒၪအီၪခိၭဒၪခလူၬတၭး လၧယဟိဝၩအဆၧယၫ့ၥၭ အကၠီၩ့, ၦလဖၪနီၪဖီၪ့ထၬအစူၪ, ဒဲအမၫအစူၪ, ဒဲအဖိၪ မုၪနံၫဂၩအစူၪ, ၥိၫ့ထၪ့ခွံၬဝ့ၫလၧဒိၩ့တၭ, အီၪက့ၪဝ့ၫ",
			"17": "<sup>17</sup> လၧခီၫ့နီၪလီၫ.- ဆၧမၩအၥၭထီးအဝ့ၫၥံၪဒုၭစဲၪ့ထၪ့ ဝ့ၫလၧခီၫ့ဂီၩ့တၭ, အဝ့ၫလဂၩ စံၭဝ့ၫဒၪ, စဲၪ့ဖီၩ့ဖျ့ၭ လၧနၥၭမၧၫ့အဂးဆံၭး ထီးယိထဲၩ့လၧနလးခဲၫ့ဒဲအီၪ လၧဆၧပျၩ့ဖၧၩ့ယီၩလဂ့ၩး စဲၪ့ဖီၩ့ဖျ့ၭခွံၬထီၩ့လၧခိၪ လီၩ့နီၪဆံၭး ဘၪလဘၪနမိထီၩ့ဘၪခိၬ လၧဆၧဂၭဂီၩ့",
			"18": "<sup>18</sup> ဂၭစၪဖီၩၬ- တၭစလီၭစံၭအဝ့ၫၥံၪး ယကဆါဧ့, မွဲဆၧ",
			"19": "<sup>19</sup> ထီးမၩအၥၭဘဲၫနီၪအၥိၭလဂ့ၩ.- ယိခွါ, နဎီးနၡၩန့ ဘၪအခိးအတၩ လၧနမ့ၬယၫဒဲနဒုၭမၧၫ့ဒံၭယၥၭတၭ, နမၩဒိၪထၪ့နခိးနတၩ လၧနမၩယၧၩလီၫ. ယစဲၪ့ဖီၩ့ ဖျ့ၭခွံၬထီၩ့လၧခိၪလီၩ့နီၪၥ့ၪအ့ၬ, ဆၧအၧၩ့ဆၧၥၫ့လ",
			"20": "<sup>20</sup> မံၩ့မံၩ့နီၪ,မိဘၪဘၪခိၬယၧၩတၭ ယမိၥံၫလီၫ.- ယိခွါ, ဒိၩ့လဖျိၪ့အီၪဘူၭ လၧယမိစဲၪ့လၧအအီၪတၭ, မွဲအ ဆံၭလဖျိၪ့လီၫ. ဒုၭစဲၪ့ဖီၩ့ဖျ့ၭခွံၬလါယၧၩလၧနီၪ ဆံၭ. တၭမွဲအဆံၭလဖျိၪ့လမွဲဘၪဧၪ, တၭယၥၭမိမၧၫ့",
			"21": "<sup>21</sup> ဒံၭလီၫ.- အဝ့ၫဒၪစံၭဝ့ၫ, ယိခွါ, ယထိးဆၧၫ့နၧၩလၧ ဆၧလမံၩ့ယီၩအဂဲးအကၠီၪ့ဆ့ယူၭတၭ, ယလမၩဂၭ",
			"22": "<sup>22</sup> ဂီၩ့ဘၪဒိၩ့လဖျိၪ့ လၧနချဲၩ့ဆၧလၧအကၠီၩ့နီၪလီၫ.- စဲၪ့ ဖီၩ့ဖျ့ၭခွံၬချဲၫ့ချဲၫ့ထီၩ့လၧနီၪဆံၭး အဂဲးဘဲၫယီၩနလ ချႃၭလ့ၩထီၩ့ဒံၭဘၪထီးနီၪတၭ, ယမၩၥ့ၪနးမံၩ့အ့ၬး မၩအၥၭဘဲၫနီၪတၭ, ဒိၩ့လဖျိၪ့နီၪ ဘၪဆၧကိၭအမံၩ့",
			"23": "<sup>23</sup> လၧဇိအၫလီၫ.- မုထၪ့လၧဂၪ့ခိၪချိၫ့တၭ, စလီၭလ့ၩနုၬ လၧဒိၩ့ဇိအၫအဖၧၩ့နီၪလီၫ.",
			"24": "<sup>24</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအၪ့မၧၫ့ဆၧဂဲၫဆၧၩ့လၩ့လၧ ကးဒဲမ့ၪတၭ, ဂဲၫလၩ့လၧယဟိဝၩအအီၪ လၧမူၭခိၪ",
			"25": "<sup>25</sup> နီၪ,ဘၪလၧဒိၩ့စီဒၧၫ့, ဒဲဂမီရၫအဖၫ့ခိၪလီၫ.- တၭအ ဝ့ၫမၩဂၭဂီၩ့ခွံၬဒိၩ့လဖၪနီၪ, ဒဲဆၧပျၩ့ထၧၫ့ဘံၪ့ယၫ, ဒဲကယဲၦဒိၩ့ဖိၪလဖၪ, ဒဲဆၧမဲၪထၪ့ လၧဂၪ့ခိၪချိၫ့နီၪ",
			"26": "<sup>26</sup> လီၫ.- အ့ၪမွဲအမၫလဂၩ ယိထဲၩ့အလးခဲၫ့တၭ, ကဲၪထၪ့",
			"27": "<sup>27</sup> ဝ့ၫလၧထံၫလၪအထုၪ့လီၫ.- စအၫဘြဟၫ့ဂဲထုၪ့ထၪ့ ဂီၩဂီၩတၭ, လ့ၩဝ့ၫလၧအလး လၧအအီၪဆၧၫ့ထုၪ့",
			"28": "<sup>28</sup> လၧယဟိဝၩအမ့ၬယၫ,- တၭယိဝ့ၫလၧစီဒၧၫ့ဒဲဂမီရၫ အအီၪဒဲလၧဆၧပျၩ့ဖၧၩ့ အဂၪ့ခိၪထၧၫ့ဘံၪ့ယၫအအီၪ, ဒဲယိထၪ့ဝ့ၫတၭ, ယိခွါ, ဂၪ့ခိၪအမ့ၪခူၪထၪ့ဝ့ၫဘဲၫဖံၫ့ ချၪအမ့ၪခူၪအၥိၭနီၪလီၫ.",
			"29": "<sup>29</sup> ဆၧမၩအၥၭထီးယွၩမၩဂၭဂီၩ့ ဆၧပျၩ့အဒိၩ့လဖၪ နီၪ, ယွၩနၪ့ထၪ့ထဲၩ့စအၫဘြဟၫ့တၭ, ထီးအမၩဂၭ ဂီၩ့ဒိၩ့လၧစလီၭအီၪဝ့ၫ လၧအဖၧၩ့လဖၪနီၪ, အဝ့ၫဒၪ အၪ့မၧၫ့စလီၭစဲၪ့ထၪ့ခွံၬ လၧဆၧဂၭဂီၩ့ အဖၧၩ့လီၫ.",
			"30": "<sup>30</sup> စလီၭစဲၪ့ထၪ့ခွံၬလၧဇိအၫတၭ, အီၪဝ့ၫလၧခိၪလီၩ့ ထိၩ့ချိၬ, ဒဲအဖိၪမုၪနံၫဂၩ အီၪလၧအၥိၭလီၫ အဂဲး ဘဲၫယီၩအီၪဝ့ၫ လၧဇိအၫအဖၧၩ့နီၪ ၥၭမဲၪဝ့ၫဒၪလီၫ. အဆၧအီၪဝ့ၫ လၧအဆၧအိၩဖၧၩ့တၭ အဝ့ၫနီၪဒဲအဖိၪ",
			"31": "<sup>31</sup> မုၪၥံၪနံၫဂၩအီၪ လၧအၥိၭလီၫ.- အဝဲၡါလဂၩစံၭအ ဖု,ပဖါအၥၭၡါယူၭတၭ, ၦလၧအမိဂဲၫနုၬ လၧပအီၪ ဘဲၫၦဂၪ့ခိၪဖိၪအထူၫအရူၫအၥိၭနီၪ အီၪဝ့ၫလၧဂၪ့ခိၪ",
			"32": "<sup>32</sup> ချိၫ့နးဂၩအ့ၬ.- ဂဲၫဘီၪ, အၪ့မၧၫ့ၡီၩ့ပဖါ အီၩစဘံၭထံၫ တၭ, ပမိမံၫဎုၬဝ့ၫ ဘဲၫၥိၭပမိဒုၭမၧၫ့ထၪ့ဆၧ အချံၫအ",
			"33": "<sup>33</sup> ၥၪလၧပဖါနီၪဆံၭ.- ဆၧလၧမုနၩနီၪ အဝ့ၫၥံၪဒုၭအီၩ အဖါလၧစဘံၭထံၫတၭ, အဝဲၡါလဂၩ လ့ၩနုၬမံၫဎုၬ ဝ့ၫလၧအဖါလီၫ. တၭမံၫနၩ့မွဲဂ့ၩ, ဂဲထုၪ့မွဲဂ့ၩ, အဖါ",
			"34": "<sup>34</sup> လၥ့ၪယၫဘၪဝ့ၫလီၫ.- တၭဆၧမၩအၥၭလၧမုဆဲၪ့ထၪ့ လနံၩနီၪ, အဝဲစံၭအဖု, ယိခွါ, လၧမုဂၪလနၩနီၪယမံၫ ဎုၬ လၧယဖါလီၫ. တၭမွဲပအၪ့မၧၫ့ၡီၩ့ အအီၩဒီၭစ ဘံၭထံၫကဲမုနၩယီၩတၭ, လ့ၩနုၬမံၫဎုၬနဝ့ၫ ဘဲၫၥိၭပ",
			"35": "<sup>35</sup> မိဒုၭမၧၫ့ထၪ့ ဆၧအချံၫအၥၪ လၧပဖါနီၪလီၫ.- အဝ့ၫ ၥံၪဒုၭအီၩအဖါလၧစဘံၭထံၫ လၧမုလနၩနီၪတၭ, အဖု လဂၩလ့ၩမံၫဎုၬဝ့ၫ လၧအဝ့ၫဒၪတၭ, မံၫနၩ့မွဲဂ့ၩ, ဂဲ",
			"36": "<sup>36</sup> ထုၪ့မွဲဂ့ၩ, အဖါလၥ့ၪယၫဘၪဝ့ၫလီၫ.- တၭစလီၭအ",
			"37": "<sup>37</sup> ဖိၪမုၪနံၫဂၩနီၪ ဒၧၩ့ထၪ့ဝ့ၫလၧအဖါလီၫ.- အဝဲၡါလဂၩ အီၪဖျဲၪန့အဖိၪခွၫတၭ, ကိၭဝ့ၫအမံၩ့ လၧစမိအၭလီၫ. တၭအဝ့ၫနီၪ မွဲၦမိအၭဖိၪအဖါ ခီးဘိၩ့နဲၪ့ယီၩလီၫ.",
			"38": "<sup>38</sup> တၭအဖုလဂၩအီၪဖျဲၪန့အဖိၪခွၫဆ့တၭ, ကိၭဝ့ၫအမံၩ့ လၧစဘံၪ့အၫမဲၫလီၫ. တၭအဝ့ၫနီၪ မွဲၦအၫမၧၫ့ဖိၪအဖါ ခီးဘိၩ့နဲၪ့ယီၩလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> စအၫဘြဟၫ့စဲၪ့ထၪ့ခွံၬထီးနီၪ ထီၩ့လၧခးအီၪလၧ မုခံၫ့လခီၫတၭ, အီၪဝ့ၫလၧကၫဒ့ၭ ဒဲၡၧၫအဘိၩ့ဆၧၩ့ တၭ,အီၪၦမွံၩ လၧဂံရၫအဖၧၩ့လီၫ.- တၭစအၫဘြဟၫ့ စံၭလၧအမၫနးစၫရၫအဂဲးနီၪ, အဝ့ၫဒၪမွဲယထၧၫ့ဖုဝဲ မုၪလီၫ. တၭဂံရၫအစဎွၩအဘံမလ့ၭ အၪ့မၧၫ့ဝ့ၫတၭ",
			"2": "<sup>2</sup> မၩန့နးစၫရၫလီၫ.- ယွၩဂဲၫလၧစအဘံမလ့ၭအအီၪ လၧဆၧမံၫမးအဖၧၩ့ လၧမုနၩတၭ, စံၭအဝ့ၫ, ယိခွါ,နမွဲ ၦၥံၫလၧၦမုၪ လၧနမၩန့ဝ့ၫအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ",
			"3": "<sup>3</sup> အဝ့ၫဒၪနီၪ မွဲၦလဂၩအမၫလီၫ.- တၭစအဘံမလ့ၭ လ့ၩဘူၭဘၪဝ့ၫဒံၭအ့ၬ. စံၭဝ့ၫဒၪ, ကဆါဧ့, မွဲနမိမၩၥံၫ",
			"4": "<sup>4</sup> ၦအတီၩလဆၨၩဆ့ဧၪ.- အဝ့ၫအနၫ့ဆါဒၪဝ့ၫစံၭ ယၧၩ,အဝ့ၫနီၪ, မွဲယထၧၫ့ဖုဝဲမုၪ, မွဲအ့ၬဧၪ. တၭၦမုၪ ဆ့, အနၫ့ဆါဒၪဝ့ၫနီၪ,စံၭ, အဝ့ၫနီၪ, မွဲယထၧၫ့ဖုဝဲခွၫ လီၫ. ယမၩဆၧယီၩ လၧယၥၭထၧၫ့ဖျိၪ့ယၫ, ဒဲယစူၪ",
			"5": "<sup>5</sup> အဆၧဒဲၩဘၭလအီၪဘၪလီၫ.- တၭယွၩလီၩဘၪအဝ့ၫ ဒၪလၧဆၧမံၫမးအဖၧၩ့နီၪ, ယနၫ့ဆါဒၪယဝ့ၫ ယၥ့ၪ ယၫလၧနမၩဆၧယီၩ လၧနၥၭထၧၫ့ဖျိၪ့ယၫလီၫ. တၭ ဘဲၫၥိၭနထီးမၩမၪဘၪယၧၩလဂ့ၩ, ယနၫ့ဆါဒၪယဝ့ၫ ဒၪလ့ၬ, ယပဒၩ့ထၬနၧၩဆ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ,",
			"6": "<sup>6</sup> ယဖ့ၪလၫ့နထိၭဘၪဝ့ၫအ့ၬ.- အခိးမွဲဘိၩ့နဲၪ့ယီၩ ဖ့ၪ ထဲၩ့ၦလဂၩနီၪအမၫဆံၭ, အဂဲးဘဲၫယီၩ အဝ့ၫနီၪမွဲမီၪ",
			"7": "<sup>7</sup> လဂၩတၭ, မိဘၩဆိၪဖၪန့နဂးတၭ, နမိမၧၫ့လီၫ.-အ့ၪမွဲ နအ့ၪလဖ့ၪထဲၩ့ဘၪတၭ, ၥ့ၪယၫနဝ့ၫ လၧနမိၥံၫတၡါ, နဝ့ၫဒၪ, ဒဲကယဲဆၧဘၪဆဲၫ့ လၧနၧၩ ထီးအလူၬနီၪ ဆံၭ.",
			"8": "<sup>8</sup> စအဘံမလ့ၭနီၪ ဂဲထုၪ့လၧဂီၩလခီၫတၭ, ကိၭန့အ ခ့ၫအၡၩထီးအလူၬတၭ, လီၩလၩ့ဆၧလဖၪနီၪ လၧအ ဝ့ၫၥံၪအနါဖၧၩ့ထီးအလူၬတၭ, ၦလဖၪနီၪ ၥၭမဲၪဝ့ၫဒၪ",
			"9": "<sup>9</sup> ဒိၪမၬလီၫ. စအဘံမလ့ၭ ကိၭန့စအၫဘြဟၫ့တၭ, စံၭ ဝ့ၫ, မွဲနမၩပၧၩလၧဆၧနီၪလမံၩ့လဲၪ, ဘဲၫၥိၭနမိအၪ့ မၧၫ့လၩ့ဆၧဒဲၩဘၭ အဒိၪလမံၩ့ဘၪယၧၩ ဒဲယဘၩ့ယ မုးတၭ, မွဲယမၩမၪနၧၩ လၧဆၧနီၪလမံၩ့လဲၪ, တၭန မၩဘၪယၧၩ လၧဆၧမၩလဖၪ လၧအကြၨၭၦမၩအ့ၬ.",
			"10": "<sup>10</sup> တၭစအဘံမလ့ၭ စံၭစအၫဘြဟၫ့ ဘဲၫနမိမၩဆၧယီၩ",
			"11": "<sup>11</sup> လမံၩ့တၭ, မွဲနဘၪဆၧနီၪလမံၩ့လဲၪ.- စအၫဘြဟၫ့ စံၭဝ့ၫဒၪ, အဂဲးဘဲၫယီၩ, ယစံၭမွဲမၬ ဆၧၥၭမဲၪယွၩလ အီၪဘၪထီးယီၩတၭ, ၦမိမၩၥံၫယၧၩ လၧယမၫအကၠီၩ့",
			"12": "<sup>12</sup> လီၫ.- မွဲလါနၫ့တၭ, မွဲလၧယထၧၫ့ဖုဝဲမုၪဆ့လီၫ. မွဲဝ့ၫ လၧယဖါအဖိၪမုၪဆ့လီၫ. မွဲလါနၫ့တၭ လမွဲဘၪယမိ",
			"13": "<sup>13</sup> အဖိၪမုၪတၭ, ကဲၪထၪ့လၧယမၫလီၫ.- ဆၧမၩအၥၭ ထီးယွၩအၪ့မၧၫ့ ယစဲၪ့ဒၪယဖါအဂံၪ့တၭ, ယစံၭအ ဝ့ၫနီၪ,နခိးနတၩ လၧနမိဘၪမၩယၧၩမွဲအယီၩ, ကယဲ အလးလၧပမိလ့ၩ ထီၩ့လစီၪ့လါလါနီၪ, စံၭလၧယ",
			"14": "<sup>14</sup> ကၠီၩ့,အဝ့ၫဒၪ, မွဲယထၧၫ့ဖုဝဲခွၫဆံၭ.- စအဘံမလ့ၭ မၩန့ၥိၪ, ဒဲချီ, ဒဲဎီးမုၪ,ဒဲဎီးခွၫလဖၪတၭ, ဖ့ၪလၫ့စအၫ",
			"15": "<sup>15</sup> ဘြဟၫ့ ဒဲဖ့ၪလၫ့ထဲၩ့ဝ့ၫလၧအမၫလီၫ.- တၭစအဘံမ လ့ၭစံၭဝ့ၫဒၪ, ယိခွါ, ယခးအီၪလၧနမ့ၬယၫလီၫ. ထီး",
			"16": "<sup>16</sup> အဘၪနၥၭလစီၪ့စီၪ့နီၪ အီၪနဝ့ၫဆံၭ. တၭစံၭနးစၫရၫ လဂၩနီၪ, ယိခွါ, ယဖ့ၪလၫ့ယူၭစ့ၩလထီၫ့လၧနထၧၫ့ဖု ဝဲခွၫယူၭ, ယိခွါ, အနီၪမွဲဆၧမၩဘံၭမ့ၬ လၧနဂးလၧက ယဲၦလၧအအီၪလၧနၥိၭအဂး, ဒဲလၧၦထီးအလူၬအ",
			"17": "<sup>17</sup> ဂးတၭ, ၦမုၪဘၪဆၧၥီၪ့ထဲၩ့ဝ့ၫလီၫ.- စအၫဘြဟၫ့ ဘၩဆိၪဖၪယွၩတၭ, ယွၩမၩဘျၪထဲၩ့ စအဘံမလ့ၭ, ဒဲအမၫ, ဒဲအဎီးမုၪလဖၪတၭ, အဝ့ၫၥံၪအီၪဖျဲၪန့အဖိၪ",
			"18": "<sup>18</sup> လဖၪလီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩမၩဘံၭထၬယူၭ စအဘံမလ့ၭအၡၩဂံၪ့ဖိၪ အဒၧၩ့လးထီးအလူၬ လၧ စအၫဘြဟၫ့အမၫ နးစၫရၫအကၠီၩ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> ယဟိဝၩအီၪၡီၩ့ နးစၫရၫ ဘဲၫအစံၭဝဲၩဝ့ၫအၥိၭ တၭ,ယဟိဝၩမၩနးစၫရၫ ဘဲၫအလီၩဘၪဝဲၩဝ့ၫအၥိၭ",
			"2": "<sup>2</sup> နီၪလီၫ.- အဂဲးဘဲၫယီၩ နးစၫရၫဒၧၩ့ထၪ့တၭ, အီၪဖျဲၪ န့စအၫဘြဟၫ့အဖိၪခွၫ လၧအၥၭၡါဝ့ၫအခံၫ့အခၫထီး အဆၧၫ့အထီ လၧယွၩလီၩဝဲၩဝ့ၫနီၪလီၫ.",
			"3": "<sup>3</sup> တၭအဖိၪခွၫ လၧဆၧအီၪဖျဲၪန့ဝ့ၫ လၧအဂးလၧနး စၫရၫအီၪဖျဲၪန့ဝ့ၫလဂၩနီၪ, စအၫဘြဟၫ့ ဖျိၬဝ့ၫအမံၩ့",
			"4": "<sup>4</sup> လၧစအံစၭလီၫ. အဖိၪခွၫစအံစၭအီၪဎိၭနံၩတၭ, အ ဖါစအၫဘြဟၫ့ကူၭတရံၭဝ့ၫ ဘဲၫယွၩမၪလူၬဝဲၩဝ့ၫအ",
			"5": "<sup>5</sup> ၥိၭနီၪလီၫ.- တၭလၧအဖိၪခွၫစအံစၭ အီၪဖျဲၪဝ့ၫလၧအ",
			"6": "<sup>6</sup> ဂးနီၪစအၫဘြဟၫ့ အၥၭၡါအနံၪ့လယၩယူၭလီၫ.- နး စၫရၫစံၭဝ့ၫဒၪ, ယွၩဒုၭနံထၪ့ယၧၩတၭ, ကယဲၦလၧအ နါဂၧၫ့ဝ့ၫထီးအလူၬလဖၪနီၪ မိနံထၪ့လၧယၥိၭလီၫ.",
			"7": "<sup>7</sup> တၭစံၭဝ့ၫဒၪယ မွဲပလၫလီၩဘၪ စအၫဘြဟၫ့လၧနးစၫ ရၫ မိဒုၭအၪ့နူဖိၪၥၪနီၪလဂၩလဲၪ, အဂဲးဘဲၫယီၩလၧ",
			"8": "<sup>8</sup> အၥၭၡါဝ့ၫနီၪ ယအီၪဖျဲၪန့ဖိၪခွၫ လၧအဂးလီၫ.- ဖိၪ ၥၪနီၪဒိၪထၪ့တၭ, လၩ့ဖၭလၧအမိအနူထံၫလီၫ. တၭ မုလနံၩ လၧစအံစၭလၩ့ဖၭ လၧအမိအနူထံၫနီၪ စအၫ ဘြဟၫ့မၩဆၧအၪ့ဆၧအီၩ ဖၭဒိၪလီၫ.",
			"9": "<sup>9</sup> တၭနးစၫရၫဒၪဘၪ ၦအံဇံၭဖိၪ နးဟၫဂၫ အဖိၪခွၫ လၧအအီၪဖျဲၪန့စအၫဘြဟၫ့အဂးနီၪ နံဒုၪဒွ့ၪဝ့ၫလီၫ.",
			"10": "<sup>10</sup> တၭအဝ့ၫစံၭစအၫဘြဟၫ့နီၪ, နၫ့ထၪ့ခွံၬဎီးမုၪဒဲအဖိၪ ခွၫဆံၭ. အဂဲးဘဲၫယီၩ ဎီးမုၪအဖိၪခွၫ လန့ၥၫဘၪဆၧ",
			"11": "<sup>11</sup> လၧယဖိၪခွၫစအံစၭနီၪလီၫ.- တၭဆၧလမံၩ့နီၪမွဲဆၧ ကၪမၬလၧစအၫဘြဟၫ့အမ့ၬယၫ လၧအဖိၪခွၫအ",
			"12": "<sup>12</sup> ကၠီၩ့လီၫ.- တၭယွၩစံၭစအၫဘြဟၫ့, မွဲအထီးကဲၪထၪ့ ဆၧကၪလၧနမ့ၬယၫ လၧနဖိၪခွၫအကၠီၩ့, ဒဲလၧနဎီးမုၪ အကၠီၩ့နီၪလဂ့ၩ, ကယဲနးစၫရၫလီၩနၧၩ ထီးအလူၬ နီၪခိၭနၪအလူဆံၭ. အဂဲးဘဲၫယီၩ ဆၧမိကိၭနချံၫနၥၪ",
			"13": "<sup>13</sup> လၧစအံစၭအဖၧၩ့လီၫ.- ဒဲယမိဒုၭကဲၪထၪ့ဎီးမုၪအ ဖိၪခွၫဆ့လၧၦလဆၨၩ, လၧအမွဲနချံၫနၥၪအကၠီၩ့လီၫ.",
			"14": "<sup>14</sup> စအၫဘြဟၫ့ဂဲထုၪ့လၧဂီၩတၭ, မၩန့ကိၪဒဲထံၫလထိၪ့ တၭ, ဖ့ၪလၫ့ဝ့ၫလၧနးဟၫဂၫ အီၪက့ၪထၪ့ဝ့ၫလၧအခိၬ ထံၭတၭအၪ့မၧၫ့အလ့ၩဆၧလီၫ. အဝ့ၫဒၪစဲၪ့ထၪ့တၭ လ့ၩဝံၩ့ဝၩ့ လၧမံၩ့လၬကျၩဘံအၧၫၡံၫဘၫ အဖၧၩ့နီၪ လီၫ.",
			"15": "<sup>15</sup> ထံၫလူၬဝ့ၫ လၧထိၪ့ဖၧၩ့တၭ, အဝ့ၫနီၪ အီၪက့ၪဖိၪ",
			"16": "<sup>16</sup> ၥၪလၧၥံၪ့ဖိၪလထံၭအဖၫ့လၬလီၫ.- တၭလ့ၩဆၧၫ့နၩ့ ဆဲၫဎၩ့လၧအဝ့ၫနီၪ ယဲၩ့ဝ့ၫဖိၭဘိၭ ၦခၭချံၪလဆိၩ လီၫ. အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, မွဲယထီးဒၪဘၪဖိၪၥၪနီၪ ၥံၫဝ့ၫလဂ့ၩ, တၭဆၧၫ့နၩ့ ဆဲၫဎၩ့လၧအဝ့ၫဒၪထုၭ",
			"17": "<sup>17</sup> ထၪ့အလူတၭ အမ့ၬထံၫလၩ့ဝ့ၫဒၪလီၫ.- ယွၩခိၭနၪဖိၪ ၥၪအလူတၭ, ယွၩအၥီၫ့လၧမူၭခိၪ ကိၭလၩ့နးဟၫဂၫ နီၪ,စံၭဝ့ၫ, နးဟၫဂၫဧ့, မွဲနမၩဆၧနီၪလမံၩ့လဲၪ, အၪ့ ယိၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩယွၩခိၭနၪယူၭ ဖိၪၥၪအ",
			"18": "<sup>18</sup> လူထီးအအီၪအလးနီၪယူၭ.- ဂဲထုၪ့ဘိၭဂဲထုၪ့ဖိၪၥၪ နီၪဆိၬထၪ့လၧနစူၪဆံၭ. အဂဲးဘဲၫယီၩ ယမိအီၪက့ၪ",
			"19": "<sup>19</sup> အဝ့ၫလၧၦလဆၨၩဖၭဒိၪလီၫ.- ယွၩဝဲထၪ့ၦမုၪအမ့ၬ ၥၪလဖၪတၭ, အဝ့ၫနီၪဒၪဘၪ ထံၫဖၧၩ့လဖၧၩ့နီၪ, လ့ၩ",
			"20": "<sup>20</sup> မၩဎွ့ၩထံၫထိၪ့တၭ, ဒုၭအီၩဖိၪၥၪနီၪလီၫ.- ယွၩအီၪ လၧဖိၪၥၪအၥိၭတၭ, အဝ့ၫဒိၪထၪ့ဝ့ၫနီၪ, အီၪဝ့ၫလၧ",
			"21": "<sup>21</sup> မံၩ့လၬကျၩတၭ, ကဲၪထၪ့ၦခၭဆၧဖိၪလီၫ.- အီၪဝ့ၫ လၧမံၩ့လၬကျၩပၫရၫ့တၭ, အမိဒုၭန့အမၫလၧခးအံ ဇံၭအဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> ဆၧမၩအၥၭ လၧအဆၧၫ့အထီ ထီးနီၪ, စ အ ဘံ မလ့ၭ, ဒဲအၥုၭမုခမျၧး အခိၪ စဖဲၫကီၫလၭ လီၩဘၪ စအၫဘြဟၫ့တၭ, စံၭဝ့ၫဒၪ, ကယဲနမၩဆၧလမံၩ့လါ",
			"23": "<sup>23</sup> လါနီၪယွၩအီၪလၧနၥိၭလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ဆိၪ လၩ့နၥၭလၧယွၩအမ့ၬယၫ လၧနလအၪ့လီၫန့ဘၪယၧၩ မွဲဂ့ၩ, ယဖိၪခွၫမွဲဂ့ၩ, ယဆၨၩယဆၬမွဲဂ့ၩနီၪဆံၭ. ဘဲၫဆၧအခိးအတၩ လၧယမၩနၧၩအၥိၭနီၪ, နမိဘၪ",
			"24": "<sup>24</sup> မၩယၧၩ, ဒဲခးလၧနအီၪမွံၩ လၧအဖၧၩ့လီၫ.- တၭ",
			"25": "<sup>25</sup> စအၫဘြဟၫ့စံၭဝ့ၫဒၪ, ယမိဆိၪလၩ့ယၥၭလီၫ. တၭ စအၫဘြဟၫ့အၪ့ၥီၪ့စအဘံမလ့ၭ လၧထံၫဖၧၩ့လဖၧၩ့ အဂဲးအကၠီၪ့, လၧစအဘံမလ့ၭ အဎီးအၡၩမၩန့ဆီၪ့",
			"26": "<sup>26</sup> ဝ့ၫအကၠီၩ့လီၫ.- တၭစအဘံမလ့ၭစံၭဝ့ၫဒၪ, ဆၧလမံၩ့ ယီၩမွဲပလၫမၩလဂၩလဲၪနီၪ, ယၥ့ၪယၫအ့ၬ, နလီၩဘၪ ယၧၩအ့ၬ, တၭယလနါဂၧၫ့ဘၪ ထီးမုဆၫလနံၩယီၩ",
			"27": "<sup>27</sup> လီၫ.- စအၫဘြဟၫ့မၩန့ၥိၪဒဲဘ့ၪ, ဒဲချီလဖၪတၭ, ဖ့ၪ လၫ့ဝ့ၫလၧစအဘံမလ့ၭတၭ, အဝ့ၫၥံၪမၩဆၧအုၩ့လၩ့",
			"28": "<sup>28</sup> လိၬအၥၭနံၫဂၩလူၬလီၫ.- တၭစအၫဘြဟၫ့ အီၪက့ၪ",
			"29": "<sup>29</sup> ၥိၪဖိၪအမိနွ့ၫဒုၩလစီၪ့ဒၪလီၫ.- တၭစအဘံမလ့ၭစံၭ စအၫဘြဟၫ့ ဆၧလၧၥိၪဖိၪ အမိနွ့ၫဒုၩလၧနအီၪက့ၪ",
			"30": "<sup>30</sup> လစီၪ့နီၪ မွဲဆၧနီၪလဲၪ.- တၭအဝ့ၫနီၪစံၭ အဂဲးဘဲၫ ယီၩၥိၪဖိၪအမိနွ့ၫဒုၩ နဘၪမၩန့ လၧယစူၪဖၧၩ့ဘဲၫအ မိကဲၪထၪ့ဆၧထိးအၥၭ လၧပဂး လၧယခုၪ့လၩ့ယူၭ",
			"31": "<sup>31</sup> ထံၫဖၧၩ့ယီၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧအလး နီၪ, ၦကိၭဝ့ၫအမံၩ့ လၧဘံအၧၫၡံၫဘၫလီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪဆိၪလၩ့လိၬအၥၭ ထီးနီၪနံၫဂၩလူၬလီၫ.",
			"32": "<sup>32</sup> အဝ့ၫၥံၪမၩဆၧအုၩ့လၩ့လိၬအၥၭ ထီးဘံအၧၫၡံၫဘၫ နီၪလီၫ. စအဘံမလ့ၭ, ဒဲအၥုၭမုခမျၧးအခိၪ စဖဲၫကီၫ လၭနီၪဂဲထုၪ့တၭ ထဲၩ့ထဲၩ့ဝ့ၫ လၧဖလံၡၫဖိၪအခးလီၫ.",
			"33": "<sup>33</sup> စအၫဘြဟၫ့ၥုၪ့ၥံၪ့ၥံၪဝၪၥံၪ လၧဘံအၧၫၡံၫဘၫအ ဖၧၩ့တၭ, ကိၭထၪ့ယဟိဝၩအမံၩ့, ယွၩအဆိၩအကၠၪ",
			"34": "<sup>34</sup> လီၫ.- တၭစအၫဘြဟၫ့အီၪမွံၩ လၧၦဖလံၡၫဖိၪအခး ဖၧၩ့အၪနံၩအၪၥၫ့လီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭ လၧဆၧလဖၪနီၪအလးခဲၫ့တၭ, ယွၩ မၩခွါစအၫဘြဟၫ့တၭ, စံၭဝ့ၫ, စအၫဘြဟၫ့ဧ့ၬ တၭ",
			"2": "<sup>2</sup> အဝ့ၫဒၪစံၭ, ယအီၪထီးယီၩလီၫ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, မၩန့နဖိၪခွၫ, နဖိၪခွၫလဂၩဎးစအံစၭ လၧနအဲၪဝ့ၫနီၪ, လ့ၩလၧခးမိၫရဲအၫတၭ, လုထၪ့အဝ့ၫထီးနီၪလၧဆၧ လုမ့ၪအဂး, လၧခိၪလီၩ့လဖျိၪ့အလီၩ့ လၧခိၪလီၩ့အ ကျၩလၧယမိလီၩဘၪနၧၩ နီၪဆံၭ.",
			"3": "<sup>3</sup> လၧဂီၩလခီၫနီၪ စအၫဘြဟၫ့ဂဲထုၪ့ဂီၩဂီၩတၭ,မၩ ထၪ့အကၥ့ၪယီၩ့တၭ, မၩန့အခ့ၫအၡၩနံၫဂၩ ဒဲအဖိၪ ခွၫစအံစၭတၭ, ဖၭန့ၥံၪ့မုလၧဆၧလုမ့ၪအဂးနီၪ ဂဲထုၪ့",
			"4": "<sup>4</sup> လ့ၩစိၩဝ့ၫလၧအလး လၧယွၩလီၩဘၪဝဲၩဝ့ၫလီၫ. တၭ ၥၧၫ့နံၩလနံၩနီၪ, စအၫဘြဟၫ့ကျဲၪ့ထၪ့အမ့ၬတၭ, ဒၪ",
			"5": "<sup>5</sup> ဘၪအလးနီၪ အီၪယဲၩ့ဝ့ၫဒၪလီၫ.- တၭစအၫဘြဟၫ့ စံၭအခ့ၫအၡၩလဖၪ, နၥံၪဝ့ၫဒဲကၥ့ၪယီၩ့ အီၪထီးယီၩ ဘီၪ, တၭယဝ့ၫဒၪ ဒဲဖိၪၥၪယီၩ, ပမိလ့ၩ လၧယၫနီၪ ဘၩဆၧဂီၩ့တၭ, ပမိဂဲၫထဲၩ့ထဲၩ့ လၧနၥံၪအအီၪလီၫ.",
			"6": "<sup>6</sup> စအၫဘြဟၫ့မၩန့ၥံၪ့မု လၧဆၧလုမ့ၪအဂးတၭ, အီၪ က့ၪထၪ့ဝ့ၫ လၧအဖိၪခွၫစအံစၭအလီၩ့တၭ, မၩန့မ့ၪဒဲ ဒီၩလဘံၪ့ လၧအစူၪဖၧၩ့တၭ, လ့ၩဝ့ၫနံၫဂၩလူၬလစီၪ့",
			"7": "<sup>7</sup> ဎးလီၫ.- စအံစၭစံၭအဖါအၫဘြဟၫ့တၭ, စံၭဝ့ၫဒၪ, ယဖါဧ့, တၭအဝ့ၫဒၪစံၭ, ယဖိၪခွၫဧ့, ယအီၪထီးယီၩ လီၫ. တၭအဝ့ၫနီၪစံၭ, ယိခွါ, မ့ၪဒဲၥံၪ့မုနီၪ, အ့ၪမွဲၥိၪ",
			"8": "<sup>8</sup> ဖိၪလၧဆၧလုမ့ၪအဂးနီၪ, မွဲအအီၪခီၫခီၫလဲၪ.- တၭ စအၫဘြဟၫ့စံၭဝ့ၫဒၪ, ယဖိၪခွၫဧ့, ယွၩမိတဲၩ့ဝဲၩဒၪ ၥိၪဖိၪလၧဆၧလုမ့ၪအဂးလီၫ. တၭအဝ့ၫၥံၪ လ့ၩနံၫ ဂၩလူၬလစီၪ့ဎးလီၫ.",
			"9": "<sup>9</sup> တၭအဝ့ၫၥံၪလ့ၩထီၩ့ လၧအလးလၧယွၩစံၭဝဲၩဝ့ၫ နီၪ, စအၫဘြဟၫ့မၩထၪ့ ဆၧလုအလးနီၪ တဲၩ့ဝဲၩၥံၪ့ မုတၭ, စၧၩ့ထၬအဖိၪခွၫ စအံစၭတၭ, အီၪက့ၪထၪ့ဝ့ၫ",
			"10": "<sup>10</sup> လၧဆၧလုအလး လၧၥံၪ့မုအဖၫ့ခိၪလီၫ.- စအၫဘြဟၫ့ မၩန့ဒီၩလဘံၪ့, ယၩ့ထၪ့အစူၪဘဲၫၥိၭ အမိမၩၥံၫအ",
			"11": "<sup>11</sup> ဖိၪခွၫလီၫ.- ယဟိဝၩအၥီၫ့ ကိၭလၩ့လၧမူၭခိၪတၭ,စံၭ ဝ့ၫဒၪ, စအၫဘြဟၫ့ဧ့ၬ စအၫဘြဟၫ့ဧ့ၬ တၭအဝ့ၫဒၪ",
			"12": "<sup>12</sup> စံၭ,ယအီၪထီးယီၩလီၫ.- တၭအဆၧစံၭဝ့ၫ, ထီးယၩ့ ထၪ့နစူၪ လၧဖိၪၥၪနီၪအလီၩ့လဂ့ၩ, ထီးမၩအဝ့ၫလၧ ဆၧနးမံၩ့လဂ့ၩ, အဂဲးဘဲၫယီၩ ဘိၩ့နဲၪ့ယီၩယၥ့ၪယၫ လၧနၥၭမဲၪယွၩတၭ, ယမၩန့နဖိၪခွၫ, နဖိၪခွၫလဂၩ ဎးနီၪ,နလယၭဘၪလီၫ.",
			"13": "<sup>13</sup> စအၫဘြဟၫ့ကျဲၪ့ထၪ့အမ့ၬ, ယိဆၧတၭ,ယိခွါ,ၥိၪ ဖၫလဒုၩအီၪ လၧအလးခဲၫ့အနိၩ့ ဘၪကွၭလၧဆၧၡိၬ ကျၩလီၫ. တၭစအၫဘြဟၫ့ လ့ၩမၩန့ၥိၪဖၫလဒုၩနီၪလု ထၪ့ဝ့ၫလၧဆၧလုမ့ၪအဂး, လၧအဖိၪခွၫအလးလီၫ.",
			"14": "<sup>14</sup> တၭဆၧအလးနီၪ စအၫဘြဟၫ့ကိၭဝ့ၫအမံၩ့ လၧယဟိ ဝၩယံရၫ, ဘဲၫၦစံၭ ထီးမုဆၫလနံၩယီၩအၥိၭ, လၧ ယဟိဝၩအခိၪလီၩ့ လဖျိၪ့အလီၩ့နီၪ ဆၧမိတဲၩ့ဝဲၩဝ့ၫ ဒၪလီၫ.",
			"15": "<sup>15</sup> တၭယဟိဝၩအၥီၫ့ကိၭလၩ့ စအၫဘြဟၫ့နီၪ လၧ",
			"16": "<sup>16</sup> မူၭခိၪနံၫဘျၩ့လဘျၩ့လီၫ.- စံၭဝ့ၫဒၪ, ယၧၩယဟိဝၩ ယီၩ,ယဆိၪလၩ့ယၥၭတၭ, စံၭမွဲနမၩဆၧယီၩလမံၩ့",
			"17": "<sup>17</sup> တၭ,လဖီၪ့ထၬဘၪနဖိၪခွၫ, နဖိၪခွၫလဂၩဎးနီၪ,- ယမိ ဆိၪဂ့ၩနၧၩဖၭဒိၪတၭ, ယမိမၩအၪထၪ့ နချံၫနၥၪအၪ အၪလ့ၬဘဲၫၡၪၥံၪ လၧမူၭခိၪအၥိၭနီၪ, ဘဲၫမ့ၭအဖျိၪ့ လၧအအီၪဝ့ၫ လၧမၫဆမံၭနဲၩ့အၥိၭနီၪလီၫ. တၭနချံၫ",
			"18": "<sup>18</sup> နၥၪမိန့ဘၪအဒုၪအဒၩ အတရၫ့လီၫ.- မွဲလၧနခိၭနၪယ လူအကၠီၩ့တၭ, ကယဲၦၡၩလၧဂၪ့ခိၪချိၫ့ လဆၨၩလါ လါနီၪ မိဘၪဆၧဆိၪဂ့ၩ လၧနချံၫနၥၪအဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> စအၫဘြဟၫ့ထဲၩ့ထဲၩ့ လၧအခ့ၫအၡၩအအီၪနီၪအ ဝ့ၫၥံၪဂဲထုၪ့တၭ, လ့ၩဝ့ၫလစီၪ့ဎး လၧဘံအၧၫၡံၫဘၫ တၭ,စအၫဘြဟၫ့အီၪဝ့ၫ လၧဘံအၧၫၡံၫဘၫလီၫ.",
			"20": "<sup>20</sup> ဆၧမၩအၥၭလၧဆၧလဖၪနီၪအလးခဲၫ့, ၦစံၭစအၫ ဘြဟၫ့တၭ,စံၭဝ့ၫဒၪ, ယိခွါ, နးမံလကၫအီၪဖျဲၪန့အ",
			"21": "<sup>21</sup> ဖိၪလဖၪလၧနထၧၫ့ဖုဝဲ စနၫဟီၫအဂးနီၪဆ့လီၫ.- စဟၧ ဇၭအဝဲၡါ, ဒဲအဖုစဘၧဇၭ ဒဲစအၫရၫ့အဖါ, စက့ၫ",
			"22": "<sup>22</sup> မၠႃၫအ့လၭ.- ဒဲစခံစ့ၭ, ဒဲစဟၫဇိၫ, ဒဲစပံလဒၭ, ဒဲစယံ",
			"23": "<sup>23</sup> ဒလၭ, ဒဲစဘၥူၫအ့လၭ,- တၭစဘၥူၫအ့လၭနီၪထၪ့ ဖိၪနးရဘ့ၭကၫနီၪလီၫ. ၦဎိၭဂၩလဂၩနီၪ, နးမံလကၫ အီၪဖျဲၪန့စအၫဘြဟၫ့ အထၧၫ့ဖုဝဲ စနၫဟီၫအဂးလီၫ.",
			"24": "<sup>24</sup> တၭအၥံၪမၫအမံၩ့ နးရူမၫအီၪဖျဲၪန့ စတံဘၧၫ, ဒဲစဂ့ ဟၫ့,ဒဲစၥၫဟၭ, ဒဲစမၫအခၫဆ့လီၫ."
		},
		"23": {
			"1": "<sup>1</sup> တၭနးစၫရၫအၥၭၡါ အနံၪ့လယၩနံၫဆံၫနွ့ၫနံၪ့နီၪ,",
			"2": "<sup>2</sup> မွဲနးစၫရၫအၥၭမၧၫ့ဝ့ၫ အနံၪ့လဖၪလီၫ.- တၭနးစၫရၫ ၥံၫဝ့ၫလၧကၧၫယၭအါဘၫ, အဝ့ၫနီၪ မွဲဟံဘြၧၫ့အီၪ လၧခးကၫနအၫ့အဖၧၩ့လီၫ. တၭစအၫဘြဟၫ့ဂဲၫဘဲၫ ၥိၭအမိဂၪ့ဝ့ၫ လၧနးစၫရၫအဂး, ဒဲအမ့ၬထံၫမိလၩ့လၧ",
			"3": "<sup>3</sup> အကၠီၩ့လီၫ.- စအၫဘြဟၫ့ဂဲထုၪ့ လၧအဆၧၥံၫအမ့ၬ ယၫတၭ, ချဲၩ့ဆၧလၧစဟ့ၥၭအဖိၪခွၫလဖၪတၭ, စံၭ",
			"4": "<sup>4</sup> ဝ့ၫဒၪ,- ယဝ့ၫဒၪယီၩ, ယမွဲၦမွံၩတၭ, ယအီၪမွံၩလၧ နၥံၪအကျၩလီၫ. ဖ့ၪလၫ့ယၧၩဆၧၥွၪခိၪ လၧဆၧဖီၪ့ ထၬအဂးလၧနၥံၪအကျၩဆံၭ. တၭယမိခုၪ့လၩ့ဘၧၩ့ ခွံၬယဆၧၥံၫ လၧယမ့ၬယၫလီၫ.",
			"5": "<sup>5</sup> စဟ့ၥၭ အဖိၪခွၫလဖၪစံၭဆၧၫ့ စအၫဘြဟၫ့တၭ,",
			"6": "<sup>6</sup> စံၭဝ့ၫ,- ကဆါဧ့, ခိၭနၪပလူဆံၭ, နမွဲယွၩအၦဒိၪလ ဂၩ လၧပကျၩလီၫ. ထီးဒၪနရွံန့ ဆၧလၧပၥွၪခိၪအ ကျၩလစီၪ့စီၪ့နီၪ ခုၪ့လၩ့ဘၧၩ့ခွံၬ နဆၧၥံၫလၧအဖၧၩ့ နီၪဆံၭ. ၦလၧအပဒၩ့နခုၪ့လၩ့ဘၧၩ့ခွံၬ နဆၧၥံၫလၧ အၥွၪခိၪဖၧၩ့နီၪ အီၪလၧပကျၩနးဂၩအ့ၬ.",
			"7": "<sup>7</sup> စအၫဘြဟၫ့ဂဲထုၪ့တၭ, ၡီၫ့ကူၭလၩ့အၥၭလၧၦခး",
			"8": "<sup>8</sup> ဖိၪစဟ့ၥၭအဖိၪခွၫလဖၪ အမ့ၬယၫလီၫ.- ချဲၩ့ဆၧလၧ အဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ, အ့ၪဘၪနၥံၪအၥၭ လၧယမိခုၪ့ လၩ့ဘၧၩ့ခွံၬ ယဆၧၥံၫလၧယမ့ၬယၫတၭ, ခိၭနၪယ လူတၭ, အၪ့ကံၩ့အၪ့ယၫန့ယဂး လၧစဇိဟၫအဖိၪခွၫ",
			"9": "<sup>9</sup> စအံဖၧၫ့လဂၩ,- ဘဲၫၥိၭအမိဖ့ၪလၫ့ယၧၩ လၧဆၧအိၩ ဖၧၩ့ မၭကပံလၫလၧအမွဲအဆၧ, အီၪလၧဂၪ့ခိၪလဝၩ့ ဖၧၩ့အထုၬနီၪဆံၭ. မွဲအဘၪအၪ့ဆၫန့ယၧၩ လၧစ့ၩ အလၧၫ့အဎွ့ၩအဂးနီၪ, ဘဲၫၥိၭအမိကဲၪထၪ့ဆၧၥွၪ ခိၪအဆၧဖီၪ့ထၬ လၧနၥံၪအကျၩလီၫ.",
			"10": "<sup>10</sup> တၭစအံဖၧၫ့အီၪဆၧၫ့နၩ့ဝ့ၫ လၧစဟ့ၥၭအဖိၪခွၫ လဖၪအကျၩလီၫ. တၭၦဟ့ၥၭဖိၪစအံဖၧၫ့ စံၭဆၧၫ့ စအၫဘြဟၫ့ လၧစဟ့ၥၭအဖိၪခွၫလဖၪအနါဖၧၩ့,က ယဲၦလ့ၩနုၬဝ့ၫ လၧအဒိၩ့အတရၫ့နီၪတၭ, စံၭဝ့ၫဒၪ,",
			"11": "<sup>11</sup> မွဲအ့ၬ,ကဆါဧ့, ခိၭနၪယလူဆံၭ. ဂၪ့ခိၪလဝၩ့နီၪယ ဖ့ၪလၫ့ဒဲဆၧအိၩဖၧၩ့ အီၪဝ့ၫလၧအဖၧၩ့နီၪ, ယဖ့ၪလၫ့ နၧၩလၧယဆၨၩဒၪယဝ့ၫ အမ့ၬယၫယီၩ, ယဖ့ၪလၫ့ နၧၩလီၫ, ခုၪ့လၩ့ဘၧၩ့ခွံၬနဆၧၥံၫဆံၭ.",
			"12": "<sup>12</sup> တၭစအၫဘြဟၫ့ ကူၭလၩ့အၥၭ လၧၦခးဖိၪအမ့ၬ",
			"13": "<sup>13</sup> ယၫ,- တၭချဲၩ့ဆၧလၧစအံဖၧၫ့ လၧၦခးဖိၪအနါဖၧၩ့, စံၭဝ့ၫဒၪ, မွဲကဒၪယူၭ, လါနၫ့တၭ, ခိၭနၪလါယလူဆံၭ. ယမိဖ့ၪလၫ့နၧၩ လၧစ့ၩလၧဂၪ့ခိၪလဝၩ့ယီၩ အဂးလီၫ. မၩန့လၧယစူၪဖၧၩ့ဆံၭ, တၭယမိခုၪ့လၩ့ဘၧၩ့ ယ ဆၧၥံၫထီးနီၪလီၫ. စအံဖၧၫ့စံၭဆၧၫ့ စအၫဘြဟၫ့တၭ, စံၭဝ့ၫ,",
			"14": "<sup>14</sup> က ဆါဧ့,ခိၭနၪယလူဆံၭ, ဂၪ့ခိၪလဝၩ့အဎွ့ၩနီၪ စ့ၩၡက့ လၭလံယၩ ဎၡက့လၭနီၪမွဲလဘၭၭ တၭ, ဆၧနီၪလၧ ယၧၩဒဲနၧၩ အတွၭအီၪဘဲၫၥ့ၪလဲၪ. တၭခုၪ့လၩ့ဘၧၩ့ ခွံၬနဆၧၥံၫဆံၭ.",
			"16": "<sup>16</sup> စအၫဘြဟၫ့ခိၭနၪ စအံဖၧၫ့အလူတၭ, စအၫဘြ ဟၫ့ခံၫ့န့စအံဖၧၫ့စ့ၩ လၧအစံၭလၧစဟ့ၥၭ အဖိၪခွၫ လဖၪအနါဖၧၩ့, စ့ၩၡက့လၭ ဎအဘၭၭ လံယၩလၧၦ အၪ့ခၩဆၧဖိၪထိးဆၧၫ့ဝ့ၫဒၪလီၫ.",
			"17": "<sup>17</sup> တၭစအံဖၧၫ့အဂၪ့ခိၪလဝၩ့ လၧအအီၪဝ့ၫလၧမၭ ကပံလၫအဖၧၩ့ လၧမၫမရံၫအမ့ၬယၫ, ဂၪ့ခိၪလဝၩ့ ဒဲဆၧအိၩဖၧၩ့ အီၪလၧအဖၧၩ့, ဒဲကယဲၥံၪ့လၧအအီၪ လၧဂၪ့ခိၪလဝၩ့အဖၧၩ့, ဒဲအီၪဝ့ၫလၧအနဲၩ့ထံၭဝၬဝၬ",
			"18": "<sup>18</sup> ထီးအလူၬနီၪ, ဆၧမၩခၧၫ့ဝ့ၫ,- လၧစအၫဘြဟၫ့အ ဆၧဎွ့ၩထၬအဂး လၧစဟ့ၥၭအဖိၪခွၫ လဖၪအမ့ၬယၫ, လၧကယဲၦလၧအလ့ၩနုၬ လၧဒိၩ့အတရၫ့ထီးအလူၬ လဖၪအမ့ၬယၫလီၫ.",
			"19": "<sup>19</sup> လၧဆၧလဖၪနီၪ အလးခဲၫ့, စအၫဘြဟၫ့ ခုၪ့လၩ့ ဘၧၩ့ခွံၬအမၫနးစၫရၫ လၧဆၧအိၩဖၧၩ့အီၪဝ့ၫ လၧမၭ ကပံလၫအဂၪ့ခိၪလဝၩ့အဖၧၩ့ လၧမၫမရံၫအမ့ၬယၫ လီၫ. အနီၪမွဲဟံဘြၧၫ့အီၪဝ့ၫ လၧခးကၫနအၫ့အဖၧၩ့",
			"20": "<sup>20</sup> လီၫ.- တၭဂၪ့ခိၪလဝၩ့ဒဲဆၧအိၩဖၧၩ့ အီၪဝ့ၫလၧအဖၧၩ့ နီၪ,စဟ့ၥၭအဖိၪခွၫလဖၪ မၩခၧၫ့ဝ့ၫလၧစအၫဘြဟၫ့ အဂး,လၧဆၧၥွၪခိၪ အဆၧဖီၪ့ထၬအဂးလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> စအၫဘြဟၫ့အၥၭၡါဝ့ၫတၭ, လ့ၩနုၬယဲၩ့ယူၭလၧ နံၪ့ၥံၪအဖၧၩ့ယူၭ, တၭယဟိဝၩ ဆိၪဂ့ၩယူၭ စအၫ",
			"2": "<sup>2</sup> ဘြဟၫ့ လၧဆၧထီးအလူၬအဖၧၩ့လီၫ.- တၭစအၫ ဘြဟၫ့ စံၭအဎီးအၡၩအၥၭၡါ လၧအဂံၪ့ဖၧၩ့လဂၩ, လၧအပၧၩ့ကယဲ အဆၧအီၪထီးအလူၬနီၪ, အီၪက့ၪလါ",
			"3": "<sup>3</sup> နစူၪလၧယကံၪဒူၪအဖၫ့လၬဆံၭ.- တၭယမိဒုၭဆိၪ လၩ့နၥၭလၧယဟိဝၩ, မူၭခိၪအယွၩဂၪ့ခိၪအယွၩအ မ့ၬယၫ, လၧနလမၩန့ဘၪ ယဖိၪခွၫအမၫ လၧၦကၫန",
			"4": "<sup>4</sup> အၫ့အဖိၪမုၪ လၧယအီၪ လၧအကျၩယီၩလီၫ.- မွဲနမိ ဘၪလ့ၩလၧယခးဒၪယဝ့ၫ, ဒဲလၧယဘူၭယထံးအအီၪ တၭ, မၩန့ယဖိၪခွၫ စအံစၭအမၫနီၪဘီၪ.",
			"5": "<sup>5</sup> အဎီးအၡၩစံၭဝ့ၫ, ဘၪလဘၪလဘၪဘၪ ၦမုၪအၥၭ လၧအမိဖိၬယခဲၫ့ ထီၩ့လၧခးလဘံၪ့ယီၩတၭး မွဲယ ဘၪအၪ့မၧၫ့နဖိၪခွၫထဲၩ့ထဲၩ့တၡါ လၧခးလၧနဂဲၫထၪ့ လၧအဖၧၩ့နီၪဆ့ဧၪ.",
			"6": "<sup>6</sup> တၭစအၫဘြဟၫ့စံၭဝ့ၫ, ထီးလၩ့နၥၭဘီၪ, မွဲနထီး",
			"7": "<sup>7</sup> ဒုၭထဲၩ့ထဲၩ့ယဖိၪခွၫထီးနီၪလဂ့ၩ.- ယဟိဝၩ, မူၭခိၪ အယွၩလၧအမၩန့ယၧၩ လၧယဖါအဂံၪ့ဖၧၩ့, ဒဲလၧ ယဘူၭယထံးအခး, လၧအချဲၩ့ဆၧလၧယၧၩ, ဒဲဆိၪ လၩ့အၥၭလၧယၧၩတၭ,စံၭ, ဆၧလၧခးလဘံၪ့ယီၩ, ယမိဖ့ၪလၫ့နချံၫနၥၪလီၫ. အဝ့ၫနီၪမိအၪ့မၧၫ့လၩ့အ ၥီၫ့လဂၩလ့ၩလၧနမ့ၬယၫတၭ, နဘၪမၩန့ယဖိၪခွၫအ",
			"8": "<sup>8</sup> မၫထီးနီၪလီၫ.- အ့ၪလဘၪဘၪၦမုၪအၥၭ လၧအမိဖိၬ နခဲၫ့တၭ, ယဒုၭဆိၪလၩ့နၥၭယီၩ လဘၪလၧၩ့ဘၪ နၧၩ, အ့ၪမွဲယဖိၪခွၫထဲၩ့ထဲၩ့ ထီးနီၪလမံၩ့, ထီးဒုၭ",
			"9": "<sup>9</sup> ထဲၩ့ထဲၩ့အဝ့ၫလဂ့ၩ.- အဎီးအၡၩအီၪက့ၪအစူၪလၧ အကဆါစအၫဘြဟၫ့ အကံၪဒူၪအဖၫ့လၬတၭ, ဆိၪ လၩ့အၥၭလၧအဝ့ၫ လၧဆၧလမံၩ့နီၪ အဂဲးအကၠီၪ့လီၫ.",
			"10": "<sup>10</sup> အဎီးအၡၩမၩန့ကလအူၭဆံၫဒုၩ လၧအကဆါအ ကလအူၭအကျၩတၭ, လ့ၩဆၧလီၫ. တၭအကဆါအ ဆၧဖိၪဆၧလံၩအီၪဝ့ၫ လၧအစူၪဖၧၩ့ ထီးအလူၬလီၫ. ဂဲထုၪ့ဝ့ၫတၭ, လ့ၩဝ့ၫထီၩ့လၧခးမ့စိၫပတ့မၠၫ ထီၩ့လၧ",
			"11": "<sup>11</sup> ဒိၩ့နၫဟီၫလီၫ.- တၭမုဂၪလၩ့အဆၧၫ့အထီ လၧၦမုၪၥံၪ စဲၪ့ထၪ့အၪ့ဒုၪ့ထံၫနီၪ, အဝ့ၫဒၪဒုၭထွံၩလၩ့ကလအူၭ အခၪ့လၧထံၫဖၧၩ့အနဲၩ့ထံၭ, လၧဒိၩ့လဖျိၪ့နီၪလၧခီၫ့",
			"12": "<sup>12</sup> လခီၫလီၫ.- တၭအဝ့ၫဒၪနီၪစံၭ, ယဟိဝၩ, ယကဆါ စအၫဘြဟၫ့အယွၩဧ့, မၩဘီၪထၪ့ယီၫထၪ့ယၧၩလၧ မုဆၫလနံၩယီၩဆံၭး မွဲယကဆါစအၫဘြဟၫ့ ဘၪအ",
			"13": "<sup>13</sup> ခိးအတၩလၧနၧၩဆံၭ.- ယိခွါ, ယဆၧၫ့ထုၪ့လၧထံၫ ထၪ့ဖျိၭအနဲၩ့ထံၭယီၩတၭ, ၦဒိၩ့ဖိၪအဖိၪမုၪလဖၪစဲၪ့",
			"14": "<sup>14</sup> ထၪ့အၪ့ဒုၪ့ထံၫ.- မွဲဆၧမၩအၥၭ လၧၦမုၪနၩ့လၧယမိ စံၭအဝ့ၫ အီၪက့ၪလၩ့နထံၫဆဲၩ ဘဲၫယမိအီၩထံၫဆံၭ နီၪတၭ, မိစံၭဝ့ၫအီၩကဒၪဘီၪ, တၭယမိဒုၭအီၩနက လအူၭလဖၪနီၪဆ့တၭး အဝ့ၫနီၪ, မွဲအကဲၪၦလၧနအီၪ က့ၪအဝ့ၫလၧနခ့ၫနၡၩ စအံစၭအဂးနီၪဆံၭ. လၧဆၧ နီၪလမံၩ့အကၠီၩ့တၭ, ယမိၥ့ၪယၫလၧယကဆါန့ဘၪ အခိးအတၩ လၧနၧၩလီၫ.",
			"15": "<sup>15</sup> ဆၧမၩအၥၭလၧအချဲၩ့ဆၧနီၪ, လချႃၭလူၬဒံၭဘၪ တၭ,ယိခွါ, နးရဘ့ၭကၫလၧဆၧအီၪဖျဲၪဝ့ၫ လၧစအၫ ဘြဟၫ့အထၧၫ့ဖုဝဲ စနၫဟီၫအမၫ နးမံလကၫအဖိၪခွၫ စဘၥူၫအ့လၭ အဂးလဂၩ, စဲၪ့ထၪ့ဆိၬထံၫဆဲၩ အီၪ",
			"16": "<sup>16</sup> လၧအခိၬထံၭလီၫ.- တၭၦမုၪနၩ့နီၪ အခံးအဂၩ့ဂ့ၩမၬ ဆ့းမွဲၦမုၪနၩ့ လၧၦခွၫၥ့ၪယၫဝ့ၫနးဂၩအ့ၬ, လ့ၩလၩ့ လၧထံၫထၪ့ဖျိၭနီၪ, မၩဎွ့ၩအထံၫဆဲၩတၭ ဂဲၫထဲၩ့ထၪ့",
			"17": "<sup>17</sup> ဝ့ၫလီၫ.- ဆၧအဎီးအၡၩစဲၪ့တလဲး လၧအအီၪတၭ, စံၭဝ့ၫဒၪ, ထံၫလၧနထံၫဆဲၩဖၧၩ့နီၪ, ဖ့ၪလၫ့လါယအီၩ",
			"18": "<sup>18</sup> နးဆံၭဘီၪ.- တၭအဝ့ၫဒၪစံၭ, ကဆါဧ့, အီၩဘီၪ. အီၪ က့ၪလၩ့အထံၫဆဲၩ လၧအစူၪလီၩ့ချဲၫ့ချဲၫ့ ဒုၭအီၩဝ့ၫ",
			"19": "<sup>19</sup> ဒၪလီၫ.- တၭဒုၭအီၩဝ့ၫဂီၩ့တၭ, စံၭဝ့ၫဒၪ, ယမိအၪ့ဒုၪ့",
			"20": "<sup>20</sup> ထံၫလၧနကလအူၭအဂး ထီးအဘျဲၩအီၩဆ့လီၫ.-မၩ ဝ့ၫချဲၫ့ချဲၫ့တၭ, ထံၫလၧအထံၫဆဲၩဖၧၩ့နီၪ, လူၫလၩ့ခွံၬ ဝ့ၫလၧချိၭဖၧၩ့တၭ, စဲၪ့အၪ့ဒုၪ့ဒီၭထံၫ လၧထံၫဖၧၩ့တၭ,",
			"21": "<sup>21</sup> အၪ့ဒုၪ့ထံၫလၧအကလအူၭ ထီးအလူၬအဂးလီၫ.- ၦ လဂၩနီၪထီၫမံၫထီၫမၪ ဆၧလၧအကၠီၩ့တၭ, မွဲယဟိဝၩ မၩဘီၪထၪ့ယီၫထၪ့ အဖၧၩ့ၥၭဧၪနီၪ, ဘဲၫၥိၭအမိၥ့ၪ ယၫဝ့ၫတၭအီၪလၩ့မါပံၭလီၫ.",
			"22": "<sup>22</sup> ထီးကလအူၭအီၩဆၧဂီၩ့တၭ, ဆၧမၩအၥၭလၧၦ လဂၩနီၪမၩန့ စူၪၥံၭထီၫ့အလယၧးနီၪ ဎၧၫ့ဝ့ၫၡက့လၭ ဎအဘၭၭ လခီၫ, ဒဲထဲၫ့ဎွံၪနံၫဘီၩ့ အလယၧးဎၧၫ့ဝ့ၫၡ",
			"23": "<sup>23</sup> က့လၭလဆံၫလၧအစူၪအဂးလီၫ.- တၭစံၭဝ့ၫဒၪ, နမွဲ ပလၫအဖိၪမုၪလဂၩလဲၪး ဒုၭနဲၪလါယၧၩဆံၭ. ဘဲၫ ၥိၭပမိအီၪလၧနဖါအဂံၪ့ဖၧၩ့ ကဲမုနၩနီၪတၭး မွဲအလး",
			"24": "<sup>24</sup> အီၪဆ့ဧၪ.- တၭအဝ့ၫနီၪစံၭ, ယမွဲနးမံလကၫအဖိၪခွၫ, လၧအအီၪဖျဲၪန့ လၧစနၫဟီၫအဂး, စဘၥူၫအ့လၭနီၪ",
			"25": "<sup>25</sup> အဖိၪမုၪလီၫ.- တၭစံၭဝ့ၫဒၪ, လီခၫ့ဒဲနၪ့ၥံၪမံၩ့ၥံၪအီၪ",
			"26": "<sup>26</sup> အၪလ့ၬ, ဒဲလးလၧမုနၩအဂးနီၪ, အီၪဝ့ၫဆ့လီၫ.- ၦလ",
			"27": "<sup>27</sup> ဂၩနီၪၡီၫ့လၩ့အခိၪတၭ, ဘၩထၪ့ယဟိဝၩ,- စံၭဝ့ၫ ဒၪ,ယဟိဝၩ ယကဆါစအၫဘြဟၫ့အယွၩ လၧအလ ဒုၭလ့ၩဒၪဘၪအခိးအတၩ, ဒဲအဆၧမွဲဆၧတီၩ လၧယ ကဆါလဂၩနီၪ, မွဲအဘၪဆၧဆိၪဂ့ၩဆံၭး ယဝ့ၫဒၪ ယီၩယအီၪ လၧဖၧၩ့ၥၭနီၪ, ယဟိဝၩ ၥိၫ့ယၧၩထီၩ့ လၧယကဆါ အထၧၫ့ဖုဝဲအဂံၪ့လီၫ.",
			"28": "<sup>28</sup> တၭၦမုၪနၩ့နီၪ စဲၪ့တလဲးဒုၭနဲၪအမိအဂံၪ့ဖိၪ လၧ",
			"29": "<sup>29</sup> ဆၧလဖၪနီၪလီၫ.- တၭနးရဘ့ၭကၫအထၧၫ့ဖုဝဲခွၫ, အီၪလဂၩအမံၩ့ မွဲစလၫဘၫ့လီၫ. တၭစလၫဘၫ့စဲၪ့တ လဲးလၧၦလဂၩအအီၪ လၧထံၫထၪ့ဖျိၭ အနဲၩ့ထံၭနီၪ",
			"30": "<sup>30</sup> လီၫ.- ထီးအဒၪဘၪစူၪၥံၭထီၫ့, ဒဲထဲၫ့ဎွံၪလၧအထၧၫ့ဖု ဝဲမုၪအစူၪလီၩ့တၭ, ထီးအနါဂၧၫ့အထၧၫ့ဖုဝဲမုၪ နးရ ဘ့ၭကၫအဆၧချဲၩ့, လၧအစံၭၦလဂၩနီၪ စံၭယၧၩဘဲၫ နီၪ,ဆၧမၩအၥၭ လၧအလ့ၩဝ့ၫ လၧၦလဂၩနီၪအအီၪ တၭ,ယိခွါ, အီၪဆၧၫ့ထုၪ့ဝ့ၫ လၧကလအူၭအနဲၩ့ထံၭ,",
			"31": "<sup>31</sup> ထီးထံၫထၪ့ဖျိၭနီၪလီၫ.- တၭအဝ့ၫဒၪစံၭ ၦလၧအဘၪ ဆၧဆိၪဂ့ၩ လၧယဟိဝၩလဂၩဧ့, ဂဲၫနုၬဆံၭ, နအီၪ ဆၧၫ့ထုၪ့လၧခီၫ့ယီၩ, မွဲဘၪလဲၪ. ယတဲၩ့ဝဲၩယူၭဂံၪ့,",
			"32": "<sup>32</sup> ဒဲအလးလစီၪ့ လၧကလအူၭအဂးယူၭလီၫ.- တၭၦလ ဂၩနီၪ လ့ၩနုၬဝ့ၫလၧဂံၪ့ဖၧၩ့လီၫ. ကွဲၪလၩ့ခွံၬကလ အူၭတၭ,ဖ့ၪလၫ့လီခၫ့, ဒဲနၪ့ၥံၪမံၩ့ၥံၪ လၧကလအူၭအ ဂးတၭ, ထံၫလၧအၥူၫဝၭခွံၬ အခၪ့အဂး, ဒဲလၧၦၡၩ",
			"33": "<sup>33</sup> အီၪလၧအၥိၭလဖၪ အခၪ့အဂးဆ့လီၫ.- တၭဆၧအီၪ က့ၪဆၧအၪ့ဆၧအီၩ လၧအမ့ၬယၫလီၫ. မွဲလါနၫ့တၭ အဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယလချႃၭလီၩဒံၭဘၪ ယဆၧချဲၩ့ တၭ,ယအၪ့ဘၪယဝ့ၫအ့ၬး တၭအဝ့ၫဒၪစံၭ, လီၩဘၪ ဘီၪ.",
			"34": "<sup>34</sup> တၭအဆၧစံၭဝ့ၫဒၪ, ယမွဲစအၫဘြဟၫ့အဎီးအၡၩ",
			"35": "<sup>35</sup> လီၫ.- ယကဆါလဂၩနီၪ, ယဟိဝၩဆိၪဂ့ၩယူၭဖၭဒိၪ ယူၭတၭး ကဲၪထၪ့ဝ့ၫလၧၦအဒိၪလီၫ. တၭဆၧဖ့ၪလၫ့ ဝ့ၫလၧၥိၪ,ဒဲဘ့ၪ, ဒဲချီ,ဒဲကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲအဎီးအၡၩခွၫ, ဒဲအဎီးအၡၩမုၪ, ဒဲကလအူၭ,ဒဲကၥ့ၪ",
			"36": "<sup>36</sup> ယီၩ့လဖၪလီၫ.- တၭယကဆါအမၫ နးစၫရၫအီၪဖျဲၪန့ အဖိၪခွၫလၧယကဆါအဂး, လၧအၥၭၡါက့ၭလီၫ. တၭကယဲအဆၧလမံၩ့လါလါနီၪ, ဖ့ၪလၫ့ယူၭဝ့ၫလၧ",
			"37": "<sup>37</sup> အဝ့ၫနီၪထီးအလူၬလီၫ.- ယကဆါဒုၭဆိၪလၩ့ယၥၭ တၭ,စံၭဝ့ၫဒၪ, မၩန့ယဖိၪခွၫအမၫ လၧၦကၫနအၫ့ဖိၪ, လၧယအီၪလၧအခးဖၧၩ့ လဖၪအဖိၪမုၪ အကျၩလ",
			"38": "<sup>38</sup> ဂ့ၩ.- အ့ၪမွဲနမိဘၪလ့ၩ လၧယဖါအဂံၪ့, ဒဲလၧယဒီၪ့ဒၪ",
			"39": "<sup>39</sup> ယဝ့ၫအအီၪတၭ, မၩန့ယဖိၪခွၫအမၫလီၫ.- တၭယ စံၭယကဆါနီၪ, ဘၪလဘၪၦမုၪနီၪ လမိဖိၬဘၪအၥၭ",
			"40": "<sup>40</sup> လၧယခဲၫ့လီၫ.- မွဲအစံၭယၧၩ, ယဟိဝၩလၧယလ့ၩ ဆၧလၧအမ့ၬယၫ မိအၪ့မၧၫ့အၥီၫ့လဂၩ လ့ၩလၧနၥိၭ တၭ,မိမၩဘီၪထၪ့ယီၫထၪ့ နဖၧၩ့ၥၭတၭး နဘၪမၩန့ ယဖိၪခွၫအမၫ လၧယဒီၪ့ဒၪယဝ့ၫအကျၩ, ဒဲလၧယ",
			"41": "<sup>41</sup> ဖါအဂံၪ့ဖၧၩ့နီၪလီၫ.- ထီးနီၪလဖၧၫ့ ယဒုၭဆိၪဆၧ နီၪလဘၪလၧၩ့ဘၪနၧၩတၭ, နအ့ၪထီၩ့လၧယၡၩလ ဒီၪ့ဒၪယဝ့ၫအအီၪတၭ, အဝ့ၫၥံၪအ့ၪလဖ့ၪလၫ့ဘၪလၧ နၧၩတၭ, ယဒုၭဆိၪဆၧယီၩ, မိဘၪလၧၩ့နၧၩအ့ၬ.",
			"42": "<sup>42</sup> တၭလၧမုဆၫလနံၩယီၩ, ယဂဲၫထီၩ့လၧထံၫထၪ့ဖျိၭ တၭ,ယစံၭ, ယဟိဝၩ,ယကဆါ စအၫဘြဟၫ့အယွၩ ဧ့, နအ့ၪမၩဘီၪမၩယီၫယဖၧၩ့ၥၭ လၧယဖိၬတၭး",
			"43": "<sup>43</sup> ယိခွါ,ယဆၧၫ့ထုၪ့ လၧထံၫထၪ့ဖျိၭ အနဲၩ့ထံၭတၭ, ဆၧမိမၩအၥၭ လၧၦမုၪနၩ့ဂဲၫထၪ့ အၪ့ဒုၪ့ထံၫတၭ,ယ စံၭအဝ့ၫ, ထံၫလၧနထံၫဆဲၩဖၧၩ့နီၪ, ဖ့ၪလၫ့လါယအီၩ",
			"44": "<sup>44</sup> နးဆံၭဘီၪ.- တၭအဝ့ၫနီၪမိစံၭယၧၩ, အီၩနဝ့ၫတၭ, ယမိအၪ့ဒုၪ့ထံၫ လၧနကလအူၭအဂးဆ့တၭ, အဝ့ၫနီၪ မွဲအကဲၪၦမုၪလၧယဟိဝၩအီၪက့ၪဝဲၩဝ့ၫ လၧယကဆါ",
			"45": "<sup>45</sup> အဖိၪခွၫအဂးနီၪဆံၭ.- တၭယချဲၩ့ဆၧ လချႃၭလူၬဒံၭ ဘၪလၧယၥၭခံဖၧၩ့တၭ, ယိခွါ,နးရဘ့ၭကၫ ဂဲၫထၪ့ အီၪလၧအထံၫဆဲၩ လၧအခိၬထံၭအလီၩ့, လ့ၩလၩ့ဝ့ၫ လၧထံၫထၪ့ဖျိၭတၭ, အၪ့ဒုၪ့ထံၫဂီၩ့, ယစံၭအဝ့ၫ,ဒုၭ",
			"46": "<sup>46</sup> အီၩလါယၧၩဆံၭ.- မွဲအမၩဝ့ၫချဲၫ့ချဲၫ့တၭ, အီၪက့ၪ လၩ့အထံၫဆဲၩ, စံၭဝ့ၫဒၪ,အီၩဘီၪ, တၭယမိဒုၭအီၩ နကလအူၭဆ့လီၫ. ယအီၩတၭ, အဝ့ၫနီၪဒုၭအီၩက",
			"47": "<sup>47</sup> လအူၭလဖၪဆ့လီၫ.- တၭယအၪ့စၪ့အဝ့ၫနီၪ, ယစံၭ, နမွဲပလၫအဖိၪမုၪလဂၩလဲၪ. အဆၧစံၭဝ့ၫဒၪ, ယမွဲ စနၫဟီၫအဖိၪခွၫ လၧနးမံလကၫ အီၪဖျဲၪန့အဂး စဘ ၥူၫအ့လၭနီၪ အဖိၪမုၪလီၫ. တၭယအီၪက့ၪနၫခွၩ့လ ဘီၩ့နီၪလၧအမ့ၬလီၩ့, ဒဲထဲၫ့ဎွံၪလဖၪ လၧအစူၪလီၩ့",
			"48": "<sup>48</sup> လီၫ.- ယၡီၫ့လၩ့ယခိၪတၭ, ယဘၩယဟိဝၩတၭ,ယ ဆိၪဂ့ၩယဟိဝၩ, ယကဆါစအၫဘြဟၫ့အယွၩ လၧ အၥိၫ့ယၧၩ လၧဖၧၩ့ၥၭအဘၪ, ဘဲၫၥိၭယမိမၩန့ ယ ကဆါအထၧၫ့ဖုဝဲလဂၩ အဖိၪမုၪ လၧအဖိၪခွၫ အဂး",
			"49": "<sup>49</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ နၥံၪအ့ၪမၩခိးမၩတၩ, မၩမွဲ မၩတီၩကယဆါတၭ, ဒုၭနဲၪယၧၩး အ့ၪလမွဲဘၪတၭ, ဒုၭနဲၪယၧၩ, ဘဲၫၥိၭလၧစူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪမွဲဂ့ၩ, ယမိကၠၪကဒၩ ယၥၭဆ့လီၫ.",
			"50": "<sup>50</sup> စလၫဘၫ့ ဒဲစဘၥူၫအ့လၭ စံၭဆၧၫ့ဆၧတၭ,စံၭဝ့ၫ ဒၪ, ဆၧယီၩလမံၩ့ဂဲၫလၩ့ဝ့ၫ လၧယဟိဝၩလီၫ. အၧၩ့",
			"51": "<sup>51</sup> မွဲဂ့ၩ, ဂ့ၩမွဲဂ့ၩ, ပစံၭဒၪပဝ့ၫၥ့ၪအ့ၬ.- ယိခွါ, နးရဘ့ၭ ကၫအီၪဝ့ၫလၧနမ့ၬယၫလီၫ. မၩန့တၭ ထဲၩ့ထဲၩ့ဆံၭး တၭမွဲအကဲၪထၪ့ နကဆါအဖိၪခွၫအမၫ, ဘဲၫယဟိဝၩ",
			"52": "<sup>52</sup> စံၭဆၧအၥိၭနီၪဆံၭ.- ထီးစအၫဘြဟၫ့ အခ့ၫအၡၩ နါဂၧၫ့အဝ့ၫၥံၪ အဆၧချဲၩ့တၭ, ဆၧမၩအၥၭ လၧအ",
			"53": "<sup>53</sup> ထွံၩလၩ့ဘၩထၪ့ယဟိဝၩလီၫ.- တၭဆၧအဎီးအၡၩ နီၪ,ထုၭထၪ့ကယၧၩ့စ့ၩ, ဒဲကယၧၩ့ထီၫ့, ဒဲဆၧအကီၩ့ အၥိၭလဖၪတၭ, ဖ့ၪလၫ့ဝ့ၫလၧနးရဘ့ၭကၫလီၫ. တၭ အဝ့ၫဖ့ၪလၫ့ဆၧလူဒိၪဎွ့ၩဒိၪလဖၪ လၧအထၧၫ့ဖုဝဲခွၫ, ဒဲအမိလီၫ.",
			"54": "<sup>54</sup> အဝ့ၫၥံၪအၪ့ဆၧဒဲအီၩဆၧတၭ, အဝ့ၫနီၪ, ဒဲၦၡၩ အီၪလၧအၥိၭ အီၪဝ့ၫၥၫ့နၩချီၩ့လီၫ. ဆၧဖၩ့ထၪ့နီၪအ ဝ့ၫၥံၪဂဲထုၪ့တၭး အဝ့ၫလဂၩစံၭ, အၪ့မၧၫ့ယထဲၩ့ထဲၩ့",
			"55": "<sup>55</sup> လၧယကဆါအအီၪဆံၭ.- တၭအထၧၫ့ဖုဝဲခွၫ, ဒဲအမိ စံၭဝ့ၫဒၪ, မွဲၦမုၪနၩ့နီၪ အီၪလၧပၥိၭအနံၩအၥၫ့လဖၪ, ဆံၫၥၫ့ဆံၭ. ဆၧလဖၪနီၪအလးခဲၫ့ မိလ့ၩဘၪဝ့ၫလီၫ.",
			"56": "<sup>56</sup> အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, မွဲလၧယဟိဝၩ မၩဘီၪထၪ့ယီၫ ထၪ့ယဖၧၩ့ၥၭအကၠီၩ့တၭ, ထီးပဒၩ့ယၧၩလဂ့ၩ, ဖ့ၪ လၫ့ယထဲၩ့ထဲၩ့ ဘဲၫၥိၭယမိထဲၩ့ထီၩ့ လၧယကဆါအ အီၪဘီၪ.",
			"57": "<sup>57</sup> အဝ့ၫၥံၪစံၭ, ပမိကိၭန့ၦမုၪနၩ့နီၪတၭ, အၪ့စၪ့ဆၧ",
			"58": "<sup>58</sup> လၧအနိၭလီၫ.- အဝ့ၫၥံၪကိၭန့နးရဘ့ၭကၫတၭ, စံၭ ဝ့ၫ,မွဲနမိလ့ၩဖိၬ ၦလဂၩယီၩအခဲၫ့ဆ့ဧၪ. အဆၧစံၭ,",
			"59": "<sup>59</sup> ယမိလ့ၩလီၫ.- တၭအဝ့ၫၥံၪအၪ့မၧၫ့ အထၧၫ့ဖုဝဲမုၪ နးရဘ့ၭကၫလ့ၩဆၧ, ဒဲၦယိဝ့ၫလဂၩ, ဒဲစအၫဘြဟၫ့ အဎီးအၡၩ ဒဲအဝ့ၫဒၪ အၡၩလဖၪ ထဲၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"60": "<sup>60</sup> တၭအဝ့ၫၥံၪဆိၪဂ့ၩ နးရဘ့ၭကၫစံၭဝ့ၫ, နဝ့ၫဒၪ,ပထၧၫ့ ဖုဝဲမုၪဧ့း မွဲနကဲၪထၪ့ၦအလၬၥံၪ အဘျၩ့လထီၫ့ဆံၭ. မွဲနချံၫနၥၪန့ဘၪ ၦလၧအၥၭဂဲၫ့နၧၩ အတရၫ့နီၪဆံၭ.",
			"61": "<sup>61</sup> နးရဘ့ၭကၫဒဲအဖိၪၥၪမုၪလဖၪ ဂဲထုၪ့တၭ, ထူၬက လအူၭတၭ, ဖိၬၦလဂၩနီၪအခဲၫ့လီၫ. ဆၧအဎီးအၡၩ",
			"62": "<sup>62</sup> လဂၩနီၪ, မၩန့နးရဘ့ၭကၫတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလီၫ.- တၭ စအံစၭအီၪဝ့ၫ လၧမုခံၫ့လခီၫနီၪ ဂဲၫထဲၩ့ဝ့ၫလၧဘံအၧၫ",
			"63": "<sup>63</sup> လဟ့ရီၫအံၫအထံၫဖၧၩ့ အဖၧၩ့ၥၭလီၫ.- စအံစၭလ့ၩ ထၪ့ဝ့ၫလၧဂၪ့ခိၪအဝၩ့ဖၧၩ့ ဘဲၫၥိၭအမိဆီၫ့မီၪ့လၩ့အ ၥၭလၧမုဂၪလၩ့နီၪလီၫ. ကျဲၪ့ထၪ့အမ့ၬတၭ, ယိဆၧ တၭ,ယိခွါ, ကလအူၭလဖၪနီၪ ဂဲၫထဲၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"64": "<sup>64</sup> နးရဘ့ၭကၫကျဲၪ့ထၪ့အမ့ၬတၭ, ထီးအဒၪဘၪစအံစၭ",
			"65": "<sup>65</sup> နီၪ,စဲၪ့လၩ့ဝ့ၫ လၧကလအူၭအလီၩ့လီၫ.- အဂဲးဘဲၫ ယီၩစံၭဝဲၩဆၧအခ့ၫအၡၩ, ၦလၧအဂဲၫအၪ့ဂၬပၧၩ လၧဂၪ့ခိၪလဝၩ့အဖၧၩ့လဂၩနီၪ, မွဲပလၫလဂၩလဲၪနီၪ တၭ,ဆၧအခ့ၫအၡၩလဂၩ, စံၭဝ့ၫဒၪ, မွဲယကဆါလီၫ.",
			"66": "<sup>66</sup> တၭမၩန့ဆၧချႃၬဘံၭတၭ, မၩဘံၭအမ့ၬလီၫ.- တၭ ဆၧအခ့ၫအၡၩလီၩဘၪစအံစၭ လၧကယဲဆၧလၧအ",
			"67": "<sup>67</sup> မၩဝ့ၫထီးအလူၬလီၫ.- စအံစၭၥိၫ့ဝ့ၫ လၧအမိနးစၫရၫ အတဲၩဖၧၩ့တၭ, မၩန့နးရဘ့ၭကၫတၭ, အဝ့ၫနီၪကဲၪ ထၪ့အမၫတၭ, အဲၪဝ့ၫကွံၩဝ့ၫလီၫ. တၭစအံစၭ ဘၪ ဆၧမၩမုၬမၩရှူၪဝ့ၫ လၧအမိၥံၫဝ့ၫအလးခဲၫ့နီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> စအၫဘြဟၫ့န့အမၫနးဖၧၫ့ဒီၭတၭ, အမံၩ့မွဲနးကတု",
			"2": "<sup>2</sup> ရၫလီၫ.- တၭအနီၪအီၪဖျဲၪန့ဝ့ၫ လၧအဂး စဇံမရၫ့, ဒဲစယီၭၡၫ့, ဒဲစမံဒၫ့,ဒဲစမံဒအၫ့, ဒဲစအံၡဘၭ,ဒဲစရှုအၧၫ",
			"3": "<sup>3</sup> လီၫ.- တၭစယီၭၡၫ့နီၪ ထၪ့ဖိၪစၡံဘၫ, ဒဲစဒံဒၫ့လီၫ. တၭစဒံဒၫ့အဖိၪခွၫၥံၪ မွဲစအရှုရံၫ့, ဒဲစလတုၡံၫ့,ဒဲစလ",
			"4": "<sup>4</sup> အၧမံၫ့လီၫ.- တၭစမံဒအၫ့အဖိၪခွၫၥံၪ မွဲစအံဖၫ,ဒဲစအံ ဖၧၫ, ဒဲစတၫနီၭ, ဒဲစအဘဲဒၫ, ဒဲစအ့ၫလဒၫအၫလီၫ.",
			"5": "<sup>5</sup> ၦလဖၪထီးအလူၬနီၪ, မွဲနးကတုရၫအဖိၪခွၫလီၫ.-တၭ စအၫဘြဟၫ့ဖ့ၪလၫ့ ကယဲအဆၧအီၪထီးအလူၬ လၧ",
			"6": "<sup>6</sup> စအံစၭအစူၪဖၧၩ့လီၫ.- အ့ၪမွဲအၥံၪမၫလဖၪ အဖိၪခွၫ ၥံၪ, လၧစအၫဘြဟၫ့န့ဘၪနီၪ, စအၫဘြဟၫ့မၧၫ့ဒံၭ အဘိၩ့ဘၭတၭ, ဖ့ၪလၫ့ဝ့ၫ, လၧဆၧဖ့ၪလၫ့လဖၪတၭ, အၪ့မၧၫ့အစဲၪ့ထၪ့ခွံၬ လၧအဖိၪခွၫစအံစၭအအီၪ, လၧ မုထၪ့လခီၫလၧခးမုထၪ့နီၪလီၫ.",
			"7": "<sup>7</sup> တၭအယီၩမွဲစအၫဘြဟၫ့ အနံၪ့လဖၪအနံၩၥံၪလၧ",
			"8": "<sup>8</sup> အမၧၫ့ဝ့ၫနီၪ, အနံၪ့လယၩနွ့ၫဆံၫယဲနံၪ့လီၫ.- တၭ စအၫဘြဟၫ့အၥၭလူၬတၭ, ၥံၫဝ့ၫလၧအခိၪဘွၩဂ့ၩ ၥၭၡါက့ၭယူၭတၭ, ဘျဲၩအီၪတၭ, ဆၧအီၪက့ၪကီၪ့ဝ့ၫ",
			"9": "<sup>9</sup> လၧအဆၨၩဒၪဝ့ၫနီၪလီၫ.- တၭအဖိၪခွၫစအံစၭ, ဒဲစ အံၡမၫအ့လၭလဖၪ ခုၪ့လၩ့ဘၧၩ့ခွံၬ လၧဆၧအိၩဖၧၩ့ မၭကပံလၫ အီၪလၧၦဟ့ၥၭဖိၪ စဇိၫဟၫအဖိၪခွၫစအံ ဖၧၫ့အဂၪ့ခိၪလဝၩ့ဖၧၩ့, လၧအအီၪ လၧမၫမရံၫအမ့ၬ",
			"10": "<sup>10</sup> ယၫနီၪလီၫ.- အနီၪမွဲဂၪ့ခိၪလဝၩ့ လၧစအၫဘြဟၫ့ဎွ့ၩ ဝ့ၫလၧစဟ့ၥၭအဖိၪခွၫ လဖၪလီၫ. စအၫဘြဟၫ့ဘၪ ဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫထီးနီၪ ဒဲအမၫနးစၫရၫဆ့လီၫ.",
			"11": "<sup>11</sup> လၧစအၫဘြဟၫ့ ၥံၫဝ့ၫအလးခဲၫ့နီၪ, ဆၧမၩအၥၭ လၧယွၩဆိၪဂ့ၩအဖိၪခွၫ စအံစၭတၭ, စအံစၭအီၪလၧ ဘံအၧၫလဟ့ရီၫအံၫ အနဲၩ့ထံၭနီၪလီၫ.",
			"12": "<sup>12</sup> တၭအယီၩမွဲစအၫဘြဟၫ့အဖိၪခွၫ, လၧၦအံဇံၭဖိၪ နးစၫရၫအဎီးမုၪ နးဟၫဂၫအီၪဖျဲၪန့လၧအဂး, စအံၡ",
			"13": "<sup>13</sup> မၫအ့လၭ အဆိၩၥံၪလီၫ.- တၭအယီၩမွဲစအံၡမၫအ့ လၭအဖိၪခွၫလဖၪအမံၩ့, ဘဲၫအမံၩ့အီၪလၧလဆိၩ ဘၪလဆိၩအၥိၭနီၪလီၫ. စအံၡမၫအ့လၭ အဖိၪခွၫဝဲ ၡါ,စနဘ့ယီၭ, ဒဲစကံဒၧၫ, ဒဲစအၭဘဒံၫအ့လၭ, ဒဲစမံ ဘစၫ့,",
			"14": "<sup>14</sup> ဒဲစမံၡၫမၫ, ဒဲစဒုမၫ, ဒဲစမၫစၫ,- စဟၫဒၭ,",
			"16": "<sup>16</sup> ဒဲစတံမၫ, ဒဲစယံတၧၫ,ဒဲစနံဖံၭ, ဒဲစက့ဒမၫလီၫ.- အဝ့ၫ ၥံၪနီၪမွဲစအံၡမၫအ့လၭ အဖိၪခွၫလဖၪတၭ, အဝ့ၫၥံၪ နီၪမွဲအမံၩ့ လၧအတဝၫ့ဖၧၩ့, လၧအဂံၪ့အဝၩ့ဖၧၩ့ၦဒိၪ",
			"17": "<sup>17</sup> လဆံၫနံၫဂၩ ဘဲၫအဆၨၩအၥိၭနီၪလီၫ.- အယီၩမွဲစအံ ၡမၫအ့လၭမၧၫ့ဝ့ၫအနံၪ့အလၩ အီၪဝ့ၫအနံၪ့လယၩ ၥၧၫ့ဆံၫနွ့ၫနံၪ့တၭ, အၥၭလူၬဝ့ၫတၭ, ၥံၫဝ့ၫနီၪဆၧအီၪ",
			"18": "<sup>18</sup> က့ၪကီၪ့အဝ့ၫ လၧအဆၨၩဒၪဝ့ၫနီၪလီၫ.- တၭအဝ့ၫၥံၪ အီၪလၧဟၭဝလၫထီၩ့ လၧၡၧၫအီၪလၧခးအံဇံၭအမ့ၬ ယၫ,ထီးနလ့ၩဆၧ လၧခးအစံရအၫလီၫ. တၭအီၪလၧ အထၧၫ့ဖုဝဲထီးအလူၬ အမ့ၬယၫလီၫ.",
			"19": "<sup>19</sup> တၭအယီၩမွဲစအၫဘြဟၫ့ အဖိၪခွၫစအံစၭအဆိၩ",
			"20": "<sup>20</sup> လဖၪလီၫ.- စအၫဘြဟၫ့ထၪ့ဖိၪစအံစၭလီၫ. တၭလၧ စအံစၭန့အမၫ လၧနးရဘ့ၭကၫ ၦအၫရၫ့ဖိၪစဘၥူၫအ့ လၭ,အီၪလၧပၫဒၫ့အၫရၫ့အဖၧၩ့လဂၩ အဖိၪမုၪလၧ အထၧၫ့ဖုဝဲမုၪ လၧၦအၫရၫ့ဖိၪစလၫဘၫ့နီၪ, မွဲအၥၭၡါ အနံၪ့လံဆံၫလီၫ.",
			"21": "<sup>21</sup> တၭစအံစၭအၪ့ကံၩ့ အၪ့ယၫယဟိဝၩ လၧအမၫအ ဂး လၧအထူၬဖိၪအကၠီၩ့လီၫ. ယဟိဝၩ ဒိၭဆၧအၪ့ ကံၩ့အၪ့ယၫလၧအဝ့ၫတၭ, အမၫနးရဘ့ၭကၫဒၧၩ့ထၪ့ ဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> တၭအဖိၪလဖၪ ဘၪဂဲၩလိၬအၥၭ လၧအအီၩ့ဖၧၩ့ တၭ, အနီၪစံၭဝ့ၫဒၪ, အ့ၪမွဲဘဲၫနီၪတၭ, မွဲဘၪနီၫလၫ ယအီၪဘဲၫယီၩလဲၪ. တၭလ့ၩအၪ့စၪ့ယဟိဝၩလီၫ.",
			"23": "<sup>23</sup> ယဟိဝၩစံၭဝ့ၫ, ၦနံၫဆၨၩ အီၪလၧနဒၧၩ့လးအဖၧၩ့ တၭ,ၦခမျၧးနံၫဆၨၩ မိလၩ့ဖၭလၧနအီၩ့ဖၧၩ့လီၫ. တၭ အလဆၨၩ မိဆီၪ့နဲၪ့အဝ့ၫလဆၨၩလီၫ. တၭအဒိၪမိ မၩအဆံၭအဆၧမၩလီၫ.",
			"24": "<sup>24</sup> ထီးအနံၩအၥၫ့ လၧအမိအီၪဖျဲၪ နီၪဎွ့ၩထၪ့ဝ့ၫတၭ,",
			"25": "<sup>25</sup> ယိခွါ, ၦအဎဲၩ့အီၪလၧအဒၧၩ့လးဖၧၩ့လီၫ.- တၭၦလၧ အဂဲၫဆိၫလဂၩဝီၩဝ့ၫ မၩအၥၭဘဲၫဆဲၫ့အီၪလၧအဆီၪ့ အၥိၭထၧၫ့ဂၩယၫလီၫ. တၭအဝ့ၫၥံၪကိၭဝ့ၫအမံၩ့လၧ",
			"26": "<sup>26</sup> စအံစီၫလီၫ.- လၧအလးခဲၫ့နီၪ အဖုဂဲၫဝ့ၫတၭ, ဖီၪ့ထၬ စအံစီၫအခၪ့နိးခဲၫ့ လၧအစူၪလီၫ. တၭဆၧကိၭဝ့ၫအ မံၩ့လၧစယၫကူၭလီၫ. တၭလၧအအီၪဖျဲၪန့ဝ့ၫနီၪ, စအံ စၭအၥၭၡါအနံၪ့ ဎူၫဆံၫလီၫ.",
			"27": "<sup>27</sup> ဖိၪၥၪလဖၪဒိၪထၪ့တၭ, စအံစီၫမွဲၦခၭဆၧၥ့ၪ, ၦမံၩ့ လၬကျၩဖိၪလီၫ. တၭစယၫကူၭနီၪ, မွဲၦအီၪလၧအၥၭ",
			"28": "<sup>28</sup> ဂုးတၭ, အီၪဝ့ၫလၧတဲၩဖၧၩ့လီၫ.- တၭစအံစၭအဲၪ စအံစီၫလီၫ. အဂဲးဘဲၫယီၩ ဆၧအမံၩ့ၥံၪ အယၪနီၪ, အဝ့ၫအၪ့အွံၪဒၪအဆၧလီၫ. အ့ၪမွဲနးရဘ့ၭကၫလဂၩ အဲၪစယၫကူၭလီၫ.",
			"29": "<sup>29</sup> စယၫကူၭ အၪ့ဖီၫ့ၥၧၫ့တၭ, စအံစီၫဂဲၫထဲၩ့လၧမံၩ့",
			"30": "<sup>30</sup> လၬကျၩတၭ, အၥၭလၩ့ဘဲၩဝ့ၫဒၪလီၫ.- တၭစအံစီၫ စံၭစယၫကူၭနီၪ ဒုၭအၪ့လါယၧၩ လၧဆၧအဝီၩ,ဆၧ အဝီၩနီၪဆံၭ. အဂဲးဘဲၫယီၩ ယၥၭလၩ့ဘဲၩလီၫ. မၩ",
			"31": "<sup>31</sup> အၥၭဘဲၫနီၪတၭ, ၦကိၭအမံၩ့လၧအံဒၧၫ့လီၫ.- တၭ စယၫကူၭစံၭ, အၪ့ဆၫခွံၬန့ယၧၩ လၧနဝဲၡါအလးလၧ",
			"32": "<sup>32</sup> မုဆၫလနံၩယီၩဘီၪ.- တၭစအံစီၫစံၭဝ့ၫဒၪ,ယိခွါ,ယမိ ၥံၫလီၫ. တၭဆၧလၧဝဲၡါအလးယီၩ, မိကဲၪထၪ့လၧယ",
			"33": "<sup>33</sup> ဂးလၧဆၧနီၪလမံၩ့လဲၪ.- တၭစယၫကူၭစံၭ, ဆိၪလၩ့ နၥၭလၧယၧၩ လၧမုဆၫလနံၩယီၩဆံၭး တၭအဆၧ ဆိၪလၩ့အၥၭလၧအဝ့ၫနီၪ, အၪ့ဆၫခွံၬအဝဲၡါအလး",
			"34": "<sup>34</sup> လၧစယၫကူၭလီၫ.- တၭစယၫကူၭဖ့ၪလၫ့ စအံစီၫလၧ ကိၪ, ဒဲၥၧၫ့အီၪလၧပထိၭၥၪလီၫ. အဝ့ၫဒၪအၪ့ဆၧဒဲ အီၩဆၧတၭ, ဂဲထုၪ့လ့ၩဆၧလီၫ. တၭစအံစီၫအီၪက့ၪ အဆၧဝဲၡါအလးနီၪ ဘဲၫဆၧၥၭလိၪအၥိၭလီၫ."
		},
		"26": {
			"1": "<sup>1</sup> တၭဆၧၥၭဝံလၩ့ဒိၩအခၪ့ထံၭ လၧအအီၪလၧစအၫ ဘြဟၫ့အမုနံၩလဖၪ အလးခဲၫ့နီၪ, ဆၧၥၭဝံလၩ့ဒိၩ အီၪထၪ့ဒီၭ လၧခးဖၧၩ့လီၫ. တၭစအံစၭ လ့ၩဝ့ၫလၧ ၦဖလံၡၫဖိၪ အစဎွၩ အဘံမလ့ၭ အီၪလၧဂံရၫအဖၧၩ့ နီၪလီၫ.",
			"2": "<sup>2</sup> ယဟိဝၩမၩဖျီၪထၪ့အၥၭတၭ, စံၭဝ့ၫဒၪ, ထီးလ့ၩ လၧအံဇံၭအဖၧၩ့လဂ့ၩ, အီၪလၧခးလၧယမိဒုၭနဲၪနၧၩ",
			"3": "<sup>3</sup> အဖၧၩ့နီၪဆံၭ.- အီၪလၧခးလဘံၪ့ယီၩဆံၭ. တၭယ မိအီၪလၧနၥိၭတၭ, ယမိဆိၪဂ့ၩနၧၩလီၫ. အဂဲးဘဲၫ ယီၩ,ဆၧလၧခးလဖၪထီးအလူၬယီၩ, ယမိဖ့ၪလၫ့နၧၩ ဒဲနချံၫနၥၪတၭ, ယမိမၩဂုးမၩခၧၫ့ဆၧ လၧယဆိၪလၩ့",
			"4": "<sup>4</sup> ယၥၭလၧနဖါစအၫဘြဟၫ့,- တၭယမိမၩအၪထၪ့နချံၫ နၥၪဘဲၫၡၪၥံၪ လၧမူၭခိၪအၥိၭတၭ, ယမိဖ့ၪလၫ့ခးလ ဖၪယီၩထီးအလူၬ လၧနချံၫနၥၪလီၫ. တၭကယဲၦၡၩ လၧဂၪ့ခိၪချိၫ့ လဆၨၩလါလါနီၪ, မိန့ဘၪဆၧဆိၪဂ့ၩ",
			"5": "<sup>5</sup> လၧနချံၫနၥၪအဖၧၩ့လီၫ.- မွဲလၧစအၫဘြဟၫ့ ခိၭနၪ ယလူ,ဒဲထီးန့ယထူၫယရူၫ, ယဆၧမၪလူၬလဖၪ,ယ ဆၧစ့ၩရၫ့လဖၪ, ဒဲယၥနိၫလဖၪအကၠီၩ့နီၪလီၫ. တၭစအံစၭအီၪဝ့ၫ လၧဂံရၫအဖၧၩ့နီၪလီၫ.",
			"6": "<sup>6</sup> တၭ ၦၡၩထီးနီၪအၪ့စၪ့ဝ့ၫ လၧအမၫအဂဲးအကၠီၪ့လီၫ. အ ဝ့ၫနီၪစံၭ, မွဲယထၧၫ့ဖုဝဲမုၪလီၫ. အဂဲးဘဲၫယီၩဘဲၫၥိၭ အမိစံၭ,မွဲယမၫနီၪ, ၥၭမဲၪဝ့ၫတၭး စံၭဝ့ၫဒၪ, ၦလၧ အလးထီးယီၩ မိမၩၥံၫဘၪခိၬယၧၩ လၧနးရဘ့ၭကၫ အကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ အခံးအဂၩ့ဂ့ၩဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> ထီးအအီၪဝ့ၫ ထီးနီၪယံၬတၭ, ဆၧမၩအၥၭလၧဖလံ ၡၩဖိၪ အစဎွၩ အဘံမလ့ၭ ယိဆၧလၧဆၧဖိးအဖၧၩ့ တၭ,ဒၪဆၧတၭ, ယိခွါ,စအံစၭ လိၬကွ့ၩလၧအမၫနး",
			"9": "<sup>9</sup> ရဘ့ၭကၫလီၫ.- စအဘံမလ့ၭကိၭန့ စအံစၭတၭ, စံၭ ဝ့ၫဒၪ,ယိခွါ, အဝ့ၫဒၪနီၪ, မွဲမၬနမၫလီၫ. တၭနစံၭလၧ အမွဲယထၧၫ့ဖုဝဲမုၪနီၪ ဘဲၫၥ့ၪလဲၪ. တၭစအံစၭ စံၭ ဆၧၫ့ဝ့ၫ,အဂဲးဘဲၫယီၩ ယစံၭယမိၥံၫဘၪခိၬ လၧအ ကၠီၩ့လီၫ.",
			"10": "<sup>10</sup> တၭစအဘံမလ့ၭစံၭ, နမၩပၧၩဘဲၫၥ့ၪလဲၪး ၦလဂၩ ဘူၭလၧအမိမံၫဎုၬလၧနမၫလီၫ. တၭနမိဒုၭဘၪပၧၩ",
			"11": "<sup>11</sup> လၧဆၧဒဲၩဘၭလီၫ.- စအဘံမလ့ၭမၪလူၬ ၦခမျၧးထီး အလူၬတၭ, စံၭဝ့ၫဒၪ, ၦၡၩလဂၩယီၩမွဲဂ့ၩ, အမၫမွဲ ဂ့ၩ,ၦလၧအထိၭဘၪဝ့ၫနီၪ မိဘၪၥံၫတၡါလီၫ.",
			"12": "<sup>12</sup> စအံစၭဎွံၪဆၧလၧခးလဘံၪ့နီၪ အဖၧၩ့တၭ,ဆၧလၧ နံၪ့လနံၪ့နီၪ, ဒိၭန့ဆၧအၪနဲၪ့အလး, အဘျၩ့လယၩ",
			"13": "<sup>13</sup> တၭ,ယဟိဝၩဆိၪဂ့ၩအဝ့ၫလီၫ.- ၦလဂၩယီၩဒိၪထၪ့ တၭ,ဒံၩ့ယံၬဒံၩ့ဒိၪထၪ့တၭ, ဒိၪထၪ့ထီးအဒိၪထၪ့ဒိၪ",
			"14": "<sup>14</sup> မၬလီၫ.- အဂဲးဘဲၫယီၩ မွဲအအီၪလၧၥိၪ, ဒဲဘ့ၪအဒီၪ့ လဖၪ,ဒဲချီၥံၪ, ဒဲအဎီးအၡၩအၪဂၩလီၫ. တၭၦဖလံၡၫ",
			"15": "<sup>15</sup> ဖိၪၥၭခ့ၬအဝ့ၫလီၫ.- တၭကယဲထံၫဖၧၩ့ လၧအဖါအ ဎီးအၡၩခုၪ့လၩ့ဝ့ၫ လၧအဖါစအၫဘြဟၫ့ အမုနံၩလ ဖၪထီးအလူၬနီၪ, ၦဖလံၡၫဖိၪ ခွံၬလၩ့ဂၪ့ခိၪလၧအဖၧၩ့ တၭ, မၩဎွ့ၩထၪ့ဝ့ၫဒၪလီၫ.",
			"16": "<sup>16</sup> တၭစအဘံမလ့ၭစံၭ စအံစၭနီၪ, စဲၪ့ထၪ့ခွံၬ လၧပ",
			"17": "<sup>17</sup> အီၪဆံၭ. အဂဲးဘဲၫယီၩနဆီၪ့နဲၪ့မၬပၧၩဆ့လီၫ.- စအံ စၭစဲၪ့ထၪ့ခွံၬ ထီးနီၪတၭ, ၥုၪ့ထၪ့အတဲၩ လၧဂံရၫ",
			"18": "<sup>18</sup> အခိၪလီၩ့ဆူၭဖၧၩ့တၭ, အီၪဝ့ၫထီးနီၪလီၫ.- တၭစအံ စၭဖုးထၪ့ထဲၩ့ဒီၭထံၫဖၧၩ့ လၧၦခုၪ့လၩ့ဝ့ၫ လၧအဖါ စအၫဘြဟၫ့အမုနံၩလဖၪနီၪလီၫ. အဂဲးဘဲၫယီၩလၧ စအၫဘြဟၫ့ၥံၫဝ့ၫ အလးခဲၫ့နီၪ, ၦဖလံၡၫဖိၪၥံၪဘံၭ ခွံၬဝ့ၫလီၫ. အဝ့ၫနီၪကိၭအမံၩ့ ဘဲၫအမံၩ့လၧအဖါကိၭ ဝ့ၫအၥိၭနီၪလီၫ.",
			"19": "<sup>19</sup> စအံစၭအဎီးအၡၩ ခုၪ့ဝ့ၫလၧခိၪလီၩ့ဆူၭဖၧၩ့တၭ,",
			"20": "<sup>20</sup> ဒၪန့ထံၫမၧၫ့လဖၪလီၫ.- တၭဂံရၫအၡၩ ယိဆၧဖိၪလ ဖၪအဲၪ့လိၬဆိၭချဲၩ့လိၬအၥၭ လၧစအံစၭအၡၩယိဆၧ ဖိၪတၭ, စံၭဝ့ၫဒၪ, ထံၫယီၩမွဲပဆၧလီၫ. အဝ့ၫၥံၪအဲၪ့ လိၬဆိၭချဲၩ့လိၬအၥၭအကၠီၩ့တၭ, ကိၭထံၫဖၧၩ့အမံၩ့",
			"21": "<sup>21</sup> လၧအံဇ့ၬလီၫ.- တၭအဝ့ၫၥံၪ ခုၪ့ဒီၭထံၫဖၧၩ့အဂူၫဂၩ လဖၧၩ့တၭ, ၦလဖၪအဲၪ့လိၬဆိၭချဲၩ့လိၬအၥၭ လၧ အဝ့ၫနီၪအဂဲးအကၠီၪ့ဆ့လီၫ. တၭအဝ့ၫဒၪ ကိၭဝ့ၫအ",
			"22": "<sup>22</sup> မံၩ့လၧစံတနၫလီၫ.- အဝ့ၫနီၪစဲၪ့ထၪ့ခွံၬထီးနီၪတၭ, ခုၪ့ထံၫဖၧၩ့အဂူၫဂၩလဖၧၩ့ဒီၭတၭ, အဝ့ၫၥံၪအဲၪ့လိၬ ဆိၭချဲၩ့လိၬအၥၭ လၧအဝ့ၫနီၪအဂဲးအကၠီၪ့အ့ၬး ကိၭ ဝ့ၫအမံၩ့ လၧရဟိဘိၭတၭ, စံၭဝ့ၫဒၪ, အဂဲးဘဲၫယီၩ, ဘိၩ့နဲၪ့ယီၩ ယဟိဝၩမၩယူၭအလး လၧပဂးယူၭတၭ, ပမိၥၪထၪ့လၧခးဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> တၭအဝ့ၫနီၪစဲၪ့ထၪ့ခွံၬထီးနီၪ လ့ၩထီၩ့လၧဘံအၧၫ",
			"24": "<sup>24</sup> ၡံၫဘၫလီၫ.- တၭဆၧလၧမုနၩလနၩနီၪ, ယဟိဝၩမၩ ဖျီၪထၪ့အၥၭ, လၧအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ယဝ့ၫဒၪ ယီၩ,ယမွဲနဖါစအၫဘြဟၫ့ အယွၩတၭး ၥၭမဲၪဆၧ လဂ့ၩး အဂဲးဘဲၫယီၩ ယအီၪလၧနၥိၭတၭ, ယမိဆိၪ ဂ့ၩနၧၩ,ဒဲမၩအၪထၪ့နချံၫနၥၪ လၧယခ့ၫယၡၩစအၫ",
			"25": "<sup>25</sup> ဘြဟၫ့အခိၪအကၠီၩ့လီၫ.- အဝ့ၫဒၪမၩထၪ့ဆၧလုအ လးထီးနီၪတၭ, ကိၭထၪ့ယဟိဝၩအမံၩ့, ၥုၪ့အတဲၩ ထီးနီၪတၭ, စအံစၭ အဎီးအၡၩ ခုၪ့ထံၫဖၧၩ့ လဖၧၩ့ ထီးနီၪလီၫ.",
			"26": "<sup>26</sup> တၭစအဘံမလ့ၭဂဲၫလၧအအီၪ လၧဂံရၫဒဲအထံၩ",
			"27": "<sup>27</sup> အၥိၭစဟၧဇၭ, ဒဲအၥုၭမုအခိၪစဖဲကီၫလၭလီၫ.- တၭ စအံစၭစံၭ အဝ့ၫၥံၪ, မွဲဘၪနီၪလၫနၥံၪ ဂဲၫလၧယအီၪ လဲၪး တၭနၥံၪ ၥၭဂဲၫ့ယၧၩတၭ, နၥံၪအၪ့မၧၫ့ယစဲၪ့ထၪ့",
			"28": "<sup>28</sup> ခွံၬလၧနၥံၪအအီၪမၬလဲၪ.- တၭအဝ့ၫၥံၪစံၭ, ပဒၪဘၪ လၧယဟိဝၩ အီၪတၡါလၧနၥိၭတၭ, ပစံၭ,မွဲဆၧဆိၪ လၩ့လိၬပၥၭ အီၪလၧပၧၩဒဲနၧၩဆံၭး ဒဲမၩၡီၩ့ဆၧအုၩ့",
			"29": "<sup>29</sup> လၩ့လိၬပၥၭလၧနၧၩ- လၧနလမၩအၧၩ့ဘၪပၧၩဘဲၫ ပလထိၭဘၪနၧၩအၥိၭ, ဘဲၫပမၩနၧၩ ကယဲဆၧဂ့ၩ တၭ,အၪ့မၧၫ့နလ့ၩဆၧ မုၬမုၬအၥိၭနီၪဆံၭ. ဘိၩ့နဲၪ့",
			"30": "<sup>30</sup> ယီၩနဘၪဆၧဆိၪဂ့ၩ လၧယဟိဝၩလီၫ.- အဝ့ၫနီၪမၩ ဆၧအၪ့ဆၧအီၩ လၧအဝ့ၫၥံၪအဂးတၭ, အဝ့ၫၥံၪအၪ့",
			"31": "<sup>31</sup> ဆၧအီၩဆၧလီၫ.- တၭဆၧဖၩ့ထၪ့နီၪ အဝ့ၫၥံၪဂဲထုၪ့ ဂီၩဂီၩတၭ, ဆိၪလၩ့လိၬအၥၭဆုၬဆုၬတၭ, စအံစၭ ကွဲၪဖျါခွံၬအဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪထဲၩ့ခွံၬဝ့ၫ လၧအအီၪ မုၬမုၬလီၫ.",
			"32": "<sup>32</sup> တၭဆၧမၩအၥၭ လၧမုလနံၩနီၪ, စအံစၭအဎီးအ ၡၩဂဲၫလီၩဘၪအဝ့ၫ, လၧထံၫဖၧၩ့လဖၧၩ့ လၧအခုၪ့ လၩ့ဝဲၩဝ့ၫအဂဲးအကၠီၪ့တၭ, လီၩဘၪအဝ့ၫ, ပဒၪန့ယူၭ",
			"33": "<sup>33</sup> ထံၫယူၭ.- တၭကိၭဝ့ၫအမံၩ့ လၧၡံဘၫလီၫ. မၩအၥၭ ဘဲၫနီၪတၭ, ဒိၩ့အမံၩ့မွဲဘံအၧၫၡံၫဘၫ ထီးမုဆၫလနံၩ ယီၩလီၫ.",
			"34": "<sup>34</sup> စအံစီၫအၥၭၡါဝ့ၫ အနံၪ့လံဆံၫတၭ, န့အမၫလၧၦ ဟ့ၥၭဖိၪ စဘအံရဲၫအဖိၪမုၪ နးယုဒံၭ, ဒဲၦဟ့ၥၭဖိၪ",
			"35": "<sup>35</sup> စအံလၧၫ့အဖိၪမုၪ နးဘၭၡမၫလီၫ.- တၭအဝ့ၫၥံၪနီၪ မၩဆၫစအံစၭ ဒဲနးရဘ့ၭကၫအၥၭလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> ထီးစအံစၭအၥၭၡါဝ့ၫတၭ, အမ့ၬခံၭထီးအလဒၪ ဘၪဆၧနီၪတၭ, ဆၧမၩအၥၭ လၧအကိၭန့အဖိၪခွၫဝဲ ၡါစအံစီၫတၭ, စံၭဝ့ၫ,ယဖိၪခွၫဧ့း တၭအဝ့ၫဒၪစံၭဝ့ၫ,",
			"2": "<sup>2</sup> ယအီၪထီးယီၩလီၫ.- အဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယိခွါ,ဘိၩ့နဲၪ့ ယီၩ,ယၥၭၡါယူၭတၭ, မုလနံၩလၧယမိၥံၫနီၪ ယၥ့ၪ",
			"3": "<sup>3</sup> ယၫအ့ၬ.- ဘိၩ့နဲၪ့ယီၩမၩန့လါနစူၪဝဲၩနဖျါဖီၩ့,ဒဲနချံၪ တၭ,လ့ၩလၧမံၩ့လၬကျၩ, ခိၭခၭန့ယၧၩ လၧဆၧဖိၪ",
			"4": "<sup>4</sup> ဆၧဎါအမံၩ့,- မၩန့ယဆၧအၪ့ လၧအအွံၪဆၧလၧယ အဲၪတၭ, ဂဲၫထဲၩ့ဆိၬ လၧယအီၪဆံၭ. တၭယမိအၪ့ ဆၧဘဲၫၥိၭယမိဆိၪဂ့ၩနၧၩ လၧယလချႃၭၥံၫဒံၭဘၪ",
			"5": "<sup>5</sup> လီၫ.- တၭစအံစၭချဲၩ့ဆၧ လၧအဖိၪခွၫစအံစီၫနီၪ,နးရ ဘ့ၭကၫနါဂၧၫ့ဝ့ၫလီၫ. တၭစအံစီၫလ့ၩဝ့ၫ လၧမံၩ့လၬ ကျၩဘဲၫၥိၭအမိခိၭခၭန့ ဆၧဖိၪဆၧဎါအမံၩ့တၭ, ဂဲၫ ထဲၩ့ဆိၬဝ့ၫလီၫ.",
			"6": "<sup>6</sup> နးရဘ့ၭကၫချဲၩ့ဆၧ လၧအဖိၪစယၫကူၭတၭ,စံၭဝ့ၫ ဒၪ,ယိခွါ, ယနါဂၧၫ့နဖါချဲၩ့ဆၧ လၧနဝဲစအံစီၫတၭ,စံၭ",
			"7": "<sup>7</sup> ဝ့ၫဒၪ, ဂဲၫထဲၩ့ဆိၬယၧၩ လၧဆၧဖိၪဆၧဎါအမံၩ့,-တၭ မၩန့ယၧၩ လၧဆၧအၪ့အအွံၪဘဲၫၥိၭ ယမိအၪ့ကံၩ့ ဆၧဆံၭ. တၭယမိဆိၪဂ့ၩနၧၩ လၧယဟိဝၩ အမ့ၬ",
			"8": "<sup>8</sup> ယၫ,လၧယလချႃၭၥံၫဒံၭဘၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ယဖိၪခွၫဧ့, ခိၭနၪယလူ လၧဆၧလၧယမၪလူၬနၧၩလ",
			"9": "<sup>9</sup> မံၩ့ယီၩဆံၭ.- ဘိၩ့နဲၪ့ယီၩ လ့ၩလၧၥိၪ, ဒဲဘ့ၪလဒီၪ့အ အီၪတၭ, ဂဲၫထဲၩ့ဆိၬန့ယၧၩ လၧဘ့ၪအဖိၪဂ့ၩနံၫဒုၩ ဆံၭ. တၭယမိမၩဆၧအၪ့အအွံၪ လၧနဖါအဂး, ဘဲၫ",
			"10": "<sup>10</sup> အအဲၪဝ့ၫအၥိၭနီၪလီၫ.- တၭနမိဘၪဆိၬ လၧနဖါအ အီၪနီၪ ဘဲၫၥိၭအမိအၪ့ဆၧ, ဘဲၫၥိၭအမိဆိၪဂ့ၩနၧၩ လၧအလချႃၭၥံၫဒံၭဘၪလီၫ.",
			"11": "<sup>11</sup> တၭစယၫကူၭစံၭအမိ နးရဘ့ၭကၫ,ယိခွါ,ယဝဲစအံ စီၫမွဲၦအီၪလၧအဆီၪ့လီၫ. အ့ၪမွဲယၧၩလဂၩယီၩ, ယ",
			"12": "<sup>12</sup> မွဲအဖျ့ၫလီၫ.- ဘၪလဘၪယဖါမိလုးယၧၩတၭ, ယမိ ကဲၪထၪ့လၧအမ့ၬယၫ, ဘဲၫၦအၪ့လီၫဆၧအၥိၭတၭ, ယမိဒုၭဂဲၫဘၪယလီၩ့ လၧဆၧဆိၪအၧၩ့တၭ, လမွဲဘၪ",
			"13": "<sup>13</sup> ဆၧဆိၪဂ့ၩလီၫ.- တၭအမိစံၭဝ့ၫ, ယဖိၪခွၫဧ့, ဆၧဆိၪ အၧၩ့နီၪ, မွဲအဘၪယၧၩယီၩဆံၭ. ခိၭနၪယလူတၭ,",
			"14": "<sup>14</sup> လ့ၩဂဲၫထဲၩ့ဆိၬန့ယၧၩ လၧဆၧနီၪလဖၪဆံၭ.- အဆၧ လ့ၩဝ့ၫတၭ, မၩန့ဂဲၫထဲၩ့ဆိၬဝ့ၫ လၧအမိအအီၪတၭ,",
			"15": "<sup>15</sup> အမိမၩဆၧအၪ့ လၧအဖါအဲၪဝ့ၫလီၫ.- တၭနးရဘ့ၭ ကၫမၩန့အဖိၪခွၫဝဲၡါ စအံစီၫအကီၩ့အၥိၭဂ့ၩ, လၧအ အီၪလၧအစူၪဖၧၩ့ လၧဂံၪ့ဖၧၩ့တၭ, ဒုၭကီၩ့ထၪ့အဖိၪ",
			"16": "<sup>16</sup> ခွၫဒၪဘၨၩစယၫကူၭလီၫ.- တၭဘ့ၪဖိၪအဖံၭနီၪ, ဒုၭ ၥိၭထၪ့ဝ့ၫလၧအစူၪ, ဒဲလၧအခိၬဖျ့ၫ အလးနီၪလီၫ.",
			"17": "<sup>17</sup> တၭဖ့ၪလၫ့ဆၧအၪ့လၧအအွံၪ, ဒဲကိၪလၧအမၩဝ့ၫလ ဖၪနီၪလၧအဖိၪခွၫ စယၫကူၭအစူၪဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪဂဲၫဝ့ၫလၧအဖါအအီၪတၭ, စံၭဝ့ၫဒၪ,ယဖါ ဧ့,တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယအီၪထီးယီၩလီၫ. ယဖိၪ",
			"19": "<sup>19</sup> ခွၫဧ့,နမွဲပလၫလဂၩလဲၪ.- တၭစယၫကူၭစံၭအဖါ,ယ မွဲနဖိၪခွၫဝဲၡါစအံစီၫလီၫ. ယမၩယူၭဆၧ, ဘဲၫနမၪလူၬ ဝ့ၫအၥိၭနီၪယူၭး ဂဲထုၪ့လါဆံၭ, တၭဆၧၫ့နၩ့အၪ့ယ ဆၧဖိၪဆၧဎါအမံၩ့, ဘဲၫၥိၭနမိဆိၪဂ့ၩယၧၩဆံၭ.",
			"20": "<sup>20</sup> တၭစအံစၭစံၭအဖိၪခွၫ, ယဖိၪခွၫဧ့, နမၩန့ချဲၫ့ချဲၫ့ဘဲၫ ယီၩဘဲၫၥ့ၪလဲၪ. တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪး အဂဲးဘဲၫ",
			"21": "<sup>21</sup> ယီၩယဟိဝၩနယွၩ ဒုၭဂဲၫလၧယအီၪလီၫ.- တၭစအံ စၭစံၭစယၫကူၭ, ၥုၭဘူၭနၥၭဆံၭး နမွဲယဖိၪခွၫစအံ စီၫလၩ့ထံးလၩ့ဆ့ၭဧၪ, နလမွဲဘၪဧၪနီၪ, ယမိလုးနၧၩ",
			"22": "<sup>22</sup> လီၫ.- စယၫကူၭၥုၭဘူၭအၥၭ လၧအဖါစအံစၭအအီၪ တၭ,အဆၧလုးအဝ့ၫတၭ, စံၭဝ့ၫဒၪ,ဆၧအလူနီၪ, မွဲ စယၫကူၭအလူ, အ့ၪမွဲအစူၪလမံၩ့စအံစီၫအစူၪလီၫ.",
			"23": "<sup>23</sup> တၭမွဲအစူၪအီၪ လၧအဆီၪ့ဘဲၫအဝဲ စအံစီၫအစူၪအ ၥိၭတၭ, အဝ့ၫနီၪလၥ့ၪယၫဘၪဝ့ၫတၭ, ဆိၪဂ့ၩဝ့ၫ",
			"24": "<sup>24</sup> လီၫ.- တၭအဝ့ၫနီၪစံၭ, နမွဲယဖိၪခွၫစအံစီၫလၩ့ထံး",
			"25": "<sup>25</sup> လၩ့ဆ့ၭဆ့ဧၪ. တၭအနီၪစံၭဆၧၫ့, ယမွဲယူၭ,- တၭ အဝ့ၫစံၭ, ဂဲၫဆိၬဘူၭလၧယၧၩတၭ, ယမိအၪ့ယဖိၪခွၫ အဆၧဖိၪဆၧဎါ အမံၩ့နီၪ. ဘဲၫၥိၭ ယမိဆိၪဂ့ၩနၧၩ လီၫ. မွဲအဆိၬဘူၭ လၧအအီၪတၭ, အဆၧအၪ့ဝ့ၫ",
			"26": "<sup>26</sup> လီၫ.- အဝ့ၫဂဲၫဆိၬန့စဘံၭထံၫတၭ, အဆၧအီၩဝ့ၫလီၫ. တၭအဖါစအံစၭစံၭအဝ့ၫ, ၥုၭဘူၭလါနၥၭလၧယအီၪ",
			"27": "<sup>27</sup> တၭအဲၪဂါယၧၩဆံၭ. ယဖိၪခွၫဧ့,- တၭအဝ့ၫဒၪၥုၭ ဘူၭအၥၭ လၧအအီၪတၭ အဲၪဂါဝ့ၫလီၫ. မွဲအနၧၫ့ဝ့ၫ အကီၩ့အၥိၭအဆၧနၧၫ့, ဆိၪဂ့ၩဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယိ ခွါ, ယဖိၪခွၫအနၧၫ့မၧၫ့ယီၩ မွဲဘဲၫဂၪ့ခိၪလဝၩ့လၧယ",
			"28": "<sup>28</sup> ဟိဝၩဆိၪဂ့ၩဝ့ၫ အနၧၫ့မၧၫ့အၥိၭနီၪလီၫ.- တၭမွဲယွၩ ဖ့ၪလၫ့နၧၩ လၧမူၭခိၪအဆၩ့ထံၫ, ဒဲဂၪ့ခိၪအၥိၪ, ဒဲဘုၪ",
			"29": "<sup>29</sup> ၥံၪဂူၫၥံၪ, ဒဲစဘံၭထံၫစဘံၭနီၫ့အၪလ့ၬဆံၭ.- မွဲၦခမျၧး လဖၪမၩနဆၧတၭ, ၦအၪဆၨၩလဖၪ ကူၭလၩ့အၥၭ လၧနမ့ၬယၫဆံၭ. မွဲနကဲၪထၪ့နထၧၫ့ဖုဝဲ လဖၪအက ဆါ, ဒဲနမိအဖိၪခွၫလဖၪ ကူၭလၩ့အၥၭ လၧနမ့ၬယၫ ဆံၭ. ၦလၧအဆိၪအၧၩ့နၧၩနီၪ, မွဲအဘၪဆၧဆိၪအၧၩ့ ဆံၭ. ဒဲၦလၧအဆိၪဂ့ၩနၧၩနီၪ, မွဲအဘၪဆၧဆိၪဂ့ၩ ဆံၭ.",
			"30": "<sup>30</sup> ထီးစအံစၭဆိၪဂ့ၩ စယၫကူၭဂီၩ့တၭ, စယၫကူၭစဲၪ့ ခွံၬလၧအဖါစအံစၭအအီၪဂီၩ့နီၪ, ဆၧမၩအၥၭလၧ အဝဲစအံစီၫ ဂဲၫထဲၩ့ဝ့ၫ လၧအလ့ၩခိၭခၭဆၧလီၫ.",
			"31": "<sup>31</sup> တၭအဝ့ၫလဂၩနီၪ မၩဆၧအၪ့လၧအအွံၪဆ့တၭ, ဂဲၫ ထဲၩ့ဆိၬဝ့ၫလၧ အဖါအအီၪတၭ, စံၭအဖါနီၪ,မွဲယဖါ ဂဲထုၪ့တၭ, အၪ့အဖိၪခွၫအဆၧဖိၪ ဆၧဎါအမံၩ့ဘဲၫၥိၭ",
			"32": "<sup>32</sup> နမိဆိၪဂ့ၩယၧၩဆံၭ. တၭအဖါစအံစၭစံၭအဝ့ၫ, နမွဲ ပလၫလဂၩလဲၪ. တၭအဝ့ၫစံၭ, ယမွဲနဖိၪခွၫ,နဖိၪဝဲၡါ,",
			"33": "<sup>33</sup> စအံစီၫလီၫ.- စအံစၭဝၭထိၬဝ့ၫနၭနၭလ့ၬတၭ, စံၭဝ့ၫ, မွဲပလၫလဂၩလဲၪး ၦလၧအခိၭခၭန့ ဆၧဖိၪဆၧဎါအ မံၩ့တၭ, ဂဲၫထဲၩ့ဆိၬလၧယအီၪ, လၧနလချႃၭဂဲၫဒံၭ ဘၪနီၪ,ယအၪ့ယူၭဆၧ ထီးအလူၬတၭ, ယဆိၪဂ့ၩယူၭ အဝ့ၫလဂၩနီၪ, မွဲအအီၪခီၫခီၫလဲၪ. မွဲတီၩအမိဘၪဆၧ",
			"34": "<sup>34</sup> ဆိၪဂ့ၩလီၫ.- ထီးစအံစီၫနါဂၧၫ့ အဖါအဆၧချဲၩ့နီၪ, ကိၭၡၭထၪ့ဖၭဒိၪ နၭနၭလ့ၬတၭ, စံၭအဖါ, ဆိၪဂ့ၩ",
			"35": "<sup>35</sup> ယၧၩဆ့ဆံၭ,ယဖါဧ့,- အဝ့ၫနီၪစံၭ, နဖုဂဲၫနီၪ,အၪ့လီၫ",
			"36": "<sup>36</sup> န့ဆၧတၭ, မၩန့ခွံၬယူၭနဆၧဆိၪဂ့ၩယူၭ.- အဆၧစံၭ ဝ့ၫဒၪ, အဝ့ၫအၪ့လီၫန့ယၧၩ နံၫဘျၩ့ယီၩတၭ, ဆၧအ မံၩ့စယၫကူၭနီၪမွဲအ့ၬဧၪ. မွဲအမၩန့ခွံၬယဝဲၡါအလး တၭ,ယိခွါ, ဘိၩ့နဲၪ့ယီၩ, မၩန့ခွံၬဒီၭ အဆၧဆိၪဂ့ၩ ယူၭလီၫ. မွဲနလအီၪက့ၪလၩ့ထးလၧၩ့ဘၪ ဆၧဆိၪဂ့ၩ လမံၩ့မံၩ့လၧယဂးဧၪ.",
			"37": "<sup>37</sup> တၭစအံစၭစံၭဆၧၫ့ဆၧတၭ, စံၭစအံစီၫ, ယိခွါ, ယအီၪက့ၪအဝ့ၫ လၧနကဆါ ဒဲအထၧၫ့ဖုဝဲထီးအလူၬ လဖၪနီၪ, ယဖ့ၪလၫ့လၧအဎီးအၡၩတၭ, ယဒုၭအီၪဂုး ခၧၫ့ဝ့ၫလၧဘုၪၥံၪဂူၫၥံၪ, ဒဲစဘံၭထံၫလီၫ. တၭဘိၩ့နဲၪ့ ယီၩ,ယမိမၩလၧနဂး ဆၧနီၪလမံၩ့လဲၪ. ယဖိၪခွၫဧ့.",
			"38": "<sup>38</sup> တၭစအံစီၫစံၭအဖါ, နအီၪလၧဆၧဆိၪဂ့ၩန့ၫလမံၩ့ လီၫဧၪ, ယဖါဧ့. ဆိၪဂ့ၩယၧၩ, ယၧၩဆ့ဆံၭ, ယဖါ ဧ့,တၭစအံစီၫ ထုၭထၪ့အလူတၭ, အမ့ၬထံၫလၩ့လီၫ.",
			"39": "<sup>39</sup> အဖါစအံစၭ စံၭဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, ယိခွါ, နအီၪအလး မိအီၪလၧဂၪ့ခိၪအၥိၪ, ဒဲမူၭခိၪလၧထၭ",
			"40": "<sup>40</sup> လခီၫအဆၩ့ထံၫနီၪလီၫ.- တၭနမိမၧၫ့လၧနနၭ, ဒဲနမိ မၩနဖုအဆၧ, ထီးနစဲၪ့ဝံၩ့ဝၩ့ဒၪဆၧတၭ, ဆၧမိမၩအ ၥၭလၧနမိမၩ ခါခွံၬအနိၪယိၭဘီၩ့ လၧနခိၬလီၫ.",
			"41": "<sup>41</sup> တၭစအံစီၫၥၭဂဲၫ့စယၫကူၭ လၧဆၧဆိၪဂ့ၩလၧအ ဖါဆိၪဂ့ၩဝ့ၫအကၠီၩ့လီၫ. တၭစအံစီၫ စံၭလၧအၥၭခံ ဖၧၩ့,မုနံၩလဖၪ လၧပဂၪ့ကိၭ လၧပဖါအကၠီၩ့နီၪအီၪ ဘူၭဆ့ယူၭး ထီးနီၪလဖၧၫ့တၭ ယမိမၩၥံၫယဖုစယၫ ကူၭလီၫ.",
			"42": "<sup>42</sup> တၭအဖိၪခွၫဝဲၡါအဆၧချဲၩ့နီၪ, ၦလီၩဘၪနးရဘ့ၭ ကၫလီၫ. အဝ့ၫဒၪအၪ့မၧၫ့ ၦလ့ၩကိၭန့အဖိၪဒၪဘၨၩ စယၫကူၭတၭ, စံၭဝ့ၫ,ယိခွါ, နဝဲစအံစီၫစ့ၩရၫ့တီၩန့",
			"43": "<sup>43</sup> အၥၭလၧနဂဲး, လၧအမိမၩၥံၫနၧၩလီၫ.- တၭဘိၩ့နဲၪ့ ယီၩ,ယဖိၪခွၫဧ့, ခိၭနၪယလူဆံၭ. ဂဲထုၪ့တၭ,စဲၪ့ထီၩ့ လၧယထၧၫ့ဖုဝဲခွၫ စလၫဘၫ့အအီၪ, လၧဟၫရၫ့အ",
			"44": "<sup>44</sup> ဖၧၩ့,- တၭအီၪလၧအဝ့ၫဒၪအၥိၭ မုနံၩလနၩ့နၩ့, ထီး နဝဲအၥၭခဲၩထၪ့နီၪ မိကၠၪခွံၬအၥၭ, ထီးနဝဲအၥၭထၪ့",
			"45": "<sup>45</sup> မိကၠၪခွံၬအၥၭ လၧနအီၪ,- ဒဲမိၥၭနၪ့ဝ့ၫ လၧဆၧလၧ နမၩအဝ့ၫနီၪဆံၭ. တၭယမိအၪ့မၧၫ့ ၦလ့ၩလၧဆၧအ လးနီၪဂဲၫထဲၩ့ၥိၫ့နၧၩလီၫ. နၥံၪမိလၩ့မါဒၪခွံၬယၧၩ နံၫဂၩလူၬလနံၩဎးနီၪ, မွဲဘၪလဲၪ.",
			"46": "<sup>46</sup> တၭနးရဘ့ၭကၫစံၭစအံစၭ, ဆၧပွံၭယၥၭလၧယ ၥၭမၧၫ့အကၠီၩ့ လၧၦဟ့ၥၭဖိၪအဖိၪမုၪ အခိၪအကၠီၩ့လီၫ. စယၫကူၭအ့ၪန့ အမၫလၧၦဟ့ၥၭဖိၪအဖိၪမုၪ, ၦဘဲၫ ယီၩၥိၭ, ၦခးဖိၪယီၩတၭ, ယၥၭမၧၫ့ယီၩ, မွဲအအိၭနီၪလဲၪ."
		},
		"28": {
			"1": "<sup>1</sup> စအံစၭကိၭန့စယၫကူၭနီၪ, ဆိၪဂ့ၩဝ့ၫတၭ,မၪလူၬ ဆၧ,စံၭအဝ့ၫ, ထီးမၩန့နမၫ လၧၦကၫနအၫ့ဖိၪအဖိၪ",
			"2": "<sup>2</sup> မုၪလဂ့ၩ.- ဂဲထုၪ့လ့ၩလၧခးပၫဒၫ့အၫရၫ့, လၧနမိအဖါ စဘၥူၫအ့လၭအဂံၪ့ဖၧၩ့တၭ, န့နမၫလၧနမိအထၧၫ့ဖု",
			"3": "<sup>3</sup> ဝဲခွၫစလၫဘၫ့ အဖိၪမုၪအကျၩထီးနီၪဆံၭ.- ယွၩလၧ အၥ့ၪဆၧလူၬနီၪ, မွဲအဆိၪဂ့ၩနၧၩ, ဒဲဒုၭၥၪထၪ့နၧၩ, ဒဲမၩအၪ့ထၪ့နၧၩ, ဘဲၫၥိၭနမိကဲၪထၪ့ လၧၦအဆၨၩ",
			"4": "<sup>4</sup> လဖၪအီၪကီၪ့လဒီၪ့, ဒဲဖ့ၪလၫ့ဆၧဆိၪဂ့ၩ ဘၪဆဲၫ့လၧ စအၫဘြဟၫ့လၧနၧၩ, ဒဲနချံၫနၥၪလၧနၥိၭဆ့, ဘဲၫၥိၭ နမိန့ၥၫခးလၧနအီၪမွံၩ လၧအဖၧၩ့ လၧယွၩဖ့ၪလၫ့",
			"5": "<sup>5</sup> စအၫဘြဟၫ့နီၪလီၫ.- စအံစၭအၪ့မၧၫ့စယၫကူၭလ့ၩ ဆၧတၭ, အဝ့ၫဒၪလ့ၩစိၩဝ့ၫ လၧပၫဒၫ့အၫရၫ့,လၧၦအၫ ရၫ့ဖိၪစယၫကူၭဒဲစအံစီၫအမိ နးရဘ့ၭကၫအထၧၫ့ဖုဝဲ စဘၥူၫအ့လၭအဖိၪခွၫ စလၫဘၫ့အအီၪနီၪလီၫ.",
			"6": "<sup>6</sup> စအံစီၫဒၪဘၪဝ့ၫ လၧစအံစၭဆိၪဂ့ၩစယၫကူၭနီၪ, အၪ့မၧၫ့အလ့ၩ လၧပၫဒၫ့အၫရၫ့, လၧအမိန့မၫထီးနီၪ တၭ,ဆိၪဂ့ၩဝ့ၫအဘိၩ့ဘၭနီၪ မၪလူၬဝ့ၫတၭ, စံၭဝ့ၫ ဒၪ,ထီးမၩန့နမၫ လၧၦကၫနအၫ့ဖိၪ အဖိၪမုၪလဂ့ၩ",
			"7": "<sup>7</sup> နီၪ,- စယၫကူၭ ခိၭနၪအမိအဖါအလူတၭ, လ့ၩဝ့ၫ",
			"8": "<sup>8</sup> လၧပၫဒၫ့အၫရၫ့လီၫ.- တၭစအံစီၫဒၪဘၪ လၧၦကၫ နအၫ့ဖိၪအဖိၪမုၪ လဘၪဘၪအဖါ စအံစၭအၥၭနီၪ,",
			"9": "<sup>9</sup> စအံစီၫလ့ၩလၧစအံၡမၫအ့လၭ အအီၪတၭ, မၩန့အၪ ထၪ့အမၫ လၧအအီၪဝဲၩလဖၪ လၧစအၫဘြဟၫ့အဖိၪ ခွၫစအံၡမၫအ့လၭအဖိၪမုၪ, စနဘ့ယီၭ အထၧၫ့ဖုဝဲ မုၪ,နးမဟၫလၫလီၫ.",
			"10": "<sup>10</sup> စယၫကူၭစဲၪ့ထၪ့ခွံၬ လၧဘံအၧၫၡံၫဘၫတၭ, လ့ၩ",
			"11": "<sup>11</sup> စိၩဝ့ၫလၧဟၫရၫ့လီၫ.- ဘၪလၧဆၧအလးလစီၪ့တၭ, အီၪဝ့ၫထီးနီၪၥၫ့နၩချီၩ့လီၫ. အဂဲးဘဲၫယီၩမုလၩ့နုၬဝ့ၫ ယူၭ, မၩန့လိးလဖျိၪ့ လၧအလးလစီၪ့နီၪတၭ, မၩအ ခိၪခုၪ့တၭ, မံၫနၩ့လၧဆၧအလး လစီၪ့နီၪလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫနီၪမံၫမးဆၧတၭ, ယိခွါ, ဎၫ့လဘီၩ့အီၪဆၧၫ့ ထုၪ့လၧဂၪ့ခိၪချိၫ့တၭ, အခံၫထိၭထၪ့ဘၭ လၧမူၭခိၪ လီၫ.တၭယိခွါ, ယွၩအၥီၫ့လဖၪ လ့ၩထၪ့ဂဲၫထဲၩ့လၩ့",
			"13": "<sup>13</sup> လၧအလီၩ့လီၫ.- ယိခွါ, ယဟိဝၩအီၪဆၧၫ့ထုၪ့လၧ အဖၫ့ခိၪနီၪ, စံၭဝ့ၫဒၪ, ယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩ, နဖါစအၫဘြဟၫ့အယွၩ, ဒဲစအံစၭအယွၩလီၫ. ခးလၧ နမံၫလၧအဖၧၩ့လဘံၪ့ယီၩ, ယမိဖ့ၪလၫ့နၧၩဒဲနချံၫနၥၪ",
			"14": "<sup>14</sup> လီၫ.- နချံၫနၥၪလဖၪနီၪ မိမၩအၥၭဘဲၫဂၪ့ခိၪမုၬအၥိၭ နီၪတၭ, နမိလၩ့မုလၩ့ဖၭလၧမုနုၬ, ဒဲလၧမုထၪ့,ဒဲလၧ မုဖၩ, ဒဲလၧမုခံၫ့တၭ, ကယဲၦဂၪ့ခိၪအဂံၪ့ဒီၪ့လဖၪမိ ဘၪဆၧဆိၪဂ့ၩလၧနၧၩ, ဒဲလၧနချံၫနၥၪအဖၧၩ့ထီးအ",
			"15": "<sup>15</sup> လူၬလီၫ.- တၭယိခွါ, ယအီၪလၧနၥိၭ, ထီးဒၪနလ့ၩ ဆၧလစီၪ့လါလါနီၪ, ယမိယိထဲၩ့ခွါထဲၩ့နၧၩတၭ,ယ မိဒုၭဂဲၫထဲၩ့ထဲၩ့နၧၩ လၧခးလဘံၪ့ယီၩလီၫ. အဂဲး ဘဲၫယီၩဆၧလၧယလီၩဘၪနၧၩနီၪ, ထီးယအ့ၪလမၩ ဂီၩ့ဒံၭဘၪတၭ, ယစဲၪ့ဒၪနၧၩနးစီၪ့အ့ၬ.",
			"16": "<sup>16</sup> စယၫကူၭနၪ့ထၪ့အၥၭတၭ, စံၭဝ့ၫဒၪ, မွဲမၬယဟိ ဝၩအီၪဝ့ၫလၧဆၧအလး လစီၪ့ယီၩတၭ, ယၥ့ၪယၫ",
			"17": "<sup>17</sup> ဘၪယဝ့ၫဆ့အ့ၬ.- ၥၭမဲၪဆၧတၭ, စံၭဝ့ၫဒၪ, ဆၧအ လးလစီၪ့ယီၩ, မွဲဆၧၥၭမဲၪအလးဆံၭဒိၪလဲၪၬ အယီၩ လမွဲဘၪဆၧဂူၫဂၩလမံၩ့နီၪ, မွဲယွၩအဂံၪ့တၭ, အယီၩ",
			"18": "<sup>18</sup> မွဲမူၭခိၪအတရၫ့လီၫ.- ဆၧဖၩ့ထၪ့နီၪ စယၫကူၭဂဲထုၪ့ ဂီၩဂီၩတၭ, မၩန့လိးလဖျိၪ့ လၧအမၩခိၪခုၪ့နီၪ, ဘဲၫ ၥိၭအမိကဲၪထၪ့ ဆၧအထုၪ့နီၪ ဘိၭဆၧၫ့ထုၪ့ဝ့ၫတၭ,",
			"19": "<sup>19</sup> လူၫလၩ့ၥိၪလၧအလီၩ့လီၫ.- ဆၧအလးလစီၪ့နီၪကိၭ ဝ့ၫအမံၩ့ ဘ့ၫၥလၭလီၫ. မွဲလါနၫ့တၭ, ဒိၩ့လဖျိၪ့နီၪ အမံၩ့လၧအခၪ့ထံၭ, မွဲလုဇၭလီၫ.",
			"20": "<sup>20</sup> စယၫကူၭဆိၪလၩ့အၥၭတၭ, စံၭဝ့ၫဒၪ,ယွၩအ့ၪအီၪ လၧယၥိၭ, ဒဲယိထဲၩ့ခွါထဲၩ့ယၧၩ လၧယဖၧၩ့ၥၭယ ဖိၬလဘီၩ့ယီၩတၭ, အ့ၪဖ့ၪလၫ့ယၧၩ ဆၧအၪ့လၧယ",
			"21": "<sup>21</sup> မိအၪ့, ဒဲဆၧကီၩ့ဆၧၥိၭ, လၧယမိကီၩ့နီၪ,- ဒဲယဂဲၫ ထဲၩ့ထဲၩ့မုၬမုၬ ထီၩ့လၧယဖါအဂံၪ့ဖၧၩ့တၭ, ထီးနီၪ",
			"22": "<sup>22</sup> လဖၧၫ့ယဟိဝၩ မိကဲၪထၪ့ယယွၩလီၫ. တၭလိးလဖျိၪ့ လၧယမၩထၪ့ထုၪ့လထုၪ့ယီၩ, မိကဲၪထၪ့ယွၩအဂံၪ့, ဒဲကယဲဆၧလၧနဖ့ၪလၫ့ယၧၩ လမံၩ့လါလါနီၪ, ယမိ ဖ့ၪလၫ့နၧၩဆံၫပိၩ့လပိၩ့တၡါဆ့လီၫ."
		},
		"29": {
			"1": "<sup>1</sup> စယၫကူၭခၫထၪ့အခၪ့တၭ, လ့ၩထီၩ့လၧၦမုထၪ့ဖိၪ",
			"2": "<sup>2</sup> အခးဖၧၩ့လီၫ.- အဝ့ၫနီၪယိဆၧတၭ, ယိခွါ ထံၫဖၧၩ့ အီၪဝ့ၫလၧဂၪ့ခိၪအဝၩ့ဖၧၩ့နီၪလဖၧၩ့တၭ, ယိခွါ,ထီး နီၪၥိၪဒဲဘ့ၪၥၧၫ့ဒီၪ့ခိၬလၩ့ လၧအနဲၩ့ထံၭလီၫ. အဂဲး ဘဲၫယီၩၦဒုၭအီၩ ၥိၪဒဲဘ့ၪအထံၫ လၧထံၫဖၧၩ့နီၪလီၫ. တၭလိးဖၭဒိၪလဖျိၪ့ အီၪလၧထံၫဖၧၩ့အခိၪထိၭလီၫ.",
			"3": "<sup>3</sup> ၥိၪဒဲဘ့ၪအီၪကိၩ့အီၪကီၪ့ ထီးနီၪထီးအလူၬတၭ, ၦချံး ခွံၬလိးနီၪလၧထံၫဖၧၩ့ အခိၪထိၭတၭ, ဒုၭအီၩၥိၪဒဲဘ့ၪ အထံၫဂီၩ့, ချံးထဲၩ့ဒီၭလိးလၧအလးဒၪဝ့ၫ လၧထံၫဖၧၩ့",
			"4": "<sup>4</sup> အခိၪထိၭလီၫ.- တၭစယၫကူၭစံၭအဝ့ၫၥံၪ, ယထၧၫ့ ဖုဝဲၥံၪဧ့, နၥံၪဂဲၫအထံၭခီၫခီၫလဲၪ. တၭအဝ့ၫၥံၪစံၭ,",
			"5": "<sup>5</sup> လၧဟၫရၫ့နီၪလီၫ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, စနၫဟီၫ အဖိၪခွၫစလၫဘၫ့နီၪ, မွဲနၥံၪၥ့ၪယၫဆ့ဧၪ. တၭအဝ့ၫ",
			"6": "<sup>6</sup> ၥံၪစံၭ,ပၥ့ၪယၫမၬကၨ.- တၭအဝ့ၫနီၪစံၭမွဲအအီၪမုၬ ဆ့ဧၪ. တၭအဝ့ၫၥံၪစံၭ, အီၪမုၬတၭ,ယိခွါ, အဖိၪမုၪ",
			"7": "<sup>7</sup> နးရၫခ့လၭဂဲၫဝ့ၫ လၧၥိၪဒဲဘ့ၪနီၪလီၫ.- အဝ့ၫဒၪစံၭ, ယိခွါ,မုအီၪဒံၭဖၭထီၫ, ဒဲအဆၧၫ့အထီလၧၦဒုၭအီၪ ကီၪ့ဆၧဖိၪဆၧဎါအဒိၩ့ လဘၪဒံၭဘၪတၭ, ဒုၭအီၩ",
			"8": "<sup>8</sup> ၥိၪဒဲဘ့ၪအထံၫတၭ, လ့ၩဒုၭအၪ့အဆၪဆံၭ.- အဝ့ၫ ၥံၪစံၭ, ကယဲၥိၪဒဲဘ့ၪထီးအလူၬ အဒီၪ့ၥံၪလချႃၭအီၪ ကီၪ့ဒံၭဘၪတၭ, အဝ့ၫၥံၪလချႃၭချံးခွံၬဒံၭဘၪလိးလၧ ထံၫဖၧၩ့အခိၪထိၭတၭ, ပမၩၥ့ၪအ့ၬ. ထီးနီၪလဖၧၫ့ ပဒုၭအီၩၥိၪဒဲ ဘ့ၪအထံၫလီၫ.",
			"9": "<sup>9</sup> တၭအဝ့ၫချဲၩ့ဆၧအဘိၩ့ဘၭနီၪ, နးရၫခ့လၭဂဲၫဝ့ၫ လၧအဖါအၥိၪဒဲဘ့ၪလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪယိ",
			"10": "<sup>10</sup> ဝ့ၫလီၫ.- ထီးစယၫကူၭဒၪဘၪ အမိအထၧၫ့ဖုဝဲခွၫစလၫ ဘၫ့အဖိၪမုၪ နးရၫခ့လၭ ဒဲအမိအထၧၫ့ဖုဝဲခွၫ စလၫ ဘၫ့အၥိၪဒဲဘ့ၪတၭ, ဆၧမၩအၥၭ လၧစယၫကူၭၥုၭ ဘူၭအၥၭတၭ, ချံးခွံၬလိးလၧထံၫဖၧၩ့ အခိၪထိၭတၭ, ဒုၭအီၩအမိ အထၧၫ့ဖုဝဲခွၫ စလၫဘၫ့အၥိၪ ဒဲဘ့ၪအ",
			"11": "<sup>11</sup> ထံၫနီၪလီၫ.- စယၫကူၭအဲၪဂါ နးရၫခ့လၭတၭ, ထုၭ",
			"12": "<sup>12</sup> ထၪ့အလူအမ့ၬထံၫလၩ့ဝ့ၫဒၪလီၫ.- တၭစယၫကူၭလီၩ ဘၪနးရၫခ့လၭ လၧအမွဲၦထၧၫ့ဖုဝဲလၧအဖါတၭ,လၧ အမွဲနးရဘ့ၭကၫ အဖိၪခွၫနီၪလီၫ. အဝ့ၫနီၪစဲၪ့တလဲး",
			"13": "<sup>13</sup> တၭလီၩဘၪအဖါလီၫ.- ထီးစလၫဘၫ့နါဂၧၫ့အထၧၫ့ ဖုဝဲမုၪအဖိၪခွၫ စယၫကူၭအပရၧၫ့တၭ, ဆၧမၩအၥၭ လၧအစဲၪ့တလဲးအၪ့ဂၬဝ့ၫတၭ, ဖိၭဝ့ၫဒဲအဲၪဂါဝ့ၫတၭ ၥိၫ့အဝ့ၫလၧအဂံၪ့လီၫ. တၭမွဲအလီၩဘၪ စလၫဘၫ့",
			"14": "<sup>14</sup> လၧဆၧလဖၪနီၪ ထီးအလူၬလီၫ.- တၭစလၫဘၫ့စံၭ အဝ့ၫ,မွဲမၬနမွဲယဎွံၪဒဲယယၪလီၫ. တၭအီၪဝ့ၫလၧအ ၥိၭဎွ့ၩထၪ့လၩလဘံၪ့လီၫ.",
			"15": "<sup>15</sup> စလၫဘၫ့စံၭစယၫကူၭ, နမွဲယထၧၫ့ဖုဝဲတၭ,နဂ့ၩ မၩယဆၧပျီၩပျီၩဆ့ဧၪ. နလံၩ့နလဲၫ, မွဲဆံၭအၪလဲၪ",
			"16": "<sup>16</sup> နီၪ,လီၩဘၪယၧၩဆံၭ.- တၭစလၫဘၫ့အဖိၪမုၪအီၪ နံၫဂၩလီၫ. အဒိၪလဂၩအမံၩ့ မွဲနးလံအၫတၭ, အဆံၭ",
			"17": "<sup>17</sup> လဂၩအမံၩ့မွဲနးရၫခ့လၭလီၫ.- တၭနးလံအၫနီၪအမ့ၬ ဆၫဝ့ၫလီၫ. အ့ၪမွဲနးရၫခ့လၭလဂၩနီၪ, အီၪလၧအဎံၫ",
			"18": "<sup>18</sup> အလၩ, ဒဲအခံးဂ့ၩအဂၩ့ဘၪလီၫ.- စယၫကူၭအဲၪနး ရၫခ့လၭတၭ, စံၭဝ့ၫဒၪ, ယမိမၩနဆၧနွ့ၫနံၪ့လၧနးရၫ",
			"19": "<sup>19</sup> ခ့လၭနဖိၪမုၪ အဆံၭလဂၩအဂးလီၫ.- တၭစလၫဘၫ့ စံၭဝ့ၫဒၪ, ယဖ့ၪလၫ့နၧၩနီၪ, မွဲအဂ့ၩနဲၪ့ယဖ့ၪလၫ့လၧ",
			"20": "<sup>20</sup> ၦဂူၫဂၩဒံၭလီၫ. အီၪလၧယၥိၭဆံၭ.- စယၫကူၭမၩ ဆၧနွ့ၫနံၪ့လၧနးရၫခ့လၭအဂးတၭ, အီၪဝ့ၫလၧအမ့ၬ ယၫဘဲၫၡၩနံၩၡၩၥၫ့အၥိၭ, လၧအအဲၪဝ့ၫအကၠီၩ့လီၫ.",
			"21": "<sup>21</sup> တၭစယၫကူၭစံၭ စလၫဘၫ့နီၪ, ဖ့ၪလၫ့ယမၫဘီၪး အဂဲးဘဲၫယီၩ ယမုနံၩလဖၪ လၧၫ့ထၪ့ဎွ့ၩထၪ့ယူၭတၭ, ယမိလ့ၩနုၬလၧအအီၪလီၫ.",
			"22": "<sup>22</sup> စလၫဘၫ့ဒုၭအီၪကိၩ့အီၪကီၪ့ ၦၡၩအီၪဝ့ၫလၧအ လးလစီၪ့နီၪ ထီးအလူၬတၭ, မၩဆၧအၪ့ ဆၧအီၩ",
			"23": "<sup>23</sup> လီၫ.- တၭဆၧမၩအၥၭလၧမုနၩနီၪ, လၧအမၩန့အဖိၪ မုၪနးလံအၫနီၪ, ၥိၫ့ဝ့ၫလၧအအီၪတၭ, အဝ့ၫလ့ၩနုၬ",
			"24": "<sup>24</sup> လၧအအီၪလီၫ.- တၭစလၫဘၫ့ ဖ့ၪလၫ့အဎီးမုၪနးဇံ လပၫလၧအဖိၪမုၪ နးလံအၫ လၧအဎီးမုၪအဂးလီၫ.",
			"25": "<sup>25</sup> ဆၧမၩအၥၭ လၧဆၧဖၩ့ထၪ့နီၪ, ယိခွါ, မွဲနးလံအၫ တၭ,အဝ့ၫဒၪစံၭစလၫဘၫ့, ဆၧလၧနမၩယၧၩ မွဲဆၧ နီၪလမံၩ့လဲၪ. ယမၩနဆၧလၧနးရၫခ့လၭအဂး လမွဲ",
			"26": "<sup>26</sup> ဘၪဧၪ. တၭမွဲဘၪနီၫ နအၪ့လီၫန့ယၧၩလဲၪ.- တၭ စလၫဘၫ့စံၭဝ့ၫဒၪ, ပဖ့ၪလၫ့ဆိၫ ၦအဆံၭလၧအဝဲၡါ အမ့ၬယၫနီၪ, ဆၧလမၩဘၪလၧအလး လစီၪ့ယီၩလီၫ.",
			"27": "<sup>27</sup> မၩဎွ့ၩထၪ့အဝ့ၫလဂၩနီၪ အဆၧနွ့ၫနံၪ့ဆံၭ. တၭပမိ ဖ့ၪလၫ့အဝ့ၫယီၩ လၧနၧၩဆ့, လၧနမၩဆၧလၧနမိမၩ လၧယဂးနွ့ၫနံၪ့ဒီၭအကၠီၩ့လီၫ.",
			"28": "<sup>28</sup> စယၫကူၭမၩဝ့ၫဘဲၫနီၪတၭ, မၩဎွ့ၩထၪ့အဝ့ၫလဂၩ နီၪအဆၧနွ့ၫတၭ, မွဲအဖ့ၪလၫ့အဝ့ၫ လၧအဖိၪမုၪနးရၫ",
			"29": "<sup>29</sup> ခ့လၭလၧအမၫဆ့လီၫ.- တၭစလၫဘၫ့ဖ့ၪလၫ့အဎီး မုၪနးဘံလဟၫ လၧအဖိၪမုၪနးရၫခ့လၭ အဎီးမုၪအဂး",
			"30": "<sup>30</sup> လီၫ.- အဝ့ၫဒၪလ့ၩနုၬ လၧနးရၫခ့လၭအအီၪဆ့တၭ, အဲၪနးရၫခ့လၭအၪနဲၪ့ နးလံအၫဆ့လီၫ. တၭမၩဒံၭ အဆၧအနံၪ့ဂူၫဂၩ နွ့ၫနံၪ့နီၪလီၫ.",
			"31": "<sup>31</sup> ယဟိဝၩဒၪဘၪဝ့ၫ လၧနးလံအၫဘၪဆၧၥၭဂဲၫ့ဝ့ၫ တၭ,ဝဲထၪ့အဒၧၩ့လးလီၫ. အ့ၪမွဲနးရၫခ့လၭမွဲၦထူၬ",
			"32": "<sup>32</sup> ဖိၪလီၫ.- နးလံအၫဒၧၩ့ထၪ့တၭ, အီၪဖျဲၪန့အဖိၪခွၫ လီၫ. တၭကိၭအမံၩ့စရုဘံၫ့လီၫ. အဂဲးဘဲၫယီၩစံၭဝ့ၫ ဒၪယဟိဝၩ ယိထဲၩ့ယဆၧနၭဆၧၡၪ့လီၫ. အခိးမွဲ",
			"33": "<sup>33</sup> ဘိၩ့နဲၪ့ယီၩ ယဝၩမိအဲၪယၧၩလီၫ.- အဝ့ၫဒၧၩ့ထၪ့ဒီၭ လဖၧၫ့အီၪဖျဲၪန့အဖိၪခွၫတၭ, စံၭဝ့ၫဒၪ,မွဲယဟိဝၩနါ ဂၧၫ့လၧယဘၪဆၧၥၭဂဲၫ့ယၧၩတၭ, ဖ့ၪလၫ့ယၧၩလၧ",
			"34": "<sup>34</sup> အယီၩဆ့လီၫ. တၭကိၭဝ့ၫအမံၩ့စစံမအၧၫ့လီၫ.-အ ဝ့ၫဒၧၩ့ထၪ့ဒီၭလဖၧၫ့, အီၪဖျဲၪန့အဖိၪခွၫတၭ, စံၭဝ့ၫဒၪ, ဘိၩ့နဲၪ့ယီၩလဖၧၫ့ ယဝၩမိၥုၭဘူၭအၥၭ လၧယၧၩလၧ ယအီၪဖျဲၪန့အဖိၪခွၫ ၥၧၫ့ဂၩအကၠီၩ့လီၫ. မၩအၥၭ",
			"35": "<sup>35</sup> ဘဲၫနီၪတၭ,ကိၭဝ့ၫအမံၩ့ စလံဝဲၫလီၫ.- အဝ့ၫဒၧၩ့ထၪ့ ဒီၭလဖၧၫ့ အီၪဖျဲၪန့အဖိၪခွၫတၭ, စံၭဝ့ၫဒၪ, ဘိၩ့နဲၪ့ ယီၩယမိစံၭထၪ့အၪ့အူၭ ယဟိဝၩလီၫ. မၩအၥၭဘဲၫ နီၪတၭ, ကိၭဝ့ၫအမံၩ့ စယုဒၫလီၫ. တၭအီၪဖျဲၪန့ဆၧ နီၪအီၪပထုၬဝ့ၫလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> နးရၫခ့လၭ ဒၪဘၪဝ့ၫ လၧအလအီၪဖျဲၪန့ဘၪအဖိၪ လၧစယၫကူၭအဂးတၭ, နးရၫခ့လၭနီၪၥၭခ့ၬအထၧၫ့ ဖုဝဲတၭ, စံၭစယၫကူၭ, ဖ့ၪလၫ့ယၧၩ လၧဖိၪလဖၪဆံၭ.",
			"2": "<sup>2</sup> အ့ၪလမွဲဘၪတၭယၥံၫလီၫ.- စယၫကူၭၥၭထၪ့နးရၫခ့ လၭတၭ,စံၭဝ့ၫဒၪ, ယဝ့ၫဒၪယီၩ, မွဲယအီၪလၧယွၩအ လး,လၧအပဒၩ့ထၬဒၧၩ့လး အဆၧၥၪလၧနၧၩဆ့ဧၪ.",
			"3": "<sup>3</sup> တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, ယိခွါ,ယဎီးမုၪ နးဘံလဟၫလ ဂၩယီၩ, လ့ၩနုၬလၧအဝ့ၫနီၪအအီၪဆံၭ. မိဘၪအီၪ ဖျဲၪန့လၧယခၪ့လုးခိၪအဖၫ့ခိၪတၭ, ယမိန့ဘၪယဖိၪ",
			"4": "<sup>4</sup> ဆ့လၧအဝ့ၫနီၪလီၫ.- အဆၧဖ့ၪလၫ့ဝ့ၫ လၧအဎီးမုၪနး ဘံလဟၫလၧအမၫအဂးတၭ, စယၫကူၭလ့ၩနုၬလၧ",
			"5": "<sup>5</sup> အအီၪလီၫ.- နးဘံလဟၫနီၪ ဒၧၩ့ထၪ့တၭ, အီၪဖျဲၪန့အ",
			"6": "<sup>6</sup> ဖိၪခွၫလၧစယၫကူၭအဂးလီၫ.- နးရၫခ့လၭစံၭဝ့ၫဒၪ, ယွၩစ့ၩရၫ့ယၧၩတၭ, ခိၭနၪယလူဆ့တၭ, ဖ့ၪလၫ့ယၧၩ လၧယဖိၪခွၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ ကိၭဝ့ၫအမံၩ့",
			"7": "<sup>7</sup> စဒၫ့လီၫ.- နးရၫခ့လၭအဎီးမုၪ နးဘံလဟၫနီၪဒၧၩ့ထၪ့ ဒီၭလဖၧၫ့တၭ, အီၪဖျဲၪန့အဖိၪခွၫ နံၫဂၩလဂၩလၧစယၫ",
			"8": "<sup>8</sup> ကူၭအဂးလီၫ.- တၭနးရၫခ့လၭစံၭဝ့ၫဒၪ, ယနီၫလိၬ ယၥၭလၧယထၧၫ့ဖုဝဲမုၪ လၧယွၩအဆၧနီၫတၭ, ယ မၩနၧၩ့ဆၧလီၫ. တၭကိၭဝ့ၫအမံၩ့ စနၭၥလဲၫလီၫ.",
			"9": "<sup>9</sup> နးလံအၫနီၪဒၪဘၪဝ့ၫ လၧအအီၪဖျဲၪန့ဆၧနီၪ အီၪပ ထုၬဝ့ၫတၭ, မၩန့အဎီးမုၪ နးဇံလဖၫတၭ, ဖ့ၪလၫ့အဝ့ၫ",
			"10": "<sup>10</sup> လၧစယၫကူၭအမၫအဂးလီၫ.- တၭနးလံအၫအဎီး မုၪနးဇံလဖၫနီၪ, အီၪဖျဲၪန့အဖိၪခွၫ လၧစယၫကူၭအဂး",
			"11": "<sup>11</sup> လီၫ.- တၭနးလံအၫစံၭဝ့ၫဒၪ, ယလၩဂ့ၩတၭ, ကိၭအ",
			"12": "<sup>12</sup> မံၩ့လၧစဂၭလီၫ.- တၭနးလံအၫအဎီးမုၪ နးဇံလဖၫအီၪ ဖျဲၪန့အဖိၪခွၫ လၧစယၫကူၭအဂး နံၩဂၩလဂၩနီၪလီၫ.",
			"13": "<sup>13</sup> တၭနးလံအၫစံၭဝ့ၫဒၪ, မုၬယၥၭဖီၬ အဂဲးဘဲၫယီၩၦအ ဖိၪမုၪလဖၪမိကိၭယၧၩ လၧၦဘၪဆၧအမုၬလီၫ. တၭ ကိၭဝ့ၫအမံၩ့ လၧစအၭၡၧၫလီၫ.",
			"14": "<sup>14</sup> ကူၭဘုၪကၠိၩ့ အမုနံၩလဖၪနီၪ, စရုဘံၫ့ လ့ၩဆၧ တၭ,ဒၪန့ဒူဒၭၥၪ လၧဂၪ့ခိၪအဝၩ့ဖၧၩ့တၭ ဂဲၫထဲၩ့ဆိၬ ဝ့ၫလၧအမိနးလံအၫအအီၪလီၫ.- တၭနးရၫခ့လၭစံၭ နးလံအၫဖ့ၪလၫ့လါယၧၩ လၧနဖိၪခွၫအဒူဒၭၥၪနီၪလ",
			"15": "<sup>15</sup> နၩ့ဆံၭ.- အဝ့ၫဒၪစံၭအဝ့ၫ, နမၩန့ခွံၬယဝၩနီၪ, မွဲဆၧ အဆံၭဧၪ. တၭနမိမၩန့ခွံၬ ယဖိၪခွၫအဒူဒၭၥၪဆ့ဧၪ. နးရၫခ့လၭစံၭဝ့ၫဒၪ, အခိးမွဲဘဲၫနီၪတၭ, မွဲအမိဘၪမံၫ ဎုၬလၧနၧၩကဲမုနၩယီၩ, လၧနဖိၪခွၫအဒူဒၭၥၪအကၠီၩ့",
			"16": "<sup>16</sup> လီၫ.- လၧမုဂၪလၩ့နီၪ, စယၫကူၭဂဲၫထဲၩ့ လၧဂၪ့ခိၪအ ဝၩ့ဖၧၩ့တၭ, နးလံအၫလ့ၩထၪ့ အၪ့ဂၬအဝ့ၫနီၪ, စံၭဝ့ၫ ဒၪ, နဘၪဂဲၫနုၬ လၧယအီၪလီၫ. အဂဲးဘဲၫယီၩယအၪ့ လံၩ့န့နၧၩ လၧယဖိၪခွၫအဒူဒၭၥၪလီၫ. တၭအဆၧမံၫ ဎုၬအဝ့ၫဒၪ လၧမုနၩနီၪလီၫ.",
			"17": "<sup>17</sup> ယွၩခိၭနၪနးလံအၫအလူတၭ, ဒၧၩ့ထၪ့ဝ့ၫ, အီၪဖျဲၪ",
			"18": "<sup>18</sup> န့အဖိၪခွၫ လၧစယၫကူၭအဂး ယဲဂၩလဂၩလီၫ.-တၭ နးလံအၫစံၭဝ့ၫဒၪ, ယွၩဖ့ၪလၫ့ယၧၩ လၧယလံၩ့ယလဲၫ လၧယဖ့ၪလၫ့ယဎီးမုၪ လၧယဝၩအကၠီၩ့လီၫ. တၭ",
			"19": "<sup>19</sup> ကိၭဝ့ၫအမံၩ့ လၧစအံစခၫလီၫ.- နးလံအၫဒၧၩ့ထၪ့ဒီၭ လဖၧၫ့တၭ, အီၪဖျဲၪန့အဖိၪခွၫ လၧစယၫကူၭအဂး ဎူၫ",
			"20": "<sup>20</sup> ဂၩလဂၩလီၫ.- တၭနးလံအၫစံၭဝ့ၫဒၪ, ယွၩနီၪဖ့ၪလၫ့ ယၧၩလၧဆၧနၩ့ဖၭ ဖ့ၪလၫ့အဂ့ၩလီၫ. ဘိၩ့နဲၪ့ယီၩ, ယဝၩမိအီၪဎုၬလၧယၧၩ လၧယအီၪဖျဲၪန့အဖိၪခွၫ ဎူၫ ဂၩအကၠီၩ့လီၫ. တၭကိၭဝ့ၫအမံၩ့ စဇ့ၭဘလၧၫ့လီၫ.",
			"21": "<sup>21</sup> လၧခဲၫ့ထဲၩ့တၭ အီၪဖျဲၪန့အဖိၪမုၪလဂၩတၭ, ကိၭဝ့ၫ အမံၩ့နးဒံနၫလီၫ.",
			"22": "<sup>22</sup> ယွၩနၪ့ထၪ့ထဲၩ့ နးရၫခ့လၭတၭ, ယွၩခိၭနၪအလူဝဲ",
			"23": "<sup>23</sup> ထၪ့အဒၧၩ့လးနီၪလီၫ.- အဝ့ၫဒၧၩ့ထၪ့တၭ, အီၪဖျဲၪန့ အဖိၪခွၫ,စံၭဝ့ၫဒၪ, ယွၩမၩဖီၩ့ဖျ့ၭယၧၩ လၧဆၧဒုၪဒွ့ၪ",
			"24": "<sup>24</sup> လီၫ.- တၭကိၭဝ့ၫအမံၩ့ လၧစယိၥၭတၭ, စံၭဝ့ၫဒၪ,မွဲ ယဟိဝၩ ဖ့ၪလၫ့ဒံၭယၧၩ လၧဖိၪခွၫအဂူၫဂၩလဂၩ ဒံၭဆံၭ.",
			"25": "<sup>25</sup> နးရၫခ့လၭအီၪဖျဲၪန့စယိၥၭဂီၩ့တၭ, ဆၧမၩအၥၭ လၧစယၫကူၭစံၭစလၫဘၫ့နီၪ, ဖျါခွံၬယၧၩ ဘဲၫၥိၭယ မိထဲၩ့ထဲၩ့လၧယလးဒၪယဝ့ၫ, ဒဲလၧယခးဒၪယဝ့ၫနီၪ",
			"26": "<sup>26</sup> ဆံၭ.- ဖ့ၪလၫ့ယၧၩလၧယမၫၥံၪ, ဒဲယဖိၪၥံၪလၧယမၩ နဆၧအကၠီၩ့တၭ, ဒုၭစဲၪ့ထၪ့ယၧၩဆံၭ. အဂဲးဘဲၫယီၩ နၥ့ၪယၫယဆၧမၩ လၧယမၩလၧနဂးလီၫ.",
			"27": "<sup>27</sup> တၭစလၫဘၫ့စံၭအဝ့ၫ, ယဘၪခိးဘၪတၩလၧနမ့ၬ ယၫး ဘဲၫယဖၭဆၧအၥိၭနီၪ, ယဟိဝၩဆိၪဂ့ၩယၧၩ",
			"28": "<sup>28</sup> လၧနကၠီၩ့လီၫ.- တၭစံၭဝ့ၫဒၪ, လီၩဘၪယၧၩလၧနလံၩ့ နလဲၫဘီၪး တၭယမိဖ့ၪလၫ့ယဝ့ၫလီၫ.",
			"29": "<sup>29</sup> အဝ့ၫနီၪစံၭ,ယမၩနဆၧတၭ, နဆၧဖိၪဆၧဎါအဒိၩ့ အီၪလၧယၧၩ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ နၥ့ၪယၫလီၫ.",
			"30": "<sup>30</sup> အဂဲးဘဲၫယီၩ လၧယလချႃၭအီၪဒံၭဘၪနီၪ နဆၧအီၪ ၡၩခိၬလီၫ. ဘိၩ့နဲၪ့ယီၩအၪထၪ့ယူၭ အၪအၪလ့ၬယူၭ တၭ,ယဟိဝၩဆိၪဂ့ၩနၧၩ လၧယဂဲၫအီၪဝ့ၫအကၠီၩ့ လီၫ.တၭဘိၩ့နဲၪ့ယီၩ, ယမိမၩလၧယဂံၪ့ ဒၪယဝ့ၫအ ဂးအထီဆံၭယံၬလဲၪ.",
			"31": "<sup>31</sup> တၭအဆၧစံၭဝ့ၫဒၪ, ယမိဘၪဖ့ၪလၫ့နၧၩ လၧဆၧ နီၪလမံၩ့လဲၪ. တၭစယၫကူၭစံၭ, နဘၪဖ့ၪလၫ့ ယၧၩ လၧဆၧနးမံၩ့အ့ၬ. နအ့ၪမၩဆၧယီၩ လမံၩ့လၧယဂး",
			"32": "<sup>32</sup> တၭ,ယမိယိ, ဒဲပၧၩ့ဘၪဒီၭနၥိၪဒဲဘ့ၪလီၫ.- ဆၧလၧမု ဆၫလနံၩယီၩ, ယမိလ့ၩလၧနၥိၪဒဲဘ့ၪ ထီးအလူၬအ ကျၩတၭ,မၩန့ထၪ့ခွံၬထီးနီၪ, ကယဲဆၧဖိၪဆၧဎါလၧ အစံၫဖီး,ဒဲကံၪကဲၩ့ထီးအလူၬလဒုၩလါလါ, ဒဲကယဲဆၧ အပၠူၭလၧၥိၪလဖၪအကျၩ လဒုၩလါလါ, ဒဲလၧအစံၫ ဖီး,ဒဲကံၪကဲၩ့ လၧဘ့ၪအကျၩနီၪ, မွဲယလံၩ့ယလဲၫ",
			"33": "<sup>33</sup> လီၫ.- ထီးနဂဲၫလၩ့ဒၪဘၪ ယလံၩ့ယလဲၫတၭ, ယဆၧ တီၩဆၧလီၩ့မိထိးအၥၭ လၧယဂး လၧမုလနံၩကဲခိၬ နီၪလီၫ. ကယဲဆၧလၧအလကံၪကဲၩ့ဘၪ ဒဲလကံၪကဲၩ့ စံၫဖီးဘၪ လၧဘ့ၪအကျၩ, ဒဲလပၠူၭဘၪလၧၥိၪအကျၩ နီၪ,မိကဲၪထၪ့ဆၧ လၧယအၪ့ဂူၪန့နီၪလီၫ.",
			"34": "<sup>34</sup> စလၫဘၫ့စံၭဝ့ၫဒၪ, ယိခွါ, မွဲဆၧမၩအၥၭဘဲၫနလူ အၥိၭနီၪဆံၭ.",
			"35": "<sup>35</sup> တၭဆၧလၧမုနံၩနီၪ အဝ့ၫမၩန့ထၪ့ခွံၬဘ့ၪအဖၫလၧ အကံၪကဲၩ့ဒဲအဘွၩ, ဒဲကံၪစံၫဖီး, ဒဲကယဲဘ့ၪမိလၧ အကံၪကဲၩ့,ဒဲစံၫဖီး, ဒဲကယဲဆၧအဘွၩ အီၪလၧအလီၩ့, ဒဲကယဲဆၧလၧအပၠူၭ လၧၥိၪအကျၩ ထီးအလူၬတၭ,",
			"36": "<sup>36</sup> ဖ့ၪလၫ့ဝ့ၫလၧအဖိၪခွၫ လဖၪအစူၪဖၧၩ့လီၫ.- တၭအ ဝ့ၫဒၪအီၪက့ၪၥၧၫ့ၥၫ့ဖၧၩ့ၥၭ လၧအနၫ့ဆါဒၪဝ့ၫ, ဒဲစယၫ ကူၭအဘိၩ့ဆၧၩ့လီၫ. တၭစယၫကူၭယိစလၫဘၫ့အ ၥိၪဒဲဘ့ၪလၧအအီၪ လၩ့ထးလဖၪနီၪလီၫ.",
			"37": "<sup>37</sup> တၭစယၫကူၭ မၩန့နိၪထိၭဘီၩ့ လၧၥံၪ့လံၫဘန့အ ၥံၫ့,ဒဲလၧၥံၪ့လူစၭ, ဒဲလၧဖံစလီၫ့တၭး ကူၭပလူၬဒဲ",
			"38": "<sup>38</sup> ကူၭကံၪကဲၩ့ဝ့ၫအလီၩ့လီၫ.- တၭထီးၥိၪဒဲဘ့ၪလဖၪ ဂဲၫအီၩထံၫနီၪ, မွဲအအီၪက့ၪ နိၪထိၭဘီၩ့ လၧအကူၭ လၩ့ဝ့ၫလဖၪ လၧအအီၩထံၫအဖၧၩ့ လၧချိၬအဖၧၩ့, လၧၥိၪဒဲဘ့ၪလဖၪအမ့ၬယၫ, ဘဲၫၥိၭထီးအဂဲၫအီၩ",
			"39": "<sup>39</sup> ထံၫတၭ, အဝ့ၫၥံၪမိဒၧၩ့ထၪ့ဝ့ၫလီၫ.- ၥိၪဒဲဘ့ၪလဖၪ ဒၧၩ့ထၪ့လၧနိၪထိၭဘီၩ့လဖၪ အမ့ၬယၫတၭ, ဖိၪဆါၥိၪ ဒဲဘ့ၪလဖၪအကံၪဘွၩ, ဒဲကံၪစံၫဖီး, ဒဲကံၪကဲၩ့လီၫ.",
			"40": "<sup>40</sup> စယၫကူၭအၪ့နၩ့ဖၭ ၥိၪဖိၪလဖၪတၭ, အီၪက့ၪၥိၪ ဒဲဘ့ၪၥံၪအမ့ၬတီၩ လၧဆၧလၧအကံၪပလူၬပလူၬ, ဒဲက ယဲအပၠူၭလၧစလၫဘၫ့ အၥိၪဒဲဘ့ၪအကျၩလီၫ. တၭ အီၪက့ၪအဆၧဖိၪဆၧဎါ အဒီၪ့ဒၪဝ့ၫလဖၪ, လၧဆၧလ စီၪ့ဒၪ, ဒဲလအီၪက့ၪဘၪလစီၪ့ဎး လၧစလၫဘၫ့အၥိၪ ဒဲဘ့ၪလဖၪလီၫ.",
			"41": "<sup>41</sup> ကယဲဆၧအဂဲးဆီၪ့အဘၭဆီၪ့လဖၪ ဒၧၩ့ထၪ့ဝ့ၫလ ဘျၩ့လါလါနီၪ, ဆၧမၩအၥၭလၧစယၫကူၭ အီၪက့ၪနိၪ ထိၭဘီၩ့လဖၪ လၧချိၬၥံၪအဖၧၩ့, လၧၥိၪဒဲဘ့ၪအမ့ၬ ယၫ,ဘဲၫၥိၭအမိဒၧၩ့ထၪ့ လၧနိၪထိၭဘီၩ့လဖၪ အကျၩ",
			"42": "<sup>42</sup> လီၫ.- တၭထီးအဒီၪ့ၥံၪ အဂဲးဆါဘၭဆါနီၪ, လအီၪ က့ၪဘၪဝ့ၫ လၧအဖၧၩ့နီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧအဂဲးဆါ အဘၭဆါလဖၪနီၪ, မွဲစလၫဘၫ့အ ဆၧ, ဒဲဆၧလၧအဂဲးဆီၪ့အဘၭဆီၪ့နီၪ, မွဲစယၫကူၭ အဆၧလီၫ.",
			"43": "<sup>43</sup> တၭၦလဂၩနီၪ ဖျိၭထၪ့အၪအၪလ့ၬတၭ, အီၪလၧၥိၪ ဒဲဘ့ၪအၪဒီၪ့, ဒဲဎီးမုၪၥံၪ, ဒဲဎီးခွၫၥံၪ, ဒဲကလအူၭၥံၪ, ဒဲကၥ့ၪယီၩ့ၥံၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> တၭအဝ့ၫနီၪနါဂၧၫ့ စလၫဘၫ့အဖိၪခွၫလဖၪ အဆၧ ချဲၩ့,လၧအစံၭဝ့ၫ စယၫကူၭမၩန့ခွံၬ ကယဲဆၧလၧအ အီၪလၧပဖါတၭ, လၧဆၧလၧအအီၪ လၧပဖါနီၪ,မွဲအ ဘၪဆၧထူၭဆၧလၧၫ့ယီၩ ထီးအလူၬလီၫ.",
			"2": "<sup>2</sup> စယၫကူၭယိစလၫဘၫ့အမ့ၬတၭ, ဒၪဘၪဝ့ၫလၧအ လကဲၪလၧၩ့ဘၪအမ့ၬ ဘဲၫလၧမုဂၪ တဂၪအၥိၭနီၪ",
			"3": "<sup>3</sup> လီၫ.- တၭယဟိဝၩစံၭစယၫကူၭနီၪ ထဲၩ့ထဲၩ့လၧနဖါ လဖၪအခး, ဒဲလၧနဘူၭနထံးအအီၪနီၪဆံၭ, တၭယမိ",
			"4": "<sup>4</sup> အီၪလၧနၥိၭလီၫ.- တၭစယၫကူၭအၪ့မၧၫ့ ၦလ့ၩကိၭ န့နးရၫခ့လၭ, ဒဲနးလံအၫလၧဆၧပျၩ့ဖၧၩ့ လၧအၥိၪ",
			"5": "<sup>5</sup> ဒဲဘ့ၪအဒီၪ့အီၪ,- စံၭအဝ့ၫၥံၪ, ယယိနၥံၪအဖါအမ့ၬ လၧအလကဲၪလၧၩ့ဘၪ ဒဲယၧၩဘဲၫလၧမုဂၪတဂၪအ ၥိၭနီၪလါနၫ့တၭ, ယဖါအယွၩနီၪ အီၪလၧယၥိၭလီၫ.",
			"6": "<sup>6</sup> တၭနၥံၪၥ့ၪယၫနၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫ လၧယမၩနၥံၪ",
			"7": "<sup>7</sup> အဖါအဆၧလၧယဂဲးယဘၭ ထီးအလူၬလီၫ.- နၥံၪအ ဖါအၪ့လီၫန့ယၧၩတၭ, အၪ့လဲၩထဲၩ့ယူၭ ယလံၩ့ယ လဲၫဆံၫဘျၩ့လါနၫ့တၭ, ယွၩဖ့ၪလၫ့အမၩအၧၩ့ယၧၩ",
			"8": "<sup>8</sup> နးမံၩ့အ့ၬ.- အဝ့ၫဒၪအ့ၪစံၭဘဲၫယီၩ, ဆၧကံၪစံၫဖီးမိ ကဲၪထၪ့နလံၩ့နလဲၫနီၪတၭ, ၥိၪဒဲဘ့ၪလဖၪ ဖိၪဆါဆၧ ကံၪစံၫဖီးထၧၫ့ဒီၪ့ယၫလီၫ. အ့ၪစံၭဘဲၫယီၩ, ဆၧကံၪ ပလူၬပလူၬ မိကဲၪထၪ့နလံၩ့နလဲၫနီၪတၭ, ၥိၪဒဲဘ့ၪလ",
			"9": "<sup>9</sup> ဖၪဖိၪဆါဆၧကံၪပလူၬပလူၬ ထၧၫ့ဒီၪ့ယၫလီၫ.- ယွၩ ထုၭထၪ့ခွံၬနၥံၪအဖါ အဆၧဖိၪဆၧဎါအဒိၩ့တၭ, ဖ့ၪ",
			"10": "<sup>10</sup> လၫ့ယၧၩလီၫ.- ဆၧအဆၧၫ့အထီ လၧၥိၪဒဲဘ့ၪလဖၪ ဒၧၩ့ထၪ့တၭ, ဆၧမၩအၥၭလၧယကျဲၪ့ ထၪ့ယမ့ၬတၭ ယဒၪဆၧလၧ ဆၧမံၫမးအဖၧၩ့နီၪ, ယိခွါ, ဘ့ၪအဖၫ လဖၪလၧအဖုၫထၪ့ လၧဘ့ၪလဖၪအလီၩ့နီၪ, မွဲအကံၪ",
			"11": "<sup>11</sup> ပလူၬပလူၬ, ကံၪကဲၩ့,ဒဲကံၪစံၫဖီးလီၫ.- ယွၩအၥီၫ့နီၪ စံၭယၧၩ လၧဆၧမံၫမးအဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, စယၫ",
			"12": "<sup>12</sup> ကူၭဧ့,တၭယစံၭ ယအီၪထီးယီၩလီၫ.- မွဲအစံၭဝ့ၫ ဒၪ,ကျဲၪ့ထၪ့နမ့ၬတၭ, ယိခွါ,ကယဲ ဘ့ၪအဖၫလၧအဖုၫ ထၪ့လၧဘ့ၪအလီၩ့နီၪ, မွဲအကံၪပလူၬပလူၬ, ဒဲကံၪ ကဲၩ့ဒဲကံၪစံၫဖီးထီးအလူၬလီၫ အဂဲးဘဲၫယီၩဆၧလၧ",
			"13": "<sup>13</sup> စလၫဘၫ့မၩနၧၩနီၪ, ယဒၪဘၪထီးအလူၬယူၭ.- ယမွဲ ဘ့ၫၥလၭအယွၩ ထီးအလး လၧနဂုၪဆၧ အထုၪ့လ ထုၪ့,ထီးနဆိၪလၩ့နၥၭ လၧယၧၩအလးနီၪလီၫ. ဘိၩ့ နဲၪ့ယီၩဂဲထုၪ့ စဲၪ့ထၪ့ခွံၬလၧခးဖၧၩ့ယီၩတၭ, ထဲၩ့ထဲၩ့ လၧနဘူၭနထံးအခးဖၧၩ့ဆံၭ.",
			"14": "<sup>14</sup> နးရၫခ့လၭဒဲနးလံအၫ စံၭဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, ဆၧလၧပဂးဒဲဆၧလၧပမိန့ၥၫနီၪ, မွဲအအီၪဒံၭလၧပဖါ",
			"15": "<sup>15</sup> အဂံၪ့ဖၧၩ့ဆ့ဧၪ.- အဝ့ၫဒၪအီၪက့ၪပၧၩ ဘဲၫၦလခီၫ ဘၩ့မုးဖိၪအၥိၭနီၪ, လမွဲဘၪဧၪ. မွဲအအၪ့ဆၫခွံၬပၧၩ",
			"16": "<sup>16</sup> ဒဲအၪ့ခွံၬပစ့ၩလူၬထူၬဆံၫ့ဘၩ့အဂဲးလီၫ.- အဂဲးဘဲၫ ယီၩကယဲဆၧလၧ အစူၪလးအခၪ့ခိၪ လၧယွၩထုၭထၪ့ ခွံၬလၧပဖါနီၪ, မွဲပဆၧဒဲပဖိၪပလံၩအဆၧလီၫ. တၭ ဘိၩ့နဲၪ့ယီၩ ကယဲဆၧလၧယွၩစံၭနၧၩ ထီးအလူၬနီၪ, မၩဆံၭ.",
			"17": "<sup>17</sup> စယၫကူၭဂဲထုၪ့တၭ, အီၪက့ၪထၪ့အဖိၪခွၫလဖၪ",
			"18": "<sup>18</sup> ဒဲအမၫၥံၪလၧကလအူၭအလီၩ့,- တၭၥိၫ့ထၪ့ခွံၬအ ဆၧဖိၪဆၧဎါအဒိၩ့ထီးအလူၬ, ဒဲကယဲအဆၧဖိၪဆၧ လံၩလၧအန့ဘၪဝ့ၫ, ဆၧဖိၪဆၧဎါအဒိၩ့ လၧအမၩန့ လၧအန့ဘၪဝ့ၫ လၧပၫဒၫ့အၫရၫ့အဖၧၩ့, ဘဲၫၥိၭအမိ လ့ၩလၧအဖါစအံစၭ အအီၪလၧခးကၫနအၫ့အဖၧၩ့",
			"19": "<sup>19</sup> နီၪလီၫ.- စလၫဘၫ့လ့ၩထံၬၥိၪအဆီၪ့တၭ, နးရၫခ့လၭ",
			"20": "<sup>20</sup> အၪ့ဂူၪန့အဖါအဆၧဂၩ့တ့ၫရဖံၫ့လီၫ.- တၭစယၫကူၭ စဲၪ့ထၪ့ၥူၪဝ့ၫ လၧၦအၫရၫ့ဖိၪ စလၫဘၫ့လၥ့ၪယၫဘၪ နီၪ,အဂဲးဘဲၫယီၩ မွဲအလဒုၭနဲၪဘၪဝ့ၫ လၧအမိစဲၪ့ထၪ့",
			"21": "<sup>21</sup> ခွံၬနီၪလီၫ.- တၭအဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬ, အနၫ့ဆါဒဲကယဲ ဆၧလၧအအီၪဝ့ၫတၭ, ဂဲထုၪ့ခၫ့ဂၬထံၫမိၡါတၭ, ဒိၭ အမ့ၬလၧခိၪလီၩ့ဂံလအၭလီၫ.",
			"22": "<sup>22</sup> တၭၥၧၫ့နံၩလနံၩနီၪ ၦလီၩဘၪစလၫဘၫ့ လၧစယၫ",
			"23": "<sup>23</sup> ကူၭစဲၪ့ထၪ့ခွံၬယူၭနီၪလီၫ.- အဝ့ၫနီၪမၩန့အထၧၫ့ဖုဝဲ လဖၪလၧအၥိၭတၭ, လီၩ့ဆီးအဝ့ၫနွ့ၫၥၫ့ဖၧၩ့ၥၭတၭ,",
			"24": "<sup>24</sup> ချႃၭန့ဝ့ၫလၧခိၪလီၩ့ ဂံလအၭအလီၩ့နီၪလီၫ.- ယွၩဂဲၫ လၧၦအၫရၫ့ဖိၪစလၫဘၫ့အအီၪ လၧဆၧမံၫမးအဖၧၩ့ လၧမုနၩတၭ,စံၭအဝ့ၫ, ထီးလၩ့နၥၭလၧဆၧဂ့ၩမွဲဂ့ၩ, ဆၧအၧၩ့မွဲဂ့ၩ,ဘဲၫၥိၭနထီးချဲၩ့ စယၫကူၭနးမံၩ့လဂ့ၩ.",
			"25": "<sup>25</sup> တၭစလၫဘၫ့ ချႃၭန့စယၫကူၭလီၫ. စယၫကူၭၥုၪ့ထၪ့ အတဲၩလၧခိၪလီၩ့နီၪတၭ, စလၫဘၫ့, ဒဲအထၧၫ့ဖုဝဲၥုၪ့ ထၪ့ဝ့ၫလၧခိၪလီၩ့ ဂံလအၭအလီၩ့လီၫ.",
			"26": "<sup>26</sup> စလၫဘၫ့စံၭစယၫကူၭနီၪ, မွဲနမၩဘဲၫၥ့ၪလဲၪ,နစဲၪ့ ထၪ့ၥူၪဝ့ၫတၭ, မီၩ့ထၪ့ခွံၬယဖိၪမုၪလဖၪ ဘဲၫၦလဖၪ",
			"27": "<sup>27</sup> လၧၦဖီၪ့န့ဝ့ၫလၧနၭအၥိၭမၬလဲၪ.- နစဲၪ့ၥူၪဝ့ၫဒဲနစဲၪ့ ထၪ့စီၩစီၩတၭ, နလလီၩဘၪယၧၩဘဲၫၥိၭ ယမိဖျါခွံၬ နၧၩလၧဆၧၥၭထိၬ, ဒဲဆၧၥံၫကျံၩ, ဒဲဒိၩ့ၥံၪမီၩ့ၥံၪ,ဒဲနါ",
			"28": "<sup>28</sup> ဒံၩ့,ဒဲၥၫ့ထီးနီၪ, မွဲဘၪလဲၪ.- တၭနလဒုၭအဲၪဂါဘၪ ယၧၩလၧယဖိၪခွၫ, ဒဲယဖိၪမုၪၥံၪနီၪ, မွဲဘၪလဲၪ. ဘိၩ့",
			"29": "<sup>29</sup> နဲၪ့ယီၩနမၩဘဲၫ ၦဂၭဂီၩ့ဖိၪအဆၧမၩအၥိၭလီၫ.- ဆၧ အစီၩ့အမၩ့အီၪဝ့ၫ လၧယစူၪဖၧၩ့လၧယမၩအၧၩ့မၩ နၭနၥံၪၥ့ၪလါနၫ့တၭ, နၥံၪအဖါယွၩချဲၩ့ဆၧ လၧယၧၩ လၧမုနၩလနၩနီၪ, စံၭဝ့ၫဒၪ, ထီးလၩ့နၥၭလၧဆၧဂ့ၩ မွဲဂ့ၩ,ဆၧအၧၩ့မွဲဂ့ၩ, ဘဲၫၥိၭနထီးချဲၩ့ စယၫကူၭနး",
			"30": "<sup>30</sup> မံၩ့လဂ့ၩ.- ဘိၩ့နဲၪ့ယီၩ,မွဲနၥၭ ယူမီၪ့ဘၪနဖါအဂံၪ့ဒိၪ မၬတၭ,ထဲၩ့တၭ, နမိထဲၩ့ဘၪလီၫ. နအၪ့ဂူၪန့ယယွၩ လဖၪနီၪ, မွဲအဘၪဆၧနီၪလမံၩ့လဲၪ.",
			"31": "<sup>31</sup> စယၫကူၭစံၭဆၧၫ့ဆၧတၭ စံၭစလၫဘၫ့နီၪ,မွဲယၥၭ မဲၪဆၧအဂဲးလီၫ. အဂဲးဘဲၫယီၩယစံၭ နမိမၩန့ခွံၬဆီၪ့",
			"32": "<sup>32</sup> ဘၪခိၬနဖိၪမုၪလဖၪလၧယၧၩလီၫ.- ၦလၧအဒၪန့နယွၩ လဖၪအီၪလၧအဝ့ၫလဂၩဂၩနီၪ, မွဲအထီးမၧၫ့လဂ့ၩ. လၧပထၧၫ့ဖုဝဲ အမ့ၬယၫယီၩ, ယိနဲၪ့ဆၧလၧအမွဲန ဆၧအီၪဒဲယၧၩတၭ, မၩန့လၧနဂးဆံၭ. တၭစယၫကူၭ လၥ့ၪယၫဘၪဝ့ၫ လၧနးရၫခ့လၭမၩန့ၥူၪဝ့ၫလီၫ.",
			"33": "<sup>33</sup> စလၫဘၫ့လ့ၫနုၬ လၧစယၫကူၭအတဲၩဖၧၩ့, ဒဲလၧ နးလံအၫအတဲၩဖၧၩ့, ဒဲလၧအဎီးမုၪနံၫဂၩလဖၪအ တဲၩဖၧၩ့တၭ, လဒၪန့ဘၪဝ့ၫနီၪ, စဲၪ့ထၪ့လၧနးလံအၫ အတဲၩဖၧၩ့တၭ, လ့ၩနုၬလၧနးရၫခ့လၭ အတဲၩဖၧၩ့",
			"34": "<sup>34</sup> လီၫ.- တၭနးရၫခ့လၭ မၩန့ဝဲၩဆၧဂၩ့တ့ၫရဖံၫ့လဖၪ နီၪတၭ,အီၪက့ၪဝ့ၫ လၧကလအူၭအခါအဖၫ့လၬတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧအဖၫ့ခိၪလီၫ. စလၫဘၫ့ လုးဆၧလၧ",
			"35": "<sup>35</sup> တဲၩဖၧၩ့ထၧၫ့ဖျိၪ့ယၫတၭ, လဒၪန့ဘၪဝ့ၫနီၪ,- အဝ့ၫဒၪ စံၭအဖါ, လၧယဂဲထုၪ့လၧနမ့ၬယၫ လကဲၪဘၪယီၩ,မွဲ ယကဆါထီးၥၭထၪ့လဂ့ၩ. အဂဲးဘဲၫယီၩၦမုၪအထူၫ အရူၫအီၪလၧယလီၩ့လီၫ. မွဲအအၪ့ဎၬဝ့ၫတၭ လဒၪန့ ဘၪဆၧဂၩ့တ့ၫရဖံၫ့နီၪလီၫ.",
			"36": "<sup>36</sup> စယၫကူၭၥုၪ့ထၪ့ၥၭထၪ့တၭ, အဲၪ့လိၬဆိၭချဲၩ့လိၬ အၥၭလၧစလၫဘၫ့တၭ, စယၫကူၭစံၭဆၧၫ့ဆၧတၭ, စံၭစလၫဘၫ့, လၧနလီၩ့ဆီးယၧၩအကၠီၩ့နီၪ, ယဆၧ မၪမွဲဆၧနီၪလမံၩ့လဲၪ. ယဆၧဒဲၩဘၭ, မွဲဆၧနီၪလမံၩ့",
			"37": "<sup>37</sup> လဲၪ.- အဂဲးဘဲၫယီၩ နလီၩ့လုးယဆၧဖိၪဆၧလံၩထီး အလူၬတၭ, နဒၪန့ဆၧဘၪဆဲၫ့လၧနဂံၪ့ အဆၧဖိၪဆၧ လံၩထီးအလူၬနီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ. အီၪက့ၪလၩ့ ထီးယီၩလၧယထၧၫ့ဖုဝဲၥံၪ, ဒဲနထၧၫ့ဖုဝဲၥံၪအမ့ၬယၫ",
			"38": "<sup>38</sup> ဘဲၫၥိၭအမိစ့ၩရၫ့ပၧၩယီၩဆံၭ.- ယအီၪလၧနၥိၭအ နံၪ့နံၫဆံၫယီၩ, နၥိၪအမိ, ဒဲနဘ့ၪအမိအဂူၭလဂၭဂီၩ့",
			"39": "<sup>39</sup> ဘၪ,နၥိၪဒဲနဘ့ၪအဖၫနီၪ ယအၪ့ဘၪဆ့အ့ၬ.- ဆၧလၧ အယၬၥံၫခွံၬနီၪ ယလဂဲၫဆိၬဘၪနအီၪတၭ, ယလိၭ ထဲၩ့ယဝ့ၫလီၫ. လၧမုဆၫလခီၫမွဲဂ့ၩ, လၧမုနၩလခီၫ မွဲဂ့ၩ, ဆၧလၧဆၧအၪ့ဂူၪဝ့ၫနီၪ, နအၪ့ဎၬလၧယစူၪ",
			"40": "<sup>40</sup> ဖၧၩ့လီၫ.- ယအီၪလၧမုဆၫလခီၫနီၪ, ဆၧခိအၪ့ယၧၩ, ဒဲလၧမုနၩနီၪ ဆၧဂီးအၪ့ယၧၩတၭ, ယဆၧမံၫစဲၪ့ထၪ့",
			"41": "<sup>41</sup> ခွံၬလၧယမ့ၬၥၪလီၫ.- ဆၧနီၪဘၪယၧၩတၭ, ယအီၪ လၧနဂံၪ့ဖၧၩ့ဘဲၫနီၪ အနံၪ့နံၫဆံၫလီၫ. ယမၩနဆၧလ ဆံၫလံနံၪ့ လၧနဖိၪမုၪနံၫဂၩအဂး ဒဲဎူၫနံၪ့ လၧနၥိၪ ဒဲဘ့ၪအဂး, ဒဲနအၪ့လဲၩထဲၩ့ ယလံၩ့ယလဲၫဆံၫဘျၩ့",
			"42": "<sup>42</sup> လီၫ.- ယဖါအယွၩ, စအၫဘြဟၫ့အယွၩ, ဒဲစအံစၭ အဆၧၥၭမဲၪနီၪ, အ့ၪလအီၪဘၪလၧယဂးတၭ, မွဲမၬ ဘိၩ့နဲၪ့ယီၩ နမိဖျါခွံၬယၧၩပျီၩပျီၩလီၫ. ယွၩယိယ ဆၧနၭဆၧၡၪ့, ဒဲယမၩဆၧလၧယစူၪတၭ အၪ့ၥီၪ့ထဲၩ့ ဆၧလၧမုနၩလၧနၧၩနီၪလီၫ.",
			"43": "<sup>43</sup> စလၫဘၫ့စံၭဆၧၫ့ဆၧတၭ, စံၭစယၫကူၭနီၪ, ဖိၪမုၪ လဖၪယီၩမွဲယဖိၪမုၪ, ဒဲဖိၪၥၪလဖၪယီၩ မွဲယဖိၪၥၪ, ဒဲၥိၪဒဲဘ့ၪလဖၪယီၩ, မွဲယၥိၪဒဲဘ့ၪလဖၪတၭ, ကယဲ ဆၧလၧနဒၪဘၪလဖၪနီၪ, မွဲယဆၧထီးအလူၬလီၫ. တၭဆၧလၧမုဆၫလနံၩယီၩ, ယမၩဆၧလၧယဖိၪမုၪ ဒဲအဝ့ၫၥံၪအဖိၪခွၫလဖၪ လၧအအီၪဖျဲၪန့ဝ့ၫအဂးနီၪမိ",
			"44": "<sup>44</sup> ၥ့ၪလမံၩ့မံၩ့ဆ့ဧၪ.- ဘိၩ့နဲၪ့ယီၩ,ဂဲၫဘီၪ, မွဲပမၩဆၧ အုၩ့လၩ့လိၬပၥၭ လၧယၧၩဒဲနၧၩတၭ, မွဲအကဲၪထၪ့ ဆၧထိးအၥၭ လၧယၧၩဒဲနၧၩအဂးနီၪဆံၭ.",
			"45": "<sup>45</sup> စယၫကူၭမၩန့ လိးလဖျိၪ့တၭ, အီၪက့ၪထၪ့ဝ့ၫလၧ",
			"46": "<sup>46</sup> ထုၪ့လထုၪ့အဂးလီၫ.- စယၫကူၭစံၭအထၧၫ့ဖုဝဲလဖၪ အၪ့ထုၫ့န့လိးလဖၪနီၪဆံၭ. အဝ့ၫၥံၪမၩန့ လိးလဖၪနီၪ တၭ,မၩပိၩ့ထၪ့ဝ့ၫလပိၩ့တၭ, အၪ့ဆၧထီးနီၪလၧဆၧ",
			"47": "<sup>47</sup> လပိၩ့အဖၫ့ခိၪလီၫ.- တၭစလၫဘၫ့ ကိၭဝ့ၫအမံၩ့လၧ ယံဂၫစံၫဟဒုၥၫလီၫ. အ့ၪမွဲစယၫကူၭ ကိၭဝ့ၫအမံၩ့လၧ ဂၫလအ့ၭလီၫ.",
			"48": "<sup>48</sup> တၭစလၫဘၫ့စံၭဝ့ၫဒၪ, ဆၧလၧဆၧပိၩ့ယီၩ, မွဲဆၧ ထိးအၥၭလၧယၧၩဒဲနၧၩ အဘိၩ့ဆၧၩ့လၧမုဆၫလနံၩ ယီၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ၦကိၭအမံၩ့လၧဂၫလ",
			"49": "<sup>49</sup> အ့ၭဒဲမံဇပၫလီၫ.- အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, ထီးပအီၪ လၩ့ဖၭလိၬပၥၭတၭ, မွဲယဟိဝၩ ယိဆၧလၧယၧၩ",
			"50": "<sup>50</sup> ဒဲနၧၩအဘိၩ့ဆၧၩ့နီၪဆံၭ.- နအ့ၪမၩနၭမၩၡၪ့ယဖိၪ မုၪလဖၪတၭ, နအ့ၪမၩန့နမၫ လၧအလမွဲဘၪယဖိၪမုၪ လဖၪတၭ, ၦၡၩလအီၪဘၪလၧပၥိၭ နးဂၩလါနၫ့တၭ, ယိခွါ,ယွၩမွဲဆၧထိးအၥၭ အီၪလၧယၧၩဒဲနၧၩအဘိၩ့ ဆၧၩ့နီၪလီၫ.",
			"51": "<sup>51</sup> စလၫဘၫ့စံၭစယၫကူၭ, ယိခွါဆၧပိၩ့လပိၩ့ယီၩ,ဒဲ ယိဆၧထုၪ့လထုၪ့ယီၩ, လၧယအီၪက့ၪဆၧလၧယၧၩ",
			"52": "<sup>52</sup> ဒဲနၧၩအဘိၩ့ဆၧၩ့ယီၩဘီၪ,- မွဲဆၧပိၩ့လပိၩ့ယီၩကဲၪ ထၪ့ဆၧထိးအၥၭ, ဒဲဆၧထုၪ့ယီၩကဲၪထၪ့ဆၧထိးအ ၥၭလၧယလခၫ့ဖၬဘၪ ဆၧပိၩ့လပိၩ့ယီၩ လၧနအီၪ, ဒဲနလခၫ့ဖၬ ဘၪဆၧပိၩ့လပိၩ့ယီၩ, ဒဲဆၧထုၪ့လထုၪ့ ယီၩလၧယအီၪ လၧဆၧအၧၩ့ဆၧနၭ အဂးနီၪဆံၭ.",
			"53": "<sup>53</sup> တၭမွဲစအၫဘြဟၫ့အယွၩ, ဒဲစနၫဟီၫအယွၩ, အဝ့ၫၥံၪ အဖါအယွၩနီၪ, စ့ၩရၫ့ဆၧလၧပဘိၩ့ဆၧၩ့ယီၩဆံၭ. တၭစယၫကူၭဆိၪလၩ့အၥၭ လၧအဖါစအံစၭ အဆၧ ၥၭမဲၪအမ့ၬယၫလီၫ.",
			"54": "<sup>54</sup> စယၫကူၭလုထၪ့ဆၧလၧခိၪလီၩ့ခိၪတၭ, ကိၭန့အ ထၧၫ့ဖုဝဲၥံၪ လၧအမိအၪ့ကိၪအဂဲးလီၫ. အဝ့ၫၥံၪအၪ့ ကိၪနီၪတၭ, အီၪဝ့ၫၥၫ့နၩချီၩ့ လၧခိၪလီၩ့ခိၪလီၫ.",
			"55": "<sup>55</sup> ဆၧဖၩ့ထၪ့နီၪစလၫဘၫ့ ဂဲထုၪ့ဂီၩဂီၩတၭ, အဲၪဂါ အဖိၪခွၫၥံၪ ဒဲအဖိၪမုၪၥံၪတၭ, ဆိၪဂ့ၩအဝ့ၫၥံၪလီၫ. စလၫဘၫ့စဲၪ့ထၪ့တၭ ထဲၩ့ထဲၩ့လၧအလးလီၫ."
		},
		"32": {
			"1": "<sup>1</sup> စယၫကူၭလ့ၩဖိၬအဖၧၩ့ၥၭတၭ, ယွၩအၥီၫ့လဖၪ",
			"2": "<sup>2</sup> ဂဲၫမၩဖျီၪထၪ့အၥၭ လၧအဝ့ၫလီၫ.- တၭထီးစယၫကူၭ ဒၪဘၪအဝ့ၫၥံၪ, စံၭဝ့ၫဒၪ, အယီၩမွဲယွၩအၡၩ ၥုၭမု ခမျၧးလီၫ. တၭဆၧလၧအလးလစီၪ့နီၪ ကိၭဝ့ၫအမံၩ့ လၧမၫဟနၫအံၫ့လီၫ.",
			"3": "<sup>3</sup> တၭစယၫကူၭ အၪ့မၧၫ့အၥီၫ့လဖၪ လ့ၩလၧအမ့ၬ ယၫလၧအဝဲ စအံစီၫအအီၪ လၧခးစံအၫအံဒၧၫ့အဂၪ့",
			"4": "<sup>4</sup> ခိၪအဝၩ့ဖၧၩ့လီၫ.- တၭမၪလူၬအဝ့ၫၥံၪ, စံၭဝ့ၫဒၪ, နၥံၪ ဘၪစံၭယကဆါ, စအံစီၫဘဲၫယီၩ, နဎီးနၡၩစယၫကူၭ စံၭဘဲၫယီၩ, ယအီၪမွံၩလၧစလၫဘၫ့အၥိၭတၭ, အီၪ",
			"5": "<sup>5</sup> ထီးနီၪခီးဘိၩ့နဲၪ့ယီၩလီၫ.- ယအီၪလၧချီ, ဒဲကၥ့ၪ ယီၩ့, ဒဲၥိၪ, ဒဲဘ့ၪဒဲဎီးခွၫ, ဒဲဎီးမုၪၥံၪတၭ, ယအၪ့မၧၫ့ ၦလ့ၩလီၩဘၪယကဆါ ဘဲၫယမိဘၪခိးဘၪတၩ လၧန မ့ၬယၫလီၫ.",
			"6": "<sup>6</sup> အၥီၫ့ၥံၪနီၪ ဂဲၫထဲၩ့ထဲၩ့ထီၩ့လၧ စယၫကူၭအအီၪ နီၪတၭ,စံၭဝ့ၫဒၪ, ပလ့ၩလၧနဝဲစအံစီၫ အအီၪနီၪ,အ ဝ့ၫဒၪဂဲၫအၪ့ဂၬ ဆၧၫ့နၧၩတၭ, ၦၡၩအီၪလၧအၥိၭ လံ ယၩလီၫ.",
			"7": "<sup>7</sup> စယၫကူၭ ၥၭမဲၪဆၧဒိၪမၬတၭ, အၥုၪ့ခိအၥၭဝီၩ လီၫ.တၭအဝ့ၫဒၪ အၪ့နၩ့ဖၭ ၦၡၩလၧအအီၪ လၧအ ၥိၭဒဲၥိၪဒဲဘ့ၪ, ဒဲချီ,ဒဲကလအူၭၥံၪ လၧဆၧနံၫဒီၪ့လီၫ.",
			"8": "<sup>8</sup> တၭစံၭဝ့ၫဒၪ စအံစီၫအ့ၪဂဲၫထီၩ့ လၧအဝ့ၫလဒီၪ့ဒဲဖ့ၬ ခွံၬအဝ့ၫၥံၪတၭ, အဝ့ၫလဒီၪ့ လၧအအီၪလၩ့ထးနီၪ,မိ ဘၪစဲၪ့ဖျိၭဝ့ၫလီၫ.",
			"9": "<sup>9</sup> တၭစယၫကူၭစံၭဝ့ၫဒၪ, ယဖါစအၫဘြဟၫ့အယွၩ, ဒဲယဖါစအံစၭအယွၩ, ယဟိဝၩလၧအစံၭယၧၩ, ထဲၩ့ ထဲၩ့လၧနခးဖၧၩ့, ဒဲလၧနဘူၭနထံးအအီၪတၭ, ယမိ",
			"10": "<sup>10</sup> မၩဂ့ၩနၧၩနီၪ, လဂၩဧ့,- ကယဲနခိးနတၩ ထီးအလူၬ အဆံၭထုၬနီၪ, ဒဲနဆၧမွဲဆၧတီၩထီးအလူၬ လၧနဒုၭ နဲၪနခ့ၫနၡၩတၭ ယကြၨၭယဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ ယခၫ့ဂၬထံၫယီၫဒၫ့ယီၩ, အီၪလၧယနိၪထိၭဘီၩ့တၭ,",
			"11": "<sup>11</sup> ဘိၩ့နဲၪ့ယီၩ ယမွဲဆၧနံၫဒီၪ့လီၫ.- မၩဖီၩ့မၩဖျ့ၭလါ ယၧၩလၧယဝဲအစူၪဖၧၩ့ လၧစအံစီၫ အစူၪဖၧၩ့နီၪ ဆံၭ.အဂဲးဘဲၫယီၩ ယၥၭမဲၪယဝ့ၫလီၫ. မိဂဲၫကျီၪ့ၥံၫ",
			"12": "<sup>12</sup> ခွံၬဘၪခိၬယၧၩ, ဒဲဖိၪၥၪၥံၪဒဲအမိနီၪဆ့လီၫ.- တၭနနၫ့ ဆါဒၪနဝ့ၫနစံၭ, ယမိမၩဂ့ၩနၧၩ လၩ့ထံးလၩ့ဆ့ၭဒဲယ မိမၩနချံၫနၥၪ ဘဲၫမ့ၭလၧမၫဆမံၭနဲၩ့အၥိၭ, လၧၦလ ဝံလနၬဘၪ လၧအအၪဝ့ၫအကၠီၩ့လီၫ.",
			"13": "<sup>13</sup> ဆၧလၧမုလနၩနီၪ အဝ့ၫဒၪအီၪထီးနီၪတၭ, မၩန့ ဆၧလၧအအီၪ လၧအစူၪဖၧၩ့လနၩ့နၩ့, မွဲလၬဆီၪ့လၧ",
			"14": "<sup>14</sup> အဝဲစအံစီၫအဂး,- ဘ့ၪအမိနံၫယၩ, ဒဲဘ့ၪအဖၫနံၫ",
			"15": "<sup>15</sup> ဆံၫ, ၥိၪအမိနံၫယၩ, ဒဲၥိၪအဖၫနံၫဆံၫ,- ကလအူၭအ မိအီၪလၧအနူထံၫဒဲအဖိၪၥၧၫ့ဆံၫ, ဒဲချီအမိလံဆံၫ,ဒဲ ချီအဖၫလဆံၫ, ကၥ့ၪယီၩ့အမိနံၫဆံၫ, ဒဲအဖိၪလဆံၫ",
			"16": "<sup>16</sup> လီၫ.- တၭအဝ့ၫဖ့ၪလၫ့ဝ့ၫ လၧအဎီးအၡၩလဖၪအစူၪ ဖၧၩ့လဒီၪ့ လၧလစီၪ့, လဒီၪ့လၧလစီၪ့ဒၪဆုၬဆုၬတၭ, စံၭအဎီးအၡၩလ့ၩခၫ့ဂၬ ဆၧလၧယမ့ၬယၫတၭ, အီၪ က့ၪဆၧအလး လၧလဒီၪ့လဒီၪ့ အဘိၩ့ဆၧၩ့နီၪဆံၭ.",
			"17": "<sup>17</sup> တၭအဝ့ၫမၪလူၬ ၦလၧယၫလဂၩနီၪ, စံၭဝ့ၫဒၪ, ထီး ယဝဲစအံစီၫ ဂဲၫဒၪခီၩ့နၧၩတၭ,စံၭဝ့ၫ, နမွဲပလၫလဂၩ လဲၪး တၭနမိလ့ၩ ခီၫခီၫလဲၪနီၪ, ဆၧအီၪလၧနမ့ၬယၫ",
			"18": "<sup>18</sup> လဖၪမွဲပလၫအဆၧလဲၪနီၪ, နမိဘၪစံၭ, မွဲနဎီးနၡၩ စယၫကူၭအဆၧတၭ, မွဲလၬဆီၪ့ဖ့ၪယူ လၧယကဆါ စအံစီၫအဂးလီၫ. တၭယိခွါ, အနၫ့ဆါဒၪဝ့ၫ အီၪဝ့ၫ",
			"19": "<sup>19</sup> လၧပလးခဲၫ့ဆ့လီၫ.- တၭအဝ့ၫဒၪမၪလူၬဆ့ ၦနံၫဂၩ လဂၩ, ဒဲၥၧၫ့ဂၩလဂၩနီၪ, ကယဲၦလၧအဖိၬဆၧအဒီၪ့ ၥံၪအခဲၫ့ကိၭဂၩဒ့ၭနီၪ, စံၭဝ့ၫဒၪ, ထီးနၥံၪဒၪဘၪစအံ စီၫတၭ,နၥံၪဘၪချဲၩ့ဆၧ လၧအဝ့ၫနီၪ လၧဆၧချဲၩ့လ",
			"20": "<sup>20</sup> ဖၪနီၪလီၫ.- တၭစံၭအဝ့ၫ, ယိခွါ,နဎီးနၡၩ စယၫကူၭ အီၪဝ့ၫလၧပလးခဲၫ့နီၪဘီၪ. အဂဲးဘဲၫယီၩ မွဲအစံၭဝ့ၫ ဒၪ,ယမိမၩရှူၪလၩ့အၥၭ လၧလၬဆီၪ့ လၧအလ့ၩလၧ ယၫအကၠီၩ့တၭ, ယမိဒၪဘၪအမ့ၬ လၧခဲၫ့လီၫ. ဘၪ လဘၪမိထိးဆၧၫ့ယၧၩလီၫ.",
			"21": "<sup>21</sup> တၭလၬဆီၪ့နီၪ လ့ၩခၫ့ဂၬ ဆၧလၧအမ့ၬယၫလီၫ. အ့ၪမွဲအနၫ့ဆါဒၪဝ့ၫ အီၪၥၫ့နၩချီၩ့လၧမုနၩနီၪ လၧဆၧ လဒီၪ့အကျၩလီၫ.",
			"22": "<sup>22</sup> တၭအဝ့ၫဂဲထုၪ့ လၧမုနၩနီၪ, မၩန့အမၫနံၫဂၩ, ဒဲအဎီးမုၪနံၫဂၩ, ဒဲအဖိၪခွၫလဆံၫလဂၩတၭ, လ့ၩခၫ့",
			"23": "<sup>23</sup> ဂၬဆၧခၫ့ဂၬချိၬ အလးယါဘီၭလီၫ.- မၩန့အဝ့ၫၥံၪတၭ, အၪ့မၧၫ့အလ့ၩခၫ့ဂၬ ထံၫချိၬတၭ, မွဲအအၪ့မၧၫ့ကယဲ အဆၧအီၪ လ့ၩခၫ့ဂၬဆၧလီၫ.",
			"24": "<sup>24</sup> တၭစယၫကူၭအီၪထးလဂၩဎးလီၫ. ၦၡၩလဂၩနီၫ",
			"25": "<sup>25</sup> လိၬအၥၭလၧအဝ့ၫ ထီးမုဆဲၪ့ဘွၩထၪ့လီၫ.- ထီးအဒၪ ဘၪလၧအမၩနၧၩ့အဝ့ၫဒၪ လၥ့ၪဘၪတၭ, ထိၭစယၫ ကူၭအကံၪဒူၪဆၧၫ့တၭ, နီၫလိၬအၥၭ အဘိၩ့ဘၭနီၪ,",
			"26": "<sup>26</sup> စယၫကူၭအကံၪဒူၪဆၧၫ့ပျံၩ့ခွံၬ,- တၭအဝ့ၫဒၪစံၭ, ဖျါ ခွံၬယၧၩဆံၭး အဂဲးဘဲၫယီၩ မုဆဲၪ့ဘွၩထၪ့ယူၭလီၫ. အဝ့ၫဒၪစံၭ နအ့ၪလဆိၪဂ့ၩဘၪယၧၩတၭ, ယဖျါခွံၬ",
			"27": "<sup>27</sup> နၧၩအ့ၬ.- တၭအဝ့ၫဒၪစံၭ, နမံၩ့နီၪမွဲဘဲၫၥ့ၪလဲၪ, တၭ",
			"28": "<sup>28</sup> အဝ့ၫစံၭ,စယၫကူၭလီၫ.- အဝ့ၫလဂၩစံၭ, ဆၧလကိၭ လၧၩ့ဘၪနမံၩ့ လၧစယၫကူၭတၭ, မွဲစအံၫစရ့လၭလ ခီၫလီၫ.အဂဲးဘဲၫယီၩ ဘဲၫၦဒိၪအၥိၭ နအီၪလၧဆၧ စီၩ့ဆၧမၩ့လၧယွၩ ဒဲၦၡၩတၭ, နမၩနၧၩ့ဆၧလီၫ.",
			"29": "<sup>29</sup> စယၫကူၭအၪ့စၪ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, လီၩဘၪလါ ယၧၩလၧနမံၩ့ဘီၪ. တၭအဝ့ၫဒၪစံၭ, ဆၧယီၩလၧ နအၪ့စၪ့ယမံၩ့မွဲဘၪလဲၪး တၭအဆၧဆိၪဂ့ၩအဝ့ၫထီး",
			"30": "<sup>30</sup> နီၪလီၫ.- တၭစယၫကူၭကိၭအလးနီၪ အမံၩ့ပနံအလၭ လီၫ. အဂဲးဘဲၫယီၩ ယယိဆၧၫ့ယၫလၧယွၩတၭ, ယ ၥၭဖီၩ့ဖျ့ၭဆၧလီၫ.",
			"31": "<sup>31</sup> အဝ့ၫလ့ၩခၫ့ဂၬ ပနံအလၭအဘိၩ့ဘၭတၭ, မုထၪ့ န့အဝ့ၫတၭ, လ့ၩဆၧစ့ၭထိၬစ့ၭထိၬ လၧအကံၪဒူၪဆၫ အကၠီၩ့လီၫ.",
			"32": "<sup>32</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦအံၫစရ့လၭဖိၪ လအၪ့ဘၪ ထီၪ့လၧအအီၪ လၧကံၪဒူၪဆၧၫ့အလီၩ့ လဘီၩ့နီၪ,ထီး မုဆၫလနံၩယီၩလီၫ. အဂဲးဘဲၫယီၩ ဆၧထိၭဘၪစယၫ ကူၭအကံၪဒူၪဆၧၫ့ လၧအမွဲကံၪဒူၪဆၧၫ့ အထီၪ့နီၪ လီၫ."
		},
		"33": {
			"1": "<sup>1</sup> စယၫကူၭကျဲၪ့ထၪ့အမ့ၬတၭ, ယိဆၧနီၪ, ယိခွါ, စအံစီၫဂဲၫတၭ, ၦၡၩဂဲၫဖိၬအခဲၫ့အီၪ လံယၩလီၫ. တၭ အဆၧအၪ့နၩ့ဖၭ ဖ့ၪဖိၪၥၪလဖၪ လၧနးလံအၫ, ဒဲနးရၫ",
			"2": "<sup>2</sup> ခ့လၭ, ဒဲလၧအဎီးမုၪနံၫဂၩလီၫ.- တၭအီၪက့ၪအဎီး မုၪၥံၪဒဲအဖိၪလဖၪ လၧအမ့ၬယၫ, နးလံအၫဒဲအဖိၪ လဖၪလၧအလးခဲၫ့, ဒဲနးရၫခ့လၭဒဲစယိၥၭ လၧခဲၫ့ထုၬ",
			"3": "<sup>3</sup> လီၫ.- တၭအနၫ့ဆါဒၪဝ့ၫလ့ၩခၫ့ဂၬ ဆၧလၧအမ့ၬယၫ",
			"4": "<sup>4</sup> ထွံၩလၩ့ဝ့ၫ နွ့ၫဘျၩ့ထီးအလၩ့ဘူၭလၧအဝဲလီၫ.- စအံ စီၫစဲၪ့အၪ့ဂၬအဝ့ၫ ဒဲဖိၭဝ့ၫတၭ, ထိၪလၩ့ထံၩဖါအၥၭ လၧအခိၬထံၭတၭ, အဲၪဂါဝ့ၫတၭ, အဝ့ၫၥံၪအမ့ၬထံၫ",
			"5": "<sup>5</sup> လၩ့ဝ့ၫဒၪလီၫ.- အဝ့ၫနီၪကျဲၪ့ထၪ့အမ့ၬတၭ, ဒၪဘၪ ၦမုၪဒဲအဖိၪလဖၪနီၪ, စံၭဝ့ၫဒၪ, ၦလဖၪယီၩ ဘၪဆဲၫ့ လၧနၧၩဘဲၫၥ့ၪလဲၪ. အဝ့ၫဒၪစံၭ, မွဲဖိၪၥၪလဖၪလၧ",
			"6": "<sup>6</sup> ယွၩဖ့ၪလၫ့ယၫ့ၥၭ နဎီးနၡၩလီၫ.- အဎီးအၡၩမုၪ, အဝ့ၫၥံၪဒဲအဖိၪလဖၪ ဂဲၫဘူၭတၭ, ကူၭလၩ့အၥၭလီၫ.",
			"7": "<sup>7</sup> နးလံအၫ ဒဲအဖိၪလဖၪ ဂဲၫဘူၭဆ့တၭ, ကူၭလၩ့အၥၭ လီၫ.လၧခဲၫ့နီၪ စယိၥၭဂဲၫဘူၭ ဒဲနးရၫခ့လၭတၭ, ကူၭ လၩ့အၥၭလီၫ.",
			"8": "<sup>8</sup> တၭအဝ့ၫဒၪစံၭ, ဆၧလဒီၪ့ထၧၫ့ဒီၪ့ယၫ, လၧယဒၪ ခီၩ့ယီၩမွဲနမိမၩဘဲၫၥ့ၪလဲၪ. အဝ့ၫဒၪစံၭ, မွဲဘဲၫၥိၭယ",
			"9": "<sup>9</sup> မိဘၪခိးဘၪတၩ လၧယကဆါအမ့ၬယၫလီၫ.- တၭ စအံစီၫစံၭဝ့ၫဒၪ, ယဆၧအီၪအၪလ့ၬ, ယဖုဧ့, ကယဲ နဆၧလမံၩ့လါလါနီၪ, မွဲအအီၪလၧနဂးဒၪနဝ့ၫဘီၪ.",
			"10": "<sup>10</sup> စယၫကူၭစံၭဝ့ၫဒၪ, မွဲအ့ၬ, ယအ့ၪဘၪခိးဘၪတၩလၧ နမ့ၬယၫတၭ, ဒိၭန့လါယလၬဆီၪ့ လၧယစူၪဖၧၩ့ယီၩ ဘီၪ.မွဲအဂဲးဘဲၫၥ့ၪလဲၪ, ယဒၪဘၪယူၭနမ့ၬ မၩအၥၭ ဘဲၫယဒၪဘၪယွၩအမ့ၬ အၥိၭတၭ, နဒုၭခိးဒုၭတၩ",
			"11": "<sup>11</sup> ယၧၩလီၫ.- ဒိၭန့လါယဆၧဆိၪဂ့ၩ လၧၦဂဲၫဆိၬလၧ နအီၪနီၪဆံၭ. မွဲလၧယွၩဖ့ၪလၫ့ ယၫ့ၥၭယၧၩ အဂဲး တၭ,မွဲလၧ ယဆၧအီၪထီးအလူၬ အဂဲးလီၫ. အၪ့ယၫ ဝ့ၫတၭ, အဆၧဒိၭန့ဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫဒၪစံၭ, မွဲပစဲၪ့ထၪ့ၡီၩ့တၭ လ့ၩၡီၩ့ဘီၪ, ယမိ",
			"13": "<sup>13</sup> လ့ၩလၧနမ့ၬယၫလီၫ.- အဆၧစံၭအဝ့ၫဒၪ, ယကဆါ ၥ့ၪယၫလၧဖိၪၥၪလဖၪ အဂဲးဆါအဘၭဆါ, ဒဲၥိၪဒဲဘ့ၪ အဒီၪ့လဖၪ, ဒဲချီအဒီၪ့လဖၪ လၧအဖိၪဆံၭလဖၪအီၪ လၧယၥိၭတၭ, ၦအ့ၪလ့ၩနၫ့ဆီၪ့ဝ့ၫလနံၩတၭ, မိၥံၫ",
			"14": "<sup>14</sup> ထၧၫ့ဒီၪ့ယၫလီၫ.- မွဲယကဆါလ့ၩဝဲၩ လၧနဎီးနၡၩအ မ့ၬယၫဆံၭ. တၭယမိလ့ၩၥိၫ့ ဆၧဖိၪဆၧဎါ, ဒဲဖိၪဒံၩ ဖိၪၥၪၡီၫၡီၪ ဘဲၫအလ့ၩမိကဲၪအၥိၭ, ထီးယထီၩ့လၧ",
			"15": "<sup>15</sup> ယကဆါအအီၪ လၧစံအၫနီၪလီၫ.- တၭစအံစီၫစံၭဝ့ၫ ဒၪ, ယမိဒုၭအီၪလၩ့ထး ၦခမျၧး လၧအဖိၬယခဲၫ့လၧ နၥိၭလနၩ့နၩ့ဘီၪ. တၭအဆၧစံၭဝ့ၫဒၪ, ဆၧနီၪမွဲအ ဘၪနီၪလဲၪ. မွဲယဘၪခိးဘၪတၩ လၧယကဆါအမ့ၬ",
			"16": "<sup>16</sup> ယၫဆံၭ.- တၭဆၧလၧမုလနံၩနီၪ, စအံစီၫထဲၩ့ထဲၩ့ ဝ့ၫလၧအဖၧၩ့ၥၭ လၧစံအၫလီၫ.",
			"17": "<sup>17</sup> တၭစယၫကူၭ လ့ၩဆၧလၧစၧကီၭတၭ, ၥုၪ့ဂံၪ့လၧ အဂးလဖျိၪ့, ဒဲမၩရိးလဖၪ လၧအဆၧဖိၪဆၧဎါအဒိၩ့ အဂးလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧအလးနီၪ ၦကိၭ",
			"18": "<sup>18</sup> ဝ့ၫအမံၩ့လၧစၧကီၭလီၫ.- တၭစယၫကူၭဂဲၫမုၬမုၬထီၩ့ လၧၡံခံၫ့အဒိၩ့လဖျိၪ့အီၪဝ့ၫ လၧခးကၫနအၫ့အဖၧၩ့ လၧအဂဲၫထၪ့ လၧပၫဒၫ့အၫရၫ့လီၫ. တၭအဝ့ၫဒၪ, ၥုၪ့ အတဲၩလၧဒိၩ့အမ့ၬယၫလီၫ.",
			"19": "<sup>19</sup> တၭထီးအမိမၩထၪ့တဲၩအလးနီၪ, ဎွ့ၩဂၪ့ခိၪအဝၩ့ လကဲၩ့, လၧစၡံခံၫ့အဖါ စဟၫမီၫ အဖိၪၥံၪအစူၪဖၧၩ့",
			"20": "<sup>20</sup> လၧစ့ၩကစံတၫလယၩအဂးလီၫ.- တၭအဝ့ၫမၩထၪ့ ဆၧလုအလးထီးနီၪလီၫ."
		},
		"34": {
			"1": "<sup>1</sup> တၭနးလံအၫအဖိၪမုၪ နးဒံနၫလၧအအီၪဖျဲၪန့စယၫ ကူၭအဂးလဂၩနီၪ, လ့ၩအီၪၡီၩ့ၦခးဖိၪ အဖိၪမုၪလဖၪ",
			"2": "<sup>2</sup> လီၫ.- တၭၦဟံဝဲၭဖိၪ ခးအၦဒိၪစဟၫမီၫ အဖိၪခွၫစၡံ ခံၫ့ဒၪဘၪဝ့ၫနီၪ, မၩန့ဝ့ၫတၭ, မံၫဎုၬဝ့ၫတၭ, မၩဂၭဂီၩ့",
			"3": "<sup>3</sup> အလၩအဖၩ့လီၫ.- အၥၭဘုၭထၬ လၧစယၫကူၭအဖိၪ မုၪနးဒံနၫတၭ, အဲၪဖိၪမုၪနီၪတၭ, ချဲၩ့မုၬဆၧလၧဖိၪမုၪ",
			"4": "<sup>4</sup> နီၪလၧအဘၪအၥၭလီၫ.- တၭစၡံခံၫ့ချဲၩ့ဆၧလၧအ ဖါစဟၫမီၫတၭ, စံၭဝ့ၫဒၪ, မၩန့ၦမုၪယီၩ လၧယမၫအ",
			"5": "<sup>5</sup> ဂးဘီၪ.- တၭစယၫကူၭနါဂၧၫ့ဝ့ၫ လၧအမၩဘၪၥၭလိၪ အဖိၪမုၪနးဒံနၫလီၫ. အဖိၪခွၫလဖၪ အီၪဝ့ၫဒဲအဆၧ ဖိၪဆၧဎါအဒိၩ့ လၧမံၩ့လၬကျၩတၭ, စယၫကူၭအီၪ လၩ့မါပံၭထီးအဝ့ၫၥံၪ ဂဲၫထဲၩ့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> တၭစၡံခံၫ့အဖါစဟၫမီၫ လ့ၩထၪ့ဝ့ၫလၧစယၫကူၭ",
			"7": "<sup>7</sup> အအီၪ, ဘဲၫၥိၭအမိချဲၩ့ဆၧ လၧအဝ့ၫဒၪလီၫ.- ထီး စယၫကူၭအဖိၪခွၫလဖၪ နါဂၧၫ့ဝ့ၫနီၪ, ဂဲၫထဲၩ့လၧမံၩ့ လၬကျၩတၭ, အၥၭဆၫဒဲအၥၭထၪ့နၭမၬလီၫ. အဂဲး ဘဲၫယီၩမွဲအမံၫဎုၬ စယၫကူၭအဖိၪမုၪတၭ, မၩၦဂၭ ဂီၩ့ဖိၪအဆၧမၩ လၧအံၫစရ့လၭအကျၩလီၫ. တၭမၩ လဂ့ၩဘၪဘဲၫနီၪၥိၭလီၫ.",
			"8": "<sup>8</sup> တၭစဟၫမီၫချဲၩ့ဆၧလၧအဝ့ၫၥံၪ, စံၭဝ့ၫဒၪ,ယဖိၪ ခွၫစၡံခံၫ့အၥၭ ဘုၭထၬလၧနၥံၪအဖိၪမုၪလီၫ. တၭယ",
			"9": "<sup>9</sup> အၪ့ကံၩ့နၥံၪဖ့ၪလၫ့အဝ့ၫ လၧအမၫအဂးဆံၭ.- တၭ န့မၫန့ဝၩလၧပကျၩဆံၭ. ဖ့ၪလၫ့ပၧၩလၧနၥံၪအဖိၪမုၪ",
			"10": "<sup>10</sup> လဖၪတၭ, မၩန့ပဖိၪမုၪလၧနၥံၪအဂးဆံၭ.- နၥံၪမိအီၪ လၧပၥိၭတၭ, ခးယီၩမိအီၪ လၧနၥံၪအမ့ၬယၫလီၫ. အီၪဂုးဝ့ၫအၪ့ခၩဆၧ လၧအဖၧၩ့ယီၩ, ဒဲမၩန့အလးလ",
			"11": "<sup>11</sup> ဖၪလၧနၥံၪမိအီၪဂုးခၧၫ့ဝ့ၫဆ့လီၫ.- တၭစၡံခံၫ့စံၭၦမုၪ အဖါဒဲအထၧၫ့ဖုဝဲလဖၪ, မွဲအဘၪခိးဘၪတၩ လၧနၥံၪ အမ့ၬၥၪဖၧၩ့ဆံၭ, တၭဆၧလၧနၥံၪစံၭ ယမိဖ့ၪလၫ့",
			"12": "<sup>12</sup> လီၫ.- ဆၧအဎွ့ၩဒဲဆၧဖ့ၪလၫ့နီၪ, နၥံၪအ့ၪအၪ့ကံၩ့လၧ ယၧၩအၪလါနၫ့တၭ, ယမိဖ့ၪလၫ့ထီးဒၪနၥံၪ စံၭဆၧ လီၫ. တၭဖ့ၪလၫ့ဖိၪမုၪနီၪ လၧယမၫအဂးဆံၭ.",
			"13": "<sup>13</sup> စယၫကူၭအဖိၪခွၫလဖၪ စံၭဆၧၫ့စၡံခံၫ့ဒဲအဖါစဟၫ မီၫလၧဆၧအၪ့လီၫအဖၧၩ့တၭ, အဝ့ၫဒၪမၩစံၪစၪဘၪ ၥၭလိၪအဝ့ၫၥံၪအထၧၫ့ဖုဝဲမုၪ နးဒံနၫအကၠီၩ့နီၪ, အဝ့ၫ",
			"14": "<sup>14</sup> ၥံၪချဲၩ့ဆၧတၭ,- စံၭၦလဖၪနီၪ, ဖ့ၪလၫ့ပထၧၫ့ဖုဝဲမုၪ လၧၦလၧအလဒိၭဘၪ ဆၧကူၭတရံၭနီၪ, ပမၩၥ့ၪအ့ၬ, အဂဲးဘဲၫယီၩ ဆၧနီၪမွဲဆၧဒုၪဒွ့ၪပၧၩ အလးလီၫ.",
			"15": "<sup>15</sup> မွဲလါနၫ့တၭ, ပမိအုၩ့လၩ့နၥံၪဘဲၫယီၩး နၥံၪအ့ၪကဲၪ ထၪ့ဘဲၫပဝ့ၫအၥိၭ, ကယဲၦခွၫ ဒိၭဆၧကူၭတရံၭကိၭ",
			"16": "<sup>16</sup> အဂၩဒ့ၭနီၪ,- ပမိဖ့ၪလၫ့ပဖိၪမုၪ လၧနၥံၪအဂးတၭ, ပမိမၩန့နၥံၪ အဖိၪမုၪလၧပဂးတၭ, ပမိအီၪလၧနၥံၪ",
			"17": "<sup>17</sup> အၥိၭ,ဒဲပမိကဲၪထၪ့ ၦလဆၨၩဎးလီၫ.- အ့ၪမွဲနၥံၪအ့ၪ လခိၭနၪဘၪပလူ လၧနၥံၪမိဒိၭဘၪဆၧကူၭတရံၭတၭ, ပမိမၩန့ခွံၬ ပထၧၫ့ဖုဝဲမုၪတၭ, ပမိလ့ၩဆၧလီၫ.",
			"18": "<sup>18</sup> တၭအဝ့ၫၥံၪအဆၧချဲၩ့နီၪ ဂ့ၩဝ့ၫလၧစဟၫမီၫ,ဒဲစ",
			"19": "<sup>19</sup> ဟၫမီၫအဖိၪခွၫ စၡံခံၫ့အမ့ၬယၫလီၫ.- ဖိၪၥၪခွၫနီၪဘဲၫ ၥိၭအမိမၩဆၧလမံၩ့နီၪတၭ, လၥုၭနံၩၥုၭၥၫ့ဘၪတၭ, ဘၪအၥၭလၧစယၫကူၭ အဖိၪမုၪအဂဲးလီၫ. တၭအဝ့ၫ ဒၪနီၪအီၪလၧ အလၩအဖၩ့အၪနဲၪ့ ကယဲအဖါအဂံၪ့ဖိၪ",
			"20": "<sup>20</sup> ထီးအလူၬဆ့လီၫ.- စဟၫမီၫဒဲအဖိၪခွၫစၡံခံၫ့လ့ၩဝ့ၫ လၧအဒိၩ့တရၫ့တၭ, ချဲၩ့ဆၧလၧၦဒိၩ့ဖိၪလဖၪတၭ,",
			"21": "<sup>21</sup> စံၭဝ့ၫဒၪ,- ၦလဖၪနီၪအီၪလၧပကျၩမုၬတၭ, မွဲအအီၪ လၧခးဖၧၩ့, ဒဲအၪ့ခၩဆၧလၧအဖၧၩ့ဆံၭး ယိခွါ,ခးယီၩ လဲဝ့ၫလၧအမ့ၬယၫလီၫ. မွဲပန့မၫလၧအဝ့ၫၥံၪအဖိၪမုၪ",
			"22": "<sup>22</sup> တၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪလၧပဖိၪမုၪဆံၭ.- မွဲလါနၫ့တၭ, ၦလဖၪနီၪ မိအုၩ့လၩ့လၧအမိအီၪလၧပၥိၭ ကဲၪထၪ့ၦ လဆၨၩဎး, မွဲန့ၫလၧဆၧလမံၩ့ယီၩအကၠီၩ့, ကယဲၦခွၫ လၧပကျၩဒိၭဆၧကူၭတရံၭ ဘဲၫအဝ့ၫၥံၪဒိၭဆၧကူၭ",
			"23": "<sup>23</sup> တရံၭအၥိၭနီၪလီၫ.- တၭအဆၧဖိၪဆၧလံၩ ဒဲအစူၪလး အခၪ့ခိၪ,ဒဲအဆၧဖိၪဆၧဎါအဒိၩ့ ထီးအလူၬနီၪမိကဲၪ ထၪ့ပဆၧ,မွဲအ့ၬဧၪ. န့ၫပအုၩ့လၩ့ လၧအဝ့ၫၥံၪနီၪ",
			"24": "<sup>24</sup> တၭ,အဝ့ၫၥံၪမိအီၪလၧပၥိၭလီၫ.- ကယဲၦလၧအစဲၪ့ ထၪ့လၧအဒိၩ့အတရၫ့နီၪ, ခိၭနၪစဟၫမီၫ, ဒဲအဖိၪခွၫ စၡံခံၫ့အလူတၭ, ကယဲၦခွၫဒိၭ ဆၧကူၭတရံၭကိၭဂၩ ဒ့ၭ,ၦလၧအစဲၪ့ထၪ့ လၧဒိၩ့အတရၫ့ ထီးအလူၬလီၫ.",
			"25": "<sup>25</sup> တၭထီးၦဆၫထၪ့ လၧမုၥၧၫ့နံၩလနံၩနီၪ ဆၧမၩအ ၥၭလၧစယၫကူၭ အဖိၪခွၫထၧၫ့ဖုဝဲ လၧနးဒံနၫ စစံမ အၧၫ့ဒဲစလံဝဲၫနံၫဂၩနီၪ, မၩန့နၭလဂၩလဘံၪ့ လဂၩ လဘံၪ့တၭ, လ့ၩနုၬလၧဒိၩ့ဖၧၩ့အီၪ လၧအၥၭဒူၩတၭ,",
			"26": "<sup>26</sup> မၩၥံၫၦခွၫထီးအလူၬလီၫ.- တၭမၩၥံၫစဟၫမီၫဒဲအဖိၪ ခွၫစၡံခံၫ့လၧနၭအနါတၭ, မၩန့ခွံၬနးဒံနၫ လၧစၡံခံၫ့",
			"27": "<sup>27</sup> အဂံၪ့ဖၧၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.- စယၫကူၭအဖိၪ ခွၫလဖၪဂဲၫဘၪလၧၦဘၪ ဆၧမၩၥံၫဝ့ၫတၭ, မၩန့အ ဆၧ,လၧၦမၩဘၪၥၭလိၪ အထၧၫ့ဖုဝဲမုၪအကၠီၩ့လီၫ.",
			"28": "<sup>28</sup> တၭမၩန့အဝ့ၫၥံၪအၥိၪ ဒဲဘ့ၪ,ဒဲချီ, ဒဲအကၥ့ၪယီၩ့,ဒဲ",
			"29": "<sup>29</sup> ဆၧအီၪလၧဒိၩ့ဖၧၩ့, ဒဲဆၧအီၪလၧဆၧပျၩ့ဖၧၩ့.- ဒဲအ ဆၧဖိၪဆၧလံၩထီးအလူၬ, ဒဲကယဲအဖိၪဒံၩဖိၪၥၪတၭ, ဖီၪ့န့အမၫၥံၪ, ဒဲအၪ့ဂူၬန့အဆၧအီၪ လၧဂံၪ့ဖၧၩ့ထီးအ လူၬလီၫ.",
			"30": "<sup>30</sup> တၭစယၫကူၭစံၭစစံမအၧၫ့ ဒဲစလံဝဲၫနီၪ,မွဲနၥံၪမၩ ခိမၩဝီၩယၧၩ ထီးယမိနၧၫ့အုၪ လၧၦခးဖိၪ အကျၩ, လၧၦကၫနအၫ့ဖိၪ, ဒဲၦပံရစဲၭဖိၪအကျၩလီၫ. တၭဆၧ လၧယၧၩယီၩ, ယမွဲၡၩဂၩတၭ, အဝ့ၫၥံၪမိအီၪကိၩ့အီၪ ကီၪ့ဝ့ၫထၫ့ဒုၪထၫ့ဒၩယၧၩ ဒဲကျီၪ့ၥံၫယၧၩတၭ, ယမိ ထီၩ့လၧဆၧဂၭဂီၩ့ဂၭစၪ, ယၧၩဒဲယဂံၪ့ဖိၪလီၫ.",
			"31": "<sup>31</sup> တၭအဝ့ၫၥံၪစံၭဆၧၫ့, မွဲအမိမၩဘၪပထၧၫ့ဖုဝဲမုၪ ဘဲၫၦမဲၩဎွဲၩမုၪ အၥိၭနီၪဆ့ဧၪ."
		},
		"35": {
			"1": "<sup>1</sup> ယွၩစံၭစယၫကူၭ, ဂဲထုၪ့လ့ၩလၧဘ့ၫၥလၭတၭ, အီၪထီးနီၪ မၩထၪ့ဆၧလုအလးလၧယွၩ, လၧအမၩ ဖျီၪထၪ့အၥၭ လၧနမ့ၬယၫလၧနစဲၪ့ထၪ့ လၧနဝဲစအံစီၫ",
			"2": "<sup>2</sup> အမ့ၬယၫလဂၩအဂးနီၪဆံၭ.- တၭစယၫကူၭစံၭအဂံၪ့ ဖိၪလဖၪ ဒဲကယဲၦအီၪလၧအစူၪဖၧၩ့ ထီးအလူၬလဖၪ နီၪ, ၦလခီၫဘၩ့လခီၫမုးဖိၪ အယွၩလဖၪ လၧအအီၪ လၧနၥံၪအကျၩနီၪ, ခွံၬၡိၭခွံၬအဝ့ၫၥံၪဆံၭ. မၩဆံၫ့နၥံၪ",
			"3": "<sup>3</sup> အၥၭတၭ, လုထၪ့နၥံၪအၥၭဆံၭ.- ဂဲထုၪ့တၭလ့ၩထၪ့ ၡီၩ့လၧဘ့ၫၥလၭဆံၭ. တၭယမိမၩထၪ့ ဆၧလုအလး ထီးနီၪလၧယွၩ လၧအစံၭဆၧၫ့ယၧၩ ထီးမုလနံၩလၧ ယဘၪဆၧခိဆၧဝီၩ, ဒဲအအီၪ လၧယၥိၭလၧဖၧၩ့ၥၭ",
			"4": "<sup>4</sup> လၧယဖိၬဝ့ၫအဖၧၩ့နီၪ လဂၩအဂးလီၫ.- တၭအဝ့ၫၥံၪ ဖ့ၪလၫ့စယၫကူၭ လၧကယဲၦလခီၫ ဘၩ့လခီၫမုးဖိၪအ ယွၩလၧအအီၪ လၧအစူၪဖၧၩ့ထီးအလူၬ, ဒဲဆၧခွၩ့ လၩ့ဆဲၩလၧအနါလဖၪနီၪလီၫ. တၭစယၫကူၭအီၪ က့ၪၥူၪဝ့ၫ လၧၥံၪ့ထိၭဖၫလထံၭ လၧအအီၪလၧၡံခံၫ့အ",
			"5": "<sup>5</sup> နဲၩ့ထံၭအဖၫ့လၬလီၫ.- အဝ့ၫၥံၪစဲၪ့တၭ, ဆၧၥၭမဲၪ ယွၩအီၪဝ့ၫလၧၦဒိၩ့ဖိၪ လၧအအီၪဝၬဖီၩ့ အဝ့ၫၥံၪအ လီၩ့တၭ, လလီၩ့ဆီးဘၪ စယၫကူၭနီၪလီၫ.",
			"6": "<sup>6</sup> တၭစယၫကူၭဂဲၫထီၩ့ လၧလုဇၭလၧခးကၫနအၫ့အ ဖၧၩ့ (အဝ့ၫနီၪမွဲဘ့ၫၥလၭ) အဝ့ၫဒၪ ဒဲၦအီၪလၧအၥိၭ",
			"7": "<sup>7</sup> ထီးအလူၬလီၫ.- တၭမၩထၪ့ဆၧလုအလး ထီးနီၪ, ကိၭဆၧအလးနီၪ လၧအ့လၭဘ့ၫၥလၭလီၫ. အဂဲးဘဲၫ ယီၩလၧအစဲၪ့ထၪ့ခွံၬ လၧအဝဲအမ့ၬယၫနီၪ, ယွၩဒုၭ နဲၪအၥၭ လၧအမ့ၬယၫ ထီးနီၪလီၫ.",
			"8": "<sup>8</sup> နးဒ့ဘိၫရၫၦလၧအယိ နးရဘ့ၭကၫနီၪ, ၥံၫဝ့ၫတၭ, ဘၪဆၧခုၪ့လၩ့ဘၧၩ့ လၧဘ့ၫၥလၭလၧလၬ လၧၥံၪ့ထိၭ ဖၫလထံၭအဖၫ့လၬတၭ, ၦကိၭအမံၩ့ လၧအၭလိၫ့ဘၫ ကူၭလီၫ.",
			"9": "<sup>9</sup> ထီးစယၫကူၭ ဂဲၫထဲၩ့ထဲၩ့ဝ့ၫ လၧပၫဒၫ့အၫရၫ့နီၪ, ယွၩနဲၪဖျီၪထၪ့ဒီၭအၥၭလဖၧၫ့ လၧအမ့ၬယၫတၭ, ဆိၪ",
			"10": "<sup>10</sup> ဂ့ၩအဝ့ၫလီၫ.- တၭယွၩစံၭဝ့ၫ, နမံၩ့မွဲစယၫကူၭလီၫ. ဆၧလကိၭလၧၩ့ဘၪနမံၩ့ လၧစယၫကူၭနီၪ, အ့ၪမွဲ အံၫစရ့လၭမွဲနမံၩ့လီၫ. ဆၧကိၭဝ့ၫအမံၩ့ လၧအံၫစရ့",
			"11": "<sup>11</sup> လၭလီၫ.- ယွၩစံၭအဝ့ၫ, ဆၧလၧယၧၩယီၩ, ယမွဲ ယွၩလၧအၥ့ၪဆၧလူၬလီၫ. ၥၪထၪ့အၪထၪ့ဆံၭ. ၦလ ဆၨၩဒဲၦအဆၨၩလဖၪ အီၪကီၪ့မိကဲၪထၪ့လၧနၧၩ, ဒဲစ",
			"12": "<sup>12</sup> ဎွၩလဖၪမိဂဲၫလၩ့ လၧနယးဒံၩ့အဖၧၩ့လီၫ.- တၭခး လၧယဖ့ၪလၫ့ စအၫဘြဟၫ့ ဒဲစအံစၭလဘံၪ့နီၪယမိ ဖ့ၪလၫ့နၧၩ, ဒဲယမိဖ့ၪလၫ့ခးနီၪ လၧနချံၫနၥၪလၧနလး",
			"13": "<sup>13</sup> ခဲၫ့လီၫ.- တၭယွၩစဲၪ့ထၪ့ခွံၬ လၧအအီၪထီးဆၧအလး",
			"14": "<sup>14</sup> လၧအချဲၩ့ဆၧလၧအဝ့ၫလီၫ.- တၭစယၫကူၭၥုၪ့လၩ့ ဆၧအထုၪ့လထုၪ့ ထီးအလးလၧအချဲၩ့ဒုၪ့ဝ့ၫ, လိးအ ထုၪ့လထုၪ့လီၫ. တၭမွဲအလူၫလၩ့ ဆၧလုအီၩလၧအ",
			"15": "<sup>15</sup> ဖၫ့ခိၪ,ဒဲလူၫလၩ့ ၥိၪလၧအဖၫ့ခိၪလီၫ.- တၭဆၧအလး လၧယွၩချဲၩ့ဒုၪ့ဝ့ၫလစီၪ့နီၪ, စယၫကူၭကိၭအမံၩ့လၧ ဘ့ၫၥလၭလီၫ.",
			"16": "<sup>16</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧဘ့ၫၥလၭတၭ, လၩ့ဘူၭလၧ ဒိၩ့အ့ဖၭနီၪ, နးရၫခ့လၭအဂူၭဆၫထၪ့တၭ, အဂူၭဆၫ",
			"17": "<sup>17</sup> အဘိၩ့ဘၭနီၪ, ဘၪဆၧကၪဆၧဂဲၩလီၫ.- တၭဆၧမၩ အၥၭလၧအဂူၭဆၫ ဒဲဆၧကၪဆၧဂဲၩအဘိၩ့ဘၭနီၪ, ၦယိၦဂူၭလဂၩစံၭဝ့ၫ, ထီးအၪ့ယိၪဆၧလဂ့ၩး အဂဲး",
			"18": "<sup>18</sup> ဘဲၫယီၩအယီၩမွဲဖိၪခွၫလၧနဂးဆ့လီၫ.- တၭဆၧမၩ အၥၭလၧအၥၭစဲၪ့ထၪ့အဘိၩ့ဘၭနီၪ, (အဂဲးဘဲၫယီၩ ၥံၫဝ့ၫ) ကိၭဝ့ၫအမံၩ့လၧဘံၫ့အိနံၫလီၫ. အ့ၪမွဲအဖါလ ဂၩနီၪကိၭအမံၩ့ လၧစဘံၪ့ယမံၫ့လီၫ.",
			"19": "<sup>19</sup> တၭနးရၫခ့လၭၥံၫဝ့ၫနီၪ, ဘၪဆၧခုၪ့လၩ့ဘၧၩ့ခွံၬ ဝ့ၫလၧအ့ဖၭၥၭအဖၧၩ့ၥၭလီၫ. အဝ့ၫနီၪ မွဲဘ့ၫၥလံၫ",
			"20": "<sup>20</sup> ဟံၫ့လီၫ.- တၭစယၫကူၭၥုၪ့လၩ့ထုၪ့ လထုၪ့လၧအၥွၪ ခိၪဖၧၩ့လီၫ. အဝ့ၫနီၪ မွဲနးရၫခ့လၭအၥွၪခိၪ ထုၪ့လ ထုၪ့ထီးမုဆၫလနံၩယီၩလီၫ.",
			"21": "<sup>21</sup> စအံၫစရ့လၭစဲၪ့ထၪ့တၭ, မၩထၪ့အတဲၩလၧမံဂဒၪ",
			"22": "<sup>22</sup> အံၫဒၧၫလၧယၫလခီၫလီၫ.- ဆၧမၩအၥၭလၧစအံၫစ ရ့လၭအီၪဝ့ၫ လၧခးနီၪအဘိၩ့ဘၭတၭ, စရုဘံၫ့လ့ၩ မံၫဎုၬလၧအဖါ အၥံၪမၫနးဘံ လဟၫတၭ, စအံၫစရ့ လၭနါဂၧၫ့ဝ့ၫလီၫ.",
			"23": "<sup>23</sup> တၭစယၫကူၭအဖိၪခွၫ အီၪလဆံၫနံၫဂၩလီၫ. နး လံအၫအဖိၪခွၫၥံၪ, စယၫကူၭအဖိၪဝဲၡါ, မွဲစရုဘံၫ့,ဒဲစ စံမအၧၫ့,ဒဲစလံဝဲၫ, ဒဲစယုဒၭ,ဒဲစအံစခၫ, ဒဲစဇ့ၭဘ",
			"24": "<sup>24</sup> လၧၫ့လီၫ.- တၭနးရၫခ့လၭအဖိၪခွၫၥံၪနီၪ, မွဲစယိၥၭ,",
			"25": "<sup>25</sup> ဒဲစဘံၪ့ယမံၫ့လီၫ.- တၭနးရၫခ့လၭအဎီးမုၪနးဘံလ",
			"26": "<sup>26</sup> ဟၫအဖိၪခွၫၥံၪနီၪ, မွဲစဒၫ့ဒဲစနၭၥလဲၫလီၫ.- တၭနးလံ အၫအဎီးမုၪနးဇံလဖၫ အဖိၪခွၫၥံၪနီၪ, မွဲစဂၭဒဲစအၭ ၡၧၫလီၫ. အဝ့ၫၥံၪ, မွဲစယၫကူၭအဖိၪခွၫလဖၪ လၧၦ ဆီၫ့အီၪန့ဝ့ၫလၧအဂး လၧပၫဒၫ့အၫရၫ့အဖၧၩ့နီၪလီၫ.",
			"27": "<sup>27</sup> တၭစယၫကူၭဂဲၫလၧအဖါ စအံစၭအအီၪလၧမၫ မရံၫ လၧဒိၩ့ကၧၫယၭအၫဘၫ, အဝ့ၫနီၪ, (မွဲဟံဘြၧၫ့) ထီး",
			"28": "<sup>28</sup> စအၫဘြဟၫ့, ဒဲစအံစၭအီၪမွံၩအလးလီၫ.- တၭစအံ",
			"29": "<sup>29</sup> စၭအမုနံၩလဖၪနီၪ မွဲအနံၪ့လယၩဎိၭဆံၫလီၫ.- တၭ စအံစၭအၥၭလူၬတၭ, ၥံၫဝ့ၫနီၪး ဆၧအီၪက့ၪကီၪ့အ ဝ့ၫဒၪလၧအဆၨၩဒၪဝ့ၫလီၫ. အၥၭၡါဆ့ဒဲအနံၩအၥၫ့ ဎွ့ၩထၪ့ဝ့ၫတၭး အဖိၪခွၫစအံစီၫ ဒဲစယၫကူၭၥံၪ ခုၪ့ လၩ့ဘၧၩ့ခွံၬဝ့ၫလီၫ."
		},
		"36": {
			"1": "<sup>1</sup> အယီၩမွဲစအံစီၫအဆၨၩအဆၬတၭး အဝ့ၫမွဲအံဒၧၫ့",
			"2": "<sup>2</sup> လီၫ.- စအံစီၫန့အမၫၥံၪ လၧခးကၫနအၫ့အဖိၪမုၪအ ကျၩနီၪၦဟ့ၥၭဖိၪ စအံလၧၫ့အဖိၪမုၪ နးအၫနၫလဂၩ, ဒဲၦဟ့ဝဲၭဖိၪစဇံဘအၧၫ့အဖိၪမုၪ နးအၫနၫနီၪအဖိၪမုၪ",
			"3": "<sup>3</sup> နးအဟိၫလံဘမၫလဂၩ,- ဒဲစအံၡမၫအ့လၭအဖိၪမုၪန",
			"4": "<sup>4</sup> ဘၫယီၭအထၧၫ့ဖုဝဲမုၪ နးဘၭၡမၭလဂၩလီၫ.- တၭ နးအၫဒၫနီၪ ဆီၫ့အီၪန့စအံၫလဲဖၭ လၧစအံစီၫအဂး,",
			"5": "<sup>5</sup> တၭနးဘၭၡမၭ ဆီၫ့အီၪန့စရယုၫအ့လၭ.- တၭနးအ ဟိၫလံဘမၫနီၪ ဆီၫ့အီၪန့စဇံအၧၭ, ဒဲစယၫအလၫ့, ဒဲစကိရၫလီၫ. အဝ့ၫၥံၪနီၪ, မွဲစအံစီၫအဖိၪခွၫၥံၪလၧ ဆၧအီၪဖျဲၪန့အဂး လၧခးကၫနအၫ့အဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> တၭစအံစီၫမၩန့အမၫလဖၪ ဒဲအဖိၪခွၫၥံၪ,ဒဲအဖိၪ မုၪၥံၪ,ဒဲကယဲၦၡၩ လၧဂံၪ့ဖၧၩ့ ထီးအလူၬလဖၪနီၪ ဒဲအၥိၪဒဲအဘ့ၪ, ဒဲအဆၧဖိၪဆၧဎါ အဒိၩ့ထီးအလူၬ တၭ,ကယဲအစူၪလးအခၪ့ခိၪ, လၧအန့ဘၪလၧခးကၫ နအၫ့အဖၧၩ့နီၪ, လ့ၩထၪ့ခွံၬလၧ အထၧၫ့ဖုဝဲစယၫကူၭ",
			"7": "<sup>7</sup> အမ့ၬယၫ, ထီၩ့လၧခးယဲၩ့လဘံၪ့အဖၧၩ့လီၫ.- အဂဲး ဘဲၫယီၩအဆၧဖိၪဆၧလံၩအၪနီၪ, ထီးအဝ့ၫၥံၪအီၪအ လးလစီၪ့ဎးၥ့ၪအ့ၬ. တၭခးလၧအဝ့ၫၥံၪအီၪမွံၩ လၧ အဖၧၩ့လဘံၪ့နီၪ, လၧအဆၧဖိၪဆၧဎါအဒိၩ့အကၠီၩ့",
			"8": "<sup>8</sup> တၭထီဝါအ့ၬ.- တၭစအံစီၫအီၪဝ့ၫ လၧခိၪလီၩ့စံအၫအ လီၩ့လီၫ. စအံစီၫနီၪမွဲအံဒၧၫ့လီၫ.",
			"9": "<sup>9</sup> တၭအယီၩမွဲၦအံဒၧၫ့ဖိၪလဖၪအဖါ, လၧခိၪလီၩ့စံ",
			"10": "<sup>10</sup> အၫအလီၩ့စအံစီၫအဆၨၩအဆၬလီၫ.- အယီၩမွဲစအံ စီၫအဖိၪခွၫၥံၪအမံၩ့း စအံစီၫအမၫနးအၫဒၫ အဖိၪခွၫ စအံလဲဖၭလဂၩ, ဒဲစအံစီၫအမၫ နးဘၭၡမၭအဖိၪခွၫ",
			"11": "<sup>11</sup> စရယုၫအ့လၭလဂၩလီၫ.- တၭစအံလဲဖၭအဖိၪခွၫၥံၪ, မွဲစတံမၫ့,စအိမၫ, ဒဲစဇံဖိၫဒဲစဂၫတၫ့, ဒဲစကံနၭလီၫ.",
			"12": "<sup>12</sup> တၭနးတံမနၫမွဲစအံစီၫအဖိၪခွၫ စအံၫလဲဖၭအၥံၪမၫ လီၫ. တၭဆီၫ့အီၪန့စအၫမလ့ၭ လၧစအံၫလဲဖၭအဂး လီၫ. အဝ့ၫၥံၪမွဲစအံစီၫအမၫ နးအၫဒၫ အဖိၪခွၫၥံၪ",
			"13": "<sup>13</sup> လီၫ.- တၭအယီၩမွဲ စရယုၫအ့လၭအဖိၪခွၫၥံၪ, စနၫ ဟၭ,ဒဲစဇံရၫ ဒဲစၡၫ့မၫ,ဒဲစမံဇၫလီၫ. အဝ့ၫၥံၪနီၪ, မွဲ",
			"14": "<sup>14</sup> စအံစီၫအမၫ နးဘၭၡမၭအဖိၪခွၫလဖၪလီၫ.- တၭအ ယီၩမွဲ စဇံဘအၧၫ့အဖိၪမုၪ နးအၫနၫအဖိၪမုၪ စအံစီၫ အမၫနးအဟိၫလံဘမၫ အဖိၪခွၫၥံၪ, အဝ့ၫဒၪအီၪဖျဲၪန့ စဇံအၧၭ, ဒဲစယၫအလၫ့, ဒဲစကိရၫလၧစအံစီၫအဂး လီၫ.",
			"15": "<sup>15</sup> တၭအယီၩ မွဲစအံစီၫအဖိၪခွၫ အစခၩ့လဖၪ,လၧစ အံစီၫအဖိၪဝဲၡါ စအံၫလဲဖၭအဖိၪခွၫလဖၪအကျၩး စ",
			"16": "<sup>16</sup> ခၩ့တံမၫ့,စခၩ့အိမၫ, စခၩ့ဇံဖိၫ,စခၩ့ကံနၭ.- စခၩ့ကိ ရၫ,စခၩ့ဂၫတၫ့, စခၩ့အၫမလ့ၭလီၫ. အဝ့ၫၥံၪမွဲစအံၫ လဲဖၭအစခၩ့ၥံၪ အီၪလၧခးအံဒၧၫ့အဖၧၩ့လီၫ. အဝ့ၫ",
			"17": "<sup>17</sup> ၥံၪမွဲနးအၫဒၫ အဖိၪခွၫၥံၪလီၫ.- တၭအယီၩမွဲစအံစီၫ အဖိၪခွၫစရယုၫအ့လၭအဖိၪခွၫၥံၪး စခၩ့နၫဟၭ, စခၩ့ ဇံရၫ,စခၩ့ၡၫ့မၫ စခၩ့မံဇၫလီၫ. အဝ့ၫၥံၪမွဲစရယုၫအ့ လၭအစခၩ့လဖၪ လၧခးအံဒၧၫ့အဖၧၩ့လီၫ. အဝ့ၫၥံၪ",
			"18": "<sup>18</sup> မွဲစအံစီၫအမၫ နးဘၭၡမၭအဖိၪခွၫလဖၪလီၫ.- တၭ အယီၩမွဲ စအံစီၫအမၫ နးအဟိၫလံဘမၫ အဖိၪခွၫၥံၪ, စခၩ့ဇံအၧၭ, စခၩ့ယၫအလၫ့ စခၩ့ကိရၫလီၫ. အဝ့ၫၥံၪ နီၪ,မွဲစအၫနၫ အဖိၪမုၪစအံစီၫအမၫ နးအဟိၫလံဘမၫ",
			"19": "<sup>19</sup> အစခၩ့လဖၪနီၪလီၫ.- အဝ့ၫၥံၪနီၪမွဲ စအံစီၫအဖိၪခွၫ ၥံၪ,အဝ့ၫဒၪမွဲအံဒၧၫ့ ဒဲအဝ့ၫၥံၪနီၪမွဲ အစခၩ့လဖၪလီၫ.",
			"20": "<sup>20</sup> တၭအယီၩမွဲၦဟီရၫဖိၪ စစံအၫအဖိၪခွၫလဖၪ, လၧအ အီၪဝ့ၫလၧခးဖၧၩ့း စလိတၫ့,ဒဲစၡိဘလၭ, ဒဲစဇံဘ",
			"21": "<sup>21</sup> အၧၫ့,ဒဲစအၫနၫ,- ဒဲစဒဲၫၡိၫ့,ဒဲစအံဇၧၫ, ဒဲစဒဲၫၡၫ့လီၫ. အဝ့ၫၥံၪမွဲစခၩ့လဖၪ လၧၦဟီရၫဖိၪအကျၩ စစံအၫအ",
			"22": "<sup>22</sup> ဖိၪခွၫၥံၪလၧ ခးအံဒၧၫ့အဖၧၩ့လီၫ.- တၭစလိတၫ့အဖိၪ ခွၫၥံၪမွဲစဟိရဲၫ, ဒဲစဟ့မၫ့, ဒဲစလူတၫ့အထၧၫ့ဖုဝဲမုၪမွဲ",
			"23": "<sup>23</sup> နးတံမနၫလီၫ.- တၭအယီၩမွဲစၡိဘလၭ အဖိၪခွၫၥံၪ, စအၫလဝၫ့, ဒဲစမၪ့အဟၭဒဲစအံဘလၭ, ဒဲစၡံဖိၫ,ဒဲစ",
			"24": "<sup>24</sup> အိနၫ့လီၫ.- တၭအယီၩမွဲစဇံဘအၧၫ့အဖိၪခွၫ, စအ့ ယၫ,ဒဲစအၫနၫလီၫ. ဆၧလၧစအၫနၫနီၪ, မွဲၦလဂၩလၧ အယိအဖါစဇံဘအၧၫ့ အကၥ့ၪယီၩ့ အဘိၩ့ဘၭနီၪ, ဒၪန့ထံၫထၪ့ဖျိၭ လၧၩ့အလး လၧမံၩ့လၬကျၩလီၫ.",
			"25": "<sup>25</sup> တၭအယီၩမွဲစအၫနၫအဖိၪၥံၪ, စဒဲၡိၫ့,ဒဲစအၫနၫအဖိၪ",
			"26": "<sup>26</sup> မုၪနးအဟိၫလံဘမၫလီၫ.- တၭအယီၩမွဲစဒဲၡိၫ့အဖိၪ ခွၫၥံၪ,စဟံၫ့ဒၫ့, ဒဲစအ့ၭၡဘၫ့, ဒဲစအံၥၫ့ဒဲစခံရၫ့လီၫ.",
			"27": "<sup>27</sup> တၭအယီၩမွဲ စအံဇၧၫအဖိၪခွၫၥံၪး စဘံလယၫ့, ဒဲစ",
			"28": "<sup>28</sup> ဇၫအဝၫ့,ဒဲစအၫကၫ့လီၫ.- တၭအယီၩမွဲစဒဲၫၡၫ့အ",
			"29": "<sup>29</sup> ဖိၪခွၫစအၧဇၭ, ဒဲစအၫရၫ့လီၫ.- တၭအယီၩမွဲစခၩ့လ ဖၪလၧၦဟီရၫဖိၪအကျၩ စခၩ့လိတၫ့, စခၩ့ၡိဘလၭ,",
			"30": "<sup>30</sup> စခၩ့ဇံဘအၧၫ့,စခၩ့အၫနၫ,- စခၩ့ဒဲၡိၫ့, စခၩ့အံဇၧၫ့, စခၩ့ဒဲၫၡၫ့လီၫ. အဝ့ၫၥံၪနီၪမွဲ ၦဟီရၫဖိၪအစခၩ့လၧအ စခၩ့လဖၪအကျၩ လၧခးစံအၫအဖၧၩ့လီၫ.",
			"31": "<sup>31</sup> တၭအယီၩမွဲစဎွၩၥံၪလၧအပၧၩ့ ဆၧလၧခးအံဒၧၫ့ အဖၧၩ့လၧအံၫစရ့လၭဖိၪၥံၪ အစဎွၩလချႃၭပၧၩ့ဒံၭ",
			"32": "<sup>32</sup> ဘၪနီၪ,- မွဲစဘံအီၫအဖိၪခွၫ စဘံလၫကဲၪစဎွၩ လၧ ခးအံဒၧၩ့အဖၧၩ့တၭ, အဒိၩ့အမံၩ့မွဲဒံၫ့ဟၫဘၫလီၫ.",
			"33": "<sup>33</sup> စဘံလၫၥံၫဝ့ၫတၭ, စစံရၫအဖိၪခွၫ ဘၪဆဲၫ့လၧဒိၩ့ဘီဇ",
			"34": "<sup>34</sup> ရၫစယိဘၭကဲၪစဎွၩ လၧအလးလီၫ.- စယိဘၭနီၪၥံၫ ဝ့ၫတၭ, စယုၡၫ့ဘၪဆဲၫ့ လၧခးတံမၫ့ကဲၪစဎွၩ လၧအ",
			"35": "<sup>35</sup> လးလီၫ.- စဟုၡၫ့နီၪၥံၫဝ့ၫတၭ စဘံဒၭအဖိၪခွၫ,(ၦလၧ အကျီၪ့ၥံၫခွံၬ မံဒအၫ့လၧခးမိအၭအဖၧၩ့) စဟၫဒၭကဲၪ",
			"36": "<sup>36</sup> စဎွၩလၧအလးလီၫ. အဒိၩ့အမံၩ့မွဲအၫဝ့ၭလီၫ.- စဟၫ ဒၭနီၪၥံၫဝ့ၫတၭ, စစၫ့မျၫဘၪဆဲၫ့ လၧမၭစံကၫ ကဲၪ",
			"37": "<sup>37</sup> စဎွၩလၧအလးလီၫ.- စစၫ့မျၫနီၪၥံၫဝ့ၫတၭ, စစီလူၫ ဘၪဆဲၫ့လၧဒိၩ့ရဟိဘိၭ လၧထံၫမိၡါအနဲၩ့နီၪ, ကဲၪ",
			"38": "<sup>38</sup> စဎွၩလၧအလးလီၫ.- စစီလူၫနီၪၥံၫဝ့ၫတၭ, စအၭဘီၫ အဖိၪခွၫစဘၫအလၭဟၫနၫ့ ကဲၪစဎွၩလၧအလးလီၫ.",
			"39": "<sup>39</sup> စအၭဘီၫအဖိၪခွၫ စဘၫအလၭဟၫနၫ့ ၥံၫဝ့ၫတၭ, စဟၫဒၫကဲၪစဎွၩ လၧအလးလီၫ. အဒိၩ့ အမံၩ့မွဲပၫ ယုၫးတၭအမၫအမံၩ့ နးမဟ့တဘ့ၫလၭ, နးမၫတြ့ၭ အဖိၪမုၪစမံဇဟၭ အဖိၪမုၪလီၫ.",
			"40": "<sup>40</sup> တၭအယီၩမွဲစအံစီၫ အစခၩ့လဖၪအမံၩ့ ဘဲၫအဒီၪ့ လဖၪအၥိၭ, ဘဲၫအလးလဖၪအၥိၭ လၧအမံၩ့လဖၪ",
			"41": "<sup>41</sup> နီၪ,စခၩ့တုမနၫ, စခၩ့ယံၥ့ၭ,- စခၩ့အဟိၫလံဘမၫ,",
			"42": "<sup>42</sup> စခၩ့အံလၫ, စခၩ့ပဲနၫ့.- စခၩ့ကံနၭ, စခၩ့တ့မၫ့, စခၩ့မံ",
			"43": "<sup>43</sup> ဘဇၫ, စခၩ့မၭဒံၫအ့လၭ, စခၩ့အဲရၫ့လီၫ.- အဝ့ၫၥံၪနီၪ မွဲအံဒၧၫ့အစခၩ့လဖၪ ဘဲၫအအီၪဝ့ၫအလး အၥိၭလၧ အဆၧဖီၪ့ထၬ အခးဖၧၩ့လီၫ. အဝ့ၫဒၪနီၪ မွဲၦအံဒၧၫ့ ဖိၪအဖါ စအံစီၫလီၫ."
		},
		"37": {
			"1": "<sup>1</sup> တၭစယၫကူၭအီၪဝ့ၫ လၧခးနီၪအဖၧၩ့, ထီးအဖါ အီၪမွံၩ လၧခးကၫနအၫ့အဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> အယီၩမွဲစယၫကူၭအဆၨၩအဆၬလီၫ. စယိၥၭအ ၥၭဎွ့ၩထၪ့လဆံၫနွ့ၫနံၪ့နီၪတၭ, ယူၬၥိၪ ဒဲဘ့ၪလဖၪ လၧအထၧၫ့ဖုဝဲအၥိၭတၭ, ဖိၪၥၪခွၫနီၪ အီၪလၧအဖါ အမၫလဖၪ နးဘံလဟၫအဖိၪခွၫၥံၪ, ဒဲနးဇံလဖၫအဖိၪ ခွၫၥံၪ,အၥိၭတၭ, စယိၥၭဂဲၫဆိၬအဝ့ၫၥံၪ အပရၧၫ့အ",
			"3": "<sup>3</sup> အၧၩ့လၧအဖါအအီၪနီၪလီၫ.- တၭစအံၫစရ့လၭအဲၪ စယိၥၭအၪနဲၪ့အဖိၪခွၫ ထီးအလူၬဒံၭလီၫ. အဂဲးဘဲၫ ယီၩမွဲအၥၭၡါ အဖိၪခွၫလီၫ. တၭမၩဆဲၫ့ဖၭထီၫ လ",
			"4": "<sup>4</sup> ဘံၪ့လၧအဂးလီၫ.- အထၧၫ့ဖုဝဲလဖၪနီၪ ဒၪဘၪလၧအ ဖါအဲၪအဝ့ၫဒၪ အၪနဲၪ့အအဲၪအထၧၫ့ဖုဝဲ ထီးအလူၬ ဒံၭတၭ, အဝ့ၫၥံၪ ၥၭဂဲၫ့အဝ့ၫနီၪတၭ, ချဲၩ့ဆၧမုၬမုၬ လၧအဝ့ၫဒၪကဲၪအ့ၬ.",
			"5": "<sup>5</sup> စယိၥၭမံၫမးဆၧမံၫမးတၭ လီၩဘၪအထၧၫ့ဖုဝဲနီၪ, အဝ့ၫၥံၪ ၥၭဂဲၫ့ဝ့ၫ အၪနဲၪ့ဒံၭ လၧအခၪ့ထံၭဒံၭလီၫ.",
			"6": "<sup>6</sup> တၭအဝ့ၫဒၪ စံၭအဝ့ၫၥံၪ ခိၭနၪလါ ယဆၧမံၫမးယီၩ",
			"7": "<sup>7</sup> ဘီၪ.- တၭယိခွါ, ပကၭထံၬဘုၪ လၧဆံၬဖၧၩ့တၭ, ယိ ခွါ, ယဘုၪထူဂဲထုၪ့တၭ, အီၪဆၧၫ့ထုၪ့လီၫ. တၭယိ ခွါ, နၥံၪအဘုၪထူအီၪဝၬဖီၩ့ဝ့ၫတၭ, ကူၭလၩ့အၥၭလၧ",
			"8": "<sup>8</sup> ယဘုၪထူအမ့ၬယၫလီၫ.- တၭအထၧၫ့ဖုဝဲၥံၪစံၭအဝ့ၫ ဒၪ, မွဲနမိကဲၪစဎွၩ လၧပဖၫ့ခိၪတၡါဆ့ဧၪး တၭလၧအ ဆၧမံၫမးအကၠီၩ့, ဒဲလၧအဆၧချဲၩ့အကၠီၩ့နီၪ, အဝ့ၫၥံၪ",
			"9": "<sup>9</sup> ၥၭဂဲၫ့ဒံၭအဝ့ၫဒၪ အၪနဲၪ့အလးဒံၭလီၫ.- တၭအဝ့ၫ မံၫမးဒံၭဆၧမံၫမး လၧအဂူၫဂၩလမံၩ့နီၪ, လီၩဘၪအ ထၧၫ့ဖုဝဲၥံၪတၭစံၭဝ့ၫဒၪ, ယိခွါ, ယမံၫမးဒံၭဆၧမံၫမး လမံၩ့ဒံၭတၭ, ယိခွါ, မုဒဲလၩဒဲၡၪၥံၪ လဆံၫလဖျိၪ့ကူၭ",
			"10": "<sup>10</sup> လၩ့အၥၭလၧယမ့ၬယၫလီၫ.- တၭအဝ့ၫလီၩဘၪအဖါ ဒဲအထၧၫ့ဖုဝဲၥံၪ, အဖါအၪ့ၥီၪ့ဝ့ၫတၭ, စံၭ, ဆၧမံၫမး လၧနမံၫမးယီၩ, မွဲဘဲၫၥ့ၪလဲၪး ယၧၩ,ဒဲနမိ, ဒဲနထၧၫ့ဖုဝဲ",
			"11": "<sup>11</sup> ၥံၪမိဂဲၫထွံၩလၩ့ လၧနမ့ၬယၫတၡါဆ့ဧၪ.- တၭအထၧၫ့ ဖုဝဲလဖၪနီၪၥၭခ့ၬဝ့ၫလီၫ. အ့ၪမွဲအဖါလဂၩနီၪ, ထီးန့ ဆၧချဲၩ့လထံၪနီၪလီၫ.",
			"12": "<sup>12</sup> တၭအထၧၫ့ဖုဝဲလဖၪ လ့ၩယူၬ အဖါအၥိၪဒဲဘ့ၪ",
			"13": "<sup>13</sup> လဖၪ လၧၡံခံၫ့နီၪလီၫ.- တၭစအံၫစရ့ လၭစံၭစယိၥၭ, နထၧၫ့ဖုဝဲလဖၪ ယူၬဆၧလၧၡံခံၫ့အဖၧၩ့,မွဲအ့ၬဧၪ. ဂဲၫဘီၪ,ယမိအၪ့မၧၫ့ နလ့ၩဆၧလၧအအီၪလီၫ. အဝ့ၫနီၪ",
			"14": "<sup>14</sup> စံၭဝ့ၫ ယအီၪထီးယီၩလီၫ.- တၭစံၭ အဝ့ၫဒၪလ့ၩဘီၪး နထၧၫ့ဖုဝဲအီၪမုၬဧၪ, ဒဲၥိၪဒဲဘ့ၪၥံၪ အီၪဂ့ၩဘၪစဲၪဆ့ ဧၪနီၪ, လ့ၩယိခွါ, တၭဂဲၫထဲၩ့လီၩ ဘၪယၧၩဘီၪ. တၭအၪ့မၧၫ့အစဲၪ့ထၪ့ခွံၬ လၧဆၧပျၩ့ဟံဘြၧၫ့တၭ,",
			"15": "<sup>15</sup> အဝ့ၫနီၪဂဲၫထီၩ့လၧၡံခံၫ့လီၫ.- ၦလဂၩဒၪဘၪအဝ့ၫတၭ, ယိခွါ, လ့ၩဝံၩ့ဝၩ့ဆၧလၧမံၩ့လၬကျၩလီၫ. ၦလဂၩနီၪ အၪ့စၪ့ဝ့ၫတၭ, စံၭ, မွဲနအၪ့ဎၬ ဆၧနီၪလမံၩ့လဲၪ.",
			"16": "<sup>16</sup> တၭအဆၧစံၭဝ့ၫ, ယအၪ့ဎၬယထၧၫ့ဖုဝဲၥံၪလီၫ. ဒုၭနဲၪ လါယၧၩထီးအဝ့ၫၥံၪ ယူၬၥိၪအဒီၪ့ၥံၪအလးနီၪဘီၪ.",
			"17": "<sup>17</sup> တၭၦလဂၩနီၪ စံၭဆၧၫ့ဆၧ, အဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬယူၭ ထီးယီၩယူၭ. အဂဲးဘဲၫယီၩ ယနါဂၧၫ့အစံၭဝ့ၫ, မွဲပလ့ၩၡီၩ့ လၧဒိၥၫ့နီၪဘီၪ. စယိၥၭလီၩ့ဝ့ၫတၭ ဒၪဘၪအဝ့ၫၥံၪ လၧဒိၥၫ့အဖၧၩ့နီၪလီၫ.",
			"18": "<sup>18</sup> အဝ့ၫၥံၪဒၪဘၪအဝ့ၫဒၪ လၧအယဲၩ့တၭး ဘိၩ့အလ ချႃၭဂဲၫဘူၭဒံၭဘၪနီၪ, အဝ့ၫၥံၪ ကိၪ့ထၪ့ထၫ့ဒုၪဒၩအ",
			"19": "<sup>19</sup> ဝ့ၫလၧအမိမၩ ၥံၫဝ့ၫအဂဲးလီၫ.- ချဲၩ့လိၬအၥၭတၭ,စံၭ",
			"20": "<sup>20</sup> ဝ့ၫဒၪ,ယိခွါ, ၦမံၫမးဆၧအကဆါ, ဂဲၫဖီၬ- ဘိၩ့နဲၪ့ယီၩ, ဂဲၫဘီၪ, မွဲပမၩၥံၫၡီၩ့အဝ့ၫဒၪတၭ, ခွံၬလၩ့ခွံၬလၧဆၧ ဖၧၩ့ဆံၭ. တၭပမိစံၭ လၧဆၧဖိၪဆၧဎါ အအၧၩ့လဒုၩ အၪ့ခွံၬဝ့ၫတၭ, အဆၧမံၫမးလဖၪ မိကဲၪထၪ့ဘဲၫၥ့ၪ",
			"21": "<sup>21</sup> လဲၪဘဲၫၥ့ၪလဲၪနီၪ, ပမိဒၪဘၪလီၫ.- တၭစရုဘံၫ့နါဂၧၫ့ ဝ့ၫနီၪ, မၩဖီၩ့မၩဖျ့ၭဝ့ၫလၧအစူၪဖၧၩ့း တၭစံၭဝ့ၫဒၪ,",
			"22": "<sup>22</sup> မွဲပထီးကျီၪ့ၥံၫအဝ့ၫလဂ့ၩ.- တၭစရုဘံၫ့စံၭအဝ့ၫၥံၪ, ထီးလူၫလၩ့ဆၧၥွံၪလဂ့ၩ, ခွံၬလၩ့ခွံၬဝ့ၫလၧဆၧဖၧၩ့ ယီၩလၧမံၩ့လၬကျၩဆံၭ. နၥံၪထီးအီၪက့ၪနၥံၪအစူၪ လၧအလီၩ့လဂ့ၩး ဘဲၫၥိၭအမိမၩဖီၩ့မၩဖျ့ၭဝ့ၫလၧအ ဝ့ၫၥံၪအစူၪဖၧၩ့, လၧအမိဖ့ၪလၫ့ဒီၭ လၧအဖါအဂဲး လီၫ.",
			"23": "<sup>23</sup> ထီးစယိၥၭဂဲၫထီၩ့လၧအထၧၫ့ဖုဝဲအအီၪတၭ, အဝ့ၫ ၥံၪဘဲၪ့လၩ့ခွံၬအဆဲၫ့နီၪ, အဆဲၫ့ဖၭထီၫလၧအအီၪဝ့ၫ",
			"24": "<sup>24</sup> လၧအလီၩ့လီၫ.- မၩန့အနၫ့ဆါတၭ, ခွံၬလၩ့ဝ့ၫလၧ ဆၧဖၧၩ့လီၫ. တၭဆၧဖၧၩ့လဖၧၩ့နီၪအီၪပျီၩလီၫ. ထံၫ",
			"25": "<sup>25</sup> အီၪလၧအဖၧၩ့အ့ၬ.- တၭအဝ့ၫၥံၪဆၧၫ့နၩ့အၪ့ဆၧနီၪ ကျဲၪ့ထၪ့အမ့ၬယိဆၧတၭ, ယိခွါ, ၦအံၡမၫအ့လၭ ဖိၪလဒီၪ့ဂဲၫလၧခးဂံလအၭ အီၪလၧကလအူၭတၭ, ဆိၬနၪ့တြူၭနကိၭအဎဲၫ့, ဒဲၥံၪ့စရံၭအထူၭ, ဒဲၥံၪ့လိၭအ",
			"26": "<sup>26</sup> ထူၭတၭ, လ့ၩဆိၬလၩ့ဝ့ၫ လၧအံဇံၭအဖၧၩ့လီၫ.- စယု ဒၫစံၭအထၧၫ့ဖုဝဲၥံၪ, ပအ့ၪမၩၥံၫပထၧၫ့ဖုဝဲလဂၩယီၩ, အီၪက့ၪၥူၪအၥွံၪတၭ, မွဲအန့ကၩဆၧနီၪ လမံၩ့လဲၪ.",
			"27": "<sup>27</sup> ဂဲၫဘီၪ,မွဲပအၪ့ဆၫခွံၬၡီၩ့ လၧၦအံၡမၫအ့လၭဖိၪနီၪ ဆံၭး တၭမွဲပစူၪထီးအီၪလၧအလီၩ့လဂ့ၩး အဂဲးဘဲၫ ယီၩမွဲပထၧၫ့ဖုဝဲ, ပဖံၭပယၪလီၫ. တၭအထၧၫ့ဖုဝဲလ",
			"28": "<sup>28</sup> ဖၪနီၪခိၭနၪဝ့ၫလီၫ.- ၦမံဒအၫ့ဖိၪ, နီၪအၪ့ခၩဆၧ, လ့ၩ ဖီၩ့ခွံၬလၧအအီၪတၭ, အဝ့ၫၥံၪထုၭထၪ့တၭ, ဆိၬထၪ့ စယိၥၭလၧဆၧဖၧၩ့နီၪ, အၪ့ဆၫခွံၬစယိၥၭ လၧၦအံ ၡမၫအ့လၭဖိၪ လၧစ့ၩနံၫဆံၫအဂးလီၫ. တၭအဝ့ၫၥံၪ",
			"29": "<sup>29</sup> ဆိၬစယိၥၭ လၧအံဇံၭအဖၧၩ့လီၫ.- တၭစရုဘံၫ့ထဲၩ့ ထဲၩ့ဝ့ၫလၧဆၧဖၧၩ့နီၪ, ယိခွါ, စယိၥၭအီၪလၧၩ့လၧ",
			"30": "<sup>30</sup> ဆၧဖၧၩ့အ့ၬ. အဝ့ၫၡၫ့ခွံၬအဖၬဘဲၩ့,- တၭထဲၩ့ထဲၩ့ လၧအထၧၫ့ဖုဝဲအအီၪတၭ, စံၭဝ့ၫဒၪ, ဖိၪၥၪခွၫလဂၩ နီၪအီၪလၧၩ့အ့ၬ. တၭယဝ့ၫဒၪယီၩ ယမိလ့ၩယဝ့ၫခီၫ",
			"31": "<sup>31</sup> ခီၫလဲၪ.- အဝ့ၫၥံၪမၩန့စယိၥၭ အဆဲၫ့လဘံၪ့တၭ, မၩ ၥံၫဘ့ၪဖိၪလဒုၩတၭ, စုၪလၩ့အဆဲၫ့ လဘံၪ့နီၪလၧအ",
			"32": "<sup>32</sup> ၥွံၪဖၧၩ့လီၫ.- အဝ့ၫၥံၪအၪ့မၧၫ့ ၦထဲၩ့ဆိၬဆဲၫ့ဖၭထီၫ လဘံၪ့နီၪတၭ, လ့ၩဆိၬဝ့ၫလၧအဖါအအီၪနီၪ, စံၭဝ့ၫ ဒၪ, ဆၧယီၩလဘံၪ့ပဒၪန့လီၫ. မွဲနဖိၪခွၫ အဆဲၫ့ဧၪ,",
			"33": "<sup>33</sup> လမွဲဘၪဧၪနီၪ, ယိနဲၪ့နဝ့ၫဆံၭ.- တၭအဝ့ၫနီၪယိနဲၪ့ ဆၧတၭ,စံၭဝ့ၫဒၪ, မွဲယဖိၪခွၫ စယိၥၭအဆဲၫ့မၬကၨ, ဆၧဖိၪဆၧဎါ အအၧၩ့လဒုၩ အၪ့ခွံၬယူၭအဝ့ၫယူၭ. တၭစယိၥၭနီၪ ဘၪဆၧအဲၪ့ၥံၫခွံၬယူၭ တၡါယူၭလီၫ.",
			"34": "<sup>34</sup> စယၫကူၭၡၫ့ခွံၬ အဖၬဘဲၩ့တၭ, ကီၩ့ထၪ့အဆၧယၬ အကဲၩ့လၧအယးဒံၩ့တၭ, ၥုၪ့အုၭၥၭအုၭလၧအကၠီၩ့",
			"35": "<sup>35</sup> အၪနံၩအၪၥၫ့လီၫ.- အဖိၪခွၫထီးအလူၬ, ဒဲအဖိၪမုၪ ထီးအလူၬ, ဂဲထုၪ့မၩမုၬထၪ့ထဲၩ့ဝ့ၫတၭ, အဝ့ၫဒၪထိး ဆၧၫ့အဆၧမၩမုၬ ထၪ့ထဲၩ့ဝ့ၫနီၪကဲၪအ့ၬ. တၭစံၭဝ့ၫ ဒၪ,အဂဲးဘဲၫယီၩ ယမိလ့ၩလၩ့လၧဆၧဘၪ မီၪ့ဆၧဘၪ မၭလၧယဖိၪခွၫအအီၪ လၧဖျႃဖၧၩ့လီၫ. တၭအဖါအ မ့ၬထံၫလၩ့လၧအကၠီၩ့လီၫ.",
			"36": "<sup>36</sup> တၭၦမံဒအၫ့ဖိၪနီၪ အၪ့ဆၫခွံၬဝ့ၫလၧဖၫရိၫ အၦဒိၪ, ၦၡၩမၩၥံၫဆၧလဖၪအခိၪ, စပီတံၫဖၫလၧအံဇံၭအဖၧၩ့, နီၪလီၫ."
		},
		"38": {
			"1": "<sup>1</sup> အထီထီးနီၪ ဆၧမၩအၥၭလၧစယုဒၫ လ့ၩဆၧစဲၪ့ ထၪ့ခွံၬ လၧအထၧၫ့ဖုဝဲအကျၩတၭ, ကၠၪကဒၩအၥၭ လၧၦလဂၩ, ၦအဒၧလၫ့ဖိၪအအီၪတၭ, အမံၩ့မွဲစဟဲ",
			"2": "<sup>2</sup> ရၫလီၫ.- တၭစယုဒၫနီၪဒၪဘၪၦလဂၩ, ၦကၫနအၫ့ဖိၪ စရှုအၫအဖိၪမုၪထီးနီၪတၭ, မၩန့ဝ့ၫတၭ, လ့ၩနုၬဝ့ၫ",
			"3": "<sup>3</sup> လၧအအီၪလီၫ.- အဝ့ၫနီၪဒၧၩ့ထၪ့တၭ, ဆီၫ့အီၪန့အ",
			"4": "<sup>4</sup> ဖိၪခွၫတၭ ဖျိၬဝ့ၫအမံၩ့စအံရၫလီၫ.- မွဲအဒၧၩ့ထၪ့ဒီၭ တၭ,ဆီၫ့အီၪန့အဖိၪခွၫတၭ, ဖျိၬဝ့ၫအမံၩ့ စအိနၫ့လီၫ.",
			"5": "<sup>5</sup> ဒၧၩ့ထၪ့ဒီၭဝ့ၫတၭ, ဆီၫ့အီၪန့အဖိၪခွၫတၭ, ဖျိၬဝ့ၫအ မံၩ့စၡံလၫလီၫ. တၭလၧအဆီၫ့အီၪန့အဝ့ၫလဂၩနီၪ, စယုဒၫအီၪဝ့ၫလၧဒိၩ့ ခံဇံၭလီၫ.",
			"6": "<sup>6</sup> စယုဒၫမၩန့မၫ လၧအဖိၪခွၫဝဲၡါ စအံရၫအဂးတၭ,",
			"7": "<sup>7</sup> အမံၩ့မွဲနးတၫမၫလီၫ.- စယုဒၫအဖိၪဝဲၡါစအံရၫလဂၩ နီၪအၧၩ့ဝ့ၫ လၧယဟိဝၩအမ့ၬယၫတၭ, ယဟိဝၩမၩ",
			"8": "<sup>8</sup> ၥံၫအဝ့ၫဒၪလီၫ.- တၭစယုဒၫစံၭစအိနၫ့, လ့ၩနုၬလၧနဝဲ အမၫအအီၪတၭ, န့မၫလၧအဝ့ၫတၭ, ဒုၭအီၪထၪ့ဆၧ",
			"9": "<sup>9</sup> အချံၫအၥၫလၧနဝဲအဂးဆံၭ.- တၭစအိနၫ့နီၪၥ့ၪယၫ လၧဆၧအချံၫအၥၪနီၪ မိကဲၪထၪ့အဆၧဒၪဝ့ၫအ့ၬး တၭ ဆၧမၩအၥၭထီးအလ့ၩနုၬ လၧအဝဲအမၫအအီၪတၭ, ဒုၭလၩ့ခွံၬအဆၧလၧဂၪ့ခိၪ ဘဲၫၥိၭအထီးဖ့ၪလၫ့ဆၧ",
			"10": "<sup>10</sup> အချံၫအၥၪလၧအဝဲလဂၩနီၪလဂ့ၩလီၫ.- တၭဆၧလၧ အမၩဝ့ၫနီၪ, မွဲဆၧအၧၩ့လၧယဟိဝၩ အမ့ၬယၫတၭ,",
			"11": "<sup>11</sup> ဆၧမၩၥံၫခွံၬအဝ့ၫဆ့လီၫ.- တၭစယုဒၫစံၭ အဒဲၪနးတၫ မၫနီၪ, အီၪမဲၫလၧနဖါအဂံၪ့ဖၧၩ့ ထီးယဖိၪခွၫစၡံလၫ ဒိၪထၪ့ဆံၭ. အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, မိၥံၫဘၪခိၬဘဲၫ အဝဲလဖၪအၥိၭလီၫ. တၭနးတၫမၫနီၪ လ့ၩအီၪဝ့ၫလၧ အဖါအဂံၪ့ဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> လၧအၪနံၩအၪၥၫ့အလးခဲၫ့တၭ, စရှုအၫအဖိၪမုၪ, စယုဒၫအမၫၥံၫဝ့ၫဒၪလီၫ. စယုဒၫ ဘၪဆၧမၩမုၬဝ့ၫ ဂီၩ့တၭ,လ့ၩဝ့ၫ လၧၦထံၬၥိၪဆီၪ့ အအီၪလၧတံမနၫ, အဝ့ၫဒၪဒဲအထံၩအၥိၭ, ၦအဒၧလၫ့ဖိၪ စဟဲရၫလီၫ.",
			"13": "<sup>13</sup> ၦလီၩဘၪ နးတၫမၫနီၪ, စံၭဝ့ၫဒၪ, နမံၩ့ၡါအခွၫလ့ၩ",
			"14": "<sup>14</sup> ထၪ့လၧတံမနၫ ဘဲၫၥိၭအမိထံၬၥိၪအဆီၪ့လီၫ.- တၭ အဝ့ၫဒၪဘဲၪ့လၩ့ခွံၬ အမုၪမဲၫ အကီၩ့အၥိၭတၭ, ချႃၬ ဘံၭထၪ့အၥၭ လၧဆၧချႃၬဘံၭနီၪ, ကီၩ့ၥိၭဆၧတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧ ထံၫထၪ့ဖျိၭနံၫဖၧၩ့ အတရၫ့ထံၭလၧအ အီၪဝ့ၫလၧတံမနၫ အဖၧၩ့ၥၭအနဲၩ့ထံၭနီၪလီၫ. အဂဲး ဘဲၫယီၩမွဲအဒၪဘၪဝ့ၫ လၧစၡံလၫဒိၪထၪ့ဝ့ၫတၭ, ဆၧ ဖ့ၪလၫ့ဝ့ၫ လၧအဝ့ၫနီၪ အမၫအဂးအ့ၬ.",
			"15": "<sup>15</sup> စယုဒၫဒၪဘၪဝ့ၫတၭ, လၧအချႃၬဘံၭအမ့ၬအကၠီၩ့",
			"16": "<sup>16</sup> နီၪ, ဆီၫ့မီၪ့ဝ့ၫလၧအမွဲ ၦမဲၩဎွဲၩမုၪလဂၩလီၫ.- အဝ့ၫ ကၠၪအၥၭလၧအအီၪ, လၧဖၧၩ့ၥၭနဲၩ့ထံၭတၭ, စံၭဝ့ၫ ဒၪ,ဂဲၫဘီၪ, ဒုၭလ့ၩနုၬလါယၧၩ လၧနအီၪဆံၭ. အဂဲး ဘဲၫယီၩလၥ့ၪယၫဘၪ လၧအမွဲအဒဲၪလီၫ. တၭအဝ့ၫ ဒၪစံၭ,ဘဲၫၥိၭနမိဂဲၫနုၬ လၧယအီၪတၭ, နမိဖ့ၪလၫ့",
			"17": "<sup>17</sup> ယၧၩလၧဆၧနီၪလမံၩ့လဲၪ.- တၭအဝ့ၫဒၪစံၭ, ယမိ အၪ့မၧၫ့ၦဂဲၫဆိၬန့နၧၩ လၧဘ့ၪလဒုၩ လၧဘ့ၪအကျၩ လီၫ.တၭအဆၧ စံၭဆၧၫ့ဝ့ၫ, နလချႃၭအၪ့မၧၫ့လၩ့ဒံၭ ဘၪနီၪမွဲနမိအီၪ က့ၪဝဲၩပီၩ့လၩ့ဆၧလၧ ယစူၪဖၧၩ့လ",
			"18": "<sup>18</sup> မံၩ့မံၩ့ဆ့ဧၪ.- တၭအဝ့ၫစံၭ, ယမိဘၪဖ့ၪဝဲၩနၧၩပီၩ့ လၩ့ဆၧလၧ ဆၧနီၪလမံၩ့လဲၪ. တၭအဝ့ၫနီၪစံၭ, နဆၧ စဲၩနဲၪ့, ဒဲအဖျံၩ, ဒဲနိၪထိၭဘီၩ့, လၧအအီၪလၧနစူၪ ဖၧၩ့လီၫ. တၭအဆၧဖ့ၪလၫ့ ဆၧလဖၪနီၪ လၧအဝ့ၫ တၭ,လ့ၩနုၬလၧအအီၪနီၪ, အဆၧဒၧၩ့ထၪ့ဝ့ၫလၧအ",
			"19": "<sup>19</sup> ကၠီၩ့လီၫ.- တၭအဝ့ၫဂဲထုၪ့ထဲၩ့ ထဲၩ့ဝ့ၫနီၪ, ဘဲၪ့လၩ့ ခွံၬအဆၧချႃၬဘံၭလၧအလီၩ့တၭ, ကီၩ့ၥိၭထၪ့ထဲၩ့",
			"20": "<sup>20</sup> ၦမုၪမဲၫအကီၩ့အၥိၭလီၫ.- တၭစယုဒၫအၪ့မၧၫ့အထံၩ အၥိၭၦအဒၧလၫ့ဖိၪ လဂၩလ့ၩဆိၬဘ့ၪဖိၪ လဒုၩဘဲၫ ၥိၭအမိန့ ဘၪထဲၩ့အဆၧပီၩ့လၩ့ လၧၦမုၪအစူၪဖၧၩ့",
			"21": "<sup>21</sup> လီၫ.မွဲလါနၫ့တၭ ဒၪဘၪအဝ့ၫနီၪအ့ၬ.- တၭအၪ့စၪ့ၦ အီၪလၧအလးနီၪတၭ, စံၭ,ၦမဲၩဎွဲၩမုၪ လၧအအီၪယူၭ လၧထံၫထၪ့ဖျိၭနံၫဖၧၩ့ အတရၫ့ထံၭလဂၩနီၪ, မွဲအအီၪ ခီၫခီၫလဲၪး တၭအဝ့ၫၥံၪစံၭဝ့ၫ, ၦမဲၩဎွဲၩမုၪအီၪထီး",
			"22": "<sup>22</sup> ယီၩနးဂၩအ့ၬ.- အဝ့ၫဒၪထဲၩ့ထဲၩ့ လၧစယုဒၫအအီၪ တၭ,စံၭဝ့ၫ, ယဒၪဘၪၦမုၪနးဂၩအ့ၬ. တၭၦအီၪလၧ",
			"23": "<sup>23</sup> ဆၧအလးနီၪစံၭဝ့ၫ, ၦမဲၩဎွဲၩမုၪ အီၪနးဂၩအ့ၬ.- တၭ စယုဒၫစံၭ, မွဲအမၩန့ဒၪဝ့ၫဆံၭ. ပမ့ၬမိမဲဘၪခိၬလီၫ. ယိခွါး ယအၪ့မၧၫ့လၩ့ ဘ့ၪဖိၪလဒုၩယီၩတၭ, နဒၪဘၪ အဝ့ၫအ့ၬ.",
			"24": "<sup>24</sup> တၭဆၧမၩအၥၭ လၧခဲၫ့လၩၥၧၫ့ဘံၪ့ ကၪယူၭနီၪ ၦလီၩဘၪစယုဒၫတၭ, စံၭဝ့ၫ, နဒဲၪနးတၫမၫလဂၩ,မၩ မၪဘၪဆၧတၭ, ယိခွါ,ဒၧၩ့ထၪ့ဝ့ၫလီၫ. စယုဒၫစံၭ,ဂဲၫ ဆိၬထၪ့န့အဝ့ၫတၭ, မွဲအဘၪဆၧဎူလၩ့ခွံၬဝ့ၫဘီၪ.",
			"25": "<sup>25</sup> ထီးၦဂဲၫဆိၬထၪ့ဝ့ၫနီၪ အဝ့ၫအၪ့မၧၫ့လၩ့ဆၧလၧအမံၩ့ ၡါအအီၪတၭ, စံၭဝ့ၫဒၪ,ယဒၧၩ့ထၪ့ လၧဆၧလဖၪနီၪ အကဆါလီၫ. တၭစံၭဝ့ၫဒၪ, ယိနဲၪ့လါဆံၭ. ဆၧစဲၩ နဲၪ့ဒဲအဖျံၩ, ဒဲနိၪထိၭဘီၩ့လဖၪယီၩ, မွဲပလၫအဆၧ",
			"26": "<sup>26</sup> လဲၪ.- တၭစယုဒၫယိနဲၪ့ဆၧတၭ, စံၭဝ့ၫဒၪ, အဝ့ၫနီၪ တီၩနဲၪ့လီၩ့နဲၪ့ယၧၩဒံၭလီၫ. အဂဲးဘဲၫယီၩ ယလဖ့ၪ လၫ့ဘၪအဝ့ၫ လၧယဖိၪခွၫ စၡံလၫလီၫ. လၧခဲၫ့လ့ၩ ဘူၭလၧၩ့ဝ့ၫအ့ၬ.",
			"27": "<sup>27</sup> ဆၧမၩအၥၭလၧအဂူၭဆၫအဘိၩ့ဘၭတၭ, ယိခွါ,",
			"28": "<sup>28</sup> ၦအဎဲၩ့အီၪလၧအဒၧၩ့လးအဖၧၩ့လီၫ.- တၭဆၧမၩ အၥၭလၧအဂူၭ ဆၫအဘိၩ့ဘၭနီၪ, ဆၧအစူၪအီၪဖျီၪ ထၪ့တၭ, ၦယိၦဂူၭဖီၪ့ဝ့ၫတၭ, ခဲးအစူၪလၧဖျံၩ အ ဝီၩတၭ,စံၭဝ့ၫဒၪ အဝ့ၫလဂၩယီၩ, ဂဲၫဆိၫဝ့ၫဒၪလီၫ.",
			"29": "<sup>29</sup> ဆၧမၩအၥၭ လၧအထုၭထၪ့ထဲၩ့ အစူၪတၭ, ယိခွါ, အထၧၫ့ဖုဝဲလဂၩ ဂဲၫထၪ့ခွံၬဝ့ၫလီၫ. တၭၦမုၪ စံၭဝ့ၫ ဒၪ,နဘုၪ့ဖိး ဆၧဘဲၫၥ့ၪလဲၪၬ မွဲဆၧဘုၪ့ဖျီၫ့ ဆၧယီၩ အီၪလၧနလီၩ့ဆံၭ. တၭဖျိၬဝ့ၫအမံၩ့ လၧစဖၫရ့ၭလီၫ.",
			"30": "<sup>30</sup> လၧခဲၫ့ထဲၩ့တၭ, အထၧၫ့ဖုဝဲ လၧအအီၪလၧဖျံၩဝီၩ လၧအစူၪလီၩ့လဂၩနီၪ, ဂဲၫထၪ့ခွံၬဝ့ၫလီၫ. တၭဖျိၬအ မံၩ့လၧစဇၫရၫလီၫ."
		},
		"39": {
			"1": "<sup>1</sup> ၦလ့ၩဆိၬလၩ့စယိၥၭ, လၧအံဇံၭအဖၧၩ့တၭ,ၦ အံဇံၭဖိၪ, ဖၫရိၫအၦဒိၪး ၦမၩၥံၫဆၧလဖၪအခိၪ, စပီ တံၫဖၫနီၪ ဎွ့ၩဝ့ၫ လၧၦအံၡမၫအ့လၭဖိၪ လၧအလ့ၩ",
			"2": "<sup>2</sup> ဆိၬဝ့ၫလဖၪအစူၪဖၧၩ့လီၫ.- ယဟိဝၩအီၪလၧစယိ ၥၭအၥိၭတၭ, အဝ့ၫဒၪမွဲၦလၧ အဘီၪထၪ့ယီၫထၪ့လ ဂၩလီၫ. တၭအီၪဝ့ၫလၧအကဆါ ၦအံဇံၭဖိၪအဂံၪ့",
			"3": "<sup>3</sup> ဖၧၩ့လီၫ.- တၭအကဆါနီၪဒၪဘၪ လၧယဟိဝၩအီၪ လၧအဝ့ၫဒၪအၥိၭ, ဒဲကယဲအမၩဆၧ လမံၩ့လါလါ, ယဟိဝၩဒုၭကဲၪထၪ့ဝ့ၫ လၧအစူၪဖၧၩ့ ထီးအလူၬလီၫ.",
			"4": "<sup>4</sup> စယိၥၭဘၪခိးဘၪတၩ လၧအမ့ၬယၫတၭ, မၩဆၧအ ခ့ၫအၡၩအဆၧလီၫ. တၭအဝ့ၫဒၪအီၪက့ၪအဝ့ၫ လၧ အဂံၪ့ဖိၪအခိၪတၭ, ကယဲအဆၧအီၪနီၪ, အီၪက့ၪဝ့ၫ",
			"5": "<sup>5</sup> လၧအဝ့ၫနီၪအစူၪဖၧၩ့ ထီးအလူၬလီၫ.- ဆၧမၩအၥၭ ထီးအအီၪက့ၪအဝ့ၫ လၧအဂံၪ့ဖိၪအခိၪ, ဒဲကယဲအဆၧ ဖိၪဆၧလံၩ လၧအအီၪဝ့ၫထီးအလူၬနီၪတၭ, ယဟိဝၩ ဆိၪဂ့ၩၦအံဇံၭဖိၪအဂံၪ့ လၧစယိၥၭအကၠီၩ့လီၫ. တၭ ယဟိဝၩအဆၧဆိၪဂ့ၩ ဘၪကယဲဆၧလၧ အအီၪဝ့ၫလၧ",
			"6": "<sup>6</sup> ဂံၪ့ဖၧၩ့,ဒဲလၧအအီၪ လၧခီၫ့ထီးအလူၬလီၫ.- တၭအဝ့ၫ အီၪက့ၪကယဲအဆၧအီၪ လမံၩ့လါလါထီးအလူၬလၧ စယိၥၭအစူၪဖၧၩ့နီၪ, ၥ့ၪယၫအဆၧဒၪဝ့ၫနးမံၩ့အ့ၬ, ၥ့ၪယၫန့ၫဆၧအၪ့ လၧအအၪ့ဝ့ၫလီၫ. စယိၥၭနီၪအခံး အဂၩ့ဂ့ၩတၭ, ၦယိဝ့ၫနီၪဂ့ၩမၬလီၫ.",
			"7": "<sup>7</sup> ဆၧမၩအၥၭလၧဆၧလဖၪနီၪ အလးခဲၫ့,ယိခွါ,အ ကဆါအမၫလဂၩ စၪ့ထၪ့အမ့ၬလၧစယိၥၭ အအီၪတၭ,",
			"8": "<sup>8</sup> စံၭဝ့ၫ, မံၫဎုၬလၧယၧၩဆံၭ.- အဝ့ၫနီၪလမၩဘၪတၭ, စံၭ အကဆါအမၫ, ယိခွါ, ယကဆါ လၥ့ၪယၫဘၪ ဆၧအီၪလၧဂံၪ့ဖၧၩ့တၭး အဝ့ၫဒၪအီၪက့ၪယူၭကယဲ အဆၧလမံၩ့လါလါ လၧယစူၪဖၧၩ့ထီးအလူၬယူၭ.",
			"9": "<sup>9</sup> ဆၧဒိၪနဲၪ့ယၧၩ လၧဂံၪ့ဖၧၩ့ယီၩအီၪအ့ၬ. တၭပဒၩ့ ထၬဆၧလၧယၧၩနးမံၩ့အ့ၬ, ပဒၩ့ထၬကယဲနၧၩလဂၩ ဎးလၧနမွဲအမၫအကၠီၩ့လီၫ. တၭယမိမၩ ဆၧအၧၩ့ ဆၧၥၫ့အဒိၪ အယိၬလမံၩ့ယီၩ, ဒဲမၩမၪဘၪယွၩနီၪမိ",
			"10": "<sup>10</sup> ၥ့ၪဘဲၫၥ့ၪလဲၪ.- တၭဆၧမၩအၥၭ ထီးအချဲၩ့ဆၧလၧ စယိၥၭလနံၩဘၪလနံၩ လနံၩဘၪလနံၩ ဘဲၫၥိၭအမိမံၫ နၩ့ဝ့ၫလၧအနဲၩ့ထံၭ ဒဲအီၪလၧအၥိၭနီၪ, အဝ့ၫနီၪ,ခိၭ",
			"11": "<sup>11</sup> နၪအလူအ့ၬ.- တၭဆၧမၩအၥၭ လၧမုလနံၩနီၪ, စယိ ၥၭလ့ၩနုၬလၧဂံၪ့ဖၧၩ့ ဘဲၫၥိၭ အမိမၩအဆၧမၩတၭ,",
			"12": "<sup>12</sup> ၦဂံၪ့ဖိၪအခွၫလဖၪ အီၪလၧဂံၪ့ဖၧၩ့နးဂၩအ့ၬ.- ၦမုၪ နီၪဖီၪ့ထၬအဖၬဘဲၩ့တၭ, စံၭဝ့ၫ, မံၫနၩ့လၧယၥိၭ ဆံၭ,တၭစယိၥၭ စဲၪ့ဒၪခွံၬ အဖၬဘဲၩ့ လၧအစူၪဖၧၩ့",
			"13": "<sup>13</sup> နီၪ,စဲၪ့ထၪ့ခွံၬတၭ လ့ၩထၪ့လၧခီၫ့လီၫ.- ဆၧမၩအၥၭ ထီးၦမုၪနီၪ ဒၪဘၪလၧအဒုၭအီၪ လၩ့ထးအဖၬဘဲၩ့",
			"14": "<sup>14</sup> လၧအစူၪဖၧၩ့, စဲၪ့ထၪ့ခွံၬလၧခီၫ့တၭ,- အဝ့ၫဒၪကိၭန့ အဂံၪ့ဖိၪအခွၫလဖၪတၭ, လီၩဘၪအဝ့ၫၥံၪတၭ, စံၭဝ့ၫ, ယိခွါ,အဝ့ၫနီၪ မၩန့ၦဟံဘြူၫဖိၪလၧပကျၩဘဲၫၥိၭအ မိမၩကြၩ့ထမးပၧၩလီၫ. အဆၧဂဲၫထၪ့ဝ့ၫလၧယအီၪ, ဘဲၫၥိၭအမိမံၫနၩ့လၧယၥိၭယီၩ, ယကိၭၡၭထၪ့လၧ",
			"15": "<sup>15</sup> ယလူဖၭဒိၪလီၫ.- ဆၧမၩအၥၭထီးအနါဂၧၫ့လၧယ ထုၭထၪ့ယလူ, ဒဲကိၭထၪ့ဆၧတၭ, မွဲအစဲၪ့ဒၪခွံၬအဖၬ",
			"16": "<sup>16</sup> ဘဲၩ့လၧယနဲၩ့ထံၭတၭ, လ့ၩထၪ့ဝ့ၫလၧခီၫ့လီၫ.- တၭ အဆၧအီၪက့ၪအဖၬဘဲၩ့လဘံၪ့နီၪ လၧအနဲၩ့ထံၭ,ထီး",
			"17": "<sup>17</sup> အကဆါဂဲၫထဲၩ့ထီၩ့ လၧအဂံၪ့လီၫ.- တၭလီၩဘၪဝ့ၫ ဘဲၫဆၧချဲၩ့ယီၩအၥိၭတၭ, စံၭဝ့ၫဒၪ, ၦဎီးဖိၪဟံဘြူၫ ဖိၪ,လၧနဂဲၫထဲၩ့ဆိၬ လၧပကျၩလဂၩနီၪ, ဂဲၫထၪ့လၧ",
			"18": "<sup>18</sup> ယအီၪဘဲၫအမိမၩ ကြၩ့ထမးယၧၩအၥိၭလီၫ.- ဆၧ မၩအၥၭထီးယကိၭၡၭထၪ့ဆၧတၭ, အဝ့ၫစဲၪ့ဒၪခွံၬ အဖၬဘဲၩ့လၧယနဲၩ့ထံၭတၭ, လ့ၩထၪ့ဝ့ၫလၧခီၫ့လီၫ.",
			"19": "<sup>19</sup> တၭဆၧမၩအၥၭ ထီးအကဆါနီၪ နါဂၧၫ့အမၫအဆၧ ချဲၩ့လၧအလီၩဘၪအဝ့ၫတၭ, စံၭဝ့ၫ,နဎီးဖိၪလဂၩမၩ ယၧၩဘဲၫဆၧချဲၩ့လဖၪယီၩ အၥိၭနီၪတၭ, အဝ့ၫနီၪအ",
			"20": "<sup>20</sup> ၥၭခဲၩထၪ့ဝ့ၫဒၪလီၫ.- စယိၥၭ အကဆါနီၪ မၩန့ဝ့ၫ တၭ,ဒုၭနုၬဝ့ၫလၧထီၫ့ဖၧၩ့, ထီးဆၧအလးလၧစဎွၩ အထီၫ့ဖိၪလဖၪ အီၪစၧၩ့ထၬ အၥၭလီၫ. တၭအဆၧ အီၪလၧထိၬအဝၩ့ အဂံၪ့ဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> တၭယဟိဝၩအီၪလၧစယိၥၭအၥိၭ, မၩခိးမၩတၩ အဝ့ၫဒၪတၭ, ဒုၭဘၪဝ့ၫလၧဆၧအခိးအတၩ လၧၦထိၬ",
			"22": "<sup>22</sup> အဝၩ့အဂံၪ့အၦဒိၪလဂၩ အမ့ၬယၫလီၫ.- တၭထိၬအ ဝၩ့အဂံၪ့အၦဒိၪလဂၩနီၪ, အီၪက့ၪၦထီၫ့ဖိၪ လၧအအီၪ လၧထိၬအဝၩ့အဂံၪ့ဖၧၩ့ ထီးအလူၬလၧ စယိၥၭအစူၪ ဖၧၩ့လီၫ. တၭထီးဒၪ ၦမၩဆၧလမံၩ့လါလါ ထီးနီၪ",
			"23": "<sup>23</sup> မွဲအဝ့ၫဒၪမၩဝ့ၫလီၫ.- တၭထိၬအဝၩ့ အဂံၪ့အၦဒိၪ လဂၩနီၪ, ယိဆၧအီၪလၧအစူၪဖၧၩ့ နးမံၩ့အ့ၬ, အဂဲး ဘဲၫယီၩယဟိဝၩ အီၪလၧစယိၥၭအၥိၭတၭ, ဆၧလၧ အမၩဆၧနီၪ, ယဟိဝၩဒုၭကဲၪထၪ့ဝ့ၫဒၪလီၫ."
		},
		"40": {
			"1": "<sup>1</sup> တၭဆၧမၩအၥၭလၧဆၧလဖၪနီၪ အလးခဲၫ့လၧအံ ဇံၭအစဎွၩအၡၩ ယိဆၧအၪ့ဆၧအီၩလဂၩ, ဒဲအၡၩ မၩကိၪလဂၩ, မၩမၪဘၪအကဆါအံဇံၭ အစဎွၩလီၫ.",
			"2": "<sup>2</sup> တၭဖၫရိၫၥၭထၪ့ၦဒိၪနံၫဂၩနီၪ, ၦယိဆၧအၪ့ဆၧအီၩ လဖၪအဒိၪလဂၩ, ဒဲၦလၧအမၩကိၪလဖၪ အဒိၪလဂၩ",
			"3": "<sup>3</sup> လီၫ.- တၭဖ့ၪလၫ့အဝ့ၫၥံၪ လၧၦခိၭထၬဆၧ လၧၦမၩ ၥံၫဆၧအဒိၪအဂံၪ့ဖၧၩ့, ထီးစယိၥၭအီၪစၧၩ့ထၬ အ",
			"4": "<sup>4</sup> ၥၭအလးလီၫ.- ၦမၩဆၧလဖၪအဒိၪနီၪ, အၪ့မၧၫ့စယိ ၥၭယိထဲၩ့ခွါထဲၩ့အဝ့ၫၥံၪတၭ, မၩအဝ့ၫၥံၪ အခ့ၫအ ၡၩအဆၧး တၭအဝ့ၫၥံၪ ဘၪဆၧအီၪခိၭထၬဝ့ၫဒၪ မု နံၩလနၩ့လီၫ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪမံၫမးဆၧမံၫမးနံၫဂၩလူၬ, လဂၩအဆၧမံၫ မး, လဂၩအဆၧမံၫမး လၧမုလနၩဎးတၭ, လဂၩဘဲၫ အဆၧမံၫမးဖၭဝ့ၫအၥိၭ, လဂၩဘဲၫအဆၧမံၫမးဖၭဝ့ၫ အၥိၭ, အံဇံၭစဎွၩအၡၩ ယိအဆၧအၪ့ဆၧအီၩ လ ဂၩ,ဒဲအၡၩမၩကိၪလဂၩ, လၧအအီၪစၧၩ့ထၬအၥၭ",
			"6": "<sup>6</sup> လၧထီၫ့ဖၧၩ့နီၪလီၫ.- ဆၧဖၩ့ထၪ့လၧဂီၩလခီၫနီၪ စယိ ၥၭဂဲၫလၧအအီၪတၭ, ယိအဝ့ၫၥံၪတၭ, ယိခွါ, အၥုၪ့ခိ",
			"7": "<sup>7</sup> အၥၭဝီၩဝ့ၫလီၫ.- တၭအဝ့ၫဒၪအၪ့စၪ့ ဖၫရိၫအၡၩၦ ဒိၪလၧအအီၪ လၧအၥိၭလဖၪ, လၧအဘၪဆၧခိၭထၬ ဝ့ၫလၧအကဆါအဂံၪ့ဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ဆၧလၧမု",
			"8": "<sup>8</sup> ဆၫလနံၩယီၩ, နၥံၪအမ့ၬလၩ့ၡါမွဲဘၪလဲၪ.- အဝ့ၫၥံၪ စံၭအဝ့ၫဒၪ, ပမံၫမးဆၧမံၫမးတၭ, ၦဖၭဆၧမံၫမးယီၩ အီၪအ့ၬ. တၭစယိၥၭစံၭဝ့ၫ, ဖၭဆၧလဖၪအီၪလၧယွၩ နီၪမွဲအ့ၬဧၪ, လီၩဘၪလါယၧၩဆံၭ.",
			"9": "<sup>9</sup> တၭၦယိဆၧအၪ့ဆၧအီၩလဖၪ အဒိၪလဂၩနီၪ,လီၩ ဘၪအဆၧမံၫမး လၧစယိၥၭတၭ, စံၭအဝ့ၫ, ယမံၫမး ဆၧအဘိၩ့ဘၭတၭ, ယိခွါ, စဘံၭမုအီၪလၧယမ့ၬယၫ",
			"10": "<sup>10</sup> လီၫ.- တၭစဘံၭမုနီၪ, အီၪလၧအထဲၩ့ၥၧၫ့ဘီၩ့လီၫ. မၩအၥၭဘဲၫအထိ ထၪ့အၥိၭတၭ, ဖၭထၪ့ဝ့ၫတၭ,",
			"11": "<sup>11</sup> အၥၪဆူၬလဖၪမံၫ့ထၪ့ဝ့ၫလီၫ. ဖၫရိၫအလိၫ့အီၪလၧ ယစူၪဖၧၩ့တၭ, ယအၪ့မၩန့စဘံၭအၥၪနီၪတၭ, ယ ဘံၭနုၬအထံၫ လၧဖၫရိၫအလိၫ့ဖၧၩ့တၭ ယအီၪက့ၪ",
			"12": "<sup>12</sup> လိၫ့နီၪလၧဖၫရိၫ အစူၪဖၧၩ့လီၫ.- တၭစယိၥၭစံၭအဝ့ၫ, အယီၩမွဲအဆၧဖၭန့, ဆၧလၧအထဲၩ့ၥၧၫ့ဘီၩ့နီၪ,မွဲမု",
			"13": "<sup>13</sup> ၥၧၫ့နံၩလီၫ.- လၧၥၧၫ့နံၩအထးဖၧၩ့နီၪ, ဖၫရိၫမိဘိၭ ထၪ့နခိၪတၭ, မိအီၪက့ၪထဲၩ့နၧၩ လၧနလးတၭ,နမိဖ့ၪ ထဲၩ့လိၫ့နီၪ လၧဖၫရိၫအစူၪဖၧၩ့ ဘဲၫအထူၫအရူၫလၧ အခၪ့ထံၭအၥိၭ, လၧနမွဲအၡၩယိအဆၧအၪ့ဆၧအီၩ",
			"14": "<sup>14</sup> အၥိၭနီၪလီၫ.- အနီၪတၭ ထီးနဘၪထဲၩ့ဆၧမုၬဆၧဂ့ၩ တၭ,နၪ့ထၪ့ထဲၩ့ယၧၩတၭ, မၩယၧၩလၧဆၧအခိးအ တၩတၭ, လီၩဘၪဖၫရိၫလၧယဂဲးယကၠီၪ့တၭ, ဒုၭစဲၪ့",
			"15": "<sup>15</sup> ထၪ့ခွံၬယၧၩ လၧဂံၪ့လဖျိၪ့အဖၧၩ့ယီၩဆံၭ.- အဂဲးဘဲၫ ယီၩ ဆၧအၪ့ဂူၪန့ယၧၩ လၧၦဟံဘြူၫဖိၪ အခးဖၧၩ့တ ၡါတၭ, ထီးယီၩဒၪလ့ၬ ဘဲၫၥိၭၦမိဒုၭနုၬယၧၩ လၧ ဆၧဖၧၩ့ယီၩတၭ, ယမၩမၪဘၪဆၧနးမံၩ့အ့ၬ.",
			"16": "<sup>16</sup> တၭၦၡၩမၩကိၪလဖၪ အဒိၪလဂၩနီၪ, ဒၪဘၪဝ့ၫ လၧအဖၭဆၧမွဲအဂ့ၩတၭ, စံၭစယိၥၭ, ဆၧလၧယၧၩ ယီၩ, ယအီၪလၧဆၧမံၫမးဆ့လီၫ. ယိခွါ, ကိၪဘွၩ",
			"17": "<sup>17</sup> အဒၩ့ၥၧၫ့ဖျိၪ့ အီၪလၧယခိၪအဖၫ့ခိၪလီၫ.- တၭဒၩ့အ ထီၫထုၬလဖျိၪ့နီၪ, အီၪလၧဖၫရိၫအဆၧ အၪ့ကိၭအမံၩ့ ဒ့ၭလၧၦမၩကိၪနီၪမၩဝ့ၫလီၫ. တၭထိၪၥံၪလံၪၥံၪအၪ့ ထုၫ့ထၪ့ခွံၬဝ့ၫလၧဒၩ့ဖၧၩ့ လၧအအီၪလၧယခိၪအဖၫ့",
			"18": "<sup>18</sup> ခိၪနီၪလီၫ.- စယိၥၭစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, အယီၩ မွဲဆၧဖၭဝ့ၫ, ဆၧလၧဒၩ့ၥၧၫ့ဖျိၪ့နီၪ မွဲမုၥၧၫ့နံၩနီၪလီၫ.",
			"19": "<sup>19</sup> လၧၥၧၫ့နံၩအထးဖၧၩ့နီၪ, ဖၫရိၫမိဒၪ့ထ့ၬခွံၬနခိၪလၧ နလီၩ့တၭ, မိဘျၭလၩ့ဆဲၩနၧၩ လၧၥံၪ့လထံၭအလီၩ့ တၭ,ထိၪၥံၪလံၪၥံၪ မိအၪ့ခွံၬနဖံၭနယၪ လၧနလီၩ့လီၫ.",
			"20": "<sup>20</sup> ဆၧမၩအၥၭလၧမုၥၧၫ့နံၩလနံၩ, ဘၪလၧဖၫရိၫအီၪ ဖျဲၪအနံၩ ဆၧၫ့ထဲၩ့အလးတၭ, မၩဆၧအၪ့ဆၧအီၩ လၧအခ့ၫအၡၩ ထီးအလူၬအဂးတၭ, ဘိၭထၪ့ၦယိ ဆၧအၪ့ဆၧအီၩလဖၪ အဒိၪလဂၩအခိၪ, ဒဲၦမၩကိၪ",
			"21": "<sup>21</sup> လဖၪအဒိၪလဂၩ လၧအခ့ၫအၡၩအကျၩလီၫ.- တၭ အဝ့ၫအီၪက့ၪထဲၩ့ ၦယိဆၧအၪ့ဆၧအီၩလဖၪ အဒိၪ လၧအယိဆၧအလးတၭ, အဝ့ၫဒၪအီၪက့ၪထဲၫ့လိၫ့နီၪ",
			"22": "<sup>22</sup> လၧဖၫရိၫအစူၪဖၧၩ့လီၫ.- အ့ၪမွဲၦလၧအမၩကိၪလ ဖၪအဒိၪလဂၩနီၪ, ဘျၭလၩ့ဆဲၩ့ဝ့ၫ, ဘဲၫစယိၥၭဖၭဝ့ၫ",
			"23": "<sup>23</sup> လၧအဂးအၥိၭနီၪလီၫ.- မွဲလါနၫ့တၭ, ၦယိဆၧအၪ့ ဆၧအီၩလဖၪအဒိၪနီၪ နၪ့ထၪ့ထဲၩ့ စယိၥၭအ့ၬး ၥၭ နၪ့ခွံၬဝ့ၫလီၫ."
		},
		"41": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧနံၫနံၪ့ အမုနံၩလဖၪအထုၬနီၪ ဖၫ ရိၫမံၫမးဆၧတၭ, ယိခွါ, ဆၧၫ့ထုၪ့ဝ့ၫလၧထံၫမိၡါအ",
			"2": "<sup>2</sup> နဲၩ့ထံၭလီၫ.- တၭယိခွါ, ချီမိလၧၦယိဂ့ၩ, လၧအဖံၭ အယၪဘီၪ့ဝ့ၫနွ့ၫဒုၩ ဂဲၫထၪ့လၧထံၫမိၡါအဖၧၩ့ အၪ့",
			"3": "<sup>3</sup> အဆၪလၧနၪ့အကျၩလီၫ.- တၭယိခွါ, ချီမိအလၬ အၧၩ့,ဒဲအဖံၭအယၪ ဎွ့လၩ့ဝ့ၫနွ့ၫဒုၩ ဂဲၫထၪ့လၧထံၫ မိၡါအဖၧၩ့တၭ, ဆၧၫ့ထုၪ့လၧချီလဖၪနီၪ အနဲၩ့ထံၭ",
			"4": "<sup>4</sup> လၧထံၫနဲၩ့လဖၪနီၪလီၫ.- တၭချီမိအလၬအၧၩ့, ဒဲအ ဖံၭအယၪဎွ့လၩ့လဖၪနီၪ အၪ့ခွံၬချီလၧၦယိဂ့ၩ, ဒဲလၧ အဖံၭအယၪဘီၪ့လဖၪနီၪလီၫ. တၭဖၫရိၫနၪ့ထၪ့အၥၭ",
			"5": "<sup>5</sup> လီၫ.- တၭအဆၧမံၫမၪဒီၭဝ့ၫနီၪ, မံၫမးဒီၭနံၫဘျၩ့လ ဘျၩ့တၭ,ယိခွါ, ဘုၪအဆဲၩ နွ့ၫဆဲၩမဲၪထၪ့ဝ့ၫလၧ",
			"6": "<sup>6</sup> လဘီၩ့အလီၩ့တၭ, အဖျိၪ့ဆၭဒဲဂ့ၩလီၫ.- တၭယိခွါ, ဘုၪအဆဲၩနွ့ၫဆဲၩ လၧအဖျိၪ့ၥွံၬ, ဒဲဎဲၫ့ထၬဝ့ၫလၧလံၩ",
			"7": "<sup>7</sup> မုထၪ့နီၪ မဲၪထၪ့ဝ့ၫလၧခဲၫ့နီၪလီၫ.- တၭဘုၪဆဲၩလၧ အဖျိၪ့ဎဲၫ့ထၬဝ့ၫနွ့ၫဆဲၩနီၪ, အၪ့ယုလၩ့ခွံၬ ဘုၪအဆဲၩ လၧအဖျိၪ့ဆၭ, ဒဲဂ့ၩနွ့ၫဆဲၩနီၪလီၫ. တၭဖၫရိၫနၪ့ထၪ့ အၥၭတၭ, ယိခွါ, မွဲဆၧမံၫမးလီၫ.",
			"8": "<sup>8</sup> ဆၧဖၩ့ထၪ့နီၪ ဆၧမၩအၥၭ လၧအၥုၪ့ခိအၥၭဝီၩ တၭ,အၪ့မၧၫ့လၩ့ဆၧကိၭန့ ကယဲၦအံဇံၭအၡၩကွ့ၭ လံၬ,ဒဲၦကိၪ့ဆၧၥ့ၪ ထီးအလူၬတၭ, ဖၫရိၫလီၩလၩ့အ ဝ့ၫၥံၪ လၧအဆၧမံၫမးလဖၪလီၫ. တၭၦဖၭန့လၧဖၫ",
			"9": "<sup>9</sup> ရိၫအဂးအီၪနးဂၩအ့ၬ.- ၦယိဆၧအၪ့ဆၧအီၩလဖၪ အဒိၪလဂၩနီၪ, ချဲၩ့ထၪ့ဆၧလၧဖၫရိၫတၭ, စံၭဝ့ၫဒၪ, ဆၧလၧမုဆၫလနံၩယီၩ, ယနၪ့ထၪ့ထဲၩ့ယဆၧဒဲၩဘၭ",
			"10": "<sup>10</sup> လီၫ.- ဖၫရိၫၥၭထၪ့အဎီးအၡၩတၭ, ဖ့ၪလၫ့ဆၧအီၪ ခိၭယၧၩလၧၦမၩၥံၫဆၧလဖၪအဒိၪအဂံၪ့ဖၧၩ့, ယၧၩ",
			"11": "<sup>11</sup> ဒဲၦမၩကိၪလဖၪ အဒိၪလဂၩလီၫ.- တၭပမံၫမးဆၧမံၫ မးလၧမုလနၩဎး, ယၧၩဒဲအဝ့ၫဒၪလဂၩ, ဘဲၫအဆၧ မံၫမးဖၭဝ့ၫအၥိၭ, လဂၩဘဲၫအဆၧမံၫမး ဖၭဝ့ၫအၥိၭ",
			"12": "<sup>12</sup> နီၪ,ပမံၫမးဆၧလီၫ.- တၭၦမၩၥံၫ ဆၧအဒိၪလဂၩအ ဎီးအၡၩအဖိၪၥၪခွၫ, ၦဟံဘြူၫဖိၪလဂၩ အီၪဝ့ၫလၧပၥိၭထီးနီၪတၭ, ပလီၩဘၪအဝ့ၫတၭ, အဝ့ၫဒၪဖၭန့ဆၧ မံၫမးလၧပဂး, လဂၩဘဲၫအဆၧမံၫမးအၥိၭ, လဂၩဘဲၫ",
			"13": "<sup>13</sup> အဆၧမံၫမးအၥိၭနီၪ ဖၭဝ့ၫဒၪလီၫ.- တၭဘဲၫအဖၭန့ လၧပဂးအၥိၭနီၪ, ဆၧမၩအၥၭလီၫ. အဂဲးဘဲၫယီၩ, ယၧၩလဂၩ, မွဲအအီၪက့ၪထဲၩ့ယၧၩ လၧယလးတၭ, အဝ့ၫလဂၩနီၪ ဘျၭလၩ့ဆဲၩဝ့ၫဒၪလီၫ.",
			"14": "<sup>14</sup> တၭဖၫရိၫအၪ့မၧၫ့လၩ့ၦကိၭန့စယိၥၭတၭ, အဝ့ၫၥံၪ ဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧထီၫ့ဖၧၩ့ ချဲၩ့မၬလီၫ. တၭအဝ့ၫ ဒၪလိၩ့ခွံၬအနိၭဆီၪ့, ဒဲလုထၪ့အၥၭတၭ, ဂဲၫထၪ့လၧ",
			"15": "<sup>15</sup> ဖၫရိၫအအီၪလီၫ.- တၭဖၫရိၫစံၭစယိၥၭနီၪ, ယမံၫမး ဆၧမံၫမးယီၩ, ၦလၧအဖၭၥ့ၪနီၪ, အီၪနးဂၩအ့ၬး တၭ ယနါဂၧၫ့လၧနဂဲး ၦၡၩစံၭဝ့ၫ, နနၪၥ့ၪ ဒဲနအ့ၪနါဂၧၫ့",
			"16": "<sup>16</sup> ဆၧမံၫမးနီၪ, နဖၭနဝ့ၫဒၪၥ့ၪဆ့လီၫ.- စယိၥၭစံၭဆၧၫ့ ဖၫရိၫတၭ, စံၭဝ့ၫဒၪ, မွဲအအီၪလၧယၧၩအ့ၬ, ယွၩမိစံၭ ဖၫရိၫမုၬမုၬလီၫ.",
			"17": "<sup>17</sup> တၭဖၫရိၫစံၭစယိၥၭနီၪ, ယမံၫမးဆၧတၭ, ယိခွါ,",
			"18": "<sup>18</sup> ယဆၧၫ့ထုၪ့လၧထံၫမိၡါအနဲၩ့ထံၭ,- ယိခွါ, ချီမိလၧ အဖံၭအယၪဘီၪ့ဒဲၦယိဂ့ၩနွ့ၫဒုၩ ဂဲၫထၪ့လၧထံၫမိၡါ",
			"19": "<sup>19</sup> အဖၧၩ့တၭ, အၪ့အဆၪလၧနၪ့ကျၩလီၫ.- တၭယိခွါ, ချီမိလၧအလဂ့ၩဘၪနီၪ, ဆၧယိအဝ့ၫၥံၪလၬအၧၩ့နၭ မၬတၭ, အဖံၭအယၪဎွ့လၩ့ ဘဲၫဆၧလဖၪယီၩအၥိၭ",
			"20": "<sup>20</sup> ယဒၪဘၪလၧအံဇံၭအဖၧၩ့ နးဆိၭအ့ၬ.- တၭချီအဎွ့ ဒဲလၬအၧၩ့လဖၪနီၪ, အၪ့ခွံၬချီအဘီၪ့ လၧအအီၪထၪ့",
			"21": "<sup>21</sup> ဆိၫဝ့ၫနွ့ၫဒုၩနီၪလီၫ.- တၭနုၬဝ့ၫလၧအဖၧၩ့ဂီၩ့တၭ, ၦၥ့ၪယၫလၧအနုၬ လၧအဖၧၩ့အ့ၬ, မွဲဆၧလၬအၧၩ့ ဘဲၫလၧအၥၫ့အၥိၭလီၫ. ထီးနီၪလဖၧၫ့ ယနၪ့ထၪ့ယ",
			"22": "<sup>22</sup> ၥၭလီၫ.- ယဒၪဘၪလၧယမံၫမးဆၧ အဖၧၩ့တၭ,ယိ ခွါ,ဘုၪဆဲၩနွ့ၫဆဲၩ မဲၪထၪ့ဝ့ၫလၧ လဘီၩ့အလီၩ့တၭ,",
			"23": "<sup>23</sup> အၥၪနီၪဎွ့ၩဝ့ၫဂ့ၩမၬလီၫ.- တၭယိခွါ, ဘုၪအဂူၫဂၩနွ့ၫ ဆဲၩလၧအဖျိၪ့ၥွံၬ, ဒဲဎဲၫ့ထၬလၧလံၩမုထၪ့နီၪ, မဲၪထၪ့",
			"24": "<sup>24</sup> လၧအဝ့ၫၥံၪအလးခဲၫ့လီၫ.- တၭဘုၪဆဲၩလၧအဖျိၪ့ၥွံၬ နီၪ,အၪ့ယုလၩ့ခွံၬ ဘုၪဆဲၩလၧအဖျိၪ့ဂ့ၩ နွ့ၫဆဲၩနီၪ လီၫ.တၭယလီၩဘၪ ၦကွ့ၭလံၬလဖၪတၭ, ဆၧဒုၭနဲၪ လီၩဘၪယၧၩနီၪ အီၪနးဂၩအ့ၬ.",
			"25": "<sup>25</sup> တၭစယိၥၭစံၭဖၫရိၫ, ဖၫရိၫအဆၧမံၫမး မွဲဆၧလ မံၩ့ဎးလီၫ. ဆၧလၧယွၩမိမၩနီၪ ဒုၭနဲၪဝ့ၫလၧဖၫရိၫ",
			"26": "<sup>26</sup> လီၫ.- ချီမိဂ့ၩနွ့ၫဒုၩနီၪမွဲနွ့ၫနံၪ့လီၫ. တၭဘုၪဆဲၩဂ့ၩ နွ့ၫဆဲၩနီၪ, မွဲနွ့ၫနံၪ့ဆ့လီၫ. ဆၧမံၫမးနီၪမွဲဆၧလမံၩ့",
			"27": "<sup>27</sup> ဎးလီၫ.- ချီမိလၧအဎွ့ဒဲလၬအၧၩ့, လၧအဂဲၫထၪ့လၧ အလးခဲၫ့နွ့ၫဒုၩနီၪ, မွဲနွ့ၫနံၪ့လီၫ. တၭဘုၪဆဲၩလၧအ ဖျိၪ့ၥွံၬဒဲဎဲၫ့ထၬ လၧလံၩမုထၪ့နွ့ၫဆဲၩနီၪ, မွဲနွ့ၫနံၪ့လၧ",
			"28": "<sup>28</sup> အအီၪလၧဆၧၥၭဝံလၩ့ဒိၩလီၫ.- အနီၪမွဲဆၧချဲၩ့လၧ ယလီၩဘၪယူၭဖၫရိၫလီၫ. ဆၧလၧယွၩမိမၩနီၪ, မွဲအ",
			"29": "<sup>29</sup> ဒုၭဒၪဘၪဝ့ၫလၧဖၫရိၫလီၫ.- ယိခွါ, နွ့ၫနံၪ့မိဂဲၫအီၪ လၧၫ့အီၪဎွ့ၩဖၭဒိၪ လၧခးအံဇံၭ ထၧၫ့ခးယၫအဖၧၩ့",
			"30": "<sup>30</sup> လီၫ.- ဆၧၥၭဝံလၩ့ဒိၩနွ့ၫနံၪ့ မိအီၪထၪ့လၧအလးခဲၫ့ နီၪတၭ, ၦမိၥၭနၪ့ဆၧလၧၫ့ဆၧဎွ့ၩ လၧခးအံဇံၭနီၪ တၭ,ဆၧၥၭဝံလၩ့ဒိၩ မိမၩလူၬခွံၬ ထံၫၥံၪခးၥံၪနီၪ",
			"31": "<sup>31</sup> လီၫ.- တၭလၧဆၧၥၭဝံလၩ့ဒိၩလၧခဲၫ့အကၠီၩ့နီၪ, ၦၥ့ၪ ယၫဆၧလၧၫ့ဎွ့ၩအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧနီၪမိအီၪနၭ",
			"32": "<sup>32</sup> နၭလ့ၬလီၫ.- တၭဆၧမံၫမးအီၪ လၧဖၫရိၫနံၫမံၩ့နံၫဖၧၫ့ နီၪ,အဂဲးဘဲၫယီၩ မွဲယွၩတဲၩ့ဝဲၩဆၧလမံၩ့နီၪ ဂုးဂုးခၧၫ့ ခၧၫ့အဂဲးလီၫ. တၭယွၩမိဒုၭမၩအၥၭနီၪ ချဲၫ့မၬလီၫ.",
			"33": "<sup>33</sup> အခိးမွဲဘိၩ့နဲၪ့ယီၩ, မွဲဖၫရိၫအၪ့ဎၬ ၦအၥုၪ့ဖၭအၥၭ ဖၭဒဲကိၪ့ၥ့ၪကိၪ့ဘၪနးဂၩတၭ, အီၪက့ၪအဝ့ၫဒၪလၧ",
			"34": "<sup>34</sup> ခးအံဇံၭအဖၫ့ခိၪနီၪဆံၭ.- မွဲဖၫရိၫမၩဝ့ၫတၭ, အီၪ က့ၪၦယိထဲၩ့ခွါထဲၩ့ ဆၧလဖၪ လၧထံၫဖိၪခးဖိၪအဖၫ့ ခိၪတၭ, ဆၧလၧၫ့ဆၧဎွ့ၩနွ့ၫနံၪ့နီၪ အၪ့မၩန့ခးအံဇံၭ",
			"35": "<sup>35</sup> နီၪယဲပိၩ့လပိၩ့ဆံၭ.- တၭမွဲအအၪ့ထုၫ့ကီၪ့ဆၧအၪ့ ဆၧအီၩလၧနံၪ့အဂ့ၩ လၧအမိဂဲၫဝ့ၫထီးအလူၬ, ဒဲအီၪ က့ၪကီၪ့ဘုၪၥံၪဂူၫၥံၪ လၧဖၫရိၫအစူၪဖၫ့လၬ ဒဲအီၪခိၭ ပၧၩ့ဘၪဆၧအၪ့ဆၧအီၩ လၧဒိၩ့လဖၪအဖၧၩ့နီၪဆံၭ.",
			"36": "<sup>36</sup> တၭဆၧလၧဆၧအၪ့ဆၧအီၩနီၪ, မိအီၪကီၪ့ဝဲၩဝ့ၫလၧ ခးအဂး, ထီၩ့လၩ့လၧဆၧၥၭဝံလၩ့ဒိၩ နွ့ၫနံၪ့လၧအမိ အီၪထၪ့လၧခးအံဇံၭအဖၧၩ့နီၪ, ဘဲၫၥိၭထံၫဖိၪခးဖိၪ ထီးဂၭဂီၩ့ လၧဆၧၥၭဝံလၩ့ဒိၩနီၪ လဂ့ၩလီၫ.",
			"37": "<sup>37</sup> တၭဆၧလမံၩ့နီၪ ဂ့ၩဝ့ၫ လၧဖၫရိၫ အမ့ၬၥၪဖၧၩ့,",
			"38": "<sup>38</sup> ဒဲလၧအခ့ၫအၡၩအမ့ၬၥၪ ထီးအလူၬအဖၧၩ့လီၫ.- တၭ ဖၫရိၫစံၭအခ့ၫအၡၩနီၪ, ပဒၪန့ၦဘဲၫယီၩၥိၭ, ၦလၧယွၩ",
			"39": "<sup>39</sup> အၥၭအီၪလၧအဖၧၩ့မိၥ့ၪဆ့ဧၪ.- ဖၫရိၫစံၭစယိၥၭ, မွဲယွၩဒုၭၥ့ၪယၫနၧၩ လၧဆၧလဖၪနီၪ ထီးအလူၬတၭ, ၦအၥုၪ့ဖၭၥၭဖၭ, ဒဲကိၪ့ၥ့ၪကိၪ့ဘၪ န့ၫနၧၩ ၥိၭယီၩ",
			"40": "<sup>40</sup> အီၪနးဂၩအ့ၬ.- နမိအီၪလၧယနီးအဖၫ့ခိၪတၭ, ယၡၩ ခမျၧး ထီးအလူၬလဖၪ ဘၪဒူၩထၪ့ယၪ့ထၪ့နၧၩလီၫ. မွဲန့ၫလၧယလး ဆီၩ့ဆီအဖၫ့ခိၪနီၪ ယမိဒိၪနဲၪ့ နၧၩ",
			"41": "<sup>41</sup> လီၫ.- တၭဖၫရိၫစံၭစယိၥၭ, ယိခွါ, ယအီၪက့ၪယူၭ",
			"42": "<sup>42</sup> နၧၩလၧခးအံဇံၭ ထၧၫ့ခးယၫအဖၫ့ခိၪယူၭလီၫ.- ဖၫ ရိၫဘဲၪ့လၩ့ခွံၬ အစူၪၥံၭလဘီၩ့ လၧအစူၪတၭ, ဖျၪ့ထၪ့ ဝ့ၫလၧစယိၥၭအစူၪတၭ, ဒုၭၥိၭဝ့ၫအဆဲၫ့ဘွၩဖျ့ၫလံၬ ကံၭ,ဒဲဒုၭလံၬဝ့ၫ လၧၥွ့ၫထီၫ့လဝၫ့ လၧအခိၬလီၩ့နီၪ",
			"43": "<sup>43</sup> လီၫ.- တၭဒုၭထူၬဝ့ၫအလဲၪ့ နံၫဖျိၪ့လဖျိၪ့တၭ, ၦကိၭ ၡၭဝ့ၫ လၧအမ့ၬယၫ, ချံၭလၩ့ခၪ့ဆံၭ. တၭဆၧအီၪ",
			"44": "<sup>44</sup> က့ၪဝ့ၫလၧခးအံဇံၭ ထၧၫ့ခးယၫအဖၫ့ခိၪလီၫ.- တၭ ဖၫရိၫစံၭစယိၥၭ, ယမွဲဖၫရိၫလီၫ. နလအီၪဘၪတၭ, ၦယူၬထၪ့ဘၪအစူၪအခၪ့ လၧခးအံဇံၭထၧၫ့ခးယၫအ",
			"45": "<sup>45</sup> ဖၧၩ့နးဂၩအ့ၬ.- တၭဖၫရိၫကိၭထဲၩ့စယိၥၭ အမံၩ့လၧ စဇၭဖနၭပ့ၫအနံအၫနီၪလီၫ. တၭဖ့ၪလၫ့ဒိၩ့အၫ့အၡၩ လုဆၧစပီတဖံရၫအဖိၪမုၪ နးအၭစနၭ လၧအမၫအဂး လီၫ. တၭစယိၥၭ လ့ၩဝံၩ့ဝၩ့ဆၧ လၧခးအံဇံၭအဖၧၩ့ လီၫ.",
			"46": "<sup>46</sup> လၧစယိၥၭဆၧၫ့ထုၪ့လၧအံဇံၭအစဎွၩ ဖၫရိၫအမ့ၬ ယၫနီၪ, အၥၭၡါအနံၪ့ၥၧၫ့ဆံၫတၭ, စယိၥၭစဲၪ့ထၪ့ခွံၬ ဝ့ၫလၧဖၫရိၫအမ့ၬယၫတၭ, လ့ၩဆၧလၧခးအံဇံၭ",
			"47": "<sup>47</sup> ထၧၫ့ခးယၫလီၫ.- တၭဆၧလၧၫ့ဆၧဎွ့ၩ နွ့ၫနံၪ့နီၪ,ဂၪ့",
			"48": "<sup>48</sup> ခိၪဒုၭမဲၪထၪ့ဆၧ အၪအၪလ့ၬလီၫ.- တၭလၧနွ့ၫနံၪ့ နီၪ,အဝ့ၫအၪ့ထုၫ့ကီၪ့န့ ဆၧအၪ့ဆၧအီၩ လၧအအီၪ လၧခးအံဇံၭအဖၧၩ့ထီးအလူၬ, ဒဲအီၪက့ၪကီၪ့ဝ့ၫလၧ ဒိၩ့လဖၪအဖၧၩ့လီၫ. ဆၧအၪ့ဆၧအီၩ လၧအအီၪဝ့ၫ လၧခီၫ့ဝၬဖီၩ့ ဒိၩ့လဖျိၪ့ဒဲလဖျိၪ့နီၪ, အီၪက့ၪဝ့ၫလၧအ",
			"49": "<sup>49</sup> ဖၧၩ့နီၪလီၫ.- တၭစယိၥၭလူၫကီၪ့ ဘုၪၥံၪဂူၫၥံၪဘဲၫမ့ၭ လၧမၫဆၧမံၭနဲၩ့အၥိၭ အၪအၪလ့ၬ, ထီးၦဝံဆၧနၬဆၧ နီၪပထုၬဝ့ၫဒၪလီၫ. အဂဲးဘဲၫယီၩဝံထၪ့နၬထၪ့ၥ့ၪလၧၩ့ အ့ၬ.",
			"50": "<sup>50</sup> ဆၧၥၭဝံလၩ့ဒိၩအနံၪ့လဖၪ လချႃၭဘၪဒံၭဘၪတၭ, အဖိၪခွၫနံၫဂၩ အီၪဖျဲၪလၧစယိၥၭအဂး, လၧဒိၩ့အၫ့ အၡၩလုဆၧ စပီတဖံရၫအဖိၪမုၪ နးအၭစနၭနီၪ, ဆီၫ့",
			"51": "<sup>51</sup> အီၪန့လၧအဂးလီၫ.- တၭစယိၥၭဖျိၬအဖိၪဝဲၡါအမံၩ့ စမနၭစ့ၫလီၫ. အဂဲးဘဲၫယီၩ ယွၩဒုၭၥၭနၪ့ခွံၬယၧၩ လၧယဆၧခိဆၧဝီၩ ထီးအလူၬဒဲယဖါ အၡၩဂံၪ့ဖိၪ",
			"52": "<sup>52</sup> ထီးအလူၬလီၫ.- တၭဖိၪခွၫနံၫဂၩလဂၩနီၪ ဖျိၬဝ့ၫအ မံၩ့လၧစအံဖံၫ့လီၫ. အဂဲးဘဲၫယီၩ ယွၩဒုၭၥၪထၪ့ ယၧၩလၧဆၧၡၪ့ဆၧနၭ အခးဖၧၩ့လီၫ.",
			"53": "<sup>53</sup> တၭဆၧလၧၫ့ဆၧဎွ့ၩနွ့ၫနံၪ့ လၧအအီၪဝ့ၫလၧခးအံ",
			"54": "<sup>54</sup> ဇံၭအဖၧၩ့နီၪထုၬဝ့ၫဒၪလီၫ.- တၭဆၧၥၭဝံလၩ့ဒိၩနွ့ၫ နံၪ့အီၪထၪ့အၥၫ့ဘဲၫစယိၥၭစံၭဝ့ၫအၥိၭနီၪတၭ, ဆၧ ၥၭဝံလၩ့ဒိၩအီၪဝ့ၫ လၧခးကိၭအဘံၪ့ဒ့ၭလီၫ. အ့ၪမွဲ လၧခးအံဇံၭ ထၧၫ့ခးယၫ အဖၧၩ့နီၪ ဆၧအၪ့အီၪဝ့ၫ",
			"55": "<sup>55</sup> ဒၪလီၫ.- ထီးၦအံဇံၭဖိၪထီးအလူၬအီၪဝံတၭ, ၦခမျၧး ကိၭထၪ့ဖၫရိၫ လၧဆၧအၪ့အဂးတၭ, ဖၫရိၫစံၭၦအံ ဇံၭဖိၪထီးအလူၬနီၪ, လ့ၩလၧစယိၥၭအအီၪတၭ, ထီး",
			"56": "<sup>56</sup> ဒၪအဝ့ၫလီၩဘၪနၥံၪ ဆၧလမံၩ့မံၩ့နီၪ, မၩဘီၪ.- ဆၧ ၥၭဝံလၩ့ဒိၩ အီၪထၪ့ဝ့ၫ လၧထံၫၥံၪခးၥံၪ ဎံၩ့ဎံၩ့လ့ၬ တၭ,စယိၥၭ ဝဲထၪ့ကယဲဆၧအလး လၧဆၧအၪ့အီၪ လၧအဖၧၩ့ထီးအလူၬတၭ, အၪ့ဆၫဝ့ၫလၧၦအံဇံၭဖိၪ လီၫ.တၭဆၧၥၭဝံ လၩ့ဒိၩနီၪနၭမၬဝ့ၫ လၧခးအံဇံၭအ",
			"57": "<sup>57</sup> ဖၧၩ့လီၫ.- တၭကယဲၦခးဖိၪလဖၪ ဂဲၫလၧခးအံဇံၭအ ဖၧၩ့လၧစယိၥၭအအီၪ, ဘဲၫၥိၭအမိဎွ့ၩန့ဆၧအၪ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧၥၭဝံလၩ့ဒိၩနီၪ, နၭမၬဝ့ၫလၧခး ကိၭဘံၪ့ဒ့ၭအဖၧၩ့လီၫ."
		},
		"42": {
			"1": "<sup>1</sup> တၭစယၫကူၭ ဒၪဘၪလၧဘုၪၥံၪဂူၫၥံၪ, အီၪလၧ အံဇံၭအဖၧၩ့း တၭစယၫကူၭစံၭအဖိၪခွၫလဖၪ, နၥံၪ",
			"2": "<sup>2</sup> ယိလိၬနၥံၪအၥၭမွဲဘၪလဲၪ.- ယိခွါ, ယနါဂၧၫ့ယူၭလၧ ဘုၪၥံၪဂူၫၥံၪ အီၪလၧခးအံဇံၭ အဖၧၩ့လီၫ. လ့ၩလၩ့ ထီးနီၪတၭ, ဎွ့ၩဆၧလၧပဂးထီးနီၪ, ဘဲၫၥိၭပမိမၧၫ့",
			"3": "<sup>3</sup> တၭ,မွဲပထီးၥံၫလဂ့ၩနီၪဆံၭ.- တၭစယိၥၭအထၧၫ့ဖု ဝဲဆံၫဂၩလ့ၩလၩ့ဝ့ၫ, ဘဲၫၥိၭအမိဎွ့ၩန့ ဘုၪၥံၪဂူၫၥံၪ",
			"4": "<sup>4</sup> လၧအံဇံၭအဖၧၩ့နီၪလီၫ.- အ့ၪမွဲစယိၥၭ အဖုစဘံၪ့ ယမံၫ့လဂၩနီၪ, စယၫကူၭအၪ့မၧၫ့ အလ့ၩဆၧလၧအ ထၧၫ့ဖုဝဲအၥိၭအ့ၬ. အဂဲးဘဲၫယီၩ စံၭဝ့ၫဒၪ, မိဘၪဘၪ ခိၬဆၧၡၪ့ဆၧနၭလီၫ.",
			"5": "<sup>5</sup> တၭအံၫစရ့လၭအဖိၪခွၫလဖၪ လ့ၩဎွ့ၩဆၧ လၧၦ လၧအဂဲၫလဖၪအကျၩလီၫ. အဂဲးဘဲၫယီၩ ဆၧၥၭဝံ",
			"6": "<sup>6</sup> လၩ့ဒိၩနီၪအီၪလၧ ခးကၫနအၫ့အဖၧၩ့လီၫ.- တၭစယိ ၥၭမွဲဆၧအခိၪ လၧခးအဖၫ့ခိၪလီၫ. အဝ့ၫဒၪ အၪ့ဆၫ ဆၧလၧၦခးဖိၪ ထီးအလူၬတၭ, စယိၥၭအထၧၫ့ဖုဝဲဂဲၫ ဝ့ၫတၭ, ကျၭလၩ့အမ့ၬ လၧဂၪ့ခိၪလၧအမ့ၬယၫလီၫ.",
			"7": "<sup>7</sup> တၭစယိၥၭဒၪဘၪအထၧၫ့ဖုဝဲနီၪ, ၥ့ၪယၫဝ့ၫလီၫ.-မွဲလါ နၫ့တၭအီၪက့ၪအၥၭ လၧၦလခီၫဘၫ့မုးဖိၪ လၧအဝ့ၫၥံၪ အမ့ၬယၫတၭ, ချဲၩ့ဆၧဆီၪ့ဆီၪ့ လၧအဝ့ၫၥံၪတၭ,စံၭ ဝ့ၫ,နၥံၪဂဲၫလၧအထံၭခီၫခီၫလဲၪ. တၭအဝ့ၫၥံၪစံၭ, ပ ဂဲၫလၧခးကၫနအၫ့ ဘဲၫၥိၭပမိဎွ့ၩ ဆၧအၪ့ဆၧအီၩအ",
			"8": "<sup>8</sup> ၥိၭနီၪလီၫ.- တၭစယိၥၭၥ့ၪယၫနဲၪ့ အထၧၫ့ဖုဝဲလီၫ.",
			"9": "<sup>9</sup> အ့ၪမွဲအဝ့ၫၥံၪၥ့ၪယၫထဲၩ့အဝ့ၫအ့ၬ.- တၭစယိၥၭနၪ့ ထၪ့ထဲၩ့ဆၧမံၫမးလဖၪ, လၧအမံၫမးဝ့ၫ လၧအဂဲးအ ကၠီၪ့တၭ,စံၭဝ့ၫ, နၥံၪမွဲၦလၧအစဲၪ့ယိၥူၪ ဆၧတၭဘဲၫ ၥိၭနၥံၪမိဒၪဘၪ ခးအအီၪဘိၪ့တၭ, နၥံၪဂဲၫနၥံၪဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.- တၭအဝ့ၫၥံၪစံၭ, မွဲအ့ၬ,ယကဆါဧ့, မွဲဘဲၫၥိၭပမိ",
			"11": "<sup>11</sup> ဎွ့ၩဆၧအၪ့ဆၧအီၩတၭ, နဎီးနၡၩဂဲၫဝ့ၫလီၫ.- ပဝ့ၫဒၪ ထီးအလူၬယီၩ, ပမွဲၦလဂၩဎးအဖိၪခွၫလီၫ. ပမွဲၦအ",
			"12": "<sup>12</sup> တီၩလီၫ. နဎီးနၡၩမွဲၦလၧအစဲၪ့ယိၥူၪဆၧအ့ၬ.- တၭအ ဝ့ၫစံၭ,မွဲအ့ၬ, မွဲဘဲၫၥိၭနၥံၪမိဒၪဘၪ ခးအအီၪဘိၪ့တၭ",
			"13": "<sup>13</sup> နၥံၪဂဲၫနၥံၪဝ့ၫလီၫ.- တၭအဝ့ၫၥံၪစံၭ, နဎီးနၡၩမွဲၦထၧၫ့ ဖုဝဲလဆံၫနံၫဂၩ, ၦလဂၩဎးအီၪလၧခးကၫနအၫ့လဂၩ အဖိၪခွၫလဖၪလီၫ. တၭယိခွါ, အဆံၭလဂၩအီၪလၧ ပဖါအၥိၭ လၧမုဆၫလနံၩယီၩလီၫ. တၭအလဂၩအီၪ",
			"14": "<sup>14</sup> လၧၩ့အ့ၬ.- တၭစယိၥၭစံၭအဝ့ၫၥံၪ, ဆၧနီၪမွဲဆၧလၧ ယစံၭနၥံၪလီၫ. ယစံၭနၥံၪမွဲၦလၧအစဲၪ့ယိ ၥူၪဆၧလီၫ.",
			"15": "<sup>15</sup> ဆၧမိမၩခွါနၥံၪဘဲၫယီၩ, လၧဖၫရိၫအၥၭမၧၫ့အမ့ၬယၫ နီၪ,နၥံၪအဖု ဒၪဘၨၩအ့ၪလဂဲၫဘၪထီးယီၩတၭ, နၥံၪ",
			"16": "<sup>16</sup> စဲၪ့ထၪ့ဘၪထီးယီၩအ့ၬ.- တၭအၪ့မၧၫ့ၦလၧနၥံၪအ ကျၩလဂၩ လ့ၩဂဲၫထဲၩ့ဆိၬ နၥံၪအဖုဒၪဘၨၩနီၪဆံၭ. တၭနၥံၪမိအီၪစၧၩ့ထၬနၥံၪအၥၭ, ဘဲၫၥိၭဆၧတီၩအီၪ လၧနၥံၪအဖၧၩ့ဧၪနီၪ, နၥံၪအဆၧချဲၩ့ မိဘၪဆၧမၩခွါ ဝ့ၫလီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, လၧဖၫရိၫအၥၭမၧၫ့",
			"17": "<sup>17</sup> အမ့ၬယၫနီၪ, နၥံၪမွဲၦစဲၪ့ယိၥူၪဆၧလီၫ.- တၭစယိၥၭ အီၪက့ၪအဝ့ၫၥံၪထီးအလူၬ လၧၦခိၭထၬဆၧအလးမု",
			"18": "<sup>18</sup> ၥၧၫ့နံၩလီၫ.- ၥၧၫ့နံၩလနံၩနီၪ, စယိၥၭစံၭအဝ့ၫၥံၪ, မၩ",
			"19": "<sup>19</sup> ဆၧယီၩတၭ, မၧၫ့ဆံၭး ယမွဲၦၥၭမဲၪယွၩလီၫ.- နၥံၪ အ့ၪမွဲၦအတီၩတၭး မွဲၦလၧနၥံၪအထၧၫ့ဖုဝဲအကျၩလ ဂၩ,ဘၪဆၧစၧၩ့ထၬဝ့ၫ လၧနၥံၪအထီၫ့ဖၧၩ့း တၭထဲၩ့ ဆိၬနၥံၪဝ့ၫလၧဘုၪၥံၪဂူၫၥံၪ လၧဆၧၥၭဝံလၩ့ဒိၩအီၪ",
			"20": "<sup>20</sup> လၧနၥံၪအဂံၪ့လဖၪအဖၧၩ့အဂးနီၪ,- တၭဂဲၫထဲၩ့ဆိၬ နၥံၪအဖုဒၪဘၨၩ လၧယအီၪဆံၭး တၭနၥံၪမိမၩတီၩ နၥံၪအလူတၭ, နၥံၪလၥံၫဘၪလီၫ. တၭအဝ့ၫၥံၪမၩဝ့ၫ",
			"21": "<sup>21</sup> ဘဲၫနီၪၥိၭလီၫ.- တၭအဝ့ၫၥံၪချဲၩ့လိၬအၥၭ ဆုၬဆုၬ တၭ,စံၭ, ပဆၧဒဲၩဘၭအီၪမၬ လၧပထၧၫ့ဖုဝဲလဂၩအ ကၠီၩ့,လၧပဒၪဘၪ အၥုၪ့ခိအၥၭဝီၩ လၧအအၪ့ကံၩ့အၪ့ ယၫပၧၩတၭ,ပခိၭနၪအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧ",
			"22": "<sup>22</sup> ခိဆၧဝီၩယီၩဘၪပၧၩလီၫ.- စရုဘံၫ့စံၭဆၧၫ့အဝ့ၫၥံၪ တၭ,စံၭဝ့ၫဒၪ, ယစံၭနၥံၪ, ထီးမၩမၪဘၪဖိၪၥၪလဂ့ၩ တၭ,နၥံၪခိၭနၪအ့ၬ, မွဲအ့ၬဧၪ. မၩအၥၭဘဲၫနီၪတၭ,",
			"23": "<sup>23</sup> ဆၧအၪ့ဎၬအၥွံၪဆ့လီၫ.- တၭစယိၥၭနၪၥ့ၪဆၧနီၪအ ဝ့ၫၥံၪၥ့ၪယၫအ့ၬ, အဂဲးဘဲၫယီၩ ၦချဲၩ့ကျိၭထဲၩ့ဆၧ",
			"24": "<sup>24</sup> လၧအဘိၩ့ဆၧၩ့အီၪဝ့ၫလဂၩလီၫ.- မွဲအကၠၪဒိၭချိၫ့ခွံၬ အၥၭလၧအဝ့ၫၥံၪနီၪ အမ့ၬထံၫလၩ့တၭ, ဂဲၫထဲၩ့ထဲၩ့ ဒီၭလၧအအီၪတၭ, ချဲၩ့ဆၧလၧအဝ့ၫၥံၪတၭ, အၪ့မၩ န့ခွံၬစစံမအၧၫ့ လၧအကျၩတၭ, စၧၩ့ထၬဝ့ၫလၧအဝ့ၫ ၥံၪအမ့ၬယၫလီၫ.",
			"25": "<sup>25</sup> တၭစယိၥၭမၪလူၬဝ့ၫ လၧၦဘၪမၩဎွ့ၩအဝ့ၫၥံၪအ ထိၪ့လဖၪလၧဘုၪ, ဒဲဒုၭနုၬအစ့ၩ လၧအထိၪ့ဖၧၩ့လ ဂၩလၧအထိၪ့ဒၪဝ့ၫ, လဂၩလၧအထိၪ့ဒၪဝ့ၫ, ဒဲဖ့ၪလၫ့ အဝ့ၫၥံၪအဂူၫဆၪမ့ၩဆွံၪလဖၪ လၧဖၧၩ့ၥၭအဂးလီၫ.",
			"26": "<sup>26</sup> တၭမၩအဝ့ၫၥံၪဘဲၫနီၪၥိၭလီၫ.- အဝ့ၫၥံၪဖဒၨၭထၪ့ဘုၪ ၥံၪဂူၫၥံၪလၧအကၥ့ၪယီၩ့အခိၪတၭ, စဲၪ့ထၪ့ခွံၬထီးနီၪ",
			"27": "<sup>27</sup> လီၫ.- တၭလၧအဝ့ၫၥံၪမံၫအလးနီၪ, ၦလဂၩဝဲထၪ့အ ထိၪ့အခိၪဘဲၫၥိၭအမိဖ့ၪလၫ့ အကၥ့ၪယီၩ့အဆၪတၭ,",
			"28": "<sup>28</sup> ဒၪဘၪအစ့ၩ, ယိခွါ, အီၪဝ့ၫလၧအထိၪ့ခိၪလီၫ.- တၭ စံၭအထၧၫ့ဖုဝဲ, ဆၧဖ့ၪထဲၩ့ယူၭယစ့ၩယူၭတၭ, ယိခွါ, အီၪလၧယထိၪ့ဖၧၩ့မၬကၨ. တၭအဝ့ၫၥံၪ အၥၭလၩ့ ဘဲၩဝ့ၫတၭ ၥၭမဲၪဆၧနီၪ, စံၭလိၬအၥၭဆုၬဆုၬ, ဆၧ လၧယွၩမၩပၧၩယီၩ မွဲဆၧနီၪလမံၩ့လဲၪ.",
			"29": "<sup>29</sup> တၭအဝ့ၫၥံၪ ဂဲၫလၧအဖါစယၫကူၭ အအီၪလၧခး ကၫနအၫ့အဖၧၩ့တၭ, လီၩဘၪအဝ့ၫလၧကယဲဆၧလၧ",
			"30": "<sup>30</sup> အဘၪဝ့ၫတၭ, စံၭဝ့ၫဒၪ,- ခးအကဆါလဂၩ ချဲၩ့ဒုၪ့ ပၧၩဆီၪ့ဆီၪ့လ့ၬတၭ, အီၪက့ၪပၧၩ လၧၦယိၥူၪဆၧ",
			"31": "<sup>31</sup> လၧခးဖၧၩ့လီၫ.- တၭပစံၭအဝ့ၫ, ပဝ့ၫဒၪယီၩပမွဲၦအ",
			"32": "<sup>32</sup> တီၩတၭး ပမွဲၦလၧအယိၥူၪဆၧအ့ၬ.- ပထၧၫ့ဖုဝဲမွဲလ ဆံၫနံၫဂၩး ပဖါအဖိၪခွၫလဖၪလီၫ. တၭအလဂၩအီၪ လၧၩ့အ့ၬ. တၭအဆံၭလဂၩအီၪလၧ ပဖါလၧခးကၫန",
			"33": "<sup>33</sup> အၫ့အဖၧၩ့လၧမုဆၫလနံၩယီၩလီၫ.- တၭၦလဂၩ,ခး အကဆါလဂၩနီၪ, စံၭပၧၩ, ယမိၥ့ၪယၫလၧနၥံၪမွဲၦအ တီၩ လၧဆၧယီၩလမံၩ့အကၠီၩ့, အီၪက့ၪလၩ့ထးနၥံၪ အထၧၫ့ဖုဝဲလဂၩ လၧယၥိၭတၭ, အၪ့မၩန့ဆၧလၧနၥံၪ အဂံၪ့လဖၪ လၧဆၧၥၭဝံလၩ့ဒိၩအဂးတၭ, စဲၪ့ထၪ့ခွံၬ",
			"34": "<sup>34</sup> ဘီၪ.- တၭနၥံၪအဖုဒၪဘၨၩနီၪ ဂဲၫထဲၩ့ဆိၬလၧယအီၪ ဆံၭ,ထီးနီၪလဖၧၫ့ ယမိၥ့ၪယၫလၧနၥံၪ လမွဲဘၪၦယိ ၥူၪဆၧ, လၧနၥံၪမွဲၦအတီၩလီၫ. ယမိဖ့ၪထဲၩ့နၥံၪအ ထၧၫ့ဖုဝဲတၭ, နၥံၪမိအၪ့ခၩဆၧလၧခးဖၧၩ့လီၫ.",
			"35": "<sup>35</sup> ထီးအဝ့ၫၥံၪမၩခီၫထိၪ့လဖၪတၭ, ယိခွါ, ဆၧမၩအ ၥၭလၧစ့ၩအဘီၪ့နီၪ အီၪလၧအထိၪ့ဖၧၩ့ ကိၭဘီၪ့ဒ့ၭ လီၫ. တၭထီးအဝ့ၫၥံၪ ဒဲအဖါဒၪဘၪစ့ၩအဘီၪ့လဖၪ",
			"36": "<sup>36</sup> တၭ,အဝ့ၫၥံၪအၪ့ယိၪၥၭမဲၪဆၧလီၫ.- တၭအဖါစယၫ ကူၭစံၭအဝ့ၫၥံၪ, နၥံၪဒုၭလၩ့မါဒၪခွံၬယဖိၪလီၫ.- စယိ ၥၭလအီၪဘၪ, စစံမအၧၫ့လအီၪဘၪတၭ, နၥံၪမိမၩန့ ခွံၬစဘံၪ့ယမံၫ့ဆ့လီၫ. ဆၧလဖၪနီၪ ထၫ့ဒုၪဒၩယၧၩ",
			"37": "<sup>37</sup> ထီးအလူၬလီၫ.- စရုဘံၫ့ချဲၩ့ဒုၪ့အဖါတၭ, စံၭ,ယအ့ၪ လဂဲၫထဲၩ့ဆိၬဘၪအဝ့ၫ လၧနအီၪတၭ, မၩၥံၫခွံၬယ ဖိၪခွၫနံၫဂၩဆံၭး အီၪက့ၪအဝ့ၫဒၪ လၧယစူၪဖၧၩ့ဆံၭ,",
			"38": "<sup>38</sup> တၭယမိဂဲၫထဲၩ့န့အဝ့ၫဒၪလၧနအီၪလီၫ.- တၭအဝ့ၫ နီၪစံၭဝ့ၫဒၪ, ယဖိၪခွၫလ့ၩလၩ့ဘၪဒဲနၥံၪအ့ၬ. အဂဲး ဘဲၫယီၩအဝဲလဂၩၥံၫယူၭတၭ, အဝ့ၫဒၪနီၪအီၪဝ့ၫလ ဂၩဎးလီၫ. အ့ၪဘၪဆၧၡၪ့ဆၧနၭ လၧဖၧၩ့ၥၭလၧနၥံၪ ဖိၬဝ့ၫနီၪ,နၥံၪမိဒုၭ လ့ၩလၩ့ယခိၪဘွၩ လၧဖျႃဖၧၩ့အီၪ လၧယၥုၪ့အုၭၥၭအုၭလီၫ."
		},
		"43": {
			"1": "<sup>1</sup> တၭဆၧၥၭဝံလၩ့ဒိၩနီၪ အီၪလၧခးဖၧၩ့နၭမၬလီၫ.",
			"2": "<sup>2</sup> ထီးအဝ့ၫၥံၪအၪ့လူၬခွံၬဘုၪၥံၪဂူၫၥံၪ လၧအဂဲၫထဲၩ့ဆိၬ ဝ့ၫလၧခးအံဇံၭအဖၧၩ့နီၪတၭ, ဆၧမၩအၥၭလၧအဖါ စံၭဝ့ၫ, လ့ၩဒီၭဎွ့ၩန့ပဆၧအၪ့ဆၧအီၩ နးဆံၭဘီၪ.",
			"3": "<sup>3</sup> တၭစယုဒၫချဲၩ့ထၪ့စံၭဝ့ၫ, ၦလဂၩနီၪ ထိးအၥၭတၡါ ၡါတၭ, စံၭဝ့ၫဒၪ, နၥံၪအဖုလဂၩနီၪ အ့ၪလအီၪဘၪ",
			"4": "<sup>4</sup> လၧနၥံၪအၥိၭတၭ, နၥံၪဒၪဘၪယမ့ၬအ့ၬ.- နအ့ၪအၪ့ မၧၫ့ပဖုလ့ၩလၧပၥိၭတၭ, ပမိလ့ၩဎွ့ၩန့ဆၧအၪ့ဆၧ",
			"5": "<sup>5</sup> အီၩလီၫ.- နအ့ၪလအၪ့မၧၫ့လၩ့ဘၪ အဝ့ၫဒၪတၭ, ပလ့ၩလၩ့အ့ၬ. အဂဲးဘဲၫယီၩ ၦလဂၩနီၪစံၭပၧၩ, နၥံၪ အဖုအ့ၪလအီၪဘၪ လၧနၥံၪအၥိၭတၭ, နၥံၪဒၪဘၪယ မ့ၬအ့ၬ.",
			"6": "<sup>6</sup> တၭစအံၫစရ့လၭစံၭဝ့ၫဒၪ, နၥံၪလီၩဘၪၦလဂၩနီၪ လၧနၥံၪအဖုအီၪဒံၭလဂၩတၭ, မၩၡၪ့မၩနၭယၧၩမွဲ",
			"7": "<sup>7</sup> ဘၪလဲၪ.- တၭအဝ့ၫၥံၪစံၭ, ၦလဂၩနီၪအၪ့စၪ့ပၧၩလၩ့ ထံးလၩ့ဆ့ၭ လၧပဂဲးပကၠီၪ့ ဒဲလၧပဘူၭပထံးအဂဲးအ ကၠီၪ့တၭ,စံၭဝ့ၫဒၪ, နၥံၪအဖါအီၪဒံၭဆ့ဧၪး တၭနၥံၪ အထၧၫ့ဖုဝဲ အီၪဒံၭလဂၩဂၩဧၪ. တၭထီးဒၪဘဲၫဆၧ ချဲၩ့အီၪဝ့ၫအၥိၭနီၪ, ပစံၭဆၧၫ့အဝ့ၫဒၪလီၫ. တၭအ ဝ့ၫမိစံၭ,နၥံၪအထၧၫ့ဖုဝဲလဂၩနီၪ ဂဲၫန့အဝ့ၫဒၪဆံၭး မွဲ ပၥ့ၪယၫဝဲၩလၩ့ထံးလၩ့ဆ့ၭ မိၥ့ၪဆ့ဧၪ.",
			"8": "<sup>8</sup> တၭစယုဒၫစံၭအဖါစအံၫစရ့လၭနီၪ, အၪ့မၧၫ့ဖိၪၥၪ ခွၫလဂၩနီၪလ့ၩဖိၬယခဲၫ့ဆံၭ. တၭပမိဂဲထုၪ့လ့ၩဆၧး ဘဲၫၥိၭပမိမၧၫ့ဒံၭဒဲလၥံၫဘၪပဝ့ၫဒဲနၧၩ, ဒဲပဖိၪဒံၩဖိၪ",
			"9": "<sup>9</sup> ၥၪဆ့လီၫ.- တၭယမိထိးယၥၭ လၧအဂး, နဘၪအၪ့ ဎၬထဲၩ့အဝ့ၫဒၪလၧယစူၪဖၧၩ့လီၫ. ယအ့ၪလဂဲၫထဲၩ့ ဆိၬဘၪလၧနအီၪ, ဒဲလအီၪက့ၪဘၪအဝ့ၫဒၪ လၧနမ့ၬ ယၫတၭ, မွဲဆၧဒဲၩဘၭ အီၪလၧယလီၩ့ လၧနမ့ၬယၫ",
			"10": "<sup>10</sup> ကိၭမုနံၩကိၭမုနၩဒ့ၭဆံၭ.- အဂဲးဘဲၫယီၩ ပအ့ၪလအီၪ ထီဘၪတၭ, ဘိၩ့နဲၪ့ယီၩ, ပဂဲၫထဲၩ့ထဲၩ့ယူၭနံၫဘျၩ့လ ဘျၩ့ယူၭလီၫ.",
			"11": "<sup>11</sup> တၭအဝ့ၫၥံၪအဖါစအံၫစရ့လၭစံၭဝ့ၫ, အ့ၪမွဲဘဲၫနီၪ, အယီၩလဖၧၫ့မၩဆၧယီၩ, အၪ့မၩန့ခးအဆၧၥၪအွံၪ လၧနၥံၪအထိၪ့ဖၧၩ့တၭ, လ့ၩဆိၬန့ၦလဂၩနီၪလၧလၬ ဆီၪ့, ၥံၪ့စရံၭအထူၭနးဆံၭ, ဒဲန့ၫစၩ့နးဆံၭ, နၪ့တြူၭန ကိၭအဎဲၫ့, ဒဲၥံၪ့လိၭအထူၭ, ၥံၪ့အၪ့ဘိတၪ့အၥၪ, ဒဲၥံၪ့",
			"12": "<sup>12</sup> ၡီၩ့က့ၭအၥၪ, တၭမၩန့စ့ၩလၧနံၫစၩ လၧနၥံၪအစူၪ ဖၧၩ့ဒဲစ့ၩလၧနၥံၪဂဲၫထဲၩ့ဆိၬထဲၩ့ လၧနၥံၪအထိၪ့ဖၧၩ့ နီၪထဲၩ့ဆိၬလၧနၥံၪအစူၪဖၧၩ့ဆံၭ. ဘၪလဘၪယိဖၬ",
			"13": "<sup>13</sup> ဆၧလီၫ.- တၭမၩန့နဖုတၭ, ဂဲထုၪ့ထဲၩ့ထဲၩ့လၧၦလ",
			"14": "<sup>14</sup> ဂၩအအီၪနီၪဆံၭ.- တၭယွၩလၧအၥ့ၪဆၧလူၬနီၪ, မွဲအ ဖ့ၪလၫ့နၥံၪ လၧဆၧယၫ့ၥၭနၥံၪ လၧၦလဂၩနီၪ အမ့ၬ ယၫ, ဘဲၫၥိၭအမိကွဲၪဖျါနၥံၪ အထၧၫ့ဖုဝဲ အဂူၫဂၩလ ဂၩ, ဒဲစဘံၪ့ယမံၫ့နီၪဆံၭ. ယဝ့ၫဒၪယီၩ, ယအ့ၪဘၪ ထိးၡၪ့ထိးနၭတၭ, ယထိးယဝ့ၫဒၪလီၫ.",
			"15": "<sup>15</sup> တၭၦလဖၪနီၪမၩန့လၬဆီၪ့, ဒဲစ့ၩနံၫစၩလၧအစူၪ ဖၧၩ့, ဒဲစဘံၪ့ယမံၫ့တၭ, ဂဲထုၪ့တၭ, လ့ၩလၩ့လၧအံ",
			"16": "<sup>16</sup> ဇံၭတၭ, ဆၧၫ့ထုၪ့လၧစယိၥၭအမ့ၬယၫလီၫ.- တၭ စယိၥၭဒၪဘၪ စဘံၪ့ယမံၫ့ အီၪလၧအဝ့ၫၥံၪ အၥိၭ တၭ, စံၭၦလၧအဂံၪ့ဖိၪအဖၫ့ခိၪလဂၩ, အၪ့မၧၫ့ၦလ ဖၪနီၪဂဲၫလၧယဂံၪ့, ဒဲမၩၥံၫဆၧတၭ, တဲၩ့ဝဲၩဆၧဆံၭ. အဂဲးဘဲၫယီၩ ၦလဖၪနီၪမိအၪ့ဆၧလၧယၥိၭ ထီးမုထုၪ့",
			"17": "<sup>17</sup> နီၪလီၫ.- ၦလဂၩနီၪ မၩဘဲၫစယိၥၭ မၪလူၬဝ့ၫအၥိၭ တၭ, ၥိၫ့ထၪ့ၦလဖၪနီၪ လၧစယိၥၭအဂံၪ့ဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> မွဲၦၥိၫ့ထၪ့ဝ့ၫလၧစယိၥၭ အဂံၪ့ဖၧၩ့အကၠီၩ့နီၪ,အဝ့ၫ ၥံၪၥၭမဲၪဆၧတၭ, စံၭဝ့ၫဒၪ, ဆၧဒုၭဂဲၫနုၬပၧၩလၧစ့ၩ လၧအအီၪထဲၩ့လၧပထိၪ့ဖၧၩ့ လၧအခၪ့ထံၭလဖၧၫ့အ ကၠီၩ့,ဘဲၫၥိၭအမိဒၪန့ အမူၭထၫ့ဒုၪဒၩပၧၩ, ဒဲထိၪလၩ့ ထံၩဖါအၥၭလၧပဖၫ့ခိၪတၭ, မၩန့ပၧၩလၧဎီးလၧၡၩ,",
			"19": "<sup>19</sup> ဒဲပကၥ့ၪယီၩ့လဖၪနီၪဆ့လီၫ.- တၭအဝ့ၫၥံၪၥုၭဘူၭ အၥၭလၧစယိၥၭအၡၩဂံၪ့ဖိၪအခိၪတၭ, ချဲၩ့ဒုၪ့ဝ့ၫဒၪ",
			"20": "<sup>20</sup> လၧဂံၪ့အတရၫ့ထံၭ,- တၭစံၭအဝ့ၫဒၪ, ပျဲၩဒၪခလူၬ, ကဆါဧ့, ပဂဲၫလၩ့လၧအခၪ့ထံၭလဖၧၫ့ ဘဲၫၥိၭပမိဎွ့ၩ",
			"21": "<sup>21</sup> ဆၧအၪ့ဆၧအီၩတီၩတီၩလီၫ.- ထီးပထီၩ့လၧပမံၫအ လးနီၪတၭ, ဆၧမၩအၥၭလၧပဝဲထၪ့ပထိၪ့တၭ, ယိခွါ, ၦအစ့ၩအီၪဝ့ၫလၧအထိၪ့ခိၪ, လဂၩအစ့ၩလၧအထိၪ့ ခိၪ,လဂၩအစ့ၩလၧအထိၪ့ခိၪ, စ့ၩဘဲၫအလယၧးအီၪ ဝ့ၫအၥိၭနီၪလၧၫ့ဎွ့ၩတၭ, ပဂဲၫထဲၩ့ဆိၬလၧပစူၪဖၧၩ့",
			"22": "<sup>22</sup> လီၫ.- တၭပဂဲၫဆိၬလၩ့စ့ၩအဂူၫဂၩ လၧပစူၪဖၧၩ့,ဘဲၫ ၥိၭပမိဎွ့ၩ ဆၧအၪ့ဆၧအီၩလီၫ. မွဲပလၫဒူၭလၩ့စ့ၩ လၧပထိၪ့ဖၧၩ့ လဂၩလဲၪနီၪ, ပၥ့ၪယၫပဝ့ၫအ့ၬ.",
			"23": "<sup>23</sup> တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, မွဲနၥံၪဘၪအမုၬဆံၭ. ၥၭမဲၪ ဆၧလဂ့ၩး နၥံၪအယွၩ, ဒဲနၥံၪအဖါအယွၩဖ့ၪလၫ့နၥံၪ အဆၧလူဒိၪဎွ့ၩဒိၪ အီၪၥူၪဝ့ၫလၧနၥံၪအထိၪ့ဖၧၩ့လီၫ. နၥံၪအစ့ၩအီၪယူၭ လၧယစူၪဖၧၩ့လီၫ. တၭအဝ့ၫနီၪ",
			"24": "<sup>24</sup> ၥိၫ့ထၪ့စစံမအၧၫ့ လၧအဝ့ၫၥံၪအအီၪလီၫ.- ၦလဂၩနီၪ ၥိၫ့ၦလဖၪလၧစယိၥၭ အဂံၪ့ဖၧၩ့တၭ, ဖ့ၪလၫ့ထံၫတၭ, အဝ့ၫၥံၪၥူၫဝၭခွံၬအခၪ့တၭ, ၦလဂၩနီၪ ဖ့ၪလၫ့ဝ့ၫအ",
			"25": "<sup>25</sup> ကၥ့ၪယီၩ့လဖၪအဆၪလီၫ.- တၭအဝ့ၫၥံၪတဲၩ့ဝဲၩ လၬဆီၪ့နီၪ ထီးစယိၥၭမိဂဲၫဝ့ၫ လၧမုထုၪ့လီၫ. အဂဲး",
			"26": "<sup>26</sup> ဘဲၫယီၩမွဲအနါဂၧၫ့ လၧအမိအၪ့ဆၧထီးနီၪလီၫ.- တၭ စယိၥၭဂဲၫလၧအဂံၪ့နီၪ အဝ့ၫၥံၪဂဲၫဆိၬလၬဆီၪ့လၧအ အီၪလၧအဝ့ၫၥံၪအစူၪဖၧၩ့နီၪ လၧအဝ့ၫဒၪအအီၪလၧ",
			"27": "<sup>27</sup> အဂံၪ့ဖၧၩ့တၭ, ထွံၩလၩ့ဝ့ၫလၧအမ့ၬယၫလီၫ.- တၭ အဝ့ၫဒၪအၪ့စၪ့အဝ့ၫၥံၪ, လၧအအီၪမုၬ အဂဲးအကၠီၪ့ တၭ, စံၭဝ့ၫဒၪ, နၥံၪအဖါ, ၦၥၭၡါလဂၩ, လၧနၥံၪ ချဲၩ့ဆၧလၧအဂဲးအကၠီၪ့, အီၪမုၬဆ့ဧၪ, မွဲအမၧၫ့ဒံၭဆ့",
			"28": "<sup>28</sup> ဧၪ.- တၭအဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫဒၪ, နဎီးနၡၩပဖါလဂၩ အီၪမုၬဝ့ၫဒဲမၧၫ့ဒံၭလီၫ. ၡီၫ့လၩ့အခိၪတၭ, ကူၭလၩ့",
			"29": "<sup>29</sup> အၥၭလၧအမ့ၬယၫလီၫ.- အဝ့ၫဒၪစၪ့ထၪ့အမ့ၬယိထၪ့ ဆၧတၭ, ဒၪဘၪအဖု, အမိအဖိၪခွၫ စဘံၪ့ယမံၫ့လဂၩ တၭ,စံၭဝ့ၫဒၪ, အဝ့ၫလဂၩယီၩ မွဲနၥံၪအဖုလၧနၥံၪ လီၩဘၪယၧၩအဂဲးအကၠီၪ့ဆ့ဧၪ. တၭစံၭအဝ့ၫဒၪ, မွဲ ယွၩယၫ့ၥၭနၧၩဆံၭ, ယဖိၪခွၫဧ့.",
			"30": "<sup>30</sup> တၭစယိၥၭ မၩဝ့ၫချဲၫ့ချဲၫ့လီၫ. အဂဲးဘဲၫယီၩ ၥၭ အီၪအဖုတၭ, အၪ့ဎၬအလး ဘဲၫၥိၭအမိလူၫလၩ့ခွံၬ အမ့ၬထံၫလီၫ. တၭလ့ၩနုၬလၧအဒူၭဖၧၩ့တၭ, အမ့ၬ",
			"31": "<sup>31</sup> ထံၫလၩ့ဝ့ၫထီးနီၪလီၫ.- ဖျါခွံၬအမ့ၬနီၪ စဲၪ့ထၪ့တၭ, ထုၭအၥၭတၭ, စံၭဝ့ၫဒၪ, အီၪက့ၪလၩ့ဆၧအၪ့ဘီၪ.",
			"32": "<sup>32</sup> တၭၦအီၪက့ၪလၧအနၫ့ဆါအဂးလစီၪ့, ဒဲလၧအဝ့ၫၥံၪ အဂးလစီၪ့ဒၪ, ဒဲလၧၦအံဇံၭဖိၪလၧအအၪ့ဆၧလၧအ ဝ့ၫဒၪအၥိၭအဂးလစီၪ့ဒၪဆ့လီၫ. အဂဲးဘဲၫယီၩၦအံ ဇံၭဖိၪအၪ့ဘၪဆၧလၧ ၦဟံဘြူၫဖိၪအၥိၭၥ့ၪအ့ၬ. အ နီၪမွဲဆၧဘၪၥၭလိၪ လၧၦအံဇံၭဖိၪအမ့ၬယၫ အဂဲး",
			"33": "<sup>33</sup> လီၫ.- တၭအဝ့ၫၥံၪဒုၭဆၧၫ့နၩ့အဝဲၡါလဂၩ, ဘဲၫအဝဲ ၡါအလးအၥိၭ, ဒဲအဆံၭလဂၩဘဲၫအဆံၭ အလးအ ၥိၭလၧအမ့ၬယၫတၭ, ၦလဖၪနီၪထီၫမံၫထီၫမၪလိၬအ",
			"34": "<sup>34</sup> ၥၭဆုၬဆုၬလီၫ.- တၭအဝ့ၫဒၪမၩန့ထၪ့ဆၧလဖၪလၧ အမ့ၬယၫလၧအဝ့ၫၥံၪအဂးတၭ, လၧစဘံၪ့ယမံၫ့အဂး နီၪအၪနဲၪ့ၦဂူၫဂၩ အဆၧယဲစၩလီၫ. တၭအဝ့ၫၥံၪအီၩ ဆၧတၭဘျဲၩအီၩဝ့ၫ မုၬအၥၭလၧအဝ့ၫဒၪ အၥိၭလီၫ."
		},
		"44": {
			"1": "<sup>1</sup> အဝ့ၫဒၪမၪလူၬၦ လၧအမွဲအဂံၪ့ဖိၪၥံၪအခိၪလဂၩ တၭ,စံၭဝ့ၫ, မၩဎွ့ၩထၪ့ၦလဖၪနီၪ အထိၪ့ဖၧၩ့ဒဲဆၧ အၪ့ဆၧအီၩ ကယဲအဆိၬထၪ့ဝ့ၫၥ့ၪတၭ, ဒုၭနုၬၦအ စ့ၩ,လဂၩအစ့ၩ လၧအထိၪ့ခိၪ, လဂၩအစ့ၩလၧအထိၪ့",
			"2": "<sup>2</sup> ခိၪ,- တၭဒုၭနုၬယလိၫ့, လိၫ့စ့ၩလဖျိၪ့ လၧၦအဆံၭအ ထိၪ့ခိၪ, ဒဲဘုၪအဎွ့ၩနီၪဆံၭ. အဝ့ၫဒၪမၩဘဲၫစယိၥၭ",
			"3": "<sup>3</sup> ချဲၩ့ဆၧအၥိၭနီၪလီၫ.- ထီးမုဆဲၪ့ထၪ့ဆၧဖၩ့ထၪ့တၭ, ဆၧအၪ့မၧၫ့ ၦလဖၪနီၪလ့ၩဆၧ, အဝ့ၫၥံၪဒဲအကၥ့ၪ ယီၩ့လီၫ.",
			"4": "<sup>4</sup> တၭအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧဒိၩ့ဖၧၩ့, လယဲၩ့ဘၪနီၪ စယိၥၭစံၭ, ၦပၧၩ့အဂံၪ့လဂၩ ဂဲထုၪ့လီၩ့ဆီးၦလဖၪနီၪ ဆံၭး ထီးနချႃၭန့ဝ့ၫနီၪ, စံၭအဝ့ၫၥံၪ, နၥံၪဖ့ၪဆၧၫ့ထဲၩ့",
			"5": "<sup>5</sup> ဆၧအၧၩ့လၧဆၧဂ့ၩအဂး, မွဲဘၪလဲၪ.- အယီၩ,မွဲဆၧ လၧကဆါအီၩဝ့ၫလၧအဖၧၩ့, ဒဲအတွၭန့ဆၧကိၪ့လဖၪ မွဲအ့ၬဧၪ. နၥံၪမၩဆၧအၧၩ့ လၧနၥံၪမၩဆၧနီၪလီၫ.",
			"6": "<sup>6</sup> တၭအဝ့ၫဒၪ လ့ၩချႃၭန့ဝ့ၫတၭ, ချဲၩ့အဝ့ၫၥံၪလၧဆၧ",
			"7": "<sup>7</sup> ချဲၩ့နီၪလီၫ.- တၭအဝ့ၫၥံၪစံၭ, ယကဆါချဲၩ့ဆၧချဲၩ့လ ဖၪနီၪ,မွဲအဘၪဆၧနီၪလဲၪး ဘဲၫနဆၧချဲၩ့လဖၪအၥိၭ",
			"8": "<sup>8</sup> နီၪ,မွဲနဎီးနၡၩထီးမၩလဂ့ၩ,- ယိခွါ,စ့ၩလၧပဒၪန့ဘၪ လၧပထိၪ့ခိၪနီၪ, ပဂဲၫထဲၩ့ဆိၬထီးနအီၪယီၩ, လၧခး ကၫနအၫ့အဖၧၩ့နီၪလီၫ. တၭပအၪ့ဂူၪကျိၪၥံၪစ့ၩၥံၪ,",
			"9": "<sup>9</sup> ထီၫ့ၥံၪလွ့ၫၥံၪ, လၧနကဆါအဂံၪ့ဖၧၩ့ဘဲၫၥ့ၪလဲၪ.- ထီး ဒၪနဎီးနၡၩ လၧဆၧဒၪန့အဝ့ၫ လၧအစူၪဖၧၩ့လဂၩဂၩ ယီၩ,မွဲအၥံၫဆံၭ. တၭပဝ့ၫဒၪယီၩ ပမိကဲၪထၪ့ပကဆါ",
			"10": "<sup>10</sup> အဎီးအၡၩဆ့လီၫ.- တၭအဝ့ၫနီၪစံၭဝ့ၫဒၪ, ဘိၩ့နဲၪ့ ယီၩမွဲအမၩဒၪဝ့ၫအၥၭ ဘဲၫနၥံၪချဲၩ့အၥိၭနီၪဆံၭ. ထီးဒၪၦလၧဆၧဒၪန့ဝ့ၫ လၧအစူၪဖၧၩ့လဂၩဂၩနီၪ, မွဲ အကဲၪထၪ့ယဎီးဆံၭ. တၭနၥံၪဝ့ၫဒၪယီၩ, နၥံၪအဆၧ",
			"11": "<sup>11</sup> ဒဲၩဘၭအီၪလၧနၥံၪအလီၩ့အ့ၬ.- အဝ့ၫၥံၪဆိၬလၩ့ခွံၬ အထိၪ့ချဲၫ့ချဲၫ့လၧဂၪ့ခိၪတၭ ဝဲထၪ့အထိၪ့, လဂၩအ",
			"12": "<sup>12</sup> ထိၪ့ဒၪဝ့ၫ, လဂၩအထိၪ့ဒၪဝ့ၫ,- အၪ့ဎၬဆိၫဝ့ၫလၧအ ဝဲၡါလဂၩတၭ, ထုၬဝ့ၫလၧအဆံၭလဂၩး တၭဒၪန့ လိၫ့လဖျိၪ့နီၪ လၧစဘံၪ့ယမံၫ့အထိၪ့ဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> အဝ့ၫၥံၪၡၫ့ယၬ အကီၩ့အၥိၭတၭ, ဖဒၨၭထၪ့ဆၧ လၧကၥ့ၪယီၩ့အခိၪ, လဂၩလၧအကၥ့ၪယီၩ့အခိၪ တၭ, လဂၩလၧအကၥ့ၪယီၩ့အခိၪတၭ, ထဲၩ့ထဲၩ့လၧ",
			"14": "<sup>14</sup> ဒိၩ့ဖၧၩ့လီၫ.- စယုဒၫဒဲအထၧၫ့ဖုဝဲ, ဂဲၫဝ့ၫလၧစယိၥၭ အဂံၪ့, အဝ့ၫဒၪအီၪဒံၭထီးနီၪတၭ အဝ့ၫၥံၪ ထိၪလၩ့",
			"15": "<sup>15</sup> ထံၩဖါအၥၭလၧဂၪ့ခိၪလၧအမ့ၬယၫလီၫ.- တၭစယိ ၥၭစံၭအဝ့ၫၥံၪ, ဆၧလၧနၥံၪမၩဆၧယီၩ, မွဲဆၧနီၪလ မံၩ့လဲၪ, ၦဘဲၫယၧၩအၥိၭ, ဖၭဆၧဘၪနီၪ, မွဲနၥံၪၥ့ၪ",
			"16": "<sup>16</sup> ယၫဒံၭအ့ၬဧၪ.- တၭစယုဒၫစံၭ, ပဝ့ၫဒၪ ပမိစံၭပက ဆါဘဲၫၥ့ၪလဲၪး ပမိချဲၩ့ဆၧဘဲၫၥ့ၪလဲၪး ပမိအီၪက့ၪ တီၩပၥၭဘဲၫၥ့ၪလဲၪ, ယွၩဒၪန့နဎီးနၡၩ အဆၧအၧၩ့ ဆၧၥၫ့လီၫ. ယိခွါ, ပမွဲကဆါအဎီးအၡၩ, ပဝ့ၫဒၪဒဲၦ",
			"17": "<sup>17</sup> လဂၩလၧဆၧဒၪန့လိၫ့နီၪ အီၪလၧအစူၪဖၧၩ့လီၫ.- တၭ အဝ့ၫဒၪစံၭ, မွဲယထီးမၩဆၧ ဘဲၫနီၪလါလါလဂ့ၩး ၦ လၧဆၧဒၪန့လိၫ့လဖျိၪ့ လၧအစူၪဖၧၩ့လဂၩနီၪ,မိကဲၪ ထၪ့ယဎီးလီၫ. အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, ဂဲထုၪ့ထဲၩ့ထဲၩ့ မုၬမုၬလၧနၥံၪအဖါအအီၪနီၪဆံၭ.",
			"18": "<sup>18</sup> စယုဒၫၥုၭဘူၭအၥၭလၧအအီၪတၭ, စံၭဝ့ၫဒၪ,ဖ့ၪ လၫ့ဒၪခလူၬ, ဒုၭချဲၩ့လါနဎီးနၡၩ လၧဆၧချဲၩ့လထံၪ လၧယကဆါအနါဖၧၩ့ဘီၪ. မွဲနထီးၥၭထၪ့ခဲၩထၪ့ဘၪ နဎီးနၡၩလဂ့ၩ, အဂဲးဘဲၫယီၩ နဝ့ၫဒၪနန့ၫၥိၭဒဲဖၫရိၫ",
			"19": "<sup>19</sup> လီၫ.- ယကဆါအၪ့စၪ့အဎီးအၡၩတၭ, စံၭဝ့ၫဒၪ,န ၥံၪအဖါမွဲဂ့ၩ, နၥံၪအထၧၫ့ဖုဝဲမွဲဂ့ၩ, မွဲအအီၪဆ့ဧၪ.",
			"20": "<sup>20</sup> တၭပလီၩဘၪယကဆါ, ပအီၪလၧပဖါ ၦၥၭၡါလဂၩ, ဒဲအဖိၪၥၪခွၫဘၪဆဲၫ့ လၧအၥုၪ့က့ၭၥၭၡါ, အဆံၭလဂၩ ဒဲအဝဲလဂၩၥံၫယူၭတၭ, လၧအမိနီၪအီၪလၩ့ထး က",
			"21": "<sup>21</sup> ယဲအဝ့ၫလဂၩနီၪလီၫ. တၭအဖါအဲၪအဝ့ၫလီၫ.- တၭ နစံၭနဎီးနၡၩ, ဘဲၫၥိၭယမိယိဘၪတၭ, ဂဲၫဆိၬလၩ့အ",
			"22": "<sup>22</sup> ဝ့ၫလၧယအီၪဆံၭ.- တၭပစံၭယကဆါ, ဖိၪၥၪခွၫနီၪ, စဲၪ့ဒၪအဖါၥ့ၪအ့ၬ. အ့ၪစဲၪ့ဒၪအဖါတၭ, အဝ့ၫဒၪမိၥံၫ",
			"23": "<sup>23</sup> လီၫ.- တၭနစံၭနဎီးနၡၩ, နၥံၪအဖုဒၪဘၨၩအ့ၪလဂဲၫ လၩ့ဘၪ လၧနၥံၪအၥိၭတၭ, နၥံၪဒၪဘၪလၧၩ့ယမ့ၬ အ့ၬ.",
			"24": "<sup>24</sup> တၭဆၧမၩအၥၭ ထီးပထဲၩ့ထဲၩ့လၧနဎီးနၡၩ ပဖါ လဂၩအအီၪတၭ, ပလီၩဘၪအဝ့ၫ လၧပကဆါအဆၧ",
			"25": "<sup>25</sup> ချဲၩ့နီၪလီၫ.- တၭပဖါစံၭ, လ့ၩဎွ့ၩန့ဆၧအၪ့ဆၧအီၩ",
			"26": "<sup>26</sup> လၧပဂးနးဆံၭဘီၪ.- တၭပစံၭပလ့ၩလၩ့ၥ့ၪအ့ၬ. ပဖု အဆံၭလဂၩ အ့ၪအီၪလၧပၥိၭတၭ, ပမိလ့ၩလီၫ. အ ဂဲးဘဲၫယီၩ ပဖုအဆံၭလဂၩ အ့ၪလအီၪဘၪ လၧပၥိၭ",
			"27": "<sup>27</sup> တၭ,ပဒၪဘၪၦလဂၩနီၪ အမ့ၬၥ့ၪအ့ၬ.- တၭနဎီးနၡၩ ယဖါလဂၩနီၪစံၭပၧၩ, နၥံၪၥ့ၪယၫလၧယမၫဆီၫ့အီၪ",
			"28": "<sup>28</sup> န့ယၧၩလၧၦနံၫဂၩလီၫ.- တၭအဝ့ၫလဂၩစဲၪ့ထၪ့ခွံၬ လၧယအီၪတၭ, ယစံၭ, ဆၧအဲၪ့ၥံၫယူၭဝ့ၫတၡါယူၭ. တၭယလဒၪလၧၩ့ဘၪအဝ့ၫဒၪ ခီးဘိၩ့နဲၪ့ယီၩလီၫ.",
			"29": "<sup>29</sup> နၥံၪအ့ၪအၪ့မၩန့ခွံၬအယီၩလဂၩဆ့ လၧယအီၪတၭ, အ့ၪဘၪဆၧၡၪ့ဆၧနၭ, နၥံၪမိဒုၭဂဲၫလၩ့ယခိၪဘွၩလၧ ဖျႃဖၧၩ့လၧဆၧၡၪ့ဆၧနၭလီၫ.",
			"30": "<sup>30</sup> ဘိၩ့နဲၪ့ယီၩ, ယအ့ၪထီၩ့လၧနဎီးနၡၩ, ယဖါအအီၪ တၭ, ၦဖိၪၥၪခွၫလဂၩယီၩ လအီၪဘၪလၧပၥိၭတၭ, မွဲလၧအၥၭမၧၫ့ ဘၪဆၧစၧၩ့ထၬဝ့ၫ လၧအဖိၪအၥၭ",
			"31": "<sup>31</sup> မၧၫ့အဖၧၩ့တၭ,- ထီးအဒၪဘၪလၧဖိၪၥၪခွၫယီၩလအီၪ ဘၪတၭ, ဆၧမိမၩအၥၭလၧအမိၥံၫဝ့ၫလီၫ. တၭနဎီး နၡၩမိဒုၭလ့ၩလၩ့နဎီးနၡၩ, ပဖါအခိၪဘွၩလၧဖျႃဖၧၩ့",
			"32": "<sup>32</sup> လၧဆၧၥုၪ့အုၭဆၧၥၭအုၭလီၫ.- အဂဲးဘဲၫယီၩ နဎီး နၡၩကဲၪထၪ့ၦထိးအၥၭ လၧအဂး လၧပဖါအမ့ၬယၫ နီၪ,ယစံၭ, ယအ့ၪလဂဲၫထဲၩ့ဆိၬဘၪအဝ့ၫဒၪ လၧနအီၪ တၭ, ယမိဘၪဆၧဒဲၩဘၭလၧယဖါအမ့ၬယၫ ကိၭမုနံၩ",
			"33": "<sup>33</sup> မုနၩဒ့ၭလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ဒုၭအီၪလါယၧၩလၧ ယကဆါအဎီး လၧဖိၪၥၪခွၫနီၪအလး, ဒုၭထဲၩ့ထဲၩ့ဖိၪ",
			"34": "<sup>34</sup> ၥၪခွၫလၧအထၧၫ့ဖုဝဲၥံၪအၥိၭဆံၭ.- အဂဲးဘဲၫယီၩဖိၪ ၥၪခွၫနီၪ, လအီၪဘၪတၭ, ယမိထဲၩ့ထၪ့လၧယဖါအ အီၪဘဲၫၥ့ၪလဲၪး ယမိဒၪဘၪခိၬ ဆၧၡၪ့ဆၧနၭလၧအမိ ဘၪယဖါနီၪလီၫ."
		},
		"45": {
			"1": "<sup>1</sup> တၭစယိၥၭထုၭအၥၭ လၧၦလၧအဆၧၫ့ထုၪ့လၧ အနဲၩ့ထံၭထီးအလူၬ အမ့ၬယၫကဲၪအ့ၬ. တၭကိၭထၪ့ ဝ့ၫ, ဒုၭစဲၪ့ထၪ့ခွံၬ ကယဲၦလၧယအီၪ ကိၭဂၩဒ့ၭဆံၭ. စယိၥၭနဲၪဖျီၪထၪ့အၥၭ လၧအထၧၫ့ဖုဝဲအမ့ၬယၫအ ဘိၩ့ဘၭနီၪတၭ, ၦဆၧၫ့ထုၪ့ဘၪဝ့ၫ လၧအၥိၭ နးဂၩ",
			"2": "<sup>2</sup> အ့ၬ.- တၭအဝ့ၫဂၪ့ၥီၫထၪ့တၭ အမ့ၬထံၫလၩ့နီၪ,ၦအံ",
			"3": "<sup>3</sup> ဇံၭဖိၪ, ဒဲဖၫရိၫအဂံၪ့ဖိၪၥံၪ နါဂၧၫ့ဝ့ၫလီၫ.- တၭစယိ ၥၭစံၭအထၧၫ့ဖုဝဲၥံၪ, ယမွဲစယိၥၭလီၫ. မွဲယဖါမၧၫ့ဒံၭ ဆ့ဧၪ, တၭအထၧၫ့ဖုဝဲချဲၩ့ဆၧၫ့ဝ့ၫ ကဲၪအ့ၬ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪ အၥုၪ့ခိအၥၭဝီၩ လၧအအီၪလၧအမ့ၬယၫ အကၠီၩ့လီၫ.",
			"4": "<sup>4</sup> တၭစယိၥၭ စံၭအထၧၫ့ဖုဝဲၥံၪ, ၥုၭဘူၭနၥံၪအၥၭ လၧယအီၪဆံၭ. အဝ့ၫၥံၪၥုၭဘူၭအၥၭလီၫ. အဝ့ၫနီၪ စံၭအဝ့ၫၥံၪ, ယမွဲနၥံၪအထၧၫ့ဖုဝဲစယိၥၭ, လၧနၥံၪအၪ့",
			"5": "<sup>5</sup> ဆၫလၩ့ခွံၬ လၧအံဇံၭနီၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, နၥံၪ ထီးၥၭအုၭလဂ့ၩး တၭနၥံၪထီးၥၭထၪ့ဘၪ နၥံၪအၥၭ လၧနၥံၪအၪ့ဆၫခွံၬယၧၩ ထီးယီၩအကၠီၩ့လဂ့ၩ. အဂဲး ဘဲၫယီၩယွၩအၪ့မၧၫ့ ယဂဲၫလၩ့လၧနၥံၪအမ့ၬ ယၫဘဲၫ",
			"6": "<sup>6</sup> ၥိၭဆၧမိဒုၭမၧၫ့ဒံၭနၥံၪလီၫ.- ဆၧၥၭဝံလၩ့ဒိၩယီၩ, အီၪယူၭ လၧခးဖၧၩ့ယီၩ နံၫနံၪ့ယူၭ. တၭအီၪဒံၭယဲ နံၪ့လၧအလမိအီၪဘၪ လၧထဲၫဆၧ, ဒဲကူၭဆၧနီၪလီၫ.",
			"7": "<sup>7</sup> ယွၩအၪ့မၧၫ့ ယလ့ၩလၧနၥံၪအမ့ၬယၫ, ဘဲၫၥိၭအမိ အီၪက့ၪဆၧအီၪလၩ့ထး လၧနၥံၪအဂး လၧဂၪ့ခိၪချိၫ့, ဒဲဒုၭမၧၫ့ဒံၭနၥံၪ လၧဆၧမၩဖီၩ့မၩဖျ့ၭဆၧ ဖၭဒိၪလီၫ.",
			"8": "<sup>8</sup> တၭဘိၩ့နဲၪ့ယီၩ နၥံၪအၪ့မၧၫ့ယဂဲၫထီးယီၩမွဲအ့ၬ, မွဲ ယွၩလီၫ. တၭယွၩအီၪက့ၪယၧၩ လၧဖၫရိၫအဖါ, ဒဲအ ဂံၪ့ဖိၪထီးအလူၬအကဆါ, ဒဲၦပၧၩ့ဆၧလၧ ခးအံဇံၭ",
			"9": "<sup>9</sup> ထၧၫ့ခးယၫလီၫ.- ထဲၩ့ထၪ့နၥံၪဝ့ၫချဲၫ့ချဲၫ့ လၧယဖါ အအီၪတၭ, စံၭအဝ့ၫး နဖိၪခွၫစယိၥၭစံၭဘဲၫယီၩ, ယွၩ အီၪက့ၪလၩ့ယၧၩ လၧခးအံဇံၭထၧၫ့ခးယၫ အကဆါ လီၫ. ဂဲၫလၩ့လၧယအီၪတၭ, ထီးၥုၭနံၩၥုၭၥၫ့လဂ့ၩ",
			"10": "<sup>10</sup> ဘီၪ.- တၭနမိအီၪလၧခးဂိၡံၫ့တၭ, နမိအီၪဘူၭလၧ ယၧၩ,နဝ့ၫဒၪ, ဒဲနဖိၪခွၫၥံၪ, ဒဲနဖိၪခွၫၥံၪအဖိၪခွၫလဖၪ, ဒဲနၥိၪ,ဒဲနဘ့ၪလဖၪ ဒဲနချီလဖၪ, ဒဲကယဲနဆၧအီၪလ",
			"11": "<sup>11</sup> မံၩ့လါလါဆ့လီၫ.- ယမိလုအၪ့လုအီၩနၧၩ ထီးနီၪ, အဂဲးဘဲၫယီၩ ဆၧၥၭဝံလၩ့ဒိၩမိအီၪဒံၭ ယဲနံၪ့လီၫ. န ဝ့ၫဒၪ,ဒဲနဂံၪ့ဖိၪၥံၪ, ဒဲကယဲၦအီၪလၧနစူၪဖၧၩ့နီၪ, ဘဲၫ",
			"12": "<sup>12</sup> ၥိၭနထီးဘၪၡၪ့ဘၪနၭလဂ့ၩတၭ,- ယိခွါ, နၥံၪအမ့ၬ ၥၪဒဲယဖု စဘံၪ့ယမံၫ့အမ့ၬၥၪဒၪဘၪဝ့ၫ, လၧအမွဲယ",
			"13": "<sup>13</sup> နိၭလၧအချဲၩ့ဆၧလၧနၥံၪလီၫ.- တၭနၥံၪမိလီၩဘၪယ ဖါလၧယလၩယဖၩ့, လၧအံဇံၭအဖၧၩ့ထီးအလူၬအ ဂဲးအကၠီၪ့, ဒဲကယဲဆၧလၧနၥံၪဒၪဘၪ ထီးအလူၬလီၫ. နၥံၪဘၪ မၩချဲၫ့ချဲၫ့တၭ, ဂဲၫထဲၩ့ဆိၬလၩ့ ယဖါထီး ယီၩဘီၪ.",
			"14": "<sup>14</sup> အဝ့ၫဒၪထိၪလၩ့ထံၩဖါအၥၭ လၧစဘံၪ့ယမံၫ့အခိၬ အမ့ၬထံၫလၩ့တၭ, စဘံၪ့ယမံၫ့အမ့ၬထံၫလၩ့ လၧအဝဲ",
			"15": "<sup>15</sup> အခိၬနီၪလီၫ.- အဝ့ၫအဲၪဂါအထၧၫ့ဖုဝဲ ထီးအလူၬတၭ, အမ့ၬထံၫလၩ့လၧအလီၩ့း တၭလၧဆၧနီၪလဖၪအလး ခဲၫ့နီၪ အထၧၫ့ဖုဝဲၥံၪချဲၩ့ဒုၪ့အဝ့ၫဒၪလီၫ.",
			"16": "<sup>16</sup> ဆၧမၩအၥၭနီၪအပရၧၫ့ ဂၧၫ့ထၪ့ၥၩလၩ့လၧဖၫရိၫ အဂံၪ့ဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, စယိၥၭအထၧၫ့ဖုဝဲလဖၪဂဲၫ ယူၭးတၭဂ့ၩဝ့ၫလၧ ဖၫရိၫအမ့ၬယၫ, ဒဲလၧအခ့ၫအၡၩ",
			"17": "<sup>17</sup> အမ့ၬယၫလီၫ.- တၭဖၫရိၫစံၭစယိၥၭ, လီၩဘၪနထၧၫ့ ဖုဝဲၥံၪ, မၩဆၧယီၩး ဖဒၨၭထၪ့ဆၧလၧနၥံၪ အဆၧဖိၪ ဆၧဎါအခိၪတၭ, လ့ၩ, ထဲၩ့ထဲၩ့ လၧခးကၫနအၫ့အ",
			"18": "<sup>18</sup> ဖၧၩ့,- တၭအၪ့မၩန့နၥံၪအဖါ ဒဲနၥံၪအဂံၪ့ဖိၪတၭ, ဂဲၫ လၧယအီၪဆံၭ. တၭယမိဖ့ၪလၫ့နၥံၪ လၧခးအံဇံၭအ",
			"19": "<sup>19</sup> ဆၧဂ့ၩတၭ, နၥံၪမိအၪ့ထံၫၥံၪခးၥံၪအၥိၪလီၫ.- တၭ ဘိၩ့နဲၪ့ယီၩ ဆၧမၪလူၬနၧၩမၩဆၧယီၩ, မၩန့လဲၪ့လၧ အံဇံၭအဖၧၩ့ လၧနၥံၪအဖိၪဒံၩဖိၪၥၪလဖၪအဂး, ဒဲလၧ နၥံၪအဖိၪအမၫၥံၪအဂး, ဆိၬထၪ့နၥံၪအဖါတၭ, ဂဲၫ",
			"20": "<sup>20</sup> ထဲၩ့ဆံၭ.- တၭမွဲနၥံၪအမ့ၬၥၪထီးလီၫ့ကီၩ့နၥံၪအဆၧ ဖိၪဆၧလံၩလဂ့ၩ, အဂဲးဘဲၫယီၩ ခးအံဇံၭထၧၫ့ခးယၫ အဆၧဂ့ၩထုၬနီၪ မွဲနၥံၪအဆၧလီၫ.",
			"21": "<sup>21</sup> တၭအံၫစရ့လၭအဖိၪခွၫၥံၪ မၩဝ့ၫဘဲၫနီၪလီၫ. တၭ စယိၥၭဖ့ၪလၫ့လဲၪ့လဖၪ ဘဲၫဖၫရိၫ မၪလူၬဝ့ၫအၥိၭ တၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪ အဆၧအၪ့ဆၧအီၩ လၧဖၧၩ့ၥၭ",
			"22": "<sup>22</sup> အဂးလီၫ.- တၭအဝ့ၫဖ့ၪလၫ့ ၦလဖၪနီၪ ထီးအလူၬ လၧအကီၩ့အၥိၭ, လဂၩလၧအမိလုထၪ့အၥၭအဂး, လဂၩ လၧအမိလုထၪ့အၥၭ အဂးလီၫ. အ့ၪမွဲလၧစ ဘံၪ့ယမံၫ့လဂၩနီၪ, ဖ့ၪလၫ့အဝ့ၫစ့ၩ ၥၧၫ့ယၩ, ဒဲအ ကီၩ့အၥိၭ လၧအမိလုထၪ့အၥၭ ယဲဘျၩ့အဂးလီၫ.",
			"23": "<sup>23</sup> တၭအဝ့ၫဒၪဖ့ၪယုအဖါဘဲၫယီၩ, ကၥ့ၪယီၩ့အဖၫဆံၫ ဒုၩအဆၧဖဒၨၭ လၧခးအံဇံၭအဆၧဂ့ၩလဖၪ, ဒဲကၥ့ၪ ယီၩ့အမိဆံၫဒုၩ လၧအဖဒၨၭဘုၪ, ဒဲကိၪ, ဒဲဆၧအၪ့",
			"24": "<sup>24</sup> လၧအဖါမိအၪ့လၧဖၧၩ့ၥၭအဂးလီၫ.- တၭအဝ့ၫဖျါ ခွံၬအထၧၫ့ဖုဝဲတၭ, အဝ့ၫၥံၪလ့ၩဝ့ၫလီၫ. တၭအဝ့ၫနီၪ စံၭအဝ့ၫၥံၪ, မွဲနၥံၪထီးၥုၪ့ခိၥၭဝီၩလိၬ နၥံၪအၥၭလၧ ဖၧၩ့ၥၭနီၪလဂ့ၩ, ဧီၪ.",
			"25": "<sup>25</sup> တၭအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧအံဇံၭတၭ ထီၩ့ဝ့ၫလၧခး ကၫနအၫ့အဖၧၩ့ လၧအဖါစယၫကူၭ အအီၪနီၪလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫၥံၪလီၩဘၪအဝ့ၫတၭ စံၭဝ့ၫဒၪ, စယိၥၭမၧၫ့ဒံၭ တၭး ပၧၩ့ဘၪခးအံဇံၭ ထၧၫ့ခးယၫလီၫ. တၭစယၫ",
			"27": "<sup>27</sup> ကူၭအၥၭချံးဝ့ၫတၭ, အဂဲးဘဲၫယီၩနဲၩဝ့ၫအ့ၬ.- တၭ ဆၧချဲၩ့လဖၪ လၧစယိၥၭလီၩဘၪဝ့ၫနီၪ အဝ့ၫၥံၪလီၩ ထဲၩ့အဝ့ၫထီးအလူၬလီၫ. အဆၧဒၪဘၪလဲၪ့လဖၪလၧ စယိၥၭဖ့ၪယုဝ့ၫတၭ, အဖါစယၫကူၭအၥၭ မၧၫ့ထၪ့",
			"28": "<sup>28</sup> ထဲၩ့ဝ့ၫလီၫ.- တၭအံၫစရ့လၭစံၭဝ့ၫဒၪ, အၪယူၭၬ ယ ဖိၪခွၫ စယိၥၭ မၧၫ့ဒံၭလီၫ. ဘိၩ့ယလချႃၭၥံၫဒံၭဘၪ ယမိလ့ၩတၭ, ယမိဒၪဘၪအဝ့ၫဒၪလီၫ."
		},
		"46": {
			"1": "<sup>1</sup> တၭအံၫစရ့လၭ စဲၪ့ထၪ့ ဒဲကယဲအဆၧအီၪထီးအ လူၬနီၪဂဲၫလၧဘံအၧၫၡံၫဘၫတၭ, လုထၪ့ဆၧလုလဖၪ",
			"2": "<sup>2</sup> လၧအဖါစအံစၭ အယွၩလီၫ.- တၭယွၩစံၭ စအံၫစရ့ လၭလၧအဒၪဆၧ လၧယၫလခီၫလၧမုနၩနီၪ စံၭဝ့ၫဒၪ, စယၫကူၭဧ့, စယၫကူၭဧ့, တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယအီၪ",
			"3": "<sup>3</sup> ထီးယီၩလီၫ.- တၭၦလဂၩနီၪစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩယ မွဲယွၩ, နဖါအယွၩလီၫ. နလ့ၩလၩ့လၧအံဇံၭ အဖၧၩ့ နီၪ, ထီးၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ယမိဒုၭကဲၪထၪ့",
			"4": "<sup>4</sup> နၧၩလၧၦလဆၨၩဖၭဒိၪထီးနီၪလီၫ.- ယမိလ့ၩလၩ့ လၧနၥိၭလၧအံဇံၭအဖၧၩ့တၭ, ယမိဂဲၫထဲၩ့ဆိၬထဲၩ့ နၧၩတၡါတၭ, စယိၥၭမိအီၪက့ၪအစူၪ လၧနမ့ၬၥၪအ",
			"5": "<sup>5</sup> လီၩ့လီၫ.- စယၫကူၭ ဂဲထုၪ့ဝ့ၫ လၧဘံအၧၫၡံၫဘၫ တၭ,စအံၫစရ့လၭအဖိၪခွၫလဖၪ, ဒုၭထူၬအဖါစယၫ ကူၭဒဲအဖိၪဒံၩဖိၪၥၪလဖၪ, ဒဲအဖိၪအမၫၥံၪလၧ လဲၪ့",
			"6": "<sup>6</sup> ဖၧၩ့လၧဖၫရိၫအၪ့မၧၫ့လၩ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪမၩန့ဆၧ ဖိၪဆၧဎါ, ဒဲအဆၧဖိၪဆၧလံၩ လၧအန့ဘၪဝ့ၫလၧခး ကၫနအၫ့အဖၧၩ့တၭ, လ့ၩလၩ့လၧအံဇံၭအဖၧၩ့တၭ, စယၫကူၭဒဲအချံၫအၥၪအီၪလၧအၥိၭ ထီးအလူၬလီၫ.",
			"7": "<sup>7</sup> အဖိၪခွၫၥံၪ, ဒဲအဖိၪခွၫအဖိၪခွၫၥံၪ အီၪလၧအၥိၭ, ဒဲ အဖိၪမုၪၥံၪ, ဒဲအဖိၪခွၫအဖိၪမုၪၥံၪ, ဒဲအချံၫအၥၪထီး အလူၬလဖၪနီၪ, အဝ့ၫနီၪဆိၬလၩ့ဝ့ၫလၧ အံဇံၭအဖၧၩ့ လီၫ.",
			"8": "<sup>8</sup> တၭအယီၩ, မွဲၦအံၫစရ့လၭဖိၪ လၧအဂဲၫလၧအံဇံၭ",
			"9": "<sup>9</sup> အဖၧၩ့, စယၫကူၭဒဲအဖိၪခွၫလဖၪအမံၩ့,- စယၫကူၭ အဖိၪဝဲၡါ, စရုဘံၫ့, စရုဘံၫ့အဖိၪခွၫၥံၪ, စဟၫနီၭ, ဒဲစဖၫလုၫ, ဒဲစဟ့ဇရၧၫ့, ဒဲစကၫမဲၫလီၫ.",
			"10": "<sup>10</sup> စစံမအၧၫ့အဖိၪခွၫ, မွဲစယ့ၫမုၫအ့လၭ, ဒဲစဟၫမံၫ့, ဒဲစအိၫဟၭ,ဒဲစယၫခံၫ့, ဒဲစဇိဟၫ,ဒဲကၫနအၫ့မုၪအဖိၪခွၫ,",
			"11": "<sup>11</sup> စၡၫအၧလၭလီၫ.- တၭစလံဝဲၫအဖိၪခွၫၥံၪ မွဲစဂၧၫ",
			"12": "<sup>12</sup> ၡၧၫ့,စကိဟၭ, ဒဲစမရၫရဲၫလီၫ.- တၭစယုဒၫအဖိၪခွၫ ၥံၪ,စအံၫရၫ, စအိနၫ့,ဒဲစၡ့လၫ, ဒဲစဖၫရ့ၭ,ဒဲစဇၫရၫ လီၫ. အ့ၪမွဲစအံၫရၫဒဲစအိနၫ့နီၪ, ၥံၫဝ့ၫလၧခးကၫနအၫ့ အဖၧၩ့လီၫ. တၭစဖၫရ့ၭအဖိၪခွၫၥံၪ, စဟ့ဇရၧၫ့, ဒဲစ",
			"13": "<sup>13</sup> ဟၫမၧလၭလီၫ.- တၭစအံစခၫအဖိၪခွၫၥံၪ, စထိလၫ,",
			"14": "<sup>14</sup> ဒဲစဖူဝၫ, ဒဲစယိဘၭ, ဒဲစၡံမရၧၫ့လီၫ.- တၭစဇ့ၭဘ လၧၫ့အဖိၪခွၫၥံၪ စစ့ရ့ၭ,ဒဲစအံလၧၫ့, ဒဲစယၫလံလၭ",
			"15": "<sup>15</sup> လီၫ.- အနီၪလဖၪမွဲနးလံအၫအဖိၪခွၫ, ဒဲအဖိၪမုၪနးဒံ နၫလၧအဆီၫ့အီၪန့လၧစယၫကူၭအဂး, လၧပၫဒၫ့အၫ ရၫ့အဖၧၩ့နီၪလီၫ. အဖိၪခွၫဒဲအဖိၪမုၪ ထီးအလူၬမွဲၦ",
			"16": "<sup>16</sup> ၥၧၫ့ဆံၫၥၧၫ့ဂၩလီၫ.- တၭစဂၭအဖိၪခွၫၥံၪ, စဇံဖအၧၫ့, ဒဲစဟၭဂဲၫ, ဒဲစရှုနဲၫ, ဒဲစအ့ဇဘၫ့, ဒဲစအံရဲၫ, ဒဲစအရိ",
			"17": "<sup>17</sup> ဒံၫ,ဒဲစအရံလံၫလီၫ.- တၭစအၭၡၧၫအဖိၪခွၫၥံၪ, စယံ မနၫ, ဒဲစအံရှုၫအၫ, ဒဲစအံစူၫအဲၫ, ဒဲစဘရဲအၫ, ဒဲအ ထၧၫ့ဖုဝဲမုၪနးစံရၫလီၫ. တၭစဘရဲအၫ အဖိၪခွၫၥံၪ,",
			"18": "<sup>18</sup> စဟံဘၧၫ, ဒဲစမၫလခံၫအ့လၭလီၫ.- အနီၪမွဲနးဇံလဖၫ လၧစလၫဘၫ့ဖ့ၪလၫ့အဖိၪမုၪ နးလံအၫလဂၩအဖိၪခွၫ ၥံၪလီၫ. တၭၦမုၪနီၪဆီၫ့အီၪန့အဝ့ၫၥံၪ လၧစယၫကူၭ",
			"19": "<sup>19</sup> အဂးၦလဆံၫဎူၫဂၩလီၫ.- တၭစယၫကူၭအမၫနးရၫခ့",
			"20": "<sup>20</sup> လၭအဖိၪခွၫၥံၪ, မွဲစယိၥၭ, ဒဲစဘံၪ့ယမံၫ့လီၫ.- စမနၭ စ့ၫဒဲစအံဖံၫ့အီၪဖျဲၪဝ့ၫ လၧခးအံဇံၭအဖၧၩ့ လၧစယိ ၥၭအဂးလီၫ. ဒိၩ့အၫ့အၦလုဆၧ, စပီၭတဖံရၫအဖိၪ",
			"21": "<sup>21</sup> မုၪ,နးအၭစနၭဆီၫ့ အီၪန့ဝ့ၫလၧအဂးလီၫ.- တၭစဘံၪ့ ယမံၫ့အဖိၪခွၫၥံၪ, စဘံလၫ, ဒဲစဘ့ခၧၫ, ဒဲစအၭၡဘ့ လၭ,စဂံရၫဒဲစနၫအမၫ, ဒဲစအံဟဲၫ, ဒဲစရိၡၫ,စမၧၭပံၫ့,",
			"22": "<sup>22</sup> ဒဲစဟၧၭပံၫ့, ဒဲစအၫဒၭလီၫ.- အနီၪလဖၪမွဲနးရၫခ့လၭ အဖိၪခွၫ လၧအအီၪဖျဲၪ လၧစယၫကူၭအဂး, ၦအၥၭ",
			"23": "<sup>23</sup> ထီးအလူၬနီၪမွဲလဆံၫလံဂၩလီၫ.- တၭစဒၫ့အဖိၪခွၫ, စဟုၡံၫ့လီၫ. တၭစနၭၥလဲၫ အဖိၪခွၫၥံၪ, စယၫဇအ့",
			"24": "<sup>24</sup> လၭ,ဒဲစဂုနဲၫ, ဒဲစယံဇၧၫ, ဒဲစၡံလံၫ့လီၫ.- အနီၪမွဲနး ဘံလဟၫ, လၧစလၫဘၫ့ဖ့ၪလၫ့အဖိၪမုၪ နးရၫခ့လၭ",
			"25": "<sup>25</sup> လဂၩအဖိၪခွၫၥံၪလီၫ.- တၭအနီၪဆီၫ့အီၪန့ဝ့ၫ လၧ စယၫကူၭအဂး, ၦအၥၭထီးအလူၬနီၪ မွဲနွ့ၫဂၩလီၫ.",
			"26": "<sup>26</sup> တၭလၧစယၫကူၭ အဖိၪခွၫၥံၪအမၫလဖၪအဖၫ့ခိၪ, ကယဲၦအၥၭ လၧအဂဲၫ လၧစယၫကူၭအၥိၭ လၧအံ ဇံၭအဖၧၩ့, လၧအဂဲၫလၧအယးဒံၩ့, ၦအၥၭ ထီးအ",
			"27": "<sup>27</sup> လူၬနီၪ, မွဲဎူၫဆံၫဎူၫဂၩလီၫ.- တၭစယိၥၭအဖိၪခွၫလၧ ဆၧအီၪဖျဲၪန့ လၧအဂးလၧအံဇံၭအဖၧၩ့နီၪ မွဲၦအၥၭ နံၫဂၩလီၫ. ကယဲၦအၥၭဘၪဆဲၫ့ လၧစယၫကူၭအဂံၪ့ ဖိၪလဖၪ လၧအဂဲၫလၧအံဇံၭနီၪ, မွဲနွ့ၫဆံၫလီၫ.",
			"28": "<sup>28</sup> တၭအဝ့ၫအၪ့မၧၫ့လၩ့ စယုဒၫလ့ၩလၧအမ့ၬယၫ လၧစယိၥၭအအီၪ, ဘဲၫၥိၭအမိဒုၭနဲၪဖၧၩ့ၥၭ လၧအ မ့ၬယၫလၧဂိၡံၫ့တၭ, အဝ့ၫၥံၪထီၩ့လၧခးဂိၡံၫ့အဖၧၩ့",
			"29": "<sup>29</sup> နီၪလီၫ.- စယိၥၭတဲၩ့ဝဲၩအလဲၪ့ဖၭဒိၪတၭ, လ့ၩအၪ့ ဂၬအဖါ စအံၫစရ့လၭ လၧဂိၡံၫ့နီၪ, အီၪဖျီၪထၪ့လၧ အမ့ၬယၫတၭ, ထိၪလၩ့ထံၩဖါအၥၭ လၧအခိၬအလီၩ့ တၭ, အမ့ၬထံၫလၩ့ လၧအခိၬအလီၩ့ ထံၪဎးလီၫ.",
			"30": "<sup>30</sup> စအံၫစရ့လၭစံၭစယိၥၭ, ယဒၪဘၪနမ့ၬယီၩလၧနမၧၫ့ ဒံၭအကၠီၩ့တၭ, ဘိၩ့နဲၪ့ယီၩ, မွဲယၥံၫဒၪယဝ့ၫဖီၩ.",
			"31": "<sup>31</sup> စယိၥၭစံၭအထၧၫ့ဖုဝဲ, ဒဲအဖါအဂံၪ့ဖိၪလဖၪ, ယမိ လ့ၩထၪ့လီၩဘၪဖၫရိၫတၭ, စံၭအဝ့ၫဒၪ ယထၧၫ့ဖုဝဲ ဒဲယဖါအဂံၪ့ဖိၪ, လၧအအီၪယူၭ လၧခးကၫနအၫ့အ",
			"32": "<sup>32</sup> ဖၧၩ့နီၪဂဲၫထီၩ့ယူၭလၧယအီၪယူၭ.- တၭၦလဖၪနီၪမွဲ ၦယူၬၥိၪဒဲဘ့ၪလီၫ. အဂဲးဘဲၫယီၩ မွဲၦဘၪဆဲၫ့လၧဆၧ ဖိၪဆၧဎါအဒိၩ့တၭ, ဂဲၫဆိၬအၥိၪဒဲအဘ့ၪလဖၪ, ဒဲအ",
			"33": "<sup>33</sup> ချီလဖၪ,ဒဲကယဲ အဆၧအီၪထီးအလူၬလီၫ.- ဆၧမိမၩ အၥၭထီးဖၫရိၫမိကိၭန့နၥံၪတၭ, စံၭ,မွဲနၥံၪမၩဆၧနီၪ",
			"34": "<sup>34</sup> လမံၩ့လဲၪနီၪတၭ,- နၥံၪမိဘၪစံၭ,နဎီးနၡၩ, ပဝ့ၫဒၪ, ဒဲပဖါလဖၪ လၧအဖိၪၥၪခွၫထၪ့လံၩလံၩ ခီးဘိၩ့နဲၪ့ ယီၩ,ဘၪဆဲၫ့လၧ ဆၧဖိၪဆၧဎါအဒိၩ့နီၪ, ဘဲၫၥိၭနၥံၪ မိအီၪဘၪလၧခးဂိၡံၫ့အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ကယဲ ၦလၧအယူၬၥိၪဒဲဘ့ၪထီးအလူၬနီၪ, မွဲဆၧဘၪၥၭလိၪ လၧၦအံဇံၭဖိၪအမ့ၬယၫလီၫ."
		},
		"47": {
			"1": "<sup>1</sup> စယိၥၭဂဲၫလီၩဘၪဖၫရိၫတၭစံၭဝ့ၫဒၪ ယဖါ, ဒဲယ ထၧၫ့ဖုဝဲလဖၪ, ဒဲအၥိၪဒဲအဘ့ၪၥံၪ, ဒဲအချီလဖၪ, ဒဲက ယဲအဆၧအီၪထီးအလူၬနီၪဂဲၫထၪ့ လၧခးကၫနအၫ့အ ဖၧၩ့တၭ, ယိခွါ, အဝ့ၫၥံၪအီၪဝ့ၫ လၧခးဂိၡံၫ့အဖၧၩ့နီၪ",
			"2": "<sup>2</sup> လီၫ.- တၭအဝ့ၫမၩန့အထၧၫ့ဖုဝဲလနၩ့, ၦယဲဂၩတၭ,",
			"3": "<sup>3</sup> အီၪက့ၪဝ့ၫလၧဖၫရိၫအမ့ၬယၫလီၫ.- တၭဖၫရိၫစံၭအ ထၧၫ့ဖုဝဲနီၪ, မွဲနၥံၪမၩဆၧနီၪလမံၩ့လဲၪ, တၭအဝ့ၫၥံၪ စံၭဖၫရိၫ, နဎီးနၡၩ, မွဲၦယူၬၥိၪဒဲဘ့ၪ, ပဝ့ၫဒၪ, ဒဲပဖါလ",
			"4": "<sup>4</sup> ဖၪဆ့လီၫ.- တၭအဝ့ၫၥံၪစံၭဖၫရိၫ, ဘဲၫၥိၭပမိအီၪမွံၩ လၧခးဖၧၩ့ယီၩ အၥိၭတၭ, ပဂဲၫပဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩနဎီးနၡၩအၥိၪဒဲအဘ့ၪလဖၪ အဆၪအီၪအ့ၬ. ဆၧ ၥၭဝံလၩ့ဒိၩအီၪဝ့ၫ လၧခးကၫနအၫ့အဖၧၩ့နၭမၬ အ ဂဲးလီၫ. တၭဘိၩ့နဲၪ့ယီၩ, ဒုၭအီၪလါနဎီးနၡၩ, လၧ ခးဂိၡံၫ့အဖၧၩ့နီၪဆံၭ.",
			"5": "<sup>5</sup> ဖၫရိၫစံၭစယိၥၭတၭ, စံၭဝ့ၫဒၪ, နဖါဒဲနထၧၫ့ဖုဝဲဂဲၫ",
			"6": "<sup>6</sup> လၧနအီၪလီၫ.- ခးအံဇံၭအီၪဝ့ၫလၧနမ့ၬယၫလီၫ. ဒုၭ အီၪနဖါ, ဒဲနထၧၫ့ဖုဝဲလဖၪ, လၧအလးအဂ့ၩထုၬလၧ ခးဖၧၩ့ဒုၭအီၪလၧခးဂိၡံၫ့နီၪဆံၭ. နအ့ၪၥ့ၪယၫၦလၧ အကျၩနီၪလၧအမၩဆၧၥ့ၪတၭ, အီၪက့ၪအဝ့ၫၥံၪလၧ ယဆၧဖိၪဆၧဎါအဒီၪ့အဒိၪလဖၪဆံၭ.",
			"7": "<sup>7</sup> စယိၥၭၥိၫ့ထၪ့အဖါစယၫကူၭ, အီၪက့ၪဝ့ၫ လၧဖၫ",
			"8": "<sup>8</sup> ရိၫအမ့ၬယၫတၭ, စယၫကူၭဆိၪဂ့ၩဖၫရိၫလီၫ.- တၭ",
			"9": "<sup>9</sup> ဖၫရိၫစံၭစယၫကူၭနီၪ, မွဲနၥၭၡါဎွ့နံၪ့ယူၭလဲၪ.- တၭ စယၫကူၭစံၭဖၫရိၫ, ယအီၪမွံၩအနံၪ့အလၩလဖၪနီၪ မွဲအနံၪ့လယၩၥၧၫ့ဆံၫလီၫ. ယၥၭမၧၫ့အနံၪ့အလၩ လဖၪနီၪ, မွဲၡၩနံၩၡၩၥၫ့တၭ, အၧၩ့ဝ့ၫနၭဝ့ၫလီၫ. တၭ ယဖါလဖၪအၥၭမၧၫ့အနံၪ့ အလၩအမုနံၩလဖၪ, လၧ",
			"10": "<sup>10</sup> အအီၪမွံၩအမုနံၩအကျၩနီၪ, ယချႃၭန့ဒံၭအ့ၬ.- စယၫ ကူၭဆိၪဂ့ၩဖၫရိၫတၭ, စဲၪ့ထၪ့ခွံၬလၧအမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> စယိၥၭအီၪက့ၪအဖါ, ဒဲအထၧၫ့ဖုဝဲၥံၪအလးတၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪ အဆၧဖီၪ့ထၬ လၧခးအံဇံၭအဖၧၩ့, လၧအလး အဂ့ၩထုၬ လၧခးဖၧၩ့, လၧရၫမစ့ၫ အခး",
			"12": "<sup>12</sup> ဖၧၩ့ဘဲၫဖၫရိၫမၪလူၬဝ့ၫအၥိၭနီၪလီၫ.- တၭစယိၥၭ လုအၪ့လုအီၩအဖါ, ဒဲအထၧၩ့ဖုဝဲၥံၪ, ဒဲအဖါအဂံၪ့ဖိၪ ထီးအလူၬလၧဆၧအၪ့, ဘဲၫဖိၪဒံၩဖိၪၥၪအနိၭအီၪဝ့ၫ အၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> တၭဆၧအၪ့ လၧထံၫၥံၪခးၥံၪ ထၧၫ့ခးယၫ အဖၧၩ့ နီၪ,အီၪလၧၩ့ဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧၥၭဝံလၩ့ဒိၩ နၭနၭလ့ၬလီၫ. တၭၦအံဇံၭဖိၪဒဲၦကၫနအၫ့ဖိၪအၥၭ",
			"14": "<sup>14</sup> လၩ့ဆါလၧဆၧၥၭဝံလၩ့ဒိၩအကၠီၩ့နီၪလီၫ.- တၭစယိ ၥၭအၪ့ထုၫ့ကီၪ့စ့ၩ လၧကယဲဆၧဒၪန့ဝ့ၫ လၧခးအံဇံၭ အဖၧၩ့, ဒဲလၧခးကၫနအၫ့အဖၧၩ့, လၧၦဎွ့ၩဘုၪၥံၪဂူၫ ၥံၪအဂးလီၫ. စယိၥၭဂဲၫဆိၬစ့ၩနီၪ လၧဖၫရိၫအဂံၪ့",
			"15": "<sup>15</sup> ဖၧၩ့လီၫ.- စ့ၩလူၬဝ့ၫလၧခးအံဇံၭအဖၧၩ့, ဒဲလၧခး ကၫနအၫ့အဖၧၩ့တၭ, ကယဲၦအံဇံၭဖိၪဂဲၫလၧစယိၥၭ အအီၪတၭ, စံၭဝ့ၫဒၪ, ဖ့ၪလၫ့ပၧၩလၧဆၧအၪ့ဆံၭ. မွဲ ဘၪနီၫလၧပမိၥံၫ လၧနမ့ၬယၫနီၪလဲၪ. မွဲစ့ၩလူၬယူၭ",
			"16": "<sup>16</sup> အဂဲးလီၫ.- စယိၥၭစံၭဝ့ၫဒၪ, စ့ၩအ့ၪလူၬတၭ, ဖ့ၪလၫ့ ယၧၩလၧနၥံၪအဆၧဖိၪဆၧဎါအဒိၩ့နီၪဆံၭ. တၭယ မိဖ့ၪနၥံၪအဆၧလၧနၥံၪ အဆၧဖိၪဆၧဎါအဒိၩ့အဂး",
			"17": "<sup>17</sup> လီၫ.- အဝ့ၫၥံၪဂဲၫဆိၬဆၧဖိၪဆၧဎါအဒိၩ့ လၧစယိၥၭ အအီၪတၭ, စယိၥၭဖ့ၪလၫ့အဝ့ၫၥံၪ ဆၧအၪ့လၧကၥ့ၪ အဂး, လၧၥိၪဒဲဘ့ၪအဂး, လၧဆၧဖိၪဆၧဎါအဒိၩ့အ ဂး, ဒဲလၧကၥ့ၪယီၩ့အဂးလီၫ. တၭဆၧလၧနံၪ့လနံၪ့ နီၪ,အဝ့ၫဖ့ၪလၫ့အဝ့ၫၥံၪ ဆၧအၪ့ဆၧအီၩ လၧဆၧဖိၪ ဆၧဎါအဒိၩ့ ထီးအလူၬ အဂးလီၫ.",
			"18": "<sup>18</sup> ဆၧလၧနံၪ့လနံၪ့နီၪ ဖီၩ့ခွံၬဝ့ၫတၭ, နံၫနံၪ့လနံၪ့နီၪ အဝ့ၫၥံၪဂဲၫလၧအအီၪတၭ, စံၭဝ့ၫ, ပလအီၪက့ၪၥူၪခွံၬ ဘၪလၧယကဆါလၧစ့ၩလူၬယူၭတၭ, ယကဆါအီၪ လၧဆၧဖိၪဆၧဎါအဒိၩ့လဖၪလီၫ. ဆၧအီၪလၩ့ထး လၧယကဆါအမ့ၬယၫ ကယဲပနၫ့ဆါ, ဒဲပဂၪ့ခိၪလီၫ.",
			"19": "<sup>19</sup> ပမိၥံၫလၧနမ့ၬယၫပဝ့ၫဒၪ, ဒဲပဂၪ့ခိၪနီၪမွဲဘၪလဲၪ. ဎွ့ၩ န့ပၧၩ ဒဲပဂၪ့ခိၪ လၧဆၧအၪ့အဂးဆံၭ, တၭပဝ့ၫဒၪ, ဒဲပဂၪ့ခိၪနီၪမိကဲၪထၪ့ဖၫရိၫအဎီးၥံၪလီၫ. တၭဖ့ၪလၫ့ ဆၧချံၫဆၧၥၪ ဘဲၫၥိၭပမိမၧၫ့ဒံၭ, ဘဲၫပထီးၥံၫလဂ့ၩ,",
			"20": "<sup>20</sup> ဒဲဂၪ့ခိၪထီးအီၪယူလဂ့ၩနီၪဆံၭ.- တၭစယိၥၭဎွ့ၩန့ ဂၪ့ခိၪလၧခးအံဇံၭ ထၧၫ့ခးယၫအဖၧၩ့ လၧဖၫရိၫအ ဂးလီၫ. အဂဲးဘဲၫယီၩ ၦအံဇံၭဖိၪ အၪ့ဆၫခွံၬ လဂၩ အဆံၬ လဂၩအဆံၬ ဆုၬဆုၬလီၫ. မွဲဆၧၥၭဝံလၩ့ဒိၩ ဘၪဝ့ၫနၭမၬအဂဲးလီၫ. တၭဂၪ့ခိၪကဲၪထၪ့လၧဖၫရိၫ",
			"21": "<sup>21</sup> အဆၧလီၫ.- တၭလၧခးအံဇံၭ အနဲၩ့ထံၭထုၬလခီၫ ထီၩ့လၧအထုၬလခီၫဒၪနီၪ, ဒုၭအီၪကီၪ့ၦခမျၧး လၧ",
			"22": "<sup>22</sup> ဒိၩ့လဖၪအဖၧၩ့လီၫ.- အ့ၪမွဲၦလုဆၧလဖၪ အဂၪ့ခိၪနီၪ ဎွ့ၩဘၪဝ့ၫအ့ၬး အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအဆၧလၧဖၫ ရိၫဖ့ၪလၫ့ဝ့ၫနီၪအီၪယူၭတၭ, အဝ့ၫၥံၪအၪ့အဆၧလၧ ဖၫရိၫဖ့ၪလၫ့ဝ့ၫနီၪလီၫ. အခိးမွဲဘဲၫနီၪတၭ, အဝ့ၫၥံၪ",
			"23": "<sup>23</sup> အၪ့ဆၫခွံၬအဂၪ့ခိၪအ့ၬ.- တၭစယိၥၭစံၭၦခမျၧးၥံၪ, ယိခွါ,ဆၧလၧမုလနံၩယီၩ, ယဎွ့ၩယူၭနၥံၪဒဲနၥံၪအ ဂၪ့ခိၪလၧဖၫရိၫအဂးယူၭ, ယိခွါ, ဆၧချံၫဆၧၥၪအီၪ",
			"24": "<sup>24</sup> လၧနၥံၪအဂးတၭ, နၥံၪမိဎွံၪဆၧလၧဂၪ့ခိၪလီၫ.- တၭ ဆၧမၩအၥၭလၧဆၧအၪထၪ့နီၪ, နၥံၪဘၪဖ့ၪလၫ့လၧ ဖၫရိၫယဲပိၩ့လပိၩ့တၭ, လံပိၩ့နီၪမိကဲၪထၪ့နၥံၪအဆၧ ဒၪနၥံၪဝ့ၫလီၫ. လၧဆံၬၥံၪနၩၥံၪ အချံၫအၥၪအဂး, ဒဲ လၧနၥံၪအဆၧအၪ့ဆၧအီၩအဂး, ဒဲၦလၧနၥံၪအဂံၪ့ ဖိၪအကျၩအဂး, ဒဲလၧနၥံၪအဖိၪဒံၩဖိၪၥၪအဂးလီၫ.",
			"25": "<sup>25</sup> တၭအဝ့ၫၥံၪစံၭ, နဒုၭမၧၫ့ယူၭပၧၩယူၭ, မွဲပဘၪဆၧ အခိးအတၩလၧယကဆါအမ့ၬယၫဆံၭ. တၭပမိကဲၪ",
			"26": "<sup>26</sup> ထၪ့ဖၫရိၫအဎီးအၡၩလီၫ.- တၭစယိၥၭမၩအီၪထၪ့ ဆၧအထူၫအရူၫလၧခးအံဇံၭအဖၧၩ့ ထၧၫ့ခးယၫ, ထီး မုလနံၩယီၩ ယဲပိၩ့လပိၩ့မိကဲၪထၪ့ဖၫရိၫအဆၧလီၫ. အ့ၪမွဲၦလုဆၧလဖၪအဂၪ့ခိၪနီၪ ကဲၪထၪ့ဖၫရိၫအဆၧ အ့ၬ.",
			"27": "<sup>27</sup> စအံၫစရ့လၭအီၪလၧခးအံဇံၭ လၧခးဂိၡံၫ့အဖၧၩ့ တၭ,အီၪလၧဆၧဖီၪ့ထၬလဖၪ လၧအဖၧၩ့တၭ, ၥၪထၪ့",
			"28": "<sup>28</sup> ဒဲအၪထၪ့ဝ့ၫဒၪအၪအၪလ့ၬလီၫ.- တၭစယၫကူၭအီၪ ဝ့ၫလၧခးအံဇံၭအဖၧၩ့ လဆံၫနွ့ၫနံၪ့တၭ, စယၫကူၭ",
			"29": "<sup>29</sup> အမုနံၩလဖၪနီၪ မွဲလယၩလံဆံၫနွ့ၫနံၪ့လီၫ.- တၭမုနံၩ လၧစအံၫစရ့လၭမိၥံၫနီၪ, ၥုၭဘူၭအၥၭတၭ, အဝ့ၫကိၭ အဖိၪခွၫစယိၥၭတၭ, စံၭဝ့ၫ, ယအ့ၪဘၪခိးဘၪတၩ လၧနမ့ၬယၫတၭ, အီၪက့ၪလါနစူၪ လၧယကံၪထံၭအ ဖၫ့လၬတၭ, မၩယၧၩလၧဆၧအခိးတၩ ဒဲလၧဆၧမွဲဆၧ တီၩဆံၭ. ထီးခုၪ့လၩ့ဘၧၩ့ခွံၬလါယၧၩ လၧအံဇံၭအ",
			"30": "<sup>30</sup> ဖၧၩ့လဂ့ၩ.- အ့ၪမွဲယမိမံၫလၧယဖါလဖၪ အၥိၭတၭ, နဘၪဆိၬထၪ့ခွံၬယၧၩ လၧအံဇံၭအဖၧၩ့တၭ, ခုၪ့လၩ့ ဘၧၩ့ယၧၩ လၧအဝ့ၫၥံၪအၥွၪခိၪဖၧၩ့လီၫ. တၭအဝ့ၫ",
			"31": "<sup>31</sup> ဒၪစံၭ,ယမိမၩဘဲၫနဆၧချဲၩ့အီၪဝ့ၫအၥိၭလီၫ.- တၭ အဆၧစံၭဝ့ၫဒၪ, ဆိၪလၩ့နၥၭလၧယၧၩဆံၭ. တၭအ ဝ့ၫဆိၪလၩ့အၥၭလီၫ. တၭစအံၫစရ့လၭဘၩဆၧလၧ အလးမံၫအဖၫ့ခိၪလီၫ."
		},
		"48": {
			"1": "<sup>1</sup> တၭဆၧလဖၪနီၪ အလးခဲၫ့ဆၧမၩအၥၭ လၧၦစံၭ စယိၥၭ, ယိခွါ, နဖါဘၪစူၭဘၪဆၫဝ့ၫလီၫ. တၭအဝ့ၫ",
			"2": "<sup>2</sup> ဒၪမၩန့အဖိၪခွၫနံၫဂၩ,စမနၭစ့ၫ,ဒဲစအံဖံၫ့လီၫ.- ၦလီၩ ဘၪစယၫကူၭတၭ, စံၭဝ့ၫဒၪ,ယိခွါ, နဖိၪခွၫစယိၥၭဂဲၫ လၧနအီၪလီၫ. တၭစအံၫစရ့လၭ မၩဆီၪ့ထၪ့အၥၭ တၭ,ဂဲထုၪ့ဆၧၫ့နၩ့ဝ့ၫ လၧအလးမံၫ အဖၫ့ခိၪလီၫ.",
			"3": "<sup>3</sup> တၭစယၫကူၭစံၭစယိၥၭ, ယွၩလၧအၥ့ၪဆၧလူၬနဲၪဖျီၪ ထၪ့အၥၭ လၧယမ့ၬယၫ ထီးလုဇၭအီၪလၧခးကၫန",
			"4": "<sup>4</sup> အၫ့အဖၧၩ့နီၪတၭ ဆိၪဂ့ၩယၧၩ,- တၭစံၭယၧၩ, ယိ ခွါ,ယမိဒုၭၥၪထၪ့နၧၩ ဒဲမၩအၪထၪ့နၧၩတၭ, ယမိဒုၭ ကဲၪထၪ့နၧၩ လၧၦဆၨၩလဒီၪ့တၭ, ယမိဖ့ၪလၫ့ခးလ ဘံၪ့ယီၩ, လၧနချံၫနၥၪလၧနလးခဲၫ့နီၪ လၧဆၧဖီၪ့ထၬ",
			"5": "<sup>5</sup> အဂးအဆိၩအကၠၪလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, နဖိၪခွၫနံၫ ဂၩ,စအံဖံၫဒဲစမနၭစ့ၫ, လၧဆၧအီၪဖျဲၪန့လၧနဂးလၧ ခးအံဇံၭအဖၧၩ့, လၧယလချႃၭဂဲၫဒံၭဘၪ လၧနအီၪ လၧအံဇံၭအဖၧၩ့နီၪ, မွဲယဆၧလီၫ. ဘဲၫစရုဘံၫ့ဒဲစစံ မအၧၫ့အၥိၭနီၪ, အဝ့ၫၥံၪ မိကဲၪထၪ့ လၧယဂးလီၫ.",
			"6": "<sup>6</sup> နဖိၪနလံၩ လၧနထၪ့ဖိၪ လၧခဲၫ့လဖၪနီၪ, မိကဲၪထၪ့န ဆၧဒၪနဝ့ၫတၭ, လၧအန့ၥၫဆၧနီၪဆၧမိကိၭဝ့ၫလၧအ",
			"7": "<sup>7</sup> ထၧၫ့ဖုဝဲအမံၩ့လီၫ.- တၭဆၧလၧယၧၩယီၩ, လၧယဂဲၫ ထဲၩ့လၧပၫဒၫ့နီၪ, နးရၫခ့လၭၥံၫဝ့ၫလၧယနဲၩ့ထံၭလၧ ခးကၫနအၫ့ထီးဖၧၩ့ၥၭယဲၩ့လၧအ့ဖၭဖိၭဖၫ့ထၩ့လ့ၩ တၭ,ယခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧအ့ဖၭအဖၧၩ့ၥၭနီၪ လီၫ.အဝ့ၫနီၪ မွဲဘ့ၭၥလံဟံၫ့လီၫ.",
			"8": "<sup>8</sup> စအံၫစရ့လၭဒၪဘၪစယိၥၭအဖိၪခွၫၥံၪတၭ, စံၭဝ့ၫ",
			"9": "<sup>9</sup> ဒၪ,ၦလဖၪယီၩ, မွဲပလၫလဖၪလဲၪ.- တၭစယိၥၭစံၭ အဖါ, မွဲယဖိၪခွၫလၧယွၩဖ့ၪလၫ့ယၧၩ ထီးယီၩလီၫ. အဝ့ၫနီၪစံၭ ဂဲၫဆိၬလါအဝ့ၫၥံၪလၧယအီၪဆံၭ. တၭ",
			"10": "<sup>10</sup> ယမိဆိၪဂ့ၩအဝ့ၫၥံၪလီၫ.- တၭစအံၫစရ့လၭအမ့ၬခံၭ ယူၭလၧအၥၭၡါယူၭအကၠီၩ့တၭ, ဒၪဆၧၥ့ၪအ့ၬ, ဆၧ ၥုၭဘူၭအဝ့ၫၥံၪလၧအအီၪတၭ, အဝ့ၫဒၪအဲၪဂါဝ့ၫဒဲဖိၭ",
			"11": "<sup>11</sup> ဝ့ၫလီၫ.- တၭစအံၫစရ့လၭစံၭစယိၥၭ, ယဆီၫ့မီၪ့လၧ ယမိဒၪဘၪနမ့ၬအ့ၬး တၭယိခွါ, ယွၩဒုၭဒၪဘၪယၧၩ",
			"12": "<sup>12</sup> လၧနချံၫနၥၪဆ့လီၫ.- စယိၥၭမၩန့ခွံၬ အဝ့ၫၥံၪလၧအ",
			"13": "<sup>13</sup> ကံၪထါဆူၭတၭ, ထွံၩလၩ့ဝ့ၫလီၫ.- တၭစယိၥၭမၩန့ အဝ့ၫၥံၪနံၫဂၩလူၬ, စအံဖံၫ့လၧအစူၪထွ့ၪလခီၫ လၧ စအံၫစရ့လၭအစူၪစ့ၪတၭ, စမနၭစ့ၫလၧအစူၪစ့ၪလ ခီၫလၧစအံၫစရ့လၭ အစူၪထွ့ၪတၭ, ၥုၭဘူၭအဝ့ၫၥံၪ လၧအအီၪလီၫ.",
			"14": "<sup>14</sup> စအံၫစရ့လၭယူၬထၪ့အစူၪထွ့ၪတၭ, အီၪက့ၪဝ့ၫလၧ စအံဖံၫ့အခိၪ လၧအမွဲၦအဆံၭ, ဒဲအစူၪစ့ၪလၧစမနၭ စ့ၫအခိၪလီၫ. ဒုၭကိၪ့ဘၪကိၪ့ၥ့ၪအစူၪလီၫ. အဂဲးဘဲၫ",
			"15": "<sup>15</sup> ယီၩစမနၭစ့ၫမွဲအဝဲၡါလီၫ.- အဝ့ၫဆိၪဂ့ၩစယိၥၭတၭ, စံၭဝ့ၫဒၪ, ယွၩလၧယဖါလဖၪ စအၫဘြဟၫ့, ဒဲစအံ စၭလ့ၩဆၧလၧအမ့ၬယၫ, ယွၩလၧအယိထဲၩ့ခွါထဲၩ့",
			"16": "<sup>16</sup> ယၧၩ,လၧယကဲၪထၪ့လံၩလံၩ ထီးမုလနံၩယီၩ,- ဆၧ အၥီၫ့လၧအဎွ့ၩထဲၩ့ယၧၩ, လၧကယဲဆၧၡၪ့ဆၧနၭ အဖၧၩ့နီၪ, မွဲအဆိၪဂ့ၩဖိၪၥၪလဖၪယီၩဆံၭ. တၭမွဲ ဆၧကိၭထဲၩ့ယမံၩ့ လၧအဝ့ၫၥံၪ, ဒဲယဖါလဖၪစအၫ ဘြဟၫ့, ဒဲစအံစၭအမံၩ့တၭး မွဲအအၪထၪ့ဂီထၪ့အၪ",
			"17": "<sup>17</sup> အၪလ့ၬလၧဂၪ့ခိၪချိၫ့ဆံၭ.- စယိၥၭဒၪဘၪဝ့ၫလၧအဖါ အီၪက့ၪအစူၪထွ့ၪလၧစအံဖြံၫ့အဖၫ့ခိၪတၭဒၪဘၪအ မ့ၬအ့ၬ.တၭဖီၪ့အဖါအစူၪ ဘဲၫၥိၭအမိၥုၭခွံၬဝ့ၫလၧ",
			"18": "<sup>18</sup> စအံဖံၫ့အခိၪထီၩ့လၧစမနၭစ့ၫအခိၪလီၫ.- တၭစယိၥၭ စံၭအဖါ, မွဲဘဲၫနီၪအ့ၬ, ယဖါဧ့, အဂဲးဘဲၫယီၩအဝ့ၫ လဂၩယီၩ, မွဲအဝဲၡါလီၫ. အီၪက့ၪလၩ့နစူၪထွ့ၪလၧ",
			"19": "<sup>19</sup> အလီၩ့ဆံၭ.- အဖါမၩအ့ၬတၭ, စံၭဝ့ၫဒၪ, ယၥ့ၪယၫ ယဖိၪခွၫဧ့, ယၥ့ၪယၫလီၫ. အဝ့ၫဒၪ, မိကဲၪထၪ့ၦလ ဆၨၩဆ့တၭ, အဝ့ၫဒၪမိဒိၪထၪ့ဆ့လီၫ. မွဲလါနၫ့အဖု မိဒိၪထၪ့ဒိၪနဲၪ့ဒံၭအဝ့ၫဒၪဒံၭတၭ, အချံၫအၥၪမိကဲၪ",
			"20": "<sup>20</sup> ထၪ့ၦအဆၨၩလဖၪအလၧၫ့အဎွ့ၩလီၫ.- ဆၧလၧမုလ နံၩနီၪ အဝ့ၫဒၪဆိၪဂ့ၩအဝ့ၫၥံၪတၭ, စံၭဝ့ၫဒၪ, ၦအံၫ စရ့လၭဖိၪမိဆိၪဂ့ၩနၧၩတၭ, မိစံၭဝ့ၫ, မွဲယွၩအီၪက့ၪ နၧၩဘဲၫစအံဖံၫ့ ဒဲဘဲၫစမနၭစ့ၫအၥိၭနီၪဆံၭ. တၭမွဲ အအီၪက့ၪစအံဖၫ့လၧစမနၭစ့ၫ အမ့ၬယၫလီၫ.",
			"21": "<sup>21</sup> စအံၫစရ့လၭစံၭစယိၥၭ, ယိခွါ, ယၥံၫယဝ့ၫလီၫ. မွဲလါနၫ့တၭ, ယွၩမိအီၪလၧနၥိၭတၭ, မိဒုၭထဲၩ့ထဲၩ့",
			"22": "<sup>22</sup> နၧၩလၧနဖါလဖၪအခးဖၧၩ့လီၫ.- တၭယဝ့ၫဒၪယီၩ, ယဖ့ၪယူၭနၧၩ ဆၧလၧနဂးလမံၩ့လၧနထၧၫ့ဖုဝဲၥံၪအ ဖၫ့ခိၪ,လၧယမၩန့ထၪ့ လၧၦအၫမိၫဖိၪအစူၪဖၧၩ့လၧ ယနၭဒဲယချံၪနီၪလီၫ."
		},
		"49": {
			"1": "<sup>1</sup> စယၫကူၭကိၭအဖိၪခွၫလဖၪတၭ, စံၭဝ့ၫဒၪ, အီၪ ကိၩ့အီၪကီၪ့ဆံၭ. တၭဆၧလၧအမိဘၪနၥံၪ လၧမုနံၩ လဖၪအလးခဲၫ့နီၪ, ယမိဒုၭနဲၪနၥံၪလီၫ.",
			"2": "<sup>2</sup> အီၪကိၩ့အီၪကီၪ့တၭ ခိၭနၪဆၧ, စယၫကူၭအဖိၪ ခွၫၥံၪဧ့, ခိၭနၪနၥံၪအဖါစအံၫစရ့လၭအလူဆံၭ.",
			"3": "<sup>3</sup> စရုဘံၫ့ဧ့, နမွဲယဖိၪဝဲၡါ, ယဂဲးယဘၭဒဲယဆၧဆီၪ့ထၪ့အခၪ့ထံၭ, ဆၧလၧအထၪ့ထီၫအထုၬ, ဒဲဆၧအစီၩ့အမၩ့အဒိၪထုၬ,",
			"4": "<sup>4</sup> လၬထၪ့လၩ့ခုၭဘဲၫထံၫအၥိၭ, နဂ့ၩနဘၪဒံၭအ့ၬ. မွဲနထၪ့လၧနဖါအလးမံၫအဂဲး, တၭနမၩဘၪၥၭလိၪစံၪစၪဆၧ, ထၪ့လၧယလးမံၫဒၩ လီၫ.",
			"5": "<sup>5</sup> စစံမအၧၫ့, ဒဲစလံဝဲၫမွဲထၧၫ့ဖုဝဲ, အဆၧအုၩ့လၩ့မွဲဆၧမၩအၧၩ့အစူၪဝဲၩ,",
			"6": "<sup>6</sup> လၧအၡၩလဒီၪ့အဆၧကိၪ့အဖၧၩ့, ယၥၭဧ့, နုၬလဂ့ၩ. လၧအဆၧအီၪကီၪ့အဖၧၩ့, ယလၩယဖၩ့ဧ့, အီၪကီၪ့ လဂ့ၩ. မွဲလၧအၥၭထၪ့အဖၧၩ့နီၪမၩၥံၫၦၡၩ, တၭလၧအလီၩ့အၥၭဒၪဝ့ၫနီၪ ဖ့ၬထ့ၬချီအခၪ့ထီၪ့နီၪ အဂဲး,",
			"7": "<sup>7</sup> အၥၭထၪ့နီၪမွဲအဘၪဆိၪအၧၩ့ လၧအဆီၪ့ဝ့ၫအဂဲး, တၭအၥၭထၪ့ဆီၪ့ လၧအဒူၩဝ့ၫအဂဲး, ယမိမၩလၩ့မုလၩ့ဖၭဝ့ၫ လၧစယၫကူၭအဖၧၩ့, တၭယမိမၩလၩ့ပၩဝ့ၫ လၧအံၫစရ့လၭအဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> စယုဒၫဧ့, နဝ့ၫယီၩနထၧၫ့ဖုဝဲမိစံၭထၪ့အၪ့အူၭနၧၩ, နစူၪမိအီၪလၧနဒုၪနဒၩအခိၬလီၩ့, နဖါအဖိၪလဖၪမိကူၭလၩ့အၥၭ လၧနမ့ၬယၫလီၫ.",
			"9": "<sup>9</sup> စယုဒၫမွဲဆၬလၥၧၫ့အဆံၭလဒုၩ, လၧဆၧအဲၪ့ၥံၫဝ့ၫနီၪနစဲၪ့ထၪ့ခွံၬယူၭ, ယဖိၪခွၫဧ့, ကူၭလၩ့နၥၭ, ခိၬလၩ့ဝ့ၫဘဲၫဆၬလၥၧၫ့အၥိၭ, တၭဘဲၫဆၬလၥၧၫ့မိအၥိၭ, မွဲပလၫမိကိၭဂဲထုၪ့အဝ့ၫ လဂၩလဲၪ.",
			"10": "<sup>10</sup> စဎွၩအနိၪထိၭဘီၩ့ လစဲၪ့ထၪ့ဘၪ လၧယုဒၫအအီၪ, ၦပၧၩ့ဆၧအနိၪထိၭဘီၩ့, လစဲၪ့ထၪ့ဘၪလၧအခၪ့ဆူၭ, ထီးၡဲလိၫဂဲၫထီၩ့, တၭၦခမျၧးမိအီၪကီၪ့လၧအအီၪ,",
			"11": "<sup>11</sup> စၧၩ့ထၬကၥ့ၪယီၩ့အဖိၪ လၧစဘံၭမု, ဒဲကၥ့ၪယီၩ့ဆံၭလၧစဘံၭမုဂ့ၩထုၬ, အၪ့ဆူၫဝၭအဆဲၫ့လၧစဘံၭထံၫ, ဒဲအဖၬဘဲၩ့ လၧစဘံၭအမုအၥွံၪဖၧၩ့,",
			"12": "<sup>12</sup> အမ့ၬဝီၩဝ့ၫလၧစဘံၭထံၫ, တၭအမဲၪဘွၩဝ့ၫ လၧဆၧနူထံၫလီၫ.",
			"13": "<sup>13</sup> စဇ့ၭဘလၧၫ့မိအီၪ လၧမၫဆမံၭနဲၩ့, တၭဆၧမိကဲၪထၪ့ကဘၩ့ၥန့ၫ, တၭအခဲၫ့မိအီၪဆဲၫဎၩ့လၧစဲဒၧၫ့လီၫ.",
			"14": "<sup>14</sup> စအံစခၫမွဲကၥ့ၪယီၩ့ လၧအဂဲးဆီၪ့အဘၭဆီၪ့လဒုၩ, ကူၭလၩ့ဝ့ၫလၧၥိၪအဖီၩ့နံၫဖီၩ့ အဘိၩ့ဆၧၩ့,",
			"15": "<sup>15</sup> မွဲအဒၪဘၪဝ့ၫ လၧဆၧအီၪပွံၭအဂ့ၩ, ဒဲဂၪ့ခိၪမွဲအမုၬ, တၭကူၭလၩ့အခိၬထံၭခိၪ လၧအမိယိၭ ဆၧအဂဲး, တၭကဲၪဎီးဝ့ၫလၧအဖ့ၪအခီၫ့လီၫ.",
			"16": "<sup>16</sup> စဒၫ့မိစ့ၩရၫ့အၡၩခမျၧးအခွး, ဘဲၫအံၫစရ့လၭအၡၩလဒီၪ့အၥိၭ,",
			"17": "<sup>17</sup> စဒၫ့မွဲဂူလၧဖၧၩ့ၥၭအနဲၩ့ထံၭလဘီၩ့, ဂူပွ့ၭလၧဖၧၩ့ၥၭအနဲၩ့ထံၭလဘီၩ့, ဖျၭဝ့ၫလၧကၥ့ၪအခၪ့နိးခဲၫ့, တၭၦထူၬဝ့ၫလၩ့ထ့ၬလၧအချိၫ့လီၫ.",
			"18": "<sup>18</sup> ယယိလါနထိးထဲၩ့တၩ့ထဲၩ့ဆၧအဖၧၩ့ၥၭ, ယဟိဝၩဧ့,",
			"19": "<sup>19</sup> စဂၭ, ၦလဒီၪ့မိဆၪ့ထဲၩ့အဝ့ၫ, အ့ၪမွဲအဝ့ၫနီၪမိဆၪ့ထဲးအဝ့ၫၥံၪ အခၪ့နိးခဲၫ့လီၫ.",
			"20": "<sup>20</sup> လၧအၭၡၧၫအဖၧၩ့ အကိၪမိအွံၪ, တၭမိဖ့ၪစဎွၩ အဆၧအွံၪဆၧဆၧၫ့လီၫ.",
			"21": "<sup>21</sup> စနၭၥလဲၫမွဲခံၫဘၩ့အဂၭဖျ့ၭလဒုၩ, မွဲအချဲၩ့ဒိၪအနိၭလီၫ.",
			"22": "<sup>22</sup> စယိၥၭမွဲထဲၩ့ၥၪထၪ့အၪတၭ, အထဲၩ့လဖၪထၪ့လၧခိၪဒၧၩ့အလီၩ့,",
			"23": "<sup>23</sup> ဖျါအကဆါၥံၪမၩဆၫအဝ့ၫဒၪအၥၭ, အဝ့ၫၥံၪခၭဒဲမၩၡၪ့မၩနၭ အဝ့ၫဒၪလီၫ.",
			"24": "<sup>24</sup> လါနၫ့အဝ့ၫနီၪ အချံၪအီၪခၧၫ့ဒၪဆၧ, တၭအစူၪအစူၪဒူၪအီၪ လၧအဂဲးအဘၭ, လၧစယၫကူၭအဆၧဆီၪ့လဂၩအစူၪ, လၧၦယိၥိၪလဂၩ, အံၫစရ့လၭအလိး,",
			"25": "<sup>25</sup> လၧနဖါအယွၩ လၧအမိမၩဘိၭမၩဆၧၩ့နၧၩ, ဒဲလၧဆၧၥ့ၪဆၧလူၬ လၧအမိဆိၪဂ့ၩနၧၩ လၧမူၭခိၪ လၧထၭလခီၫ အဆၧဆိၪဂ့ၩလဖၪ. ဆၧအယိၬဖၧၩ့ လၧလၬလခီၫ အဆၧဆိၪဂ့ၩ, နူဒဲဒၧၩ့လး အဆၧဆိၪဂ့ၩလီၫ.",
			"26": "<sup>26</sup> နဖါအဆၧဆိၪဂ့ၩဒိၪနဲၪ့ ခိၪလီၩ့အဆိၩအကၠၪအဆၧ ဆိၪဂ့ၩလဖၪ, ဆၧစီၩ့ခိၪအဆိၩအကၠၪအဆၧဂ့ၩဆၧဘွၩ, တၭမိအီၪလၧစယိၥၭအခိၪ, ဒဲလၧၦလဂၩလၩ့ဖၭ လၧအထၧၫ့ဖုဝဲၥံၪအဒၩ့ခိၪလီၫ.",
			"27": "<sup>27</sup> စဘံၪ့ယမံၫ့, ထွံၪမံၩ့လဒုၩမိအဲၪ့ၡၫ့ခွံၬဆၧ, လၧမုဂီၩနီၪအၪ့ဆၧအၪ့ဂူၬန့, ဒဲလၧမုဂၪနီၪ မိအၪ့နၩ့ဖၭဆၧအၪ့ဂူၬန့လီၫ.",
			"28": "<sup>28</sup> အဝ့ၫၥံၪထီးအလူၬနီၪ မွဲအံၫစရ့လၭအဒီၪ့ လဆံၫနံၫ ဒီၪ့လီၫ. တၭအနီၪမွဲဆၧလၧအဖါချဲၩ့ဆၧ လၧအဝ့ၫၥံၪ တၭ,ဆိၪဂ့ၩဝ့ၫလဂၩ ဘဲၫအဆၧဆိၪဂ့ၩအၥိၭ, လဂၩ ဘဲၫအဆၧဆိၪဂ့ၩအၥိၭနီၪ မွဲအဆိၪဂ့ၩအဝ့ၫၥံၪလီၫ.",
			"29": "<sup>29</sup> တၭအဝ့ၫမၪလူၬအဝ့ၫၥံၪ, စံၭဝ့ၫ, ဆၧမိအီၪက့ၪကီၪ့ ယၧၩလၧယၡၩခမျၧးလီၫ. ခုၪ့လၩ့ဘၧၩ့ခွံၬယၧၩလၧ ယဖါလဖၪအၥိၭ, လၧဆၧဖၧၩ့အီၪဝ့ၫလၧၦဟ့ၥၭဖိၪ,",
			"30": "<sup>30</sup> စအံဖၧၫ့ အဂၪ့ခိၪအဝၩ့ဖၧၩ့,- ဆၧဖၧၩ့ လၧအအီၪ ဝ့ၫလၧဂၪ့ခိၪအဝၩ့, မၭကပံလၫအဖၧၩ့ လၧအအီၪလၧ မၫမရံၫအမ့ၬယၫ, လၧခးကၫနအၫ့အဖၧၩ့ လၧစအၫ ဘြဟၫ့ဎွ့ၩန့ဝ့ၫ, ဒဲၦဟ့ၥၭဖိၪစအံဖၧၫ့အဂၪ့ခိၪလဝၩ့",
			"31": "<sup>31</sup> နီၪဆ့, လၧအဆၧၥွၪခိၪအဆၧဖီၪ့ထၬအဂးဆံၭ.- ၦ ခုၪ့လၩ့ဘၧၩ့ခွံၬစအၫဘြဟၫ့ထီးနီၪ, ဒဲအမၫနးစၫရၫ ဆ့လီၫ. ၦခုၪ့လၩ့ဘၧၩ့ခွံၬစအံစၭထီးနီၪ, ဒဲအမၫနးရ ဘ့ၭကၫဆ့လီၫ. တၭထီးနီၪယခုၪ့လၩ့ဘၧၩ့ခွံၬနးလံ",
			"32": "<sup>32</sup> အၫဆ့လီၫ.- ဆၧဎွ့ၩဂၪ့ခိၪလဝၩ့အီၪဝ့ၫ လၧဆၧဖၧၩ့ လၧအဖၧၩ့နီၪ လၧစဟ့ၥၭအဖိၪခွၫလဖၪအအီၪလီၫ.",
			"33": "<sup>33</sup> စယၫကူၭမၪလူၬ အဖိၪခွၫဂီၩ့တၭ, ထုၭထၪ့အခၪ့ လၧအလးမံၫဖၧၩ့နီၪ, ၥံၫဝ့ၫတၭ, ဆၧအီၪက့ၪကီၪ့ဝ့ၫ လၧအဖါလဖၪအၥိၭလီၫ."
		},
		"50": {
			"1": "<sup>1</sup> စယိၥၭထိၪလၩ့ထံၩဖါအၥၭ လၧအဖါအမ့ၬအဖၫ့ ခိၪတၭ, အမ့ၬထံၫလၩ့ လၧအဖၫ့ခိၪတၭ, အဲၪဂါဝ့ၫ",
			"2": "<sup>2</sup> လီၫ.- တၭစယိၥၭမၪလူၬအခ့ၫအၡၩ, ၥံၪဆရၫလဖၪ, ဘဲၫၥိၭအမိအီၪက့ၪအဖါအစွၪ လၧၥံၪနီၪလီၫ. တၭၥံၪ ဆရၫလဖၪနီၪ အီၪက့ၪစအံၫစရ့လၭအစွၪ လၧၥံၪ",
			"3": "<sup>3</sup> လီၫ.- တၭအနံၩလံဆံၫလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ လၧအဂး လီၫ. အဂဲးဘဲၫယီၩ ၦလၧဆၧအီၪက့ၪအစွၪလၧၥံၪလ ဖၪနီၪအနံၩအၥၫ့လၧၫ့ထၪ့ဎွ့ၩထၪ့ဘဲၫနီၪလီၫ. တၭၦ",
			"4": "<sup>4</sup> အံဇံၭဖိၪဂၪ့ဝ့ၫဒၪ လၧအဂးအနံၩနွ့ၫဆံၫလီၫ.- ဆၧ ဂၪ့ဆၧယၧၩ့အမုနံၩနီၪ ဖီၩ့ခွံၬတၭ, စယိၥၭလီၩဘၪ ဖၫရိၫအၡၩဂံၪ့ဖိၪတၭ, စံၭဝ့ၫဒၪ, ယအ့ၪဘၪခိးဘၪ တၩလၧနၥံၪအမ့ၬယၫတၭ, ချဲၩ့လါဆၧလၧဖၫရိၫအ",
			"5": "<sup>5</sup> နါဖၧၩ့တၭ,စံၭ,- ယဖါအၪ့မၧၫ့ယဆိၪလၩ့ယၥၭတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,ယၥံၫယဝ့ၫလီၫ. ဆၧဖၧၩ့လၧယခုၪ့ လၩ့လၧယဂး လၧခးကၫနအၫ့အဖၧၩ့နီၪ, နမိဘၪခုၪ့ လၩ့ဘၧၩ့ခွံၬယၧၩ ထီးနီၪလီၫ. တၭဘိၩ့နဲၪ့ယီၩ, ဒုၭ လ့ၩထၪ့ယၧၩ, ဘဲၫၥိၭယမိခုၪ့လၩ့ဘၧၩ့ခွံၬယဖါဆံၭ.",
			"6": "<sup>6</sup> တၭယမိဂဲၫထဲၩ့ထဲၩ့လီၫ.- တၭဖၫရိၫစံၭဝ့ၫဒၪ, လ့ၩ ထၪ့တၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬနဖါ ဘဲၫအဒုၭဆိၪလၩ့နၥၭ အၥိၭဘီၪ.",
			"7": "<sup>7</sup> တၭစယိၥၭလ့ၩခုၪ့လၩ့ဘၧၩ့ခွံၬအဖါနီၪ, ဖၫရိၫအ ခ့ၫအၡၩထီးအလူၬလ့ၩဖိၬအခဲၫ့, ဒဲအဂံၪ့ဖိၪၥၭၡါလ",
			"8": "<sup>8</sup> ဖၪ,ဒဲကယဲခးအံဇံၭ အၥုၪ့က့ၭၥၭၡါၥံၪ,- ဒဲစယိၥၭ အဂံၪ့ဖိၪထီးအလူၬ, ဒဲအထၧၫ့ဖုဝဲဒဲအဖါ အဂံၪ့ဖိၪ လီၫ.အ့ၪမွဲဖိၪဒံၩဖိၪၥၪလဖၪ, ဒဲအၥိၪဒဲဘ့ၪလဖၪ, ဒဲချီ လဖၪနီၪ, အီၪက့ၪလၩ့ထးဝ့ၫ လၧခးဂိၡံၫ့အဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> ၦၡၩၥံၪလ့ၩထၪ့ဝ့ၫလၧလဲၪ့လဖၪ, ဒဲၦထူၬကၥ့ၪလဖၪ",
			"10": "<sup>10</sup> တၭ, ဆၧလဒီၪ့နီၪၦၡၩခမျၧးအီၪအၪမၬဆ့လီၫ.-အ ဝ့ၫၥံၪလ့ၩထီၩ့လၧအၫတၭအခရဲးဖၧၩ့ လၧအအီၪဝ့ၫ လၧယီၫဒၫ့ဝါလခီၫတၭ, ထီးနီၪအဝ့ၫၥံၪ ဂၪ့ဝ့ၫယၧၩ့ ဝ့ၫလၧဆၧဂၪ့ဆၧယၧၩ့ဖၭဒိၪဆ့လီၫ. တၭအဝ့ၫနီၪ",
			"11": "<sup>11</sup> ဂၪ့ဝ့ၫလၧအဖါအကၠီၩ့နွ့ၫနံၩလီၫ.- တၭၦထံၫဖိၪခးဖိၪ ၥံၪ,ၦကၫနအၫ့ဖိၪလဖၪဒၪဘၪဝ့ၫ, ၦဂၪ့ကိၭၡၭထၪ့ ဆၧလၧအၫတၭအခရဲးဖၧၩ့တၭ, စံၭဝ့ၫဒၪ, ဆၧဂၪ့ဆၧ ယၧၩ့ယီၩ အီၪလၧၦအံဇံၭဖိၪနၭမၬကၨၬ မၩအၥၭ ဘဲၫနီၪတၭ, ၦကိၭဝ့ၫအမံၩ့လၧအၫဘလၭမံၭဇရံၫ့လၧ",
			"12": "<sup>12</sup> အအီၪလၧယီၫဒၫ့ဝါလခီၫလီၫ.- အဖိၪခွၫလဖၪနီၪမၩ",
			"13": "<sup>13</sup> ဝ့ၫဘဲၫအမၪလူၬဝ့ၫအၥိၭနီၪလီၫ.- တၭအဖိၪခွၫလဖၪ လ့ၩဆိၬထၪ့ထဲၩ့အဝ့ၫ လၧခးကၫနအၫ့တၭ, ခုၪ့လၩ့ ဘၧၩ့ခွံၬဝ့ၫလၧဂၪ့ခိၪလဝၩ့, လၧမၭကပံလၫအိၩဖၧၩ့, လၧစအၫဘြဟၫ့ဎွ့ၩန့ဝ့ၫ လၧၦဟ့ၥၭဖိၪစအံဖၧၫ့ဒဲဂၪ့ ခိၪလဝၩ့လၧဆၧၥွၪခိၪ အဆၧဖီၪ့ထၬအဂး, အီၪဝ့ၫလၧ",
			"14": "<sup>14</sup> မၫမရံၫအမ့ၬယၫလီၫ.- တၭလၧအခုၪ့လၩ့ဘၧၩ့ခွံၬ အဖါအလးခဲၫ့နီၪ, စယိၥၭထဲၩ့ထဲၩ့လၧအံဇံၭ, အဝ့ၫ ဒဲအထၧၫ့ဖုဝဲလဖၪ, ဒဲကယဲၦလၧအလ့ၩဖိၬအခဲၫ့လၧ အဆၧမိခုၪ့လၩ့ဘၧၩ့ခွံၬ အဖါနီၪလီၫ.",
			"15": "<sup>15</sup> စယိၥၭ အထၧၫ့ဖုဝဲလဖၪ ဒၪဘၪလၧအဖါၥံၫယူၭ တၭ,စံၭဝ့ၫဒၪ, ဘၪလဘၪစယိၥၭမိမၩၡၪ့မၩနၭပၧၩ တၭ,မိမၩအၧၩ့ဆၧၫ့ပၧၩ လၧကယဲဆၧအၧၩ့ လၧပ",
			"16": "<sup>16</sup> မၩအဝ့ၫနီၪတၡါလီၫ.- အဝ့ၫၥံၪအၪ့မၧၫ့လၩ့ဆၧလၧ စယိၥၭတၭ, စံၭဝ့ၫဒၪ, နဖါလချႃၭၥံၫဒံၭဘၪနီၪ, မၪ",
			"17": "<sup>17</sup> လူၬဆၧစံၭဝ့ၫဒၪ,- နၥံၪဘၪစံၭစယိၥၭဘဲၫယီၩ, ယၫ့ ၥၭဖျါခွံၬနထၧၫ့ဖုဝဲအဆၧမၪ, ဒဲအဆၧဒဲၩဘၭနီၪဆံၭ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမၩၡၪ့မၩနၭယူၭနၧၩလီၫ. တၭ ဘိၩ့နဲၪ့ယီၩ, ကွဲၪဖျါနဖါအယွၩအခ့ၫအၡၩ အဆၧမၪ ဆံၭ.ထီးအဝ့ၫၥံၪချဲၩ့ဆၧလၧအဝ့ၫတၭ စယိၥၭအမ့ၬ",
			"18": "<sup>18</sup> ထံၫလၩ့ဝ့ၫလီၫ.- တၭအထၧၫ့ဖုဝဲလဖၪလ့ၩထိၪလၩ့ ထံၩဖါအၥၭလၧအမ့ၬယၫဆ့, စံၭဝ့ၫဒၪ, ယိခွါ, ပမွဲနဎီး",
			"19": "<sup>19</sup> နၡၩလီၫ.- တၭစယိၥၭစံၭအဝ့ၫၥံၪ ထီးၥၭမဲၪဆၧလ",
			"20": "<sup>20</sup> ဂ့ၩ,အဂဲးဘဲၫယီၩမွဲယအီၪလၧယွၩအလးဆ့ဧၪ.- နၥံၪ ဝ့ၫဒၪယီၩ, နၥံၪကိၪ့ထၪ့ဆၧအၧၩ့လၧယဂးလီၫ. အ့ၪ မွဲယွၩဒုၭကဲၪထၪ့ဝ့ၫလၧဆၧဂ့ၩ, ဘဲၫၥိၭအမိမၩဆၧ ဘဲၫလၧမုဆၫလနံၩယီၩအၥိၭ, လၧအမိဒုၭမၧၫ့ဒံၭၦ",
			"21": "<sup>21</sup> ခမျၧးအၪအၪလ့ၬအဂဲးလီၫ.- ဘိၩ့နဲၪ့ယီၩထီးၥၭမဲၪ ဆၧလဂ့ၩ. ယမိလုအၪ့လုအီၩနၥံၪအဖိၪအလံၩလဖၪ နီၪလီၫ. အဝ့ၫနီၪမၩမုၬထၪ့ထဲၩ့အဝ့ၫၥံၪတၭ ချဲၩ့ဘၪ ၥုၪ့ဘၪၥၭဝ့ၫဆ့လီၫ.",
			"22": "<sup>22</sup> တၭစယိၥၭအီၪဝ့ၫလၧအံဇံၭအဖၧၩ့, အဝ့ၫဒၪ,ဒဲအ ဖါအဂံၪ့ဖိၪလီၫ. တၭစယိၥၭမၧၫ့ဝ့ၫအနံၪ့လယၩလ",
			"23": "<sup>23</sup> ဆံၫလီၫ.- တၭစယိၥၭဒၪဘၪစအံဖြံၫ့အဖိၪအလံၩၥၧၫ့ ဆိၩလဆိၩလီၫ. တၭစမနၭစ့ၫအဖိၪခွၫစမၫခၧၫအဖိၪ အလံၩအီၪဖျဲၪဝ့ၫလၧစယိၥၭအခၪ့လုးခိၪလီၫ.",
			"24": "<sup>24</sup> စယိၥၭစံၭအထၧၫ့ဖုဝဲၥံၪ, ယမိၥံၫယဝ့ၫလီၫ. တၭ ယွၩမိဂဲၫအီၪၡီၩ့နၥံၪတၡါတၭ, မိဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ လၧခးယီၩ, ထီၩ့လၧခးလဘံၪ့နီၪ, လၧအဆိၪလၩ့ အၥၭ လၧအဂဲးအကၠီၪ့ လၧစအၫဘြဟၫ့, ဒဲစအံစၭ,",
			"25": "<sup>25</sup> ဒဲစယၫကူၭနီၪလီၫ.- စယိၥၭဒုၭဆိၪလၩ့ၦအံၫစရ့လၭ ဖိၪအၥၭတၭ, စံၭဝ့ၫဒၪ, ယွၩမိဂဲၫအီၪၡီၩ့ နၥံၪတၡါ တၭ, နၥံၪမိဘၪဆိၬထၪ့ခွံၬယဎွံၪလဖၪ ထီးယီၩလီၫ.",
			"26": "<sup>26</sup> စယိၥၭအၥၭၡါအနံၪ့လယၩ လဆံၫနီၪၥံၫဝ့ၫလီၫ. ၦအီၪက့ၪအစွၪလၧၥံၪတၭ, အီၪက့ၪနုၬဝ့ၫလၧတလၫ လဖျိၪ့အဖၧၩ့ လၧအံဇံၭအဖၧၩ့နီၪလီၫ."
		}
	}
};
